(86479, 'frFR', 'Donjons de recherche de groupe  11.0 The War Within  Mode outil Raids  1er', '', '', '', '', '', '', '', '', 57534),
(85948, 'frFR', 'Un voyage brlant dans le temps', 'Terminez 5donjons des Marcheurs du temps.', 'L\toile ardente claire le monde, en brlant la terre et en desschant le paysage. Cette toile est implacable, presque malveillante mme. Tant que son influence perdure, de nouveaux chemins vers des lieux loigns dans l\espace ou dans le temps peuvent s\ouvrir. Aucun tre sage ne comprend rellement la nature de ce signe, mais la chance sourit aux individus audacieux.', '', '', '', '', '', '', 57534),
(85947, 'frFR', 'Un voyage originel dans le temps', 'Terminez 5donjons des Marcheurs du temps.', 'Les mes guerrires d\un certain ge ne cessent de rpter que la vie sur Azeroth tait beaucoup plus dure  leur poque.\n\nSi ces gens vous voyaient, ils vous diraient que vous n\tes pas assez coriace pour survivre dix minutes dans leur monde.\n\nVous pensez pouvoir les dtromper? Montrez-moi ce que vous avez dans le ventre.', '', '', '', '', '', 'Parlez  Bobadormu devant les grottes du Temps en Tanaris.', 57534),
