(85208, 'frFR', 'Un message pirate', 'Rcuprez les notes auprs de Rosa la Renfrogne  Baie-du-Butin.', 'Ah, vous tes l, $n. Une certaine Rosa la Renfrogne veut vous voir  Baie-du-Butin.', '', '', '', '', '', '', 57534),
(85195, 'frFR', 'Gastronomie pirate', 'Utilisez les notes de traduction sur le banquet du partage de Rosa pour chercher les ingrdients.', 'Tenez, voici les notes de Cuistolome dchiffres. Mme si elles peuvent paratre tranges, je vous assure que je les ai bien dchiffres.\n\nJ\ai pu comprendre la plupart des ingrdients dont vous aurez besoin, mais il avait sa faon  lui d\en appeler certains, alors bon courage!', '', '', '', '', '', 'Retournez voir Ndos sur la cte de Tanaris.', 57534),
(85060, 'frFR', 'Nourriture pirate et superstitions', 'Aidez les boucaniers de Baie-du-Butin  comprendre comment prparer le festin porte-bonheur de Cuistolome.', 'On a perdu en mer notre fidle coq, Cuistolome. Un incident bien tragique, qui rend notre situation actuelle encore plus tragique! On n\ose pas reprendre la mer sans le festin porte-bonheur que Cuistolome nous prparait avant chaque voyage.\n\nOn a tent de dchiffrer ses gribouillis, mais tout ce qu\on a russi  faire, c\est faire baver l\encre.\n\nCe matelot jure avoir entendu Cuistolome dire qu\il n\emportait que des copies en mer. Si c\est vrai, les originaux doivent se trouver  Baie-du-Butin, pas loin de sa couchette!', '', '', '', '', '', '', 57534),
(85047, 'frFR', 'Des pirates dans la panade', 'Rendez-vous au camp des boucaniers de Baie-du-Butin.', 'On m\a parl rcemment d\un petit groupe de boucaniers de Baie-du-Butin qui a dbarqu et dress son camp tout prs de la zone des festivits au nord.\n\nCe n\est pas un problme en soi, mais les pirates sont des lments imprvisibles et sources de chaos. Je sais bien que vous avez  faire, mais pourriez-vous aller voir s\il leur faut un coup de main?', '', '', '', '', '', '', 57534),
(85043, 'frFR', 'Vol de jouets', 'Dcouvrez qui vole les jouets.', 'Mon vouet! On me l\a vol!\n\nIl faut qu\on retrouve qui a fait fa avant que ve perde tous mes vouets!', '', '', '', '', '', 'Retournez voir Maru  l\extrieur des grottes du Temps.', 57534),
