(84933, 'frFR', 'Des cendres  la sagesse', 'Montrez  Feu-du-Vide la destruction cause par Aile de mort.', 'Je vais devenir comme le grand et puissant Aile de mort! Tremblez devant ma force!\n\nVous, l! Voulez-vous vous joindre au prochain Aile de mort dans une aventure pique?', '', '', '', '', '', 'Invoquez Feu-du-Vide avec le sifflet  Dragonnet.', 57534),
(84932, 'frFR', 'Une ligne de destruction', 'Retrouvez le Dragonnet au terrain de jeu des mascottes.', 'Vous, l! Un Dragonnet a fait son apparition sur le terrain de jeu des mascottes et sme le chaos.\n\nPourriez-vous aller lui parler pour rsoudre le problme?', '', '', '', '', '', 'Retrouvez le Dragonnet au terrain de jeu des mascottes.', 57534),
(84924, 'frFR', 'Queue d\oiseau', 'Dcouvrez l\histoire de Percy en trouvant ses plumes.', 'J\ai cont bien des histoires dans ma vie, mais mon compagnon Percy a lui aussi sa lgende. Souhaitez-vous la connatre?\n\nJe vais vous donner un premier indice. De l, vous devrez trouver les autres indices que Percy a laisss pour reconstituer son histoire.\n\nVous pouvez aussi prendre cette plume qu\il a laisse. Restez aux aguets pour trouver d\autres indices. Peut-tre qu\avoir votre propre oiseau pourra vous aider en chemin.', '', '', '', '', '', 'Retournez voir Reshad devant les grottes du Temps prs de la scne.', 57534),
(84923, 'frFR', 'Conte d\oiseau', 'Retrouvez Reshad prs de la scne.', 'On m\a dit que Reshad avait une nouvelle histoire  raconter sur son oiseau de compagnie, Percy. Allez lui parler si vous voulez la connatre.', '', '', '', '', '', 'Retrouvez Reshad prs de la scne.', 57534),
