(84908, 'frFR', 'Le mrite de la tempte', 'Parlez  la chevaucheuse de tempte Bruelda  Dornogal.', '<Une lettre dore vous parvient.>\n\nMme si vous n\tes pas $gun chevaucheur:une chevaucheuse; de tempte, vous pourriez en mriter l\armure.\n\nRejoignez la chevaucheuse de temptes Bruelda si vous voulez avoir cet honneur.', '', '', '', '', '', '', 57534),
