(84868, 'frFR', 'Une bouffe d\aide', 'Achetez de l\encens spirituel auprs de Benatauk et servez-vous-en.', 'Plus aucun secret ne pourra vous rsister, maintenant! Je suis sr que Maru aimerait vous accompagner, mais elle est beaucoup trop jeune.\n\nHeureusement, le peuple rohart a un encens qui permet  nos mes de communiquer sur de longues distances.\n\nJ\en ai toujours une petite rserve sur moi, si vous voulez. Et puisque vous tes $gun ami:une amie; de Maru, je ne vous ferai payer que le cot des ingrdients.', '', '', '', '', '', '', 57534),
