(84735, 'frFR', 'La vrit autour du clan Sombrefer', 'Vainquez l\empereur Dagran Thaurissan dans le raid Retour aux profondeurs de Rochenoire.', 'Peu de gens connaissent la vrit au sujet du clan Sombrefer. Plus rares encore sont celles et ceux qui l\ont vue de leurs propres yeux.\n\nLes Marcheurs du temps ont accept de nous faire revenir dans le pass. Ils nous enverront  l\poque o notre clan a perdu son empereur. Et  cette occasion, j\espre pouvoir vous montrer tout ce qui a dcoul de cette dfaite. Le bon. Et le mauvais\n\nVoulez-vous voir la vrit par vous-mme?', '', '', '', '', '', '', 57534),
(84700, 'frFR', 'Pactes en toute discrtion', 'Allez voir la veuve Arak\nai au repaire de la Tisserande.', 'Ce tisse-rat porte une note sur lui. Celle-ci vous a t adresse par la veuve Arak\nai.\n\nChre petite friandise,\n \nLes autres membres du triumvirat des Fils tranchs et moi-mme sollicitons votre prsence. Azj-Kahet est  un tournant de son histoire, mais nous aurons besoin de vos mthodes uniques pour mener les choses  bien.\n\nEt, comme toujours, les rcompenses pour vous et votre cause seront tout  fait exceptionnelles.', '', '', '', '', '', '', 57534),
(84693, 'frFR', 'Table de profession de repaire de la Tisserande', 'Parlez  Ak\itaz au repaire de la Tisserande.', 'Prsentez ce jeton  Ak\itaz dans le repaire de la Tisserande pour faire construire votre propre table de profession.', '', '', '', '', '', 'Parlez  Ak\itaz au repaire de la Tisserande.', 57534),
(84682, 'frFR', 'Pactes qui impactent', 'Parlez aux reprsentants des Fils tranchs, puis forgez votre premier pacte.', 'Les Fils tranchs se tiennent prts pour vous et vos camarades. Vous serez une source de lumire pour les toiles d\Ansurek.\n\nLe gnral, le vizir et moi-mme, la Tisserande, avons chacun des mthodes diffrentes pour affronter nos adversaires Et des avantages diffrents pour aider nos partenaires. Vous prfrerez peut-tre donner la priorit  l\un ou l\autre, ou bien traiter avec les trois  la fois.\n\nRencontrez nos reprsentants et renseignez-vous sur nos diffrentes pratiques. Vous pourrez ensuite forger votre premier pacte.\n\nRassurez-vous, petite friandise, aucun choix n\est dfinitif.', '', '', '', '', '', '', 57534),
(84664, 'frFR', 'Soutenir le commerce de proximit', 'Dpensez kejs auprs de vendeurs ou vendeuses du repaire de la Tisserande.', 'Bonjour, rampe-surface. Vous n\avez pas l\air dans votre lment. Vous vous tes fait craser par un aronef ou quoi?\n\nEnfin bref. Peu importe. Un conseil entre $gtrangers:trangres;: pour survivre ici, il va falloir apprendre les rgles de la route. L\or, c\est bien beau, mais ici, on a besoin de kejs, beaucoup de kejs.\n\n prsent, tenez. Considrez ceci comme un gage de bonne volont de la part de dame Pedipalps l-haut. Allez vous offrir quelque chose de sympa.', '', '', '', '', '', '', 57534),
