(84616, 'frFR', 'Clbrez les bons moments!', 'Participez aux activits des festivits et aux tches proposes par les personnes qui sont en visite.', 'Bienvenue  la clbration du Vol draconique de bronze!\n\nNous vous invitons  profiter de notre multitude d\vnements. Vous pourriez choisir de devenir votre mascotte et de courir dans notre aire de jeux.\n\nVous pouvez participer  l\un de nos grands rendez-vous comme la Frnsie de la mode ou Aventure des Montures. Un vnement diffrent commence toutes les 15min.\n\nOu alors, vous pouvez chercher Moira pour un voyage dans les profondeurs de Rochenoire, ou Chromie qui nettoie son codex pour se prparer  ses visites.\n\nN\importe quel vnement fera l\affaire tant que vous vous amusez!', '', '', '', '', '', '', 57534),
(84595, 'frFR', 'L\affaire du lokdu en qute de tout-doux', 'Trouvez une mascotte pour Riko et Kiryn.', 'Riko en a assez de ces zouk de creuse-tique! Tout ce que veut Kiryn, c\est tout-doux, et ces mancaques veulent pas partager!\n\nKiryn dit que Riko doit arrter coucris. Dit que prendre tout-doux, c\est voler.\n\nVous lokdu utile? Trouvez ami tout-doux pour Kyrin! Mieux vaut prendre note pour pas que lokdu coince.', '', '', '', '', '', '', 57534),
