(84521, 'frFR', 'Recherches mditatives', 'Escortez Maru et rsolvez les nigmes de Benatauk.', 'Maru a fait preuve de talent en tant que dtective junior, il est temps de la rcompenser avec sa propre coiffe de rflexion!\n\nBien sr, je ne peux pas me contenter de la lui donner, j\en ai donc enterr des morceaux pour qu\elle se la fabrique elle-mme. J\ai dissimul les coordonnes de chaque morceau sous forme d\nigmes. Vous n\aurez qu\ les rsoudre pour trouver les cachettes!\n\nVous voulez bien l\escorter pour vous assurer qu\il ne lui arrive rien? Vous pouvez emporter ma coiffe de rflexion pour vous aider. Et je vais aussi vous donner un livre d\indices spcial qui rvlera de nouvelles nigmes au fil de votre progression.', '', '', '', '', '', '', 57534),
(84520, 'frFR', 'Bibelot antique: utilitaire', 'Utilisez et quipez la relique profile sur Brann Barbe-de-Bronze.', '<Vous prenez la relique et dcouvrez une faible lueur qui en mane. Elle semble importante. La Ligue des explorateurs sera certainement trs intresse.>', '', '', '', '', '', '', 57534),
