(84490, 'frFR', 'La grande chambre forte', 'Procurez-vous un objet entrepos dans la grande chambre forte.', 'Beaucoup de systmes de Dornogal qui taient rests endormis pendant des millnaires sont  nouveau oprationnels. L\un d\eux pourrait vous tre utile, $r: la grande chambre forte.\n\nIl y a longtemps de cela, cette rserve d\armes et d\armures alimentait les Terrestres qui avaient fait le serment de protger Dornogal. Elle vous soutiendra de la mme manire en attendant de vous que tout au long de votre qute, vous mettiez cet arsenal au service de la protection des autres.\n\nLa chambre forte se trouve ici,  Dornogal,  l\intrieur du Trsor du conseil. Le conseiller vous a donn l\autorisation d\accder  son contenu.', '', '', '', '', '', '', 57534),
(84489, 'frFR', 'Emplettes  gogo!', 'Parlez aux vendeurs et vendeuses.', 'Maintenant que vous avez une ide des principales attractions, parlons emplettes.\n\nLe pavillon principal que vous voyez l abrite juste quelques-uns des nombreux endroits o vous pouvez acheter de nouveaux bibelots tonnants. Faites un tour et discutez avec les vendeuses et vendeurs pour voir ce qu\ils ont  vous proposer.\n\nUne fois que vous aurez termin, revenez me voir et dites-moi si quelque chose vous a plu.\n\nAu plaisir!', '', '', '', '', '', '', 57534),
