(84446, 'frFR', 'Renom de Khaz Algar', 'Parlez  Faerin Lothar  Dornogal.', 'On a encore tant  faire pour aider Khaz Algar.\n\nMais je n\connais gure ces terres au-del du royaume des Terrestres.\n\nVous feriez mieux de vous adresser  Faerin Lothar pour savoir ce dont Sainte-Chute a besoin.\n\nAllez la voir et demandez-lui si elle a besoin d\aide. C\est votre copine maintenant, pas vrai?', '', '', '', '', '', 'Parlez  Faerin Lothar  Dornogal.', 57534),
