(84424, 'frFR', 'En route pour l\aventure!', 'Utilisez le portail dans le couvoir Martial pour rejoindre Chromie.', 'Nous sommes libres, $c. Libres d\agir comme bon nous semble.\n\nLe reste de votre vie vous attend de l\autre ct de ce portail.\n\nUne personne appartenant au Vol draconique de bronze vous aidera dans votre aventure.', '', '', '', '', '', '', 57534),
(84423, 'frFR', 'Dpoussirage', 'Retrouvez l\Ours en peluche trs apprci d\Alzya dans le bassin Dvorant  Sainte-Chute.', 'Ouah, vous avez l\air $gfort:forte;! Vous voulez bien me donner un coup de main?\n\nMes parents ont t tus par les vilains Kobyss. Mais en partant, j\ai oubli de prendre mon ours en peluche prfr.\n\nVous pourriez aller me le chercher?', '', '', '', '', '', '', 57534),
(84419, 'frFR', 'F\est parti pour les ruines!', 'Rejoignez Maru et Enzo  l\extrieur des ruines d\Uldum.', 'Vous avez rcupr l\obvet de limier de mon frre!\n\n<Maru le soulve avec admiration.>\n\nLe bton de Rvlafion! Cet obvet peut allumer des lumires, faire fondre des trucs et mme dverrouiller des TRVORS ANFIENS. Vous n\avez qu\ le tenir devant vous!\n\nOn voulait l\effayer sur le maffin devant les ruines d\Uldum. Vous voulez v\nir?', '', '', '', '', '', '', 57534),
(84409, 'frFR', 'Acte de vaillance', '', '', '', '', '', '', '', '', 57534),
(84404, 'frFR', 'Un petit paquet de marchandises', '', '', '', '', '', '', '', '', 57534),
(84403, 'frFR', 'Un petit paquet de marchandises', '', '', '', '', '', '', '', '', 57534),
(84393, 'frFR', 'Le bton de Rvlafion', 'Suivez Maru, puis utilisez la torche de Pyrreth sur un brasero  l\extrieur des ruines d\Uldum.', 'Allez, il est temps d\effayer le bton de Rvlafion!\n\nFuivez-moi.', '', '', '', '', '', '', 57534),
(84392, 'frFR', 'Un petit creux dans le grand trou', 'Cherchez Dolena  la fondrire Grondante.', 'Bien le bonjour. Vous cherchez un bon repas?\n\nQuitte  vous salir un peu en chemin?\n\nAllez donc voir Dolena. Elle s\occupera de vous. Mais je vous prviens tout de suite, n\essayez mme pas de la convaincre de quitter son trou. Tout le monde a essay, vous pouvez me croire. Pourquoi diable quelqu\un quitterait la protection de la Lumire pour aller l-bas, allez savoir\n\nMais elle a l\air de s\y plaire.', '', '', '', '', '', '', 57534),
(84370, 'frFR', 'La cl du succs', 'Apportez la cl de chiffrage archaque  lise Cherchtoile  Dornogal.', '<Une cl de chiffrage? lise Cherchtoile lui trouvera peut-tre une utilit.>', '', '', '', '', '', '', 57534),
(84367, 'frFR', ' l\heure du rassemblement', 'Parlez  Moira Thaurissan  Dornogal.', 'On devrait bientt recevoir toute une flotte en renfort. Il tait temps! On m\a galement dit qu\Alleria et Anduin taient de retour  Dornogal.\n\nConnaissant Moira, elle doit dj les avoir pris sous son aile pour prparer notre prochaine manuvre. Elle est ne pour tre cheffe, aussi vrai qu\un griffon est n pour voler! Je vous conseille d\aller la trouver avant que ce n\soit elle qui vous trouve.', '', '', '', '', '', '', 57534),
(84365, 'frFR', 'Du mouvement  l\horizon', 'Parlez  Brann Barbe-de-Bronze  Dornogal.', 'L\quipe de reconnaissance de Brann a aperu des renforts approchant des ctes de Khaz Algar.\n\nIl a lanc un appel aux aventuriers et aventurires pour le rejoindre  Dornogal.', '', '', '', '', '', 'Parlez  Brann Barbe-de-Bronze  Dornogal.', 57534),
(84363, 'frFR', 'Faffe au trsor', 'Utilisez la torche de Pyrreth pour chercher des trsors dans les ruines de Tanaris.', 'Ve fais! On pourrait fe fervir de fe bton pour ferfer des trsors!\n\nVous et Enzo, allez fouiller les autres ruines. Effayez de trouver des trucs fuper cool!\n\nEnfuite, on fe retrouvera aux festivits.', '', '', '', '', '', 'Retournez voir Maru  l\extrieur des Grottes du Temps.', 57534),
(84336, 'frFR', 'Jeu des erreurs', 'Rsolvez l\affaire du dmon changeforme.', 'coutez, je suis le vrai inspecteur. Vous me croyez, n\est-ce pas?\n\nJ\ai une ide. Demandez-moi n\importe quoi. Les braves gens du coin pourront confirmer ma version et prouver mon identit.', '', '', '', '', '', 'Retournez voir Alyx devant les grottes du Temps.', 57534),
(84334, 'frFR', 'Un inspecteur averti en vaut deux', 'Avertissez l\inspecteur Jones  propos du changeforme.', 'Contente de vous revoir, $n.\n\nJ\ai vu l\inspecteur se diriger vers l\ouest. Dpchez-vous d\aller l\avertir avant que le changeforme ne lui tombe dessus!', '', '', '', '', '', 'Avertissez l\inspecteur Jones  propos du changeforme.', 57534),
