(84296, 'frFR', 'Piste refroidie', 'Trouvez le repaire de Griff.', 'J\ai suivi l\odeur de Griff jusqu\ici, mais cet air froid couvre notre piste. J\ai trouv quelques fragments de notes. Rien de trs utile pour le moment, mais, dans sa hte, il semble avoir laiss une trane de documents derrire lui.\n\nCherchez des indices sur l\emplacement du repaire de notre tueur. Je noterai mes dcouvertes sur votre carte.\n\nPrenez le sifflet d\Esprit. Et faites-nous signe si vous avez besoin d\aide.', '', '', '', '', '', 'Retournez voir Alyx devant les grottes du Temps.', 57534),
(84288, 'frFR', 'Commandes d\artisanat: alchimie', 'Trouvez Tarig sur la Placeforge et utilisez sa paillasse d\alchimie.', 'Ainsi, vous tes alchimiste? Je vois.\n\nVous devriez aller trouver Tarig, elle est alchimiste, comme vous.\n\nElle possde sa propre paillasse d\alchimie dans le quartier sud de la Placeforge. Elle pourra vous aider  examiner, fabriquer et livrer des commandes issues de registres publics et de contacts personnels tels que des camarades ou d\autres membres de votre guilde. Si vous avez de la chance, vous tomberez peut-tre sur une commande manant de quelqu\un de renom qui vous offrira des rcompenses supplmentaires. Enfin, c\est ce qu\on dit.', '', '', '', '', '', '', 57534),
(84287, 'frFR', 'Commandes d\artisanat: calligraphie', 'Trouvez Brrigan sur la Placeforge et utilisez sa table  dessin.', 'Ainsi, vous tes scribe? Je connais la meilleure calligraphe de Dornogal.\n\nVous devriez aller trouver Brrigan, dans le quartier sud de la Placeforge. \n\nBrrigan possde sa propre table  dessin o vous pourrez examiner, fabriquer et livrer des commandes issues de registres publics et de contacts personnels tels que des camarades ou des membres de votre guilde. Si vous avez de la chance, vous tomberez peut-tre sur une commande manant de quelqu\un de renom qui vous offrira des rcompenses supplmentaires. Enfin, c\est ce qu\on dit.', '', '', '', '', '', '', 57534),
(84286, 'frFR', 'Ce qu\il y a de plus beau', '', '', '', '', '', '', '', '', 57534),
(84285, 'frFR', 'Commandes d\artisanat: ingnierie', 'Allez trouver Arhdas  la Placeforge et utilisez sa table d\ingnierie.', 'Alors comme a, vous vous ddiez  l\ingnierie, c\est cela?\n\nVous devriez aller voir le machiniste Arhdas  la Placeforge. Je vais indiquer son emplacement sur votre carte.\n\nArhdas possde son propre tabli d\ingnierie o vous pourrez examiner, fabriquer et livrer des commandes issues de registres publics et de contacts personnels tels que des camarades ou de membres de votre guilde. Si vous avez de la chance, vous tomberez peut-tre sur une commande manant de quelqu\un de renom qui vous offrira des rcompenses supplmentaires. Enfin, c\est ce qu\on dit.', '', '', '', '', '', '', 57534),
(84281, 'frFR', 'Commandes d\artisanat: couture', 'Allez trouver Kotag sur la Placeforge et utilisez sa table de couture.', 'Alors comme a, vous faites de la couture? Vous auriez d le dire plus tt!\n\nJe vous envoie chez Kotag, qui tient un atelier de couture fort rput  l\est de la Placeforge. Je vais indiquer son emplacement sur votre carte.\n\nKotag possde sa propre table de couture o vous pourrez examiner, fabriquer et livrer des commandes issues de registres publics et de contacts personnels tels que des camarades ou des guildes. Si vous avez de la chance, vous tomberez peut-tre sur une commande manant de quelqu\un de renom qui vous offrira des rcompenses supplmentaires. Enfin, c\est ce qu\on dit.', '', '', '', '', '', '', 57534),
(84280, 'frFR', 'Commandes d\artisanat: travail du cuir', 'Trouvez Marbb sur la Placeforge et utilisez son tabli de travail du cuir.', 'Alors comme a, vous travaillez le cuir? Vous auriez d le dire plus tt!\n\nJe vous envoie chez Marbb, une travailleuse du cuir rpute qui a son atelier  l\est de la Placeforge. Je vais indiquer son emplacement sur votre carte. \n\nMarbb possde son propre tabli de travail du cuir o vous pourrez examiner, fabriquer et livrer des commandes issues de registres publics et de contacts personnels, tels que des camarades ou des guildes. Si vous avez de la chance, vous tomberez peut-tre sur une commande manant de quelqu\un de renom qui vous offrira des rcompenses supplmentaires. Enfin, c\est ce qu\on dit.', '', '', '', '', '', '', 57534),
(84279, 'frFR', 'Commandes d\artisanat: joaillerie', 'Trouvez Makir sur la Placeforge et utilisez son tabli de joaillerie.', 'Alors comme a, vous crez des bijoux? Vous auriez d le dire plus tt!\n\nJe vous envoie chez Makir, un joaillier rput qui a son atelier au sud de la Placeforge. Je vais indiquer son emplacement sur votre carte. \n\nMakir possde son propre tabli de joaillerie o vous pourrez examiner, fabriquer et livrer des commandes issues de registres publics et de contacts personnels, tels que vos camarades ou des guildes. Si vous avez de la chance, vous tomberez peut-tre sur une commande manant de quelqu\un de renom qui vous offrira des rcompenses supplmentaires. Enfin, c\est ce qu\on dit.', '', '', '', '', '', '', 57534),
(84278, 'frFR', 'Suivi de qute', 'Suivez les coordonnes du message jusqu\ l\emplacement de Rexxar dans la toundra Borenne.', 'Bonne nouvelle! Nous avons une piste. Rexxar a accept de nous aider  retrouver Griff. Si quelqu\un peut mettre la main dessus, c\est bien lui.\n\nIl a suivi son odeur jusqu\ la toundra Borenne. Il vous a laiss ce message.', '', '', '', '', '', 'Parlez  Rexxar dans la toundra Borenne.', 57534),
(84274, 'frFR', 'Commandes d\artisanat: forge', 'Trouvez Darean  la Placeforge et utilisez sa table de forge.', 'Alors comme a, vous forgez? Vous auriez d le dire plus tt!\n\nJe vous envoie chez Darean, une forgeronne rpute qui a son atelier dans la Placeforge. Je vais indiquer son emplacement sur votre carte. \n\nDarean possde son propre tabli de forge o vous pourrez examiner, fabriquer et livrer des commandes issues de registres publics et de contacts personnels, tels que vos camarades ou des guildes. Si vous avez de la chance, vous tomberez peut-tre sur une commande manant de quelqu\un de renom qui vous offrira des rcompenses supplmentaires. Enfin, c\est ce qu\on dit.', '', '', '', '', '', '', 57534),
(84260, 'frFR', 'Artisanat sur commande', 'Parlez  Ardran  l\Enclave de l\artisan.', 'Bonjour et bienvenue  l\Enclave de l\artisanat.\n\nPour rpondre  la demande de la prfte Vokgret, nous travaillons dsormais avec le Consortium d\artisanat pour rpondre aux besoins des Terrestres et des gens d\ailleurs.\n\nAdressez-vous  Ardran ou  Pordaz pour en savoir plus et passer des commandes.', '', '', '', '', '', '', 57534),
(84254, 'frFR', 'Rencontres et accueil', 'Parlez aux htesses et htes chargs des activits.', 'Bonjour, salutations et joyeux anniversaire!\n\nJe suis Yllana, la chef d\orchestre de cette symphonie de clbrations. Je suppose que vous avez envie de vous amuser et de vous divertir? Ne vous inquitez pas, car il y a bien des choses  faire et beaucoup de temps  disposition.\n\nJ\ai indiqu sur votre carte l\emplacement de mes joyeux htes et htesses, qui vous renseigneront sur les activits qui vous attendent.\n\nUne fois que vous leur aurez parl, revenez me voir pour obtenir un cadeau qui amplifiera votre bonheur. Aprs tout, qu\est-ce qu\une fte sans ses cadeaux?', '', '', '', '', '', '', 57534),
(84253, 'frFR', '[obsolte] Commandes de forge requises', '', '', '', '', '', '', '', '', 57534),
(84246, 'frFR', 'Tmoin de l\illumination', 'Assistez  la Sublimation de Siesbarg.', 'Le moment est enfin venu et rien n\est plus exaltant. Il est temps de se mettre au travail.\n\nRejoignez-moi  l\extrieur, observons les fruits de notre travail.', '', '', '', '', '', '', 57534),
(84237, 'frFR', 'L\inspecteur de pas si haute vole', 'Rsolvez le mystre de la disparition d\Herrkrop.', 'Le visiteur port disparu? Oui, un certain Herrkrop. Mais ne vous en faites pas, j\ai dj rsolu l\affaire.\n\nIl s\est srement perdu, rien de plus. Dtendez-vous, $c. Profitez des festivits! Notre visiteur disparu finira bien par rapparatre.\n\nEt si vous ne me croyez pas, vous n\avez qu\ je ne sais pas rsoudre l\affaire vous-mme. Interrogez les gens que vous croisez, ce genre de choses.', '', '', '', '', '', 'Retournez voir Alyx devant les grottes du Temps.', 57534),
(84236, 'frFR', 'L\inspecteur de haute vole', 'Allez parler  l\inspecteur Jones.', 'La Lumire soit loue, vous tes l! Un visiteur a disparu.\n\nUn inspecteur enqutait sur l\affaire, mais je n\ai aucune nouvelle de lui. Pourriez-vous lui demander s\il a avanc?', '', '', '', '', '', '', 57534),
(84224, 'frFR', 'Direction les Gouffres!', 'Retrouvez Brann Barbe-de-Bronze  Dornogal.', 'C\est pas le travail qui manque dans les Gouffres, $n! \n\nRetrouvez-moi  Dornogal. Faut faire le point!', '', '', '', '', '', '', 57534),
