(84144, 'frFR', 'Fe vilain mffant', 'Utilisez l\idole d\Ohn\ahra pour chercher des indices prs des toilettes.', 'Ce vilain mfant a vol l\obvet de limier de mon frre! On doit dcouvrir qui il est et l\obliver  nous le rendre!\n\nVe crois qu\il est tomb prs des toilettes.\n\nMon onc\ a une vieille idole en forme d\oiseau pour trouver des indifes! Vous avez l\air ferviable, alors vous pouvez l\emprunter fi vous voulez.', '', '', '', '', '', '', 57534),
(84143, 'frFR', 'Un emploi du temps charg', 'Retrouvez Maru prs du poulet de Leeroy.', 'La Lumire soit loue, vous tombez  pic!\n\nJe vous en prie, vous devez m\aider. Organiser des vnements est un mtier prouvant, mme dans les meilleures circonstances. Mais l, les problmes ne cessent de s\accumuler!\n\nUne petite Rohart a besoin d\aide, mais je n\ai pas une minute  moi. La dernire fois que je l\ai vue, elle se dirigeait vers le poulet de Leeroy.', '', '', '', '', '', 'Retrouvez Maru prs du poulet de Leeroy.', 57534),
(84133, 'frFR', 'Des services d\alchimie trs demands', 'Honorez des commandes d\alchimie pour le Consortium d\artisanat.', 'Bien le bonjour, $c. Le Consortium d\artisanat est  la recherche de talents pour honorer les commandes de sa clientle locale. \n\nSi vous pensez que votre travail est  la hauteur des critres de qualit requis, essayez de traiter certaines de nos commandes publiques. Vous pouvez galement accepter des commandes pour vos propres clients ou des guildes, voir mme des commandes prives. \n\nRevenez me voir lorsque vous aurez termin vos projets. Puisse le vent guider vos mains et votre cur.', '', '', '', '', '', '', 57534),
