(84086, 'frFR', 'Rare, mais ncessaire', 'Collectez $1oacristal clatant et apportez-le  Nagad  Dornogal.', 'Il arrive que l\on fasse appel  nous pour accorder nos plus grandes et plus puissantes bndictions. Pour ce faire, j\ai besoin d\un cristal clatant.\n\nCertes, de tels cristaux sont rares, mais ils sont ncessaires si l\on veut perfectionner notre art. Ne vous inquitez pas, il sera utilis  bon escient.', '', '', '', '', '', '', 57534),
(84085, 'frFR', 'Le pouvoir du potentiel', 'Collectez $1oaclats resplendissants et apportez-les  Nagad  Dornogal.', 'Nous, enchanteurs et enchanteresses, ne nous contentons pas de vendre des runes ou des baguettes. Notre vritable denre est le potentiel. Nous prenons le pouvoir du possible et l\infusons dans des formes tangibles.\n\nPour cela, les clats resplendissants sont indispensables. Il m\en faut plusieurs pour poursuivre mon travail.', '', '', '', '', '', '', 57534),
