(84024, 'frFR', 'Contrle critique', 'Apportez un burin du roi-bougie au mandataire Jurlax pour obtenir des pices dtaches.', 'La machine respire sans vivre.\n\nNous devons lui insuffler notre souffle vital.\n\nTrouvez un moyen de transmettre la volont divine.', '', '', '', '', '', '', 57534),
(84023, 'frFR', 'Savoir se reprer', 'Apportez un biraliseur synergtique au mandataire Jurlax pour obtenir des pices dtaches.', 'La machine se dplace sans raison.\n\nDonnons-lui un but.\n\nDonnez une direction  cet appareil.', '', '', '', '', '', '', 57534),
(84022, 'frFR', 'Runir les Fils tranchs', 'Joignez vos forces  celles de la Tisserande, du gnral et du vizir pour forger les Fils tranchs.', 'Vous avez bien fait de rallier Anub\azal et Nizrek  notre cause.\n\nIl est temps de consolider ce triumvirat qui nous unit. Nous nous runirons via les lance-ombres. Activez-les lorsque vous voudrez commencer.', '', '', '', '', '', '', 57534),
(84021, 'frFR', 'Machine sans rouages', 'Apportez un lanceur d\croumerang suraliment au mandataire Jurlax pour obtenir des pices dtaches.', 'Diagnostic: le mouvement de cette machine est bloqu.\n\nNous devons la remettre en tat de marche. Il me faudra des pices de rechange. Ces engrenages ne demandent qu\ tourner  nouveau.', '', '', '', '', '', '', 57534),
(84020, 'frFR', 'Une mcarmure en dtresse', 'Apportez la mcarmure dfectueuse au mandataire Jurlax  Gundargaz.', 'Cette mcarmure a connu des jours meilleurs Peut-tre qu\une ou un mandataire qualifi pourrait vous aider.\n\nJe sais que le mandataire Jurlax est depuis peu en charge de l\assignation des machinistes  la maintenance des mcarmures. Il pourra sans doute tre de bon conseil.', '', '', '', '', '', 'Apportez la mcarmure dfectueuse au mandataire Jurlax  Gundargaz.', 57534),
(83931, 'frFR', 'Caisse d\anniversaire abme', 'Rapportez la caisse d\anniversaire abme  Alyx devant les grottes du Temps.', '<La caisse est en mauvais tat. On dirait qu\un loup s\est fait les dents sur l\un de ses coins. Mais Alyx apprcierait que vous lui rapportiez ses fournitures.>', '', '', '', '', '', '', 57534),
(83832, 'frFR', 'Rves dchirs', 'Cherchez Raenie Ptibourbe devant les grottes du Temps.', 'Bonjour, $gaventurier:aventurire;! J\ai besoin d\un coup de main.\n\nHier soir, des tourbillons des sables ont abm le livre d\une visiteuse nomme Raenie Ptibourbe. Ils ont sem le chaos et je dois m\occuper de tout remettre en ordre, mais peut-tre pourriez-vous aider Raenie avec son problme?', '', '', '', '', '', '', 57534),
(83825, 'frFR', 'La restauration d\un grand classique', 'Rapportez Les vertes collines de Strangleronce  Raenie Ptibourbe devant les grottes du Temps.', 'C\tait horrible! Mon livre a t dchiquet et les pages se sont envoles de tous les cts!\n\nCertaines ont t emportes par les tourbillons des sables qui sont descendus dans le tunnel, d\autres par des aventuriers partant affronter les gros monstres de Tanaris, et il y en a qui sont parpilles dans les environs. Votre oiseau ne pourrait pas les retrouver?\n\nJe vous en prie, aidez-moi  retrouver les pages pour restaurer mon livre!\n\nOh, mfiez-vous de Cravitz Lorent. Ce gros louche vend de nouveaux exemplaires pour cent pices d\or sous la scne de la Frnsie de la mode! C\est une vrai escroquerie!', '', '', '', '', '', '', 57534),
(83794, 'frFR', 'Caisse d\anniversaire trempe', 'Rapportez la caisse d\anniversaire trempe  Alyx devant les grottes du Temps.', '<La caisse est mouille et sent un peu le poisson, mais elle semble tanche. Alyx apprcierait que vous lui rapportiez ses fournitures.>', '', '', '', '', '', '', 57534),
(83771, 'frFR', 'Appel du Gouffre: abysse de Tak-Rethan', 'Terminez le Gouffre de l\abysse de Tak-Rethan dans n\importe quel mode.', 'AVIS DE LA TISSERANDE\n\nLes rangs des Kobyss ne cessent de crotre dans l\abysse de Tak-Rethan.\n\nQuelqu\un doit enrayer cette menace avant qu\ils ne s\insurgent et viennent contrarier nos plans.', '', '', '', '', '', 'Retournez voir la veuve Arak\nai au repaire de la Tisserande.', 57534),
(83770, 'frFR', 'Appel du Gouffre: Trame spirale', 'Terminez le Gouffre de la Trame spirale dans n\importe quel mode.', 'Nous qui avons survcu avons bien des histoires  raconter au sujet de la Trame spirale. C\est un endroit o les Nrubiens, parat-il, prparent de lourdes oprations militaires.\n\nLeur livrer bataille impacterait grandement leurs ambitions belliqueuses.', '', '', '', '', '', '', 57534),
(83769, 'frFR', 'Appel du Gouffre: grotte de Mycomancie', 'Terminez le Gouffre de la grotte de Mycomancie dans n\importe quel mode.', 'On a besoin d\aide!\n\nLes fongiciens des grottes de Mycomancie s\attaquent  nos caisses d\pices destines  la croise de Lorel. Il faut que quelqu\un s\aventure dans ces grottes et repousse la menace fongicienne!\n\nForte rcompense  la cl.', '', '', '', '', '', 'Retournez voir Valrin Paller  la Bont de Dunelle.', 57534),
(83768, 'frFR', 'Appel du Gouffre: la brche Grouillante', 'Terminez le Gouffre de la brche Grouillante dans n\importe quel mode.', 'Appel  qui est capable de tenir une pe ou de lancer un sort!\n\nLes Nrubiens s\adonnent  des rituels impies dans les failles de notre mur de l\gide, jadis si majestueux. Ils auraient tabli sous terre un temple noir ddi  leurs dieux maudits.\n\nQue quelqu\un parte enquter sur ce lieu hrtique et mette un terme  leurs sombres desseins!', '', '', '', '', '', 'Retournez voir Lerrenai Fayn  la Bont de Dunelle.', 57534),
(83767, 'frFR', 'Appel du Gouffre: le Puisard', 'Terminez le Gouffre du Puisard dans n\importe quel mode.', 'On nous a signal un rassemblement massif de Kobyss non loin d\un repaire appel le Puisard. Nous redoutons qu\ils aient pour projet d\attaquer les petits villages ctiers lorsque l\opportunit se prsentera  eux.\n\nUne belle rcompense sera offerte  quiconque s\aventurera dans le Puisard pour mettre un terme  leurs machinations!', '', '', '', '', '', 'Retournez voir Aegor Lealferr  la croise de Lorel.', 57534),
(83766, 'frFR', 'Appel du Gouffre: fosse de l\Effroi', 'Terminez le Gouffre de la fosse de l\Effroi dans n\importe quel mode.', 'Les deux ennemis d\un commerce prospre sont la concurrence loyale et les Nrubiens. Le premier, j\en fais mon affaire, mais chargez-vous du deuxime!\n\nNous avons perdu dj beaucoup de personnel dans une grotte appele la fosse de l\Effroi. Les Nrubiens y font des trucs pas trs nets.\n\nOn a besoin que vous les dgagiez pour que les affaires reprennent!', '', '', '', '', '', 'Parlez  Clive DelGlingo.', 57534),
(83761, 'frFR', 'Gouffres: le donjon de l\Abme', 'Trouvez des informations sur Zekvir dans le donjon de l\Abme et terminez le Gouffre dans n\importe quel mode.', 'Qui aurait cru que je pioncerais un jour dans un repaire nrubien?\n\nOn m\a parl d\une belle ordure, un certain Zekvir, qui menace tous les gus qui cherchent  explorer cette le. J\ai d\mand plus d\infos  la Tisserande.\n\nD\aprs elle, on pourrait en trouver dans un endroit appel le donjon de l\Abme. Allons-y et voyons si elle a dit vrai!', '', '', '', '', '', 'Retrouvez Brann Barbe-de-Bronze  l\avance de Faerin.', 57534),
(83759, 'frFR', 'Appel du Gouffre: Repos de Kriegval', 'Terminez le Gouffre du Repos de Kriegval dans n\importe quel mode.', 'AVIS  LA POPULATION\n\nLe Repos de Kriegval est envahi de Kobolds! Il faut restaurer cet ancien sanctuaire sacr des Terrestres.', '', '', '', '', '', 'Retournez voir Bondaz sur la place de la Croise.', 57534),
(83758, 'frFR', 'Appel du Gouffre: Folie fongique', 'Terminez le Gouffre de la Folie fongique dans n\importe quel mode.', 'On nous signale de plus en plus de fongiciens faisant route vers un lieu que nous avons surnomm la Folie fongique.\n\nNous avons besoin d\aide pour dbarrasser la zone de cette invasion de champignons avant qu\ils ne s\tendent davantage.', '', '', '', '', '', 'Retrouvez Bondaz sur la place de la Croise.', 57534),
(83755, 'frFR', 'Gouffres: sanctuaire Crpusculaire', 'Trouvez des traces de Zekvir dans le sanctuaire Crpusculaire et terminez le Gouffre dans n\importe quel mode.', 'a fait du bien de vous r\voir! Y a eu du grabuge depuis la dernire fois.\n\nUn Nrubien, Zekvir qu\il s\appelle, veut que l\expdition arrte d\explorer ces terres. Savez c\que j\en pense? Eh bien, on va explorer encore plus!\n\nCes fanatiques de l\Ordre de la nuit ont pt\tre bien des tuyaux sur ce Zekvir. Allons au sanctuaire Crpusculaire et voyons c\qu\on peut trouver.', '', '', '', '', '', 'Retrouvez Brann Barbe-de-Bronze  l\entre du sanctuaire Crpusculaire.', 57534),
(83752, 'frFR', 'Sous la menace de Zekvir', 'Parlez  Brann Barbe-de-Bronze afin d\inspecter le coffre trange.', 'On nous r\garde, $n. Ils ont plac c\coffre ici pour qu\on l\trouve.\n\nDites-moi quand vous s\rez $gprt:prte;. Je dclencherai le pige et on y verra plus clair.', '', '', '', '', '', '', 57534),
(83749, 'frFR', 'Gouffres: le moulin  eau', 'Terminez le Gouffre du moulin  eau dans n\importe quel mode.', 'Quel priple! Z\imaginez tout c\qui se cache l-d\ssous?\n\nLes mandataires des machines m\ont parl des problmes qu\ils ont  ce qu\ils appellent le moulin  eau. J\mets ma main  couper que ces satans Kobolds sont dans l\coup. Et puis ils ont enterr un trsor bien profond.\n\nAlors, z\en dites quoi? Partons  l\aventure et filons un coup d\main  ces gaillards!', '', '', '', '', '', 'Retrouvez Brann Barbe-de-Bronze devant le moulin  eau.', 57534),
(83742, 'frFR', 'Au garde--vous', 'Allez voir le gnral Anub\azal au bastion du Sige.', 'Salut  vous, $gsoldat:soldate;. Le gnral Anub\azal requiert votre prsence immdiate au bastion du Sige. Il a besoin de votre expertise pour une affaire fort dlicate.\n\nJe n\ai pas l\autorisation d\en dvoiler plus ici. Allez voir le gnral pour en savoir plus.\n\nPour Azj-Kahet.', '', '', '', '', '', '', 57534),
(83740, 'frFR', 'Notorit auprs du vizir', 'Parlez  Tulumun au repaire de la Tisserande.', 'Le vizir m\a demand de vous fournir des ressources supplmentaires pour soutenir vos travaux.\n\nVenez au repaire de la Tisserande. Je vous attendrai avec un paquet.', '', '', '', '', '', '', 57534),
(83739, 'frFR', 'Notorit auprs du gnral', 'Parlez  l\aspirant Kiipka au repaire de la Tisserande.', 'De nombreux fidles du gnral ont eu vent de vos exploits!\n\nRetrouvez-moi au repaire de la Tisserande. Nous vous avons prpar un hommage!', '', '', '', '', '', '', 57534),
(83738, 'frFR', 'Notorit auprs de la Tisserande', 'Parlez  Bobine au repaire de la Tisserande.', 'Un grand merci de la part de la Tisse-mre. \n\nRetournez donc au repaire. De bonnes marchandises vous attendent. \n\nJe les ai entoils et protgs, donc pas d\inquitude  avoir!', '', '', '', '', '', '', 57534),
(83737, 'frFR', 'Les voyages temporels de Chromie', '', '', '', '', '', '', '', '', 57534),
(83722, 'frFR', 'La mouche du coche', 'Prenez Siesbarg des mains de Shalba.', 'Voil qui est regrettable.\n\nMon exprience a chou et Siesbarg en a pay le prix. Nanmoins, je reste optimiste quant  l\avenir qui m\attend. Ce n\est qu\une question de temps avant que je ne matrise le processus. Alors, je pourrai peut-tre concevoir ma propre Sublimation!\n\nSa forme physique n\est pas celle que j\avais prvue, mais l\esprit de Siesbarg semble intact. Il peut encore tre utile, je n\en doute pas. Prenez-le. Sa nouvelle forme rendra de meilleurs services sur le champ de bataille que dans ma minuscule boutique.', '', '', '', '', '', '', 57534),
(83721, 'frFR', 'Un chantillon qui vaut son pesant de sang', 'Collectez suffisamment de sang nrubien pour l\exprience de Shalba.', 'Parfait! Nous y sommes presque! Mais mme si nous touchons au but, impossible de se passer de la partie la plus importante de l\quation gntique: le sang. Nous avons besoin de faire couler un peu de sang nrubien.\n\nCependant, pour que cette nouvelle forme soit  toute preuve, le sang doit provenir des Nrubiens les plus forts qui soient. Rasoir-cleste ou Sublim, peu importe. De cette faon, nous disposerons du meilleur matriel gntique possible.\n\nLe type de matriel que Siesbarg mrite!', '', '', '', '', '', '', 57534),
(83720, 'frFR', 'Veni, vidi, venin', 'Collectez suffisamment de venin nrubien pour l\exprience de Shalba.', ' prsent que nous disposons d\assez de chitine pour l\armure idale, il nous faut le venin parfait. Ne me regardez pas comme a, enfin. Si nous changeons de forme, c\est pour tre en mesure de nous dfendre!\n\nPendant que vous rcoltez ce dont j\ai besoin, je vais incorporer les premiers lments  la nouvelle carapace dont sera dote la Sublimation de Siesbarg. Gardez toutefois  l\esprit qu\il faut imprativement que ce soit du venin nrubien. Hannetons et araignes ne suffiront pas.\n\nO en trouver? Ma foi, je vous laisse juger.', '', '', '', '', '', '', 57534),
(83719, 'frFR', 'Paroles en chitine', 'Collectez suffisamment de chitine nrubienne pour l\exprience de Shalba.', 'Ma foi, voici un spcimen des plus intrigants. On dirait que la personne qui a conu cette crature a commis de graves erreurs de dosage au niveau des matriaux gntiques. Rien d\tonnant  ce que la crature que vous avez croise soit une telle abomination. Voil un travail bcl!\n\nCela tant dit, avec les bons matriaux, je pourrais l\amliorer. Siesbarg ici prsent sera notre cobaye pour ce test. Qui sait, peut-tre que sa Sublimation attirera l\attention des responsables en charge des promotions!', '', '', '', '', '', '', 57534),
(83718, 'frFR', 'uf-traction', '', '', '', '', '', '', '', '', 57534),
(83716, 'frFR', 'Sous les racines', 'Trouvez le camp de repli des arochevaliers en Azj\Kahet occidental.', 'Je suis heureuse de voir que vous allez bien, $n. Je viens d\apprendre qu\un bon nombre d\arochevaliers ont trouv abri dans un camp non loin de l o l\aronef a t arraisonn en vol. \n\nPouvez-vous aller voir comment ils vont?', '', '', '', '', '', 'Trouvez le camp de repli des arochevaliers en Azj\Kahet occidental.', 57534),
(83715, 'frFR', 'Objets de rcupration revendiqus', '', '', '', '', '', '', '', '', 57534),
(83711, 'frFR', 'Les armes de la conqute', 'Obtenez des points de conqute en arnes cotes et champs de bataille cots.', 'Les rcits de vos prouesses sont parvenus jusqu\ mes oreilles, $gpuissant hros:puissante hrone;. Si vous tes aussi $gdou:doue; au combat que ce qu\on raconte, je suis persuade que vous apprcierez l\une de mes crations. Gravez votre nom dans l\histoire. Revenez me voir quand vous aurez prouv vos talents et fait dmonstration de votre honneur.', '', '', '', '', '', '', 57534),
