(83639, 'frFR', 'Communications ouvertes', 'Parlez  Ysabel et claircissez le malentendu.', 'Vous comprenez que d\autres vivent des vies diffrentes de la vtre. Nos voies nous restreignent. Nos traditions ne sont pas pour les oreilles des trangers. Je ne vous parle qu\ cause de la parole d\Orweyna, mais en mme temps je sens la dsapprobation d\On\hiea.\n\nQu\il est inconfortable d\entretenir des mystres. Voil pourquoi tant de personnes ont peur du noir. Parce qu\il leur est inconnu.\n\nJe sais, je parle d\une manire nigmatique. Mais nos voies ne signifient pas que nous sommes offenss par le peuple arathi. Il cre une tension o il n\y en a pas chez nous.', '', '', '', '', '', 'Parlez  Ysabel au camp sauvage Or\lay.', 57534),
(83632, 'frFR', 'Anneaux du souvenir', 'Amenez la racine de Goehi au camp sauvage Or\lay.', 'J\apprcie ce que vous avez fait. N\ayez crainte, je n\en ai pas encore termin.\n\nSi vous le voulez bien, amenez cette racine  celles et ceux qui vous ont $genvoy:envoye;. Ils pourront lire l\histoire de ma vie dans les anneaux de bois qui la constituent. Ma vie est une parmi tant d\autres sur la Grande tapisserie, mais nous sommes tous entrelacs. \n\nCes personnes trangres que vous avez rencontres peuvent paratre recluses, voire mystrieuses, mais elles comprennent la Grande tapisserie mieux que personne, et elles la gardent au pril de leur vie.', '', '', '', '', '', 'Ramenez la racine au camp sauvage Or\lay.', 57534),
(83629, 'frFR', 'Rpit de l\ancien', 'Tuez $1oamites gloutonnes pour Goehi.', 'C\tait un lac magnifique, autrefois. Mais avec le temps, les racines ont perc le fond et drain toute l\eau. J\ai vcu ici toute ma vie, j\ai assist  sa lente dcadence. Mais aujourd\hui, des changements plus sombres sont  l\uvre.\n\nParfois, le changement vient avec la mort. La dcomposition est naturelle.\n\nMais les mites qui se nourrissent de mon peuple n\ont rien de naturel. Elles propagent une curieuse infestation qui fait le mme effet que si mon corce voulait quitter mon corps.\n\nDtruisez ces mites pour que je puisse me reposer sans craindre de sentir leurs gueules se repatre de ma silhouette endormie.', '', '', '', '', '', '', 57534),
(83628, 'frFR', 'Situation tendue', 'Parlez aux personnes trangres pour amliorer les relations avec le peuple arathi.', 'La situation avec ces personnes trangres est tendue. Nous apprcions vraiment l\autorisation de venir nous abriter ici dans leur camp, mais elles semblent  peine nous tolrer. Nous avons offert de partager notre ravitaillement, mais a les a offenses.\n\nMa sur est gravement blesse, j\ai vu qu\il y avait des herbes mdicinales dans cette tente, l-bas, mais cette espce d\escargot gant me barre l\entre.\n\nJ\ai demand de l\aide au garde sur la colline, mais il n\a fait que me lancer un regard furibond. Je ne sais plus quoi faire. Il vous coutera peut-tre, vous?', '', '', '', '', '', 'Trouvez l\ancien au-dessus du lac de la Rupture.', 57534),
(83627, 'frFR', ' l\origine du beau', 'Apportez la fiole de sang de rasoir-cleste  Shalba.', '<Cela pourrait intresser un alchimiste nrubien.\n\nLa Sublimation, c\est leur spcialit, et cette chose pourrait tre la cl pour mieux comprendre le processus.>', '', '', '', '', '', '', 57534),
(83616, 'frFR', 'La grande retranche', 'Offrez vos services  la grande surfileuse Antourix contre Ren\khat.', 'Et maintenant, l\autre joyau de ce coup d\tat.\n\nJ\opre sous les mandibules de la grande surfileuse Antourix depuis un certain temps. Elle s\est retranche  Rak-Ahat, croyant que rien ne peut la toucher tout l-haut. Elle a dj refus de se soumettre  Ren\khat.\n\nMme elle sait que si Ren\khat obtient le soutien de la couronne, alors tout n\est plus qu\une question de temps. Expdions donc ses tentatives d\viction de cet arriviste.\n\nEt nous verrons bien combien de temps ils mettent pour se tourner l\un contre l\autre.', '', '', '', '', '', '', 57534),
(83587, 'frFR', 'L\occasion de frapper', 'Retrouvez le vizir auprs de l\apothicaire royal.', '<L\araigne aux traits d\enfant vous prsente un parchemin scell portant le sceau du vizir.>\n\nL\quilibre des pouvoirs change  Azj-Kahet. L\influence de la reine se fait chaque jour plus instable, et je crains que nous devions agir avant que l\occasion de l\arrter ne nous glisse entre les doigts. \n\nRetrouvez-moi auprs de l\apothicaire royal ds que vous recevrez cette missive.', '', '', '', '', '', 'Retrouvez le vizir auprs de l\apothicaire royal.', 57534),
