(83552, 'frFR', 'Azj-Kahet', 'Parlez  Faerin Lothar  bord de la Rtribution  Azj-Kahet.', 'Un aronef arathi est en rade  Azj-Kahet  la suite d\une perfide embuscade nrubienne.\n\nAidez les personnes survivantes  rsister  l\assaut des Nrubiens.', '', '', '', '', '', '', 57534),
(83551, 'frFR', 'Sainte-Chute', 'Parlez  Faerin Lothar  Sainte-Chute.', 'Anduin Wrynn espre gagner la confiance et l\aide du peuple arathi de Sainte-Chute.\n\nIl aura besoin d\aide pour convaincre ces allis potentiels.', '', '', '', '', '', '', 57534),
(83550, 'frFR', 'Les abmes Retentissants', 'Retrouvez la mandataire Brinthe aux abmes Retentissants.', 'La mandataire Brinthe est alle aux abmes Retentissants pour valuer comment les mandataires des machines s\en sont sortis pendant son absence.\n\nElle a demand que des aventuriers et aventurires la rejoignent au fond de la galerie Primaire.', '', '', '', '', '', '', 57534),
(83548, 'frFR', 'le de Dorn', 'Parlez  dame Jaina Portvaillant sur l\le de Dorn.', 'Les survivantes et survivants de l\attaque sur Dalaran sont assaillis par des Nrubiens mens par le garde de la reine Zirix.\n\nPrtez main-forte  la dernire poche de rsistance.', '', '', '', '', '', '', 57534),
(83543, 'frFR', 'Aventures en Khaz Algar', 'Examinez la carte de reconnaissance et slectionnez une rgion de Khaz Algar  laquelle apporter votre aide.', 'On a des quipes de reconnaissance aux quatre coins de Khaz Algar, et elles signalent toutes la mme chose: a sent les ennuis.\n\nOn arrive juste  temps, pas vrai?\n\nConsultez la carte de reconnaissance sur la table derrire vous, et prtez main-forte o vous le pouvez.', '', '', '', '', '', '', 57534),
