(83530, 'frFR', 'Tournoi de pche de Sainte-Chute', 'Attrapez ces poissons trophes avant la fin de l\amlioration Participation au tournoi: perche sanglante, cherchepche rugissant, hmitriptre hriss.', 'La vie n\est pas simple, ici, $p. Les Nrubiens, les Kobyss, la faim La mort est partout.\n\nAlors il faut se garder du temps pour souffler et s\adonner  une activit tranquille. Comme la pche.\n\nMon pre passait tous ses samedis  pcher, quand j\tais jeune. Il disait: Si tu ne prends pas du temps pour toi, tu n\apporteras rien de bon  personne.\n\nAlors, tous les samedis, je dfie des gens au concours de pche de Sainte-Chute. Vous avez une heure pour attraper des poissons trophes. Voyons un peu ce que vous pouvez me rapporter!', '', '', '', '', '', '', 57534),
(83529, 'frFR', 'Tournoi de pche de Sainte-Chute', 'Attrapez ces poissons trophes avant la fin de l\amlioration Participation au tournoi: stromate-bismuth juvnile, mirtoile murmurant, pseudochromide.', 'La vie n\est pas simple, ici, $p. Les Nrubiens, les Kobyss, la faim La mort est partout.\n\nAlors il faut se garder du temps pour souffler et s\adonner  une activit tranquille. Comme la pche.\n\nMon pre passait tous ses samedis  pcher, quand j\tais jeune. Il disait: Si tu ne prends pas du temps pour toi, tu n\apporteras rien de bon  personne.\n\nAlors, tous les samedis, je dfie des gens au concours de pche de Sainte-Chute. Vous avez une heure pour attraper des poissons trophes. Voyons un peu ce que vous pouvez me rapporter!', '', '', '', '', '', '', 57534),
(83503, 'frFR', 'Retournez  Dornogal.', 'Retournez  Dornogal sur l\le de Dorn et expliquez ce qui s\est pass.', 'La bataille est enfin termine. Le temps est venu de panser nos plaies.\n\nRetournez  Dornogal, $gchampion:championne;!\n\nJ\arriverai ds que Khadgar sera en tat de supporter le voyage.', '', '', '', '', '', 'Parlez  Anduin  Dornogal, sur l\le de Dorn.', 57534),
(83500, 'frFR', 'Zekvir, Main de la messagre', 'Terrassez Zekvir, la Main de la messagre dans son propre Gouffre.', 'On va devoir ouvrir l\il pour pas manquer Zekvir en explorant les Gouffres. Je crois pas qu\on soit encore suffisamment fort pour l\affronter, mais on le sera un jour!\n\nContinuons  explorer et  amasser des trsors jusqu\ c\qu\on soit suffisamment puissant pour le traquer jusqu\ son repaire et le dtruire.', '', 'Une monstrueuse crature qui traque les aventuriers et aventurires dans le Gouffre.', 'Zekvir, Main de la messagre', '', '', '', 57534),
(83497, 'frFR', 'Un ami proccup', 'Allez voir Kyron le Grand  Mereldar.', 'Ah, $n, vous voil! Kyron le Grand demande  vous voir avec votre ami Anduin. \n\nJe pense qu\il veut vous parler de Faerin. Rien d\urgent, voyez-vous, elle a probablement juste besoin d\un peu de compagnie, mais nous sommes tout de mme un peu inquiets pour elle.\n\nAllez donc voir Kyron quand vous aurez un moment, voulez-vous?', '', '', '', '', '', 'Allez voir Kyron le Grand  Mereldar.', 57534),
(83496, 'frFR', 'Bataillons: l\espace-temps, c\est de l\argent', 'Positionnez la matrice d-recombobulation dans la banque de Gadgetzan.', 'Maintenant que nous avons toutes les donnes transpositionnelles que nous pouvions esprer, tout ce qu\il reste  faire est d\installer un tunnel spatiotemporel dans un tablissement bancaire adquat, et nous pourrons changer notre quipement sur le terrain en moins de temps qu\il n\en faut pour le dire!\n\nEt il se trouve qu\il y a justement une banque ici  Gadgetzan!\n\nVous pouvez mme coordonner votre propre portail au mme moment pour accder  votre banque de bataillon, o que vous soyez. a va tre tellement pratique!', '', '', '', '', '', '', 57534),
(83495, 'frFR', 'Bataillons: positions jumelles', 'Activez le recombobulateur  signal transpositionnel  l\extrieur de Gadgetzan et faites face aux consquences.', 'Nous sommes sur une bonne srie! Nous avons dtect une anomalie encore plus anormale pendant votre absence, et l\avons localise avec prcision  l\ouest de la ville.\n\nNous y avons install notre tout nouveau recombobulateur  signal transpositionnel, mais je ne voulais pas l\activer sans vous. Vous nous avez t d\un grand secours, aprs tout.\n\nTout ce que vous avez  faire est de saisir les coordonnes dessus et d\actionner le commutateur! Simple comme bonjour.\n\nRivet dit que les chances que quelque chose de cataclysmique survienne sont fort leves, mais qu\est-ce qui pourrait mal tourner, franchement?', '', '', '', '', '', '', 57534),
(83494, 'frFR', 'Bataillons: fantmes de l\espace sur la cte', 'Collectez des rsidus spatiaux sur les cratures partiellement tlportes prs de Gadgetzan.', 'Il y a un grand nombre de choses  moiti tlportes qui se baladent dans le dsert non loin d\ici. C\est dj surprenant d\en apercevoir une, mais en croiser un tel nombre, c\est assurment stupfiant!\n\nElles ne semblent pas particulirement amnes, mais si nous pouvions en apprendre suffisamment sur leur fcheuse posture, je parie que nous viterons que l\inhibiteur de distance de banque de bataillon ne dilapide tout notre butin!\n\nEssayez de trouver quoi que ce soit qui pourrait nous aider  comprendre ce qui a mal tourn pour elles. Ce n\est pas comme si les gens aimaient se tlporter alatoirement dans tous les sens, pas vrai?', '', '', '', '', '', '', 57534),
(83493, 'frFR', 'Bataillons: lecteur des failles', 'Scannez les anomalies transpositionnelles prs de Gadgetzan.', 'Je parie que vous vous demandez sur quoi nous travaillons, n\est-ce pas? Nous allons faire en sorte que notre banque de bataillon soit accessible depuis n\importe o!\n\nRivet appelle cela un inhibiteur de distance de banque de bataillon en attendant de lui trouver un nom plus accrocheur, mais nous avons besoin d\un peu d\aide pour parachever le projet.\n\nPour s\assurer de pouvoir accder  notre rserve partage depuis plusieurs endroits, il va nous falloir des portails! Nous en avons repr des magnifiques ici.\n\nSi vous pouviez nous obtenir des analyses des anomalies locales, on vous devrait une fire chandelle!', '', '', '', '', '', '', 57534),
(83492, 'frFR', 'Bataillons: batailler ensemble', 'Retrouvez Bleu et son bataillon  Gadgetzan.', 'Salutations, $n. Des amis et moi-mme avons form un bataillon, et nous travaillons  quelque chose qui faciliterait grandement la coopration, mme quand nous sommes spars!\n\nIl nous faudrait juste un peu d\aide pour la dernire tape.\n\nVenez nous retrouver  Gadgetzan quand vous avez un moment!', '', '', '', '', '', 'Retrouvez Bleu et son bataillon  Gadgetzan.', 57534);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(83489, 'frFR', ' tous les gladiateurs!', 'Apportez la brochure  Hotharn  la porte du Belligrant  Dornogal.', 'Approchez, approchez, cap sur Dornogal!\n\nEn plus de la slection habituelle de puissants quipements proposs  la Porte du belligrant, les aspirants combattants et gladiateurs vtrans peuvent acheter des jetons hraldiques utiliss pour fabriquer de l\quipement certifi dans les arnes et sur les champs de bataille!\n\nPrsentez cette brochure  Hotharn pour en recevoir plusieurs. C\est la maison qui offre!\n\n Aisha', '', '', '', '', '', '', 57534),
(83469, 'frFR', 'Cit des Fils', 'Biergoth veut que vous liminiez toutes les menaces de la cit des Fils.', 'Tulumun, notre alli nrubien, nous a recontacts. Il a parl d\un lieu appel la Transformacie o sont menes d\abominables expriences.\n\nJ\ai besoin que vous infiltriez la cit pour y rencontrer le vizir en personne, avec qui vous terminerez la mission.\n\nliminez les ennemis du vizir, mettez un point final  la menace, et revenez me voir pour votre paiement.', '', '', '', '', '', '', 57534),
(83465, 'frFR', 'Ara-Kara, la cit des chos', 'Biergoth veut que vous mettiez fin  l\opration en cours  Ara-Kara.', 'Nous avons t approchs par Tulumun, l\agent d\un nouveau contact connu sous le nom du vizir.\n\nJamais je ne me serais attendue  ce qu\un Nrubien vienne qumander notre aide, mais la menace dont il nous a fait part pourrait bien tous nous concerner.\n\nJ\ai besoin que vous descendiez  Azj-Kahet pour y infiltrer Ara-Kara, la cit des chos. Si Tulumun dit vrai, nous ne pouvons pas en laisser sortir la chose qui y a t tisse.\n\nMettez un terme  leurs oprations. Rapportez-nous ensuite des preuves de ce que vous aurez dcouvert.', '', '', '', '', '', '', 57534),
(83459, 'frFR', 'Le Brise-Aube', 'Biergoth veut que vous alliez au Brise-Aube pour aider la gnrale Heurtacier  scuriser la crmonie.', 'La gnrale Heurtacier du peuple arathi nous a informs qu\elle exigeait que vous assistiez  une crmonie  bord du Brise-Aube.\n\nElle a besoin d\une surveillance particulire; avez-vous dj scuris des crmonies  haut risque?  la Placeforge, a signifie en gnral une affaire sans intrt suivie d\un bourbier diplomatique.\n\nToutes mes excuses, quand la gnrale a exig votre prsence, j\ai simplement dit oui. Et puis c\est normal qu\il y ait des missions moins palpitantes que d\autres, de temps en temps.', '', '', '', '', '', '', 57534),
(83458, 'frFR', 'Prieur de la Flamme sacre', 'Biergoth veut que vous alliez au prieur de la Flamme sacre pour aider sur Etna Blayze.', 'Vous tombez bien, $n. J\ai une mission pour vous.\n\nSur Etna Blayze du peuple arathi est convaincue que quelque chose cloche au prieur de la Flamme sacre. Elle ne s\est pas attarde sur les explications.\n\nAllez voir la sur au prieur de la Flamme sacre. J\ai l\intuition qu\elle n\a pas tort et qu\elle aurait bien besoin de votre aide.', '', '', '', '', '', '', 57534),
(83457, 'frFR', 'La Cavepierre', 'Biergoth veut que vous mettiez un terme  la corruption des Skardyns  la Cavepierre.', 'J\ai une mission pour vous de la part de la haute-mandataire Brinthe en personne.\n\nLa corruption des Skardyns envahit la Cavepierre. Pour contenir la panique, la haute-mandataire Brinthe nous a demand de l\aide. Je lui ai dit qu\elle pouvait nous faire confiance, car notre soutien est aussi solide que la roche mre sous nos pieds.\n\nAllez  la Cavepierre et mettez un terme  la corruption des Skardyns. Faites-moi signe lorsque vous aurez termin.', '', '', '', '', '', '', 57534),
(83443, 'frFR', 'Faille de Flamme-Noire', 'Biergoth veut que vous vous aventuriez dans la faille de Flamme-Noire pour y affronter les Tnbres.', 'Une nouvelle allie, une Kobold des abmes Retentissants nomme Trotteuse, m\a contacte.\n\nJ\ai besoin que vous alliez  la faille de Flamme-Noire pour y anantir une certaine menace, une chose que Trotteuse nomme les Tnbres.\n\nComment une Kobold qui passe une bonne partie de sa vie sous terre peut-elle craindre les tnbres? a n\a pas de sens. Mais les Kobolds tant ce qu\ils sont, je ne m\attarderai pas  chercher  les comprendre.', '', '', '', '', '', '', 57534),
(83436, 'frFR', 'Hydromellerie de Brassecendre', 'Biergoth veut que vous mettiez fin  la prsence de la KapitalRisk  l\hydromellerie de Brassecendre.', 'Une rumeur est parvenue  mes oreilles grce  l\un de mes contacts nomm Wenbrandt. Vous avez peut-tre entendu parler de lui, il tient l\hydromellerie de Brassecendre.\n\nSelon ses dires, des Gobelins affilis  une organisation qui se fait appeler la KapitalRisk essaient de prendre le contrle de l\hydromellerie. Nous ne pouvons l\accepter, et j\ai besoin de vous pour entrer dans l\hydromellerie et liminer cette menace.\n\nBrassecendre est un produit terrestre qui en tant que tel doit rester sous le contrle des Terrestres. Wenbrandt leur donnera une leon, mais en attendant, je compte sur vous pour remplir cette tche.', '', '', '', '', '', '', 57534),
(83432, 'frFR', 'La colonie', 'Biergoth veut que vous entriez dans la colonie pour mettre un terme  la menace des Skardyns.', 'Mes contacts autour de Dornogal m\ont command de garder le secret, mais je dois vous faire confiance, car je n\ai personne d\autre  qui demander cela.\n\nNous avons un problme  la colonie: une invasion de Skardyns.\n\nQuelqu\un doit nettoyer la colonie de la prsence des Skardyns, trouver la source de la propagation et la reboucher avec le rocher.\n\nUne fois la mission termine, revenez me voir pour votre rcompense.\n\nEt n\oubliez pas cela reste entre nous.', '', '', '', '', '', '', 57534),
(83366, 'frFR', 'Le monde vous attend', 'Accomplissez 10expditions en Khaz Algar.', 'Peut-tre pouvons-nous transformer votre tragdie en une exprience mutuellement positive? Il y a fort  faire pour assister les Terrestres. \n\nPrtez-nous main-forte o vous le pouvez.', '', '', '', '', '', '', 57534),
(83365, 'frFR', 'Un passage glacial dans les limbes du temps', 'Venez  bout de 5boss de raid ou donjons des Marcheurs du temps.', 'Depuis que notre cit est tombe du ciel, j\en apprends constamment sur l\histoire de ce monde et sur les dfis auxquels font face les tres hroques comme vous. \n\nC\est en apprenant du pass que l\on assure l\avenir. Marchez  travers le temps jusqu\ un pass gel pour y vaincre  nouveau les menaces qui y rdent, et rapportez les leons de vos exploits.', '', '', '', '', '', '', 57534),
(83363, 'frFR', 'Un passage brlant dans les limbes du temps', 'Venez  bout de 5boss de raid ou donjons des Marcheurs du temps.', 'Vos gens m\ont rapport des histoires d\une Porte des tnbres au-del de laquelle se trouvent de nombreux ennemis et dfis. J\aimerais entendre d\autres de ces lgendes.\n\nVoyagez  travers l\espace et le temps jusqu\ ce lieu isol, venez  bout des ennemis qui y rdent, et ramenez-moi des nouvelles de leur trpas.', '', '', '', '', '', '', 57534),
(83358, 'frFR', 'L\appel de l\arne', 'Remportez 10escarmouches en arne.', 'Avez-vous prouv votre valeur dans l\arne? Remportez suffisamment de combats, et nous trouverons peut-tre un jour que les rcits de vos batailles sont dignes de l\archive.', '', '', '', '', '', '', 57534),
(83357, 'frFR', 'La crme de la crme', 'Battez 5personnages-joueurs en JcJ en utilisant la fonction Trouver un combat avec une quipe de mascottes de niveau25.', 'Le lien entre nos machines et nous ressemble  celui que d\autres ont avec leur animal familier. Il faut tre en harmonie avec ses compagnons pour accomplir de grandes choses!\n\nMontrez-moi que vous savez collaborer avec vos mascottes, et venez  bout de vos ennemis avec leur aide!', '', '', '', '', '', '', 57534),
(83347, 'frFR', 'L\missaire de guerre', 'Terminez 4donjons en mode hroque ou mythique.', 'Souhaitez-vous relever un vritable dfi? Creusez au plus profond de lieux tnbreux, grimpez vers les plus hauts sommets en augmentant constamment les enjeux du dfi. \n\nC\est en s\imposant des conditions extrmes que l\on met vraiment ses talents au dfi.', '', '', '', '', '', '', 57534),
(83345, 'frFR', 'L\appel au combat', 'Remportez 4champs de bataille.', 'J\ai appris que vos peuples mnent de grandes batailles les uns contre les autres de part et d\autre de prairies normes aussi bien que dans des ruines. \n\nN\est-ce pas une perte de temps que de se battre pour des drapeaux au lieu d\abattre le travail ncessaire? On peut tester la valeur du guerrier sur le champ de bataille, c\est le seul avantage que j\y vois.\n\nApportez-moi des nouvelles de vos victoires! J\attends d\tre impressionne.', '', '', '', '', '', '', 57534),
(83339, 'frFR', 'Brise-aiguillon', 'Tuez Anub\esska sur la route non loin de la Randonneraie, sur l\le de Dorn.', 'Les attaques nrubiennes ne nous sont pas totalement inconnues. Le Kirin Tor est bien quip pour repousser ces menaces. Dalaran\n\ntait bien quip. Je ne peux pas repousser tous les adversaires de cette ville, mais vous y parviendrez peut-tre. J\ai dtect la prparation d\une embuscade sur la route qui mne ici. Une tactique des plus familires d\un ennemi des plus familiers. Allez donc dclencher le pige et pourfendre le monstre qui rde au-dessous.', '', 'Anub\esska prfre tendre des embuscades  ses proies par en dessous. Une tactique bien connue, dsormais, mais fort efficace.', 'Anub\esska', '', '', '', 57534),
(83338, 'frFR', 'Le pourfendeur de mages', 'Tuez le pourfendeur de mages Phytethil prs de la Randonneraie sur l\le de Dorn.', 'J\avoue que je ne suis pas venue ici sans raison. Il existe une entit non loin qui ne peut tre laisse en libert.\n\nUn prisonnier du fort Pourpre tristement connu sous le nom du pourfendeur de mages. Je suis venue demander l\aide de ces gens, mais ce ne sont que des fermiers. J\espre que vous tes plus  mme de vous en charger.\n\nCherchez ce monstre et mettez un terme  son existence.', '', 'Le pourfendeur de mages extrait tout le mana de ses victimes afin de l\utiliser comme nergie lors de puissants rituels.', 'Pourfendeur de mages Phytethil', '', '', '', 57534),
(83337, 'frFR', 'Balafr par la tempte', 'Tuez Balafre-tempte dans les pturages prs de la Randonneraie sur l\le de Dorn.', 'Jetez un coup d\il  ce splendide village. Que voyez-vous? Des fermes et leurs mousselaines. Mais o est pass mon troupeau  moi? Dans l\estomac d\une bte, figurez-vous. Balafre-tempte, qu\on l\appelle. \n\nBalafre-tempte qui rugit comme le tonnerre. Qui frappe comme la foudre. Et dont l\estomac est rempli du travail de toute une vie. \n\nJe suis venu acheter des armes et tout ce qu\il y a, c\est du matriel de ferme. Vous n\avez pas l\air faible. Et si vous mettiez un terme au rgne de Balafre-tempte sur nos pturages?', '', 'On raconte que Balafre-tempte peut tuer un blirithe adulte d\un coup de mchoire.', 'Balafre-tempte', '', '', '', 57534),
(83336, 'frFR', 'La Plaie de la terre', 'Rcuprez le cur-de-pierre bris de Roth la Plaie de la terre sur l\le de Dorn.', '<Etterca grogne  votre approche.>\n\nLa terre tremble. Je n\aime pas a.\n\nLes lments se rveillent. Quelque chose de pourri en eux. Le danger est sur nous. Vous devez le forcer  s\incliner et donner son cur.\n\nAlors la terre pourra gurir. Alors Etterca pourra reprendre sa tche.', '', 'Roth ressent les blessures qui entaillent la terre.', 'Roth la Plaie de la terre', '', '', '', 57534),
(83335, 'frFR', 'Avis de recherche: brise-quartier', 'liminez le brise-quartier Stik\kar sur l\le de Dorn.', '<Ce message est clou au poteau avec une petite plaque chitineuse.>\n\nPour ses crimes entravant les dits de Dornogal, le conseil offrira une rcompense  la personne qui abattra la crature chitineuse appele Stik\kar.\n\nUn chantillon de la carapace de Stik\kar est joint  ce message. Si vous ne parvenez pas  l\endommager, prire de passer votre chemin et d\ignorer cette requte.', '', 'Une expertise en forage de tunnels et une faade quasi impntrable.', 'Brise-quartier Stik\kar', '', '', '', 57534),
(83334, 'frFR', 'La richesse d\un empire', '', '', '', '', '', '', '', '', 57534),
(83333, 'frFR', 'quip contre le danger', 'Terminez $2oa$lvague:vagues; de l\vnement L\veil de la machine.', 'Salutations, l\$gami:amie;.\n\nLa machine est de nouveau en panne et a besoin d\tre rpare.\nJ\ai besoin de votre expertise pour raliser les travaux de maintenance avec brio.\n\nUne rcompense est accorde pour une intervention bien mene.', '', '', '', '', '', '', 57534),
(83331, 'frFR', 'Prservation et faux-semblants', 'Cherchez des lieux  creuser en qute d\objets historiques en utilisant le dtecteur d\histoire gobelin.', 'Ciboulette adore histoire. Vous aider  faire dcouverte? \n\nGobelin a donn dtecteur histoire. Dit trouver histoire sous terre! Vous utiliser. Ciboulette creuse.', '', '', '', '', '', '', 57534),
(83330, 'frFR', 'Niveau60', '', '', '', '', '', '', '', '', 57534),
(83329, 'frFR', 'Niveau50', '', '', '', '', '', '', '', '', 57534),
(83328, 'frFR', 'L\Interface d\analyse', 'Compltez la squence d\analyse dans l\Interface d\analyse.', 'Voici l\Interface d\analyse.\n\nAfin d\assurer que notre programme principal reste intact, ces consoles furent installes avec une srie d\interrogations pour valuer la matrice mmorielle des Terrestres qui venaient de s\veiller.\n\nBien qu\Aurore vous encourage  rpondre comme vous le voulez, je eh bien, j\espre que vous rpondrez honntement.\n\nQuand vous voudrez.', '', '', '', '', '', 'Parlez avec Aurore dans le forum Procdural.', 57534),
(83326, 'frFR', 'La dernire bougie', 'Volez la dernire bougie pour la bouche d\aration suspecte  la taverne de Gundargaz.', 'Vous toujours bien prendre bougies brillantes.\n\nNous avoir dernire tche confier  vous,  grande cire luisante! Dernier travail! Aprs, fini affaires collantes.\n\nDans sous-sol, grande bougie apparente. Pierres utiliser bougie pour loigner rats du miel, substance coulante. Nous pas rats! Nous Kobooolds.\n\n<Un ange passe.>\n\nRien rimer avec Kobolds.\n\nVous rcuprer grande bougie!', '', '', '', '', '', '', 57534),
(83325, 'frFR', 'Hannetons abondants', 'Parlez  Kish\nal  Rak-Ush.', 'Le gnral Anub\azal a de grands projets pour la grouillerie de Rak-Ush. Il a l\intention de la remettre en tat de marche pour soutenir sa campagne de guerre.\n\nMais j\ai des rserves sur les deux personnes qu\il a laisses aux commandes.\n\nKish\nal semble avoir la tte sur les paules, mais Vix\aron? Volatil serait un euphmisme. Ils auraient besoin d\un petit coup de pression.\n\nRetrouvez Kish\nal  Rak-Ush et suivez les ordres d\Anub\azal.', '', '', '', '', '', 'Parlez  Kish\nal  Rak-Ush.', 57534),
(83324, 'frFR', 'Bobine de soie', 'Retrouvez Sum\latha au quartier Soyeux.', 'Vous cherchez du travail? <Linny plisse les yeux.> Si vous comptez rester dans les parages, j\ai eu vent de rumeurs en provenance de la capitale. Une associe de la Tisserande s\occupe d\une affaire dans le quartier Soyeux.\n\nLe nouveau quartier est cens reprsenter un renouveau pour les citoyens de la capitale, mais les Cingletrme ples de la reine l\ont transform en camp militaire. Cette situation ne rjouit pas la population.\n\nTrouvez une Nrubienne nomme Sum\latha  l\extrieur du quartier. Elle vous donnera tous les dtails.', '', '', '', '', '', 'Retrouvez Sum\latha au quartier Soyeux.', 57534),
(83322, 'frFR', 'Le Brise-Aube: lancement', 'Contribuez  la russite de la crmonie de lancement dans le donjon du Brise-Aube.', 'Le vaisseau amiral de l\armada arathie est le Brise-Aube. C\est une merveille d\ingnierie arathie et de la foi en la Flamme sacre. Sa prsence dans le ciel de Sainte-Chute nous aidera  repousser les Nrubiens lorsqu\ils oseront lancer un nouvel assaut sur nos terres.\n\nPuisque vous nous avez t d\une grande aide par le pass, je vous invite cordialement  la crmonie de lancement du Brise-Aube. Si vous pouvez faire en sorte qu\elle se droule sans accroc, vous aurez toute ma gratitude.', '', '', '', '', '', '', 57534),
(83321, 'frFR', 'tranges chauves-souris', 'Enqutez sur la prsence ventuelle d\un druide.', 'Sa Seigneurie a une piste sur une chauve-souris des plus tranges qui volait autour des Terrevers.\n\nLes espions ont rapport qu\elle se comportait plus comme une personne que comme un animal. Nous souponnons l\existence d\un druide, mais il ne se manifesterait pas volontairement auprs des Nrubiens.\n\nVous inspirez le respect. Allez donc y jeter un il.', '', '', '', '', '', '', 57534),
(83315, 'frFR', 'Se prparer pour l\inconnu', 'Retournez voir Moira Thaurissan  Dornogal.', 'Ce processus sera long, et Dagran ne peut pas rester aussi longtemps sur les les.\n\nMais peut-tre que\n\n Il y a de nombreuses reliques des Titans que je peux utiliser comme cls pour librer des informations dans le serveur ou pour le rparer. Cela pourrait acclrer le processus.\n\nL\avenir nous le dira.\n\nVous nous avez suffisamment aids, $n. Retournez voir Moira et faites-lui part de nos dcouvertes.', '', '', '', '', '', '', 57534),
(83306, 'frFR', 'L o les monstres se terrent', 'Retrouvez Orweyna au camp sauvage Ul\ar.', 'Mes gens ont trouv quelques Haranir installant un de leurs campements au sud-ouest. Au vu de leur manque cruel de ravitaillement, mes gens ont offert leur aide. Mais je ne peux pas m\empcher de m\inquiter.\n\nPourriez-vous prendre de leurs nouvelles? Assurez-vous que nous avons correctement accueilli les Haranir et que personne n\a offens quiconque par mgarde. S\il vous plat.', '', '', '', '', '', 'Retrouvez Orweyna au camp sauvage Ul\ar.', 57534),
(83286, 'frFR', 'Ce que cache Dornogal', 'Redmarrez l\ordinateur central dans le caveau du Souvenir  Dornogal.', 'trange. Le mcanisme et la console sont aliments, mais je ne parviens pas  initialiser la squence de redmarrage.\n\nLa requte de Dagran devra attendre.\n\nJ\ai pu vrifier le nom de l\installation: le caveau du Souvenir. Cela confirme la justesse de ma premire thorie. Cet endroit est reli  l\archive de Dornogal.\n\nComme ce type d\installation de Titan n\a pas de secret pour vous deux, vous aurez peut-tre plus de chances de le faire fonctionner  plein rgime.', '', '', '', '', '', '', 57534),
(83285, 'frFR', 'Le parchemin ancien', 'Apportez l\ancien parchemin distordu dans le temps  Grannadormu devant les grottes du Temps.', 'Tout d\abord, une brume semble dissimuler les dtails du parchemin. Mais alors que vous vous concentrez pour le dchiffrer, elle se dissipe brivement pour rvler un parchemin immacul, constitu d\un vlin de la plus haute qualit. Il est cachet par un sceau si neuf que la cire semble encore chaude. Une seconde plus tard, le parchemin prend un aspect dangereusement fragile et le sceau semble si dlicat qu\il pourrait se rompre  tout moment. Alors que la brume se forme  nouveau, vous voyez le parchemin passer en scintillant par tous les tats intermdiaires.', '', '', '', '', '', '', 57534),
(83283, 'frFR', 'Pour le moral des troupes', 'Rcuprez $1oatonneaux de Brut imprial  Rhum-Enclave.', 'Veuillez excuser l\impolitesse de mon mari. En nous lanant dans cette expdition, nous savions que nous serions loigns de nos familles pendant quelques annes. Mais nous voil ici, luttant contre la fin, contre Renilash. Qui sait quand notre garde se terminera?\n\nJ\ai conserv du vin des vignobles de notre glise pour en faire profiter tout le monde lorsque la tension monterait. Ma cachette, Rhum-Enclave, a t colonise par des cratures. Vous voulez bien aller chercher le vin pour moi?', '', '', '', '', '', '', 57534),
(83282, 'frFR', 'Famille Heaume-Colline: une couve d\ufs', 'Remettez la couve d\ufs  Aliya Heaume-Colline  la ferme de Heaume-Colline.', '<Des ufs de poule, ils doivent provenir d\une ferme non loin. Peut-tre qu\Aliya Heaume-Colline en saura plus  ce sujet.>', '', '', '', '', '', '', 57534),
(83279, 'frFR', 'Faire ses preuves', 'Battez l\iniquit amalgame dans Rhum-Enclave.', 'Oui, vous nous avez aids  lutter contre ces nuisibles, mais ce n\est pas suffisant. Il me faut davantage.\n\nL\une des zones proches de notre ville a t envahie par les ombres. Si votre pass trange ne vous en empche pas, vous n\auriez aucun problme  dtruire la source de ce danger, n\est-ce pas?', '', 'Une puissante manifestation des tnbres  Sainte-Chute.', 'Iniquit amalgame', '', '', 'Parlez  Derill Fayn  Rhum-Enclave.', 57534),
(83278, 'frFR', 'Famille Heaume-Colline: une chaussure gare', 'Remettez la chaussure gare  Aliya Heaume-Colline  la ferme de Heaume-Colline.', '<Une chaussure dans le style de celles portes par la famille Heaume-Colline. Peut-tre qu\Aliya Heaume-Colline pourra en dire plus.>', '', '', '', '', '', '', 57534),
(83277, 'frFR', 'Drobade personnelle', 'Trouvez $1oapreuves  charge dans le refuge de Meesk.', '<La petite araigne regarde autour d\elle, chacun de ses yeux se rtrcissant.\n\nVous vous souvenez que la Tisserande vous a demand de runir des preuves pour faire chanter Meesk.\n\nMais Broche a fait du saccage de l\entrept de Meesk une affaire personnelle.>', '', '', '', '', '', 'Retournez voir la veuve Arak\nai au repaire de la Tisserande.', 57534),
(83276, 'frFR', 'Il faut sauver le soldat Broche', 'Trouvez Broche  Haut-Creux.', 'Cela fait un moment que je n\ai pas eu de nouvelles de l\une de mes tisse-rats. J\ai envoy Broche chercher des renseignements utiles contre l\un des nergumnes au service d\Ansurek, mais elle n\est pas rentre de mission.\n\nMeesk la Langue de venin est un voyou de la pire espce, un flagorneur, mais il est tout de mme dangereux. J\ai toute confiance en les capacits de ma chre Broche, mais je crains ce qu\un sclrat comme Meesk pourrait faire  l\une de mes protges s\il la dcouvrait.\n\nTrouvez Broche. Assurez-vous qu\elle va bien.', '', '', '', '', '', '', 57534),
(83275, 'frFR', 'Enchantement d\quipement', 'Terminez le didacticiel d\enchantement d\objet en appliquant  n\importe quel anneau la formule confie par Ellerdin, Enchantement d\anneau  hte scintillante.', 'Salutations, $gtranger:trangre;!\n\nJ\ai eu vent de vos exploits depuis votre arrive fracassante sur nos rives. Nous, Terrestres, acceptons de vous aider.\n\nJe peux vous apprendre  enchanter votre quipement avec les ressources de mon pays. Pour vaincre nos ennemis, le moindre pouvoir compte.', '', '', '', '', '', '', 57534),
(83274, 'frFR', 'Un passage originel dans les limbes du temps', 'Terminez 5donjons des Marcheurs du temps.', 'Les guerriers et les guerrires d\un certain ge ne cessent de rpter que la vie sur Azeroth tait beaucoup plus dure  leur poque.\n\nSi ces gens vous voyaient, ils vous diraient que vous n\tes pas assez coriace pour survivre dix minutes dans leur monde.\n\nVous pensez pouvoir les dtromper? Montrez-moi ce que vous avez dans le ventre.', '', '', '', '', '', 'Parlez  Bobadormu devant les grottes du Temps en Tanaris.', 57534),
(83271, 'frFR', 'Un secret peut en cacher un autre', 'Allez voir Dagran ThaurissanII et Brinthe dans l\archive de Dornogal.', 'Aprs ce qu\a fait mon pre, les machines des Titans sont de nouveau en ligne, mme celles qui se trouvent  Dornogal.\n\nDagran s\est dj bien amus avec Brinthe en la bombardant de questions, mais maintenant il l\aide  trier l\archive.\n\nEt maintenant, il a besoin de votre aide. Il tait trop excit pour me dire pourquoi, mais il veut que vous alliez le voir  l\archive.', '', '', '', '', '', '', 57534),
(83247, 'frFR', 'Esprits mfiants', 'Trouvez $1oacurs de dracamandre  Rhum-Enclave.', 'Depuis de longues annes, tout ce qui n\tait pas arathi reprsentait un danger,  Sainte-Chute. Les Nrubiens, les cratures d\ombre, les animaux sauvages Alors pardonnez-moi si votre arrive ne m\inspire pas confiance.\n\nCependant, ma moiti m\incitait  me montrer plus aimable et je veux essayer de m\amliorer. Pour elle.\n\nDes dracamandres de Rhum-Enclave nous importunent. Tuez-les, et rapportez-moi la preuve de votre acte.', '', '', '', '', '', '', 57534),
(83240, 'frFR', 'La troupe de thtre', 'Participez  l\vnement de la troupe de thtre.', 'Puisque vous tes membre honoraire de la troupe de thtre, $n, que pensez-vous de jouer un rle dans nos pices?\n\nRien de bien important, je ne veux pas contrarier le reste de la troupe en leur volant la vedette. Vous savez comment ils sont.\n\nSeriez-vous disponible, disons, une fois par semaine?', '', '', '', '', '', '', 57534),
(83182, 'frFR', 'Un hritage sanglant', 'Rcuprez les affaires des parents d\Alyza dans le bassin Dvorant  Sainte-Chute.', 'Lorsque les Kobyss ont tu mes parents, certains de leurs biens les plus prcieux ont disparu au passage. \n\nJe ne parle pas de moi, bien sr. Des affaires. \n\nEssayons de les retrouver en tuant les Kobyss.', '', '', '', '', '', '', 57534),
(83181, 'frFR', 'Amiti jusqu\au bout', 'liminez la charpentire de marine Isaebela et le tisse-l\ombre Azarak  la grotte de Sylvesoie.', 'J\ai vu la charpentire de marine quitter la caverne et descendre vers la plage. Elle tait accompagne d\une crature nrubienne tout  fait formidable.\n\nLa charpentire de marine est le cerveau de cette opration. Elle sait exactement comment couper le bois, et quelles essences choisir pour leurs aronefs.\n\nLes Nrubiens le savent et la font protger par un de leurs meilleurs lments.\n\nSi nous parvenons  liminer la charpentire de marine, tous leurs plans s\effondreront.', '', 'Isaebela approvisionne l\Ordre de la nuit en bois afin de leur permettre de construire leurs propres aronefs.', 'Charpentire de marine Isaebela', '', '', ' rendre', 57534),
(83178, 'frFR', 'Rgles et consquences', 'Vainquez l\assassin.', 'Je crains d\avoir t un peu trop gnreux en offrant mon aide  droite et  gauche. J\ai attir sur moi beaucoup de regards importuns.\n\nSoyez sur vos gardes. Une menace silencieuse plane sur nous.', '', '', '', '', '', '', 57534),
(83177, 'frFR', 'Mdecine sociale', 'Administrez la potion de Nizrek aux rsidentes et rsidents opprims.', 'Je me suis laiss dire que la frange la plus misrable de la population des Terriers succombait  une forme d\pidmie.\n\nPrenez cette potion et soignez les malades. Cela renforcera les personnes atteintes et limitera la contagion.', '', '', '', '', '', '', 57534),
(83166, 'frFR', 'Ara-Kara, la cit des chos: fin de moisson', 'Entrez dans Ara-Kara, la cit des chos, et tuez Ki\katal la Moissonneuse.', 'Vous avez bien vu, non? Le Sang noir, comme on l\appelle.\n\nNous ne pouvons plus rester les bras croiss. Pas tant qu\Ansurek mutile, fore et saigne notre prcieux territoire pour rcuprer les dernires gouttes de l\agonie des dieux trs anciens. \n\nFouillez la cit antique sous nos pieds, Ara-Kara, la cit des chos. Vous recevrez une jolie prime si vous tuez la prpose aux excavations. Ses agents l\appellent Ki\katal la Moissonneuse.', '', '', '', '', '', '', 57534),
(83165, 'frFR', 'Robot rcalcitrant', 'Parlez  Kagfritha  la halte d\Ombreveine.', 'Allez-y, riez. Je rirais aussi si je n\avais pas des affaires urgentes  mener. Mon robot a trbuch sur un caillou, m\a dsaronne, puis s\est redress et a continu d\avancer. Sans moi! \n\nJe suis cloue au sol pendant qu\il se promne, tout tranquille. Vous vous rendez compte? \n\ncoutez, si vous allez vers la halte d\Ombreveine, vous pourriez prvenir Kagfritha que je vais tre en retard pour mon quart? Je dois attendre que ce tas de ferraille tombe  sec de carburant et descende assez bas pour que je reprenne les commandes.', '', '', '', '', '', '', 57534),
(83164, 'frFR', 'Cit des Fils: briser le faisceau', 'Entrez dans la cit des Fils et vainquez Izo le Grand Faisceau.', 'La Sublimation n\est pas une vritable volution. C\est une profanation. Une condamnation. Et Ansurek grave cette condamnation dans le marbre un peu plus  chaque jour qui passe.\n\nSi nous dtruisons la Transformacie, nous dbarrasserons potentiellement Azj-Kahet de ces abominations.\n\nAnsurek a choisi Izo le Grand Faisceau pour superviser le processus de Sublimation. Sparez sa tte de son corps, et les mutations cesseront peut-tre.', '', '', '', '', '', '', 57534),
(83162, 'frFR', 'Remettez-le en place!', 'Pitinez les geles et repartez avec le crne d\Alhainr.', 'a va tout gcher! Personne ne voudra venir dans un centre de vacances avec un cerf fantomatique de dix mtres de haut! Bon, pas de panique. Il est probablement un peu fch que vous ayez pris son crne.\n\nD\abord, il va falloir se dbarrasser de ces geles. Puis emmenez-moi ce crne ailleurs. Plus il sera loin, mieux ce sera.\n\nPff, ils vont mettre de l\ectoplasme dans les bassins chauds!', '', '', '', '', '', '', 57534),
(83160, 'frFR', 'Rserve de Brassecendre', 'Apportez la rserve de Brassecendre  Cogwin  la porte de Sainte-Chute.', 'La vente a peut-tre t interdite, mais plutt me calcifier que de laisser ma rserve de Brassecendre tomber aux mains de ces vis tordues, ou exploser quand un lmentaire la regardera de travers.\n\nLes quipes d\inspection me surveillent, alors je ne peux pas aller la chercher moi-mme, mais personne ne fera attention  vous.\n\nJ\ai laiss le ft derrire mon bureau, dans les sous-sols.\n\nNe vous approchez pas trop des garantes et des garants, ou ils confisqueront tout ce que vous porterez, et je n\aurai plus rien  boire.', '', '', '', '', '', '', 57534),
(83159, 'frFR', 'Raccourcissez-moi a!', 'Tuez Alhainr et rcuprez son crne.', 'Vous aviez dj vu un arpenteur des profondeurs avant de venir? Celui-ci n\a pas l\air ravi de nous voir. Il a t bien prompt  pitiner tous les dchiqueteurs qui sont passs. C\est bien dommage, les pilotes vont devoir faire des heures supplmentaires pour rembourser la casse.\n\nSi quelqu\un lui rglait son compte et m\en rapportait la preuve je suis sre que la rcompense serait  la hauteur.', '', 'Alhainr tait ici bien avant la halte de l\Aubaine. Certains disent qu\il tait l avant les Terrestres.', 'Alhainr', '', '', '', 57534),
(83155, 'frFR', 'Les pieds dans la taupinire', 'Dlogez $1oataupes ttedures', 'Tout ce qui nous spare du site d\excavation le plus riche que j\ai jamais vu, c\est quelques taupes et un cerf avec des grandes cannes. Pardon, je m\emporte.\n\nVous voyez ces dchiqueteurs? Le nec plus ultra dans le domaine de la mutilation et de l\abattage. Et ils n\arrtent pas de se coincer dans des trous!\n\ncoutez, j\ai le sens de l\cologie, toute la nation gobeline a a dans le sang, mais ces taupes doivent disparatre. Il va falloir leur donner une leon. Et si vous voyez quelqu\un de mon quipe, allez l\aider, d\accord?', '', '', '', '', '', '', 57534),
(83154, 'frFR', 'Gri-gris de Gris-gris', 'Rcuprez les trsors de Gris-gris dans la faille de Flamme-Noire.', 'Pas juste! Pas juste! Gris-gris trouve plein d\objets qui brillent pendant longue vie. Mais stupide Griffe-bougies chassent Gris-gris et famille. Tous les qui-brille rests l-bas!\n\nTenez, ami gobelin aider  faire liste de tous mes trsors dans faille de Flamme-Noire. Vous reprendre!', '', '', '', '', '', '', 57534),
(83153, 'frFR', 'Vous avez des vapeurs?', 'Tenez-vous dans les vents prs de la porte de Sainte-Chute lorsqu\ils entrent en ruption pour rcuprer des chantillons.', 'Les effets de l\accumulation magmatique sont vidents, mais a ne nous explique pas leur cause.\n\nPour la dterminer, et empcher qu\elle ne se prsente  nouveau, j\ai besoin d\chantillons des gaz volcaniques que vous voyez jaillir du sol.\n\nDes chantillons frais. Trs frais.\n\nVous allez devoir rester en plein milieu du jaillissement pour me fournir ce que je cherche.', '', '', '', '', '', '', 57534),
(83152, 'frFR', 'Maintenance magmatique', 'Tuez des magmas soulevs et des bulles de scorie prs de la porte de Sainte-Chute.', 'Comme si l\effondrement du tuyau n\avait pas suffi, une horde d\lmentaires magmatiques a surgi lors de l\avarie.\n\nNous ne pouvons pas nous permettre d\envoyer d\autres personnes procder  des rparations tant qu\ils se trouvent dans la zone, mais ce magma est essentiel pour alimenter les profondeurs.\n\nSi vous le pouvez, faites-les partir, pour que nous puissions remettre le magma en mouvement.', '', '', '', '', '', '', 57534),
(83108, 'frFR', 'Diagnostics du jour', 'Prenez les relevs de diagnostic de $1oamachines dans la Cavepierre.', 'J\ai le devoir et l\honneur de relever quotidiennement des mesures afin de dterminer la production et l\efficacit des grandes machines de la Cavepierre. Ce fardeau m\incombe.\n\nBilan de la situation: depuis que les Skardyns ont envahi la Cavepierre, je ne peux plus atteindre mes machines!\n\nSolution envisageable: on m\a vant votre hrosme sans gal. Allez rcuprer les mesures du jour. S\il y a un problme, nous devons le savoir le plus vite possible. En attente de confirmation.', '', '', '', '', '', '', 57534),
(83105, 'frFR', 'Rquisition rapide', 'Rcuprez $1oamorceaux d\aqirite et $2oade minerai de griffefer, puis apportez-les  Tarib  Dornogal.', 'C\est un plaisir de vous voir. J\ai du travail pour vous.\n\nLes spcialistes de la forge m\ont envoy une commande de minerai rare  la dernire minute. Ces butors de cogneurs Pour se gaver de graviers, ils sont l, mais pour s\organiser il n\y a plus personne. Enfin, vous vous en sortirez.\n\nIl va leur falloir de l\aqirite et du griffefer.', '', '', '', '', '', '', 57534),
(83102, 'frFR', 'Pas un bismuth  perdre', 'Rcuprez $1oamorceaux de bismuth, puis apportez-les  Tarib  Dornogal.', 'Vous savez sur quoi repose une bonne opration de minage? Je ne parle pas des minerais rares ou m\as-tu-vu. Mais du bon vieux bismuth.\n\nEt on n\en a pas assez! O que vous alliez, essayez d\en trouver. Apportez-moi tout ce que vous pourrez. \n\nJe vous promets une rmunration.', '', '', '', '', '', '', 57534),
(83101, 'frFR', 'En qute de ressources', '', '', '', '', '', '', '', '', 57534),
(83099, 'frFR', 'Fusions et acquisitions', 'Vainquez Goldie Baronnie et aidez Wenbrandt  reprendre l\hydromellerie de Brassecendre.', 'Quand les forces nrubiennes ont lanc leur attaque sur mon hydromellerie, elles n\ont laiss qu\une ruine calcine. Adelgonn a promis de la reconstruire, mais j\ai t impatient. J\ai accept l\aide de la KapitalRisk pour la restructuration.\n\nEt maintenant, il devient clair qu\elle avait une ide derrire la tte. Mon tablissement est pass entre des mains gobelines, et je pense qu\il ne va pas s\en remettre. La production a t pousse  son maximum, bien au-del de ses capacits. Les cendrabeilles et le matriel ne tiendront pas.\n\nAidez-moi  arranger a, $n.', '', 'Commencez la production, ou je vous envoie parmi les abeilles!', 'Goldie Baronnie', '', '', '', 57534),
(83097, 'frFR', 'Cendre et tempte', 'Rcuprez $1oatemptes en bouteille et $2oasoies de cendrabeille brlantes, puis apportez-les  Ginnad  Dornogal.', 'Les cratures sauvages de la rgion possdent des proprits tonnantes. Je me demande ce qui se produira si je les combine?\n\nCherchez de la tempte en bouteille et des soies de cendrabeille brlantes. Je vous rcompenserai gnreusement si vous me rapportez des chantillons. Oh, et si vous les rcoltez vous-mme, vitez de vous brler. Ou de vous foudroyer. Voire les deux.', '', '', '', '', '', '', 57534),
(83092, 'frFR', 'Fin igne', 'Librez des personnages terrestres ensevelis sous les coques de pierre prs de la porte de Sainte-Chute.', 'Lorsque le conduit de transport du magma s\est rompu, notre main-d\uvre s\est prcipite pour entamer les rparations.\n\nLes lmentaires ont pris tout le monde de court, s\levant et attaquant avec de grands jets de lave.\n\nHeureusement, nous, les Terrestres, sommes d\une matire solide et un peu de magma ne saurait signer notre arrt de mort. Par contre, le magma qui s\est refroidi s\est transform en parois de pierre qui ont enseveli nos quipes de rparation sur place.\n\nBrisez ces prisons de pierre et librez mes manuvres!', '', '', '', '', '', '', 57534),
(83087, 'frFR', 'La vieille garde', 'Suivez le signal et assistez au deuxime souvenir.', 'Dornic Galan J\ai entendu ces noms au Proscenium!\n\nMais qui parlait? Ils taient pas contents de Galan. Tous ces corps de Terrestres\n\nReconvertis comme reprogramms? Pour protger quoi?\n\nSuivons l\autre signal. Il a l\air de mener dans les collines.\n\nJ\vais rester ici avec Brinthe et explorer un peu plus cette tour. Vous, prenez l\appareil.', '', '', '', '', '', '', 57534),
(83085, 'frFR', 'DEPRECATED', '', '', '', '', '', '', '', '', 57534),
(83084, 'frFR', 'Les vieux ordres', 'Inspectez la tour abandonne derrire Dornogal.', 'Il y a longtemps, il tait prvu de creuser un tunnel  travers la montagne jusqu\ Dornogal. \n\nAvant que les travaux ne commencent, les alentours ont t abandonns soudainement.\n\nAucun document ne relate ce qui s\est pass. Il y a juste une force de dissuasion, ce champ, qui tient les Terrestres  distance de cette rgion.\n\nChaque partie de ma matrice cognitive m\incite  partir. Mais nous devons persvrer.\n\nLe signal de l\appareil indique que quelque chose se trouve dans la tour voisine.', '', '', '', '', '', '', 57534),
(83083, 'frFR', 'Un lieu oubli', 'Parlez  la mandataire Brinthe et  Dagran derrire Dornogal sur l\le de Dorn.', 'Il y a un endroit derrire Dornogal o je ne peux pas aller.\n\nEt je ne suis pas la seule dans ce cas. Quelque chose, une force probablement cre par les Titans, empche les Terrestres d\explorer une petite partie de l\le derrire la ville.\n\nvidemment, a attise ma curiosit, mais pendant des milliers d\annes, je me suis tenue scrupuleusement  l\cart. a semblait tre la volont des Titans.\n\nL\endroit met un faible signal semblable  celui de cet appareil. Il s\agit peut-tre de la cl, au sens littral du terme, de ce qui se trouve l.\n\nNous verrons bien.', '', '', '', '', '', '', 57534),
(83082, 'frFR', 'Le front d\opale', 'Tuez les troupes nrubiennes  l\Opalcreg sur l\le de Dorn.', 'Je suis garde de la ville, pas fantassin! Mais ces gens ont besoin de notre aide!\n\nIl y a trop de Nrubiens, impossible de tous les liminer. Nous ne pouvons que contenir ce nud d\tranglement et esprer que les mineurs nous rejoignent.\n\nCelui-l tait trop petit. Mais vous avez l\air de savoir vous battre. Aidez-nous!', '', '', '', '', '', '', 57534),
(83081, 'frFR', 'Pas assez de minraux', 'Collectez $1oaopales de feu terrestres  l\Opalecreg sur l\le de Dorn.', 'J\aurais jamais cru que l\Opalecreg serait attaque! Brinthe non plus d\ailleurs.\n\nLa garde-paix Hektare refuse que je m\batte, mais elle vous laissera peut-tre faire, vous.\n\nJ\vais rester ici pour m\occuper de cet tre terrestre. J\ai appris deux ou trois choses  Dornogal.\n\nOh, mais Brinthe avait vraiment besoin de ces opales', '', '', '', '', '', '', 57534),
