(83057, 'frFR', 'Poser des limites', 'Tuez le Nrubien sublim qui torture Vi\azl.', 'Vi\azl a subi des tortures dont je n\avais pas conscience. Nous ne pouvons pas l\aider  surmonter sa peur tant qu\il ne sera pas en scurit.\n\nDans la mesure du possible, je prne l\amiti, le rtablissement et la rconciliation. Je demande aux autres d\agir avec compassion et empathie. Tout le monde mrite de se rtablir. J\y consacre ma vie.\n\nMais quand j\entends ce qui arrive  Vi\azl je crois que a me fait changer d\avis. Trop c\est trop. Nous devons agir.', '', 'Vek\kix traite sa main-d\uvre avec brutalit.', 'Vek\kix', '', '', '', 57534),
