(83031, 'frFR', 'Culpabilit du survivant', 'Aidez Aethas Saccage-Soleil  envoyer un message aux mages du Kirin Tor encore en vie.', '<Aethas pousse un profond soupir, la voix teinte de chagrin.>\n\nDalaran C\tait jadis un symbole d\unit et de matrise des arcanes, mais ce n\est plus qu\un tas de gravats et de cendres. Une fois encore.\n\nTant de pertes, tant de souffrances. Des camarades disparus en un instant, leurs voix rduites au silence par Xal\atath.\n\n<Il prend une grande inspiration pour ne pas se laisser submerger par le chagrin.>\n\nMais l\heure n\est pas aux larmes. Nous devons trouver d\autres personnes ayant survcu, nous regrouper et leur offrir du rconfort en ces heures sombres.\n\nCependant, il n\est pas facile de trouver les mots justes.', '', '', '', '', '', '', 57534),
