(83025, 'frFR', 'Un lien sacr', 'Collectez $1oaEsprits de tempte en tuant de puissantes cratures de Khaz Algar.', 'J\ai pu vous autoriser  porter notre armure, mais de l  concentrer la puissance de la tempte  travers elle comme le font les plus grands chevaucheurs et chevaucheuses\n\nLes plus aptes d\entre nous ne se contentent pas de manipuler le pouvoir de la tempte. Ces gens le matrisent pleinement. Et cette matrise s\est forge au fil de nombreuses batailles.\n\nIl est temps de prouver que vous comptez parmi l\lite.', '', '', '', '', '', '', 57534),
(83024, 'frFR', 'Le lien du chevaucheur de tempte', 'Collectez $1oaEsprits de tempte en tuant de puissantes cratures de Khaz Algar.', 'Vous vous estimez digne de porter l\armure d\$gun chevaucheur de tempte:une chevaucheuse de tempte;?\n\nNous, les chevaucheurs et chevaucheuses, avons t crs par les Titans pour combattre et pour chevaucher des freux de la tempte. Mme ainsi, nous devons prouver notre comptence martiale avant d\obtenir l\autorisation de porter l\armure. Je ne vois pas pourquoi vous ne devriez pas relever les mmes dfis.\n\nAllez-y. Montrez-moi que vous possdez la puissance de la tempte en vous.', '', '', '', '', '', '', 57534),
