(82992, 'frFR', 'Biens chargs par la tempte', 'Collectez $1oalots de cuir charg par la tempte et livrez-les  Ginnad  Dornogal.', 'Je vous salue!\n\nJe suis  la recherche d\une personne dispose  faire une petite commission. Je suis  court de marchandises et je n\ai pas eu de nouvelles de la personne qui me fournit en cuir depuis un certain temps. Si je ne peux pas fournir de peaux et de cuirs, notre spcialiste du travail du cuir ne pourra pas confectionner les vtements.\n\nSi vous me rapportez plusieurs lots de cuir charg par la tempte, je vous rcompenserai.', '', '', '', '', '', '', 57534),
(82990, 'frFR', 'Rparer les dgts', 'Dfendez Danagh pendant qu\il rpare la station-relais.', 'Toutes mes excuses. Arbauch n\tait pas l pour des rparations, il a vol ce golem.\n\nArbauch et moi avons travaill  ses cts durant des annes dans les profondeurs obscures des abmes. Le travail a us le golem. Il est devenu imprvisible, voire dangereux. Nous avions prvu de le mettre hors service, mais le moment venu, Arbauch n\a pas pu s\y rsoudre. Il s\y tait attach. Alors il l\a pris et s\est enfui avant que nous n\ayons pu le dtruire.\n\nIl faut le retrouver, mais cette station-relais a subi des dgts catastrophiques. Avec votre aide, je vais tenter de la rparer.', '', '', '', '', '', 'Retourner voir Danagh au camp Murroch', 57534),
(82969, 'frFR', 'Traage de pierres', 'Scannez les restes du golem pour trianguler sa position.', 'Je n\ai pas pu m\empcher de tendre l\oreille. Sans vouloir me vanter, le peuple gobelin ne compte quasi que des spcialistes dans le domaine des robots dchans.\n\nSi ce golem est aussi instable que le dit Danagh, il doit dgager toutes sortes d\nergie. Prenez a, faites quelques analyses et vous le trouverez. Oh, prenez garde. Les animaux ont tendance  devenir un peu fous quand on active ce truc.\n\nC\est gratuit, les golems meurtriers sont mauvais pour les affaires. Et j\ai un peu honte de vous faire travailler pour retrouver un cadavre.', '', '', '', '', '', '', 57534),
