(82962, 'frFR', 'Une poigne de pose-appts', 'Collectez $1oapose-appts pour Akdan  Dornogal.', 'Vous, oui, vous.\n\nAvez-vous dj entendu parler de la pose-appt? Il s\agit d\une plante carnivore rare qui mange des insectes. Nous n\avons pas d\insectes ici, mais j\aimerais bien en avoir quelques chantillons. Faites-moi savoir si vous en trouvez, ou mieux, apportez-les-moi.', '', '', '', '', '', '', 57534),
