(82956, 'frFR', 'Direction la halte de l\Aubaine', 'Prenez un verre  la halte de l\Aubaine.', 'Heureusement pour moi, cette affaire est rgle. Maintenant, mon patron peut arrter de me harceler!\n\nJ\ai quelques rparations  faire sur mon vhicule, mais allez voir  la halte de l\Aubaine! Je vous offre un coupon pour une boisson gratuite dans notre bel tablissement.\n\nAllez parler  Griz Finglebourre et il vous arrangera a.', '', '', '', '', '', '', 57534),
(82955, 'frFR', 'La dtermination du vizir', 'Assistez au discours du vizir dans le bazar Ombreux.', 'Le dcor est plant et la troupe est rassemble. Il est temps pour moi de sortir de l\ombre.\n\nMerci de m\avoir paul jusqu\ prsent, $n. Peu importe ce qui se passera ensuite, je me rjouis d\avoir fait votre connaissance.', '', '', '', '', '', '', 57534),
(82954, 'frFR', 'Couteaux dans l\obscurit', 'Tuez 4assassins surekis dans la cit des Fils.', 'Vous vous souvenez sans doute de l\assassin qui a voulu m\liminer lors de notre dernire rencontre en ces lieux. Sans votre intervention, je ne serais pas ici aujourd\hui. Ne vous y trompez pas, si mon rle dans cette affaire a t compromis, cet assassin ne sera pas le dernier.\n\nSi je dois donner mon baroud d\honneur, j\aurai besoin de votre aide pour assurer ma scurit jusqu\ la fin. Parcourez la ville  la recherche de ces menaces furtives et faites ce qu\il faut pour que rien ne vienne troubler mon discours.', '', '', '', '', '', '', 57534),
(82953, 'frFR', 'Une invitation cordiale', 'Rpandez la nouvelle de l\annonce du vizir dans la cit des Fils.', 'Il est clair pour moi que mon temps en tant que vizir est compt. Mes services  Azj-Kahet doivent voluer.  cette fin, j\ai une dernire tche  vous confier, $n.\n\nVous avez beaucoup travaill dans la cit des Fils depuis votre arrive. Il ne fait aucun doute que votre rputation vous prcde dsormais. Cherchez nos allis et allies dans la ville et demandez-leur de se rassembler au bazar Ombreux. J\ai un message  leur intention.', '', '', '', '', '', '', 57534),
(82952, 'frFR', 'Une pause bienvenue', 'Distribuez $1oaprospectus aux ouvrires et ouvriers fatigus  Gundargaz et dans les environs.', 'H, vous! Oui, vous ferez l\affaire. Besoin d\un peu d\argent? Nous essayons d\attirer la clientle dans notre station de luxe. Vous en avez peut-tre entendu parler? Le spa et centre balnaire de la halte de l\Aubaine!\n\nLe patron m\a envoye  Gundargaz pour distribuer cette pile de prospectus, mais mon triklo a explos. Je suis donc coince ici pour un moment, le temps de rparer. Que diriez-vous d\y aller et de les distribuer pour moi? Cherchez les personnes qui vous paraissent fatigues.', '', '', '', '', '', '', 57534),
