(82895, 'frFR', 'Le poids des responsabilits', 'Retrouvez Urtago  l\avant-poste de Bordechute pour l\aider  endosser son nouveau rle.', 'Je suis maintenant la gardienne de la cime plore.\n\nJe sens finalement le poids de cette nouvelle responsabilit sur mes paules. C\est un grand honneur, mais je dois m\y prparer.\n\nS\il vous plat, aidez-moi  accomplir une dernire tche, et ensuite je serai prte.\n\nRetrouvez-moi  l\avant-poste de Bordechute.', '', '', '', '', '', 'Retournez voir Urtago  l\avant-poste de Bordechute.', 57534),
