(82847, 'frFR', 'Assez d\ail', 'Ramassez de l\ail pour la cuisinire.', 'En temps normal, a conviendrait. Je ne suis pas trs difficile. Mais vous tes $gun invit:une invite;, alors il va nous falloir de l\ail.\n\nIl y en a qui pousse sur une colline prs d\ici. a ne devrait pas tre le cas, et pourtant, il est l.\n\nHlas, les hydres l\ont trouv, elles aussi.\n\nVous avez des armes et ce genre de choses, n\est-ce pas?', '', '', '', '', '', '', 57534),
