(82842, 'frFR', 'Test Quest - Combined First time Rewards (DNT)', 'Tuez $1oafltrisseuses hurlevols et $2oagriffe-sorts hurlevols.', 'This quest should give the following rewards for first / additional completions on the act\n\nDragon Isles Supplies (stupid complex setup): \nFirst Time : 101,025 + 9075  bonus\nAdditional: 101,025\n\nValdrakken Rep (Simple setup with flags):\nFist time: 25 + 75 bonus\nAdditional: 25\n\nMaruuk Centaur (simple setup with modifier only)\nFirst time completion: 25 + 75 bonus\nAdditional Completion: 25 \n\nDragonscale (modifier + combine)\nFirst Time: 25 + 100 bonus\nAdditional: 25\n\n(DNT)', '', '', '', '', '', '', 57534),
(82836, 'frFR', 'Mise  Xerosh', 'Terrassez la poliorcte Xerosh.', '$p, la poliorcte qui est au sud d\ici semble donner leurs ordres aux Nrubiens. Si nous parvenons  la vaincre, nous pourrons renverser la vapeur.\n\nSans cheffe pour organiser l\attaque des Nrubiens, le peuple arathi parviendra peut-tre  les repousser, surtout si Faerin parvient  allumer la tour de l\aube dont elle parlait.\n\nMais plus nous tarderons, plus les aronefs arathis seront touchs. Dpchez-vous!', '', 'Xerosh est responsable de la mort d\innombrables gens du peuple arathi depuis des annes.', 'Poliorcte Xerosh', '', '', 'Retrouvez Anduin  l\Ascension de Tenir.', 57534),
