(82817, 'frFR', 'Perturbation dtecte: profondeurs de Rochenoire', 'Rcuprez les plans de Forgefer distordus dans le temps auprs de l\empereur Thaurissan dans les profondeurs de Rochenoire.', 'Les Marcheurs du temps affirment avoir dtect un objet dplac dans le temps dans les profondeurs de Rochenoire.\n\nSi ce conflit s\est sold par notre dfaite, le clan Sombrefer est conscient de ce qui est en jeu si l\histoire venait  changer. Nous pourrions perdre l\alliance naine actuelle et tout le bien qu\elle nous a apport.\n\nRcuprez l\objet et protgez notre paix actuelle.', '', '', '', '', '', '', 57534),
