(82814, 'frFR', 'Dmantlement des tnbres', 'Dtruisez le golem corrompu et rcuprez la gemme mmorielle du contrematre Arbauch.', 'La mise hors service d\une machine est une opration rare mais ncessaire. Elle doit tre effectue avec soin et respect.\n\nNous nous investissons dans notre travail. Quand nous le dtruisons, une partie de nous-mmes disparat. Et en agissant ainsi, nous reconnaissons notre incapacit  protger l\uvre des Titans. Mais lorsque la pierre se rvolte contre la pierre, nous devons faire preuve de fermet.\n\nObjectif impratif: dtruire cette chose. Retrouvez la gemme mmorielle d\Arbauch.', '', 'Un golem envoy trop souvent dans les tnbres peut finir par en rapporter un fragment.', 'Golem corrompu', '', '', 'Retournez voir Danagh au camp Murroch.', 57534),
(82813, 'frFR', 'Temps emprunt', 'Trouvez $1oasouvenirs perdus.', 'Ah, quel plaisir de vous revoir! On est toujours l, MacMag\ et moi,  chercher des souvenirs. Vous avez un moment pour nous aider?', '', '', '', '', '', '', 57534),
