(82809, 'frFR', 'Ainsi font les griffons', 'Trouvez un moyen de rconforter Bourrasque.', '<Bourrasque, votre freux de la tempte pique, s\approche de vous et ppie tristement. Quelqu\un sait peut-tre ce qui la perturbe.>', '', '', '', '', '', 'Annoncez  Bourrasque que ses frres et surs ont t retrouvs.\nVous pouvez l\invoquer depuis votre codex des mascottes.', 57534),
(82801, 'frFR', 'Une motivation prcieuse', 'Terrassez Kix\arak devant la mine d\Opalcreg.', 'Pour qu\il n\y ait pas d\autres victimes terrestres, nous allons devoir liminer leur chef.\n\nVous savez ce qu\on dit, liminez le contrematre ou la contrematresse et c\est toute la production qui s\effondre.\n\nBref, si nous voulons nous en sortir, il faudra leur passer sur le corps.', '', 'Un ennemi monstrueux aux intentions monstrueuses.', 'Kix\Arak', '', '', 'Retournez voir Germira  Landefrey.', 57534),
(82800, 'frFR', 'Un instant sdimentaire', 'Aidez Cendreragg  motiver les ouvriers et ouvrires terrestres de l\Opalecreg.', 'La plupart ont dj commenc  vacuer la zone, mais il en reste qui refusent d\obtemprer.\n\nPourriez-vous leur faire entendre raison?\n\nUn avis extrieur saura peut-tre les convaincre de partir.', '', '', '', '', '', '', 57534),
(82799, 'frFR', 'Pierre, papier toile', 'Portez secours  $1oaouvriers et ouvrires terrestres de l\Opalecreg.', 'C\est le contrematre Alvegar qui vous envoie? Je comprends mieux.\n\nLa situation est loin d\tre idale. Cet endroit grouille de Nrubiens et ils ne font preuve d\aucune piti. Ils nous ont forcs  extraire du minerai et nous ont soutir les opales que nous avions mis tant de temps  obtenir.\n\n la moindre objection, ils vous recouvrent de toile.\n\nJe me suis miraculeusement chappe lorsqu\ils sont apparus. Quant aux autres C\est l que vous entrez en jeu.\n\nSi vous russissez  les occuper, je pourrai librer les Terrestres dans les toiles.', '', '', '', '', '', 'Retrouvez Cenderragg  proximit de l\entre de la mine.', 57534),
(82798, 'frFR', 'La mine d\opale', 'Aidez Cendreragg  collecter $1oachantillons de minerai d\opale  l\Opalecreg.', 'Je vais tre directe: nous sommes ici avec un but et ce but est de mettre la main sur les opales.\n\nPersonne ne partira tant que nous n\aurons pas accompli notre mission, ces opales sont absolument cruciales. Si vous parveniez  rassembler suffisamment de minerai, nous pourrions convaincre l\quipe de quitter les lieux.\n\nMais restez sur vos gardes, les Nrubiens sont dangereux.', '', '', '', '', '', 'Retrouvez Cendreragg  proximit de l\entre de la mine.', 57534),
(82797, 'frFR', 'Au fond du trou', 'Descendez au fond de la mine et trouvez Cendreragg.', 'a descend bien, c\est sr, mais je sais que vous y arriverez.\n\nSi vous doutez de vos capacits, j\ai fabriqu des parachutes pour faciliter l\atterrissage.\n\nUne fois au plus profond de la mine, cherchez Cendreragg. C\est la plus exprimente du groupe, elle saura mieux que quiconque laborer un plan pour sauver toute l\quipe.', '', '', '', '', '', 'Retrouvez Cendreragg  l\Opalecreg.', 57534),
(82796, 'frFR', 'L\entre secrte de la mine', 'Retrouvez Alvegar  la troisime entre de l\Opalecreg.', 'J\ai t isole du reste de la troupe. Nous ne nous attendions aucunement  essuyer une embuscade nrubienne. Mais je doute que les autres aient rendu les armes.\n\nNotre tche est bien trop importante pour abandonner.\n\nFaire irruption dans la mine les armes  la main ne ferait qu\attiser la colre des Nrubiens et les amener  blesser davantage des ntres. Mais tout  l\heure, j\ai trouv une troisime manire d\y accder. Il sera toutefois difficile de se soustraire totalement  leur vigilance.\n\nSuivez-moi.', '', '', '', '', '', 'Retrouvez Alvegar  la troisime entre de l\Opalecreg.', 57534),
(82792, 'frFR', 'Mine de rien', 'Allez  l\Opalecreg et cherchez Alvegar.', '$Gtranger:trangre;, nous avons besoin de votre aide.\n\nLes Terrestres qui sont ici assurent que vous pouvez tre d\un prcieux soutien.\n\nNos camarades terrestres de l\Opalecreg ne nous ont pas fait parvenir leur quota. Un incident a d survenir.\n\nPourriez-vous aller vous renseigner auprs du contrematre Alvegar?', '', '', '', '', '', 'Trouvez Alvegar  l\Opalecreg.', 57534),
(82786, 'frFR', 'Devoir d\entretien', 'Activez les systmes de secours le long de la Cataracte.', 'Le golem est instable, il n\ira pas bien loin. Nous retrouverons sa trace, mais j\ai dj manqu de vivacit. Arbauch a fait preuve de dvotion  l\gard des machines, nous serions bien aviss de suivre son exemple. Mieux vaut commencer par les rparations.\n\nLe fonctionnement des machines est dlicat. Nous devons activer le systme auxiliaire avant qu\une cascade de dfaillances ne se produise. Exterminez galement tous les parasites que vous trouverez. Mme la plus petite crature peut enrayer les rouages dlicats d\une machine.\n\nJe suis endommag. Je vais envoyer mon marche-rouage avec vous pour transmettre les instructions.', '', '', '', '', '', '', 57534),
(82785, 'frFR', 'Fantmes dans la machine', 'Retrouvez le contrematre Arbauch.', 'Il y a une station-relais juste en dessous de nous? C\est peut-tre l qu\Arbauch est parti se cacher Oubliez ce que je viens de dire, nous devons enquter.\n\nAvec un peu de chance, Arbauch sera toujours l. L\entre devrait se trouver au nord, prs du bassin d\eau form par la conduite qui a clat. Venez avec moi. Il pourrait bien avoir besoin de notre aide.\n\nJe vous expliquerai tout quand nous l\aurons localis.', '', '', '', '', '', '', 57534),
(82784, 'frFR', 'Performance de rsonance', 'Parlez  Burkhalt au Proscenium.', '$p, j\ai beaucoup appris en vous regardant jouer. Vous changez si facilement de personnalit. En une seule pice, je vous ai vu basculer d\$gennemi  ami:ennemie  amie;, de colre  tristesse C\est comme observer une goutte de mercure.\n\nAvec vous sur notre scne, j\ai le sentiment que nous excutons nos pices conformment aux instructions, et ce pour la plus grande satisfaction de notre public.\n\nSi vous avez un moment, je voudrais vous remercier pour votre soutien.', '', '', '', '', '', '', 57534),
(82783, 'frFR', 'Le codex de Chromie', 'Terminez l\vnement du codex de Chromie.', 'Bonjour! J\ai vraiment besoin de votre aide.\n\nEn effet, mon codex a t un peu chamboul au cours de mes voyages et je dois effectuer une visite temporelle guide jusqu\aux portes d\Ahn\Qiraj dans une heure.\n\nJ\ai besoin que vous m\aidiez  rsoudre toute incohrence. Ensuite, tout sera parfait et les touristes que vous voyez l vivront une excursion amusante et pas si dangereuse que a!', '', '', '', '', '', '', 57534),
(82782, 'frFR', 'Authenticit vestimentaire', 'Parlez  Rabaan au Proscenium.', 'Vous vous tes trs bien $gdbrouill:dbrouille; sur scne, $p.\n\nMais en tant que membre d\une troupe, nous devons respecter d\autres rgles. L\une d\entre elles consiste  entretenir nos costumes pour qu\ils puissent tre utiliss dans de futures pices. De nombreuses tenues sont utilises plus d\une fois.\n\nJe pense que nous pouvons vous confier l\utilisation et la prservation des costumes de la troupe, n\est-ce pas? Vous pourriez ainsi rpter plus souvent avec nous', '', '', '', '', '', '', 57534),
(82781, 'frFR', 'Avide d\attention', 'Recevez des conseils d\Elma au Proscenium.', 'Ah, $p, il semble que vous ayez attir l\attention d\une personne en particulier dans l\auditoire.\n\nCe message d\admiration a atterri par erreur dans mon courrier de fans. Cela ne m\tonne pas. Le tri de mes lettres doit tre une tche titanesque\n\nTenez. C\est  vous.\n\nTout ceci est certainement nouveau pour vous. J\ai quelques conseils  prodiguer concernant les fans un peu trop enthousiastes, si a vous intresse', '', '', '', '', '', '', 57534),
(82775, 'frFR', 'La relve de la garde-robe', 'Recevez des conseils de Wendeline au Proscenium.', 'Vous semblez possder la programmation d\$gun grand acteur:une grande actrice;, $p!\n\nJe le sais parce que j\ai moi-mme cette flamme en moi, quoi qu\en disent les autres soi-disant artistes.\n\nJe suis trs impressionne par la rapidit avec laquelle vous changez de costume. Je suis galement passe matre dans l\art de modifier rapidement mon apparence.\n\nVous tes sur le point de trouver le truc. Vous avez juste besoin des conseils d\une experte comme moi!', '', '', '', '', '', '', 57534),
(82774, 'frFR', 'Brume  couper au couteau', 'Dispersez la brume autour du camp Murroch.', 'Les mandataires des machines n\aiment pas les btes de brume. L o il y a de la brume, la rouille n\est jamais bien loin. Je prfrerais tout de mme viter de faire du mal aux animaux. Arbauch disait que a portait malheur.\n\nPrenez cet appareil. Les glandes que vous avez collectes devraient fournir assez d\nergie pour disperser la brume sans blesser les btes qui s\y trouvent.\n\nPrudence. Les btes de brume sont craintives, mais il peut aussi y avoir d\autres cratures.', '', '', '', '', '', '', 57534),
(82773, 'frFR', 'Faveur fonctionnelle', 'Collectez $1oaglandes galvaniques.', 'Je cherche mon mentor, le contrematre Arbauch. Il a disparu. En d\autres circonstances, je lancerais des recherches depuis Gundargaz, mais le temps presse.\n\nJe pense qu\il est pass par ici, mais ma seule piste est DelGlingo. Il souhaite que les btes de brume locales soient limines. Rticence. Mais s\il a vu Arbauch, je dois apprendre ce qu\il sait.\n\nLes rdeurs au sud possdent de puissantes glandes galvaniques. Elles sont assez charges pour disperser mme la brume la plus paisse. Allez en chercher. Compensation assure.', '', '', '', '', '', '', 57534),
(82771, 'frFR', 'Armure ancestrale des Terrestres', 'Ajoutez vos expriences  l\archive de Dornogal.', 'Le temps est venu de contribuer  l\enrichissement de l\archive. \n\nLes Terrestres qui vagabondent ont une invitation  partager leurs expriences afin de prserver ce qui a t fait auparavant et d\amliorer le sort des gens qui viendront ensuite. \n\nCe savoir et cette exprience du vaste monde d\Azeroth sont un trsor inestimable, et leur partage est la cl de notre hritage terrestre.', '', '', '', '', '', '', 57534),
(82768, 'frFR', 'Pche aux nuages', 'Offrez $8oaanguilles lectriques aux freux de la nue sauvages.', 'Maintenant que nous avons les anguilles, nous pouvons essayer de faire revenir les freux de la nue sur terre.\n\nRendez-vous sur l\le voisine. Approchez-vous autant que possible et faites une offrande aux freux.\n\nAvec un peu de chance, ils cesseront de tourner en rond et descendront se nourrir.', '', '', '', '', '', '', 57534),
(82748, 'frFR', 'Ravin d\Abondabme', 'Terminez le champ de bataille du ravin d\Abondabme.', 'On nous a signal des incidents dans les profondeurs. Explorez le ravin d\Abondabme et ses ressources, puis faites un rapport  Ruffio.', '', '', '', '', '', '', 57534),
(82747, 'frFR', 'Place de la Croise', 'Rencontrez Bondaz sur la place de la Croise.', 'Bonjour, $gtranger:trangre;. Voulez-vous tre $ginform:informe; de la situation  l\extrieur de la ville?\n\nLa Croise est un lieu privilgi d\change d\informations et de marchandises entre les Terrestres, quelles que soient leurs allgeances ou leurs dits.\n\nMon ami Bondaz entretient officieusement la place. Il serait ravi de vous voir en personne. Je suis certaine qu\il a dj entendu moult histoires sur la faon dont vous et les gens du dehors avez russi  atteindre notre le.', '', '', '', '', '', 'Rencontrez Bondaz sur la place de la Croise.', 57534),
(82740, 'frFR', 'Les intrigues du Crpuscule', 'Utilisez la torche luminescente pour dtruire 8exemplaires du livre Le credo du Crpuscule dans le Domicile des profondeurs de Rochenoire.', 'L\influence des membres du Marteau du crpuscule grandit progressivement au cur des profondeurs de Rochenoire. Ils se sont allis aux Nains sombrefer et cherchent  les convaincre de mener le combat hors de la montagne.$B$BNous devons dtruire ce qui cause l\agitation du Marteau du crpuscule. Leur influence sur les Sombrefer doit tre minimise.$B$BJe veux que vous vous rendiez au Domicile des profondeurs de Rochenoire et que vous utilisiez cette torche pour brler les livres que les membres du Marteau du crpuscule y distribuent.', '', '', '', '', '', '', 57534),
(82710, 'frFR', 'Gouffres: exploration empire-ique', 'Terminez 2Gouffres uniques  Sainte-Chute.', 'Mais c\est une vritable sommit qui vient me voir!\n\nJ\ai discut avec Faerin et apparemment, les bestioles qui vivent dans les Gouffres de Sainte-Chute s\comportent bizarrement. Plus que d\habitude, en tout cas.\n\nBref, a vous dit qu\on aille voir ce qu\il se passe?', '', '', '', '', '', '', 57534),
(82709, 'frFR', 'Gouffres: archologie percutante', 'Rcuprez $1oafragments archologiques de Khaz Algar dans des Gouffres de cette rgion.', 'J\ai fait des recherches sur les trouvailles que nous avons faites au cours de nos explorations. Beaucoup d\entre elles sont des pices majeures de l\histoire d\Azeroth! Dire que ces pourritures des Gouffres les dtruisent sans tats d\me!\n\nMettons un terme  tout a et rcuprons ce que nous pouvons encore sauver. Je parie que si nous tombons sur une de ces bandes de durs  cuire, ils auront des tas de fragments pour nous.', '', '', '', '', '', '', 57534),
(82708, 'frFR', 'Gouffres: menace nrubienne', 'Terminez 2Gouffres nrubiens.', '$n! Entrez donc!\n\nJ\ai parl aux gens de Dornogal. On dirait qu\les Nrubiens ont sem la pagaille partout en Khaz Algar.\n\nPourquoi n\pas enfiler nos meilleurs souliers botteurs d\arachno-trains pour aller leur donner  rflchir?', '', '', '', '', '', '', 57534),
(82706, 'frFR', 'Gouffres: recherche dans Khaz Algar', 'Terminez 3Gouffres en Khaz Algar.', 'La situation est plutt calme ces derniers temps. J\ai pas eu vent de problmes.\n\nC\est l\occasion rve de partir en exploration, non? J\suis  votre disposition! On peut aller o a vous chante!', '', '', '', '', '', '', 57534),
(82689, 'frFR', 'Partout les tnbres', 'Terrassez le roi-liche remmor pendant un vnement d\chos radieux.', 'J\attends ce jour depuis longtemps, $ghros:hrone;. Vos camarades et vous tes-vous d\attaque pour faire subir notre justice au roi-liche? Ordonnez, et nous chargerons!', '', 'Jamais les bois de Lordaeron n\oublieront son nom.', 'Roi-liche remmor', '', '', '', 57534),
(82682, 'frFR', 'Dgustation d\lmentaires', 'Collectez $1oaanguilles lectriques.', 'Les freux de la nue ne pourront pas tourner en rond infiniment, et je ne supporterais pas d\en perdre d\autres. Peut-tre se poseront-ils si nous les attirons avec leur nourriture favorite?\n\nLes anguilles qui peuplent ces eaux sont charges d\lectricit,  la manire des mousselaines. Les freux de la tempte, plus rapides et robustes que leurs cousins, en raffolent. Je me suis dit un jour que les freux de la nue pourraient les trouver  leur got, eux aussi.\n\nPour tout vous dire Cela fait des annes que je les nourris moi-mme avec ces anguilles.\n\nRamenez-en quelques-unes et voyez si cela attire les freux.', '', '', '', '', '', '', 57534),
(82681, 'frFR', 'Freux en vol', 'liminez les lmentaires enrags du Bouclier central.', 'Vous voyez cette nue au loin? Ce sont des freux de la nue sauvages.\n\nPendant trs longtemps, ils ont vcu pacifiquement sur ces les, mais les vnements rcents ont troubl le calme des lmentaires de la terre et de la mer. Un freux de la nue a t attaqu, il a fini dsintgr.\n\nDepuis, la nue dcrit des cercles dans le ciel sans rpit. Les freux finiront par se fatiguer tt ou tard, mais je n\ose imaginer ce qui arrivera alors\n\nSi nous dbarrassions cette le des lmentaires hostiles, ils pourraient y retourner et se reposer.', '', '', '', '', '', '', 57534),
(82680, 'frFR', 'L\homme-oiseau des Trois-Boucliers.', 'Trouvez Olbarig aux Trois-Boucliers.', 'Vous tes $gvenu:venue; pour admirer les mousselaines? Non?\n\nQuel dommage. Je trouve les cratures lmentaires de notre le absolument fascinantes. Je suis d\ailleurs loin d\tre le seul.\n\nUn vieil ami  moi tudie les freux de la nue sauvage du ct des Trois-Boucliers. Il s\appelle Olbarig.\n\nD\ailleurs, cela fait bien longtemps qu\il n\a pas donn de nouvelles. Il faudrait sans doute s\assurer qu\il va bien. Vous pourriez faire a pour moi?', '', '', '', '', '', '', 57534),
(82679, 'frFR', 'Archive: en qute d\histoire', 'Rcuprez $1oafragments de disques des Titans.\n\nCes fragments de disques se trouvent dans les donjons, les Gouffres et sur les cratures dangereuses, ainsi que dans les trsors de Khaz Algar.', 'Nous n\avons pas fini de traiter les donnes de l\archive et de restaurer ce que nous pouvons. Mais les disques que nous avons rcuprs jusqu\ maintenant dans l\archive sont inutilisables.\n\nIl est essentiel d\en trouver d\autres. Nous devons retrouver nos souvenirs.\n\nRapportez ce que vous trouverez  Dagran. Il m\aide  reconstruire l\archive.', '', '', '', '', '', 'Retournez voir Dagran dans le caveau du Souvenir.', 57534),
(82678, 'frFR', 'Archive: le premier disque', 'Retrouvez Dagran dans le caveau du Souvenir et aidez-le  rcuprer des fragments de disques des Titans.\n\nCes fragments de disques se trouvent dans les donjons, les Gouffres et sur les cratures dangereuses, ainsi que dans les trsors de Khaz Algar.', 'J\ai le plaisir de vous informer que nous avons accompli quelques progrs dans la restauration du caveau du Souvenir des Titans dans l\archive. J\ai relanc le serveur principal, mais une partie de ses mcanismes internes a cd face aux outrages du temps.\n\nIl ne sera pas facile de trouver des pices de rechange, et nous aurons besoin de votre aide. Accompagnez-moi au caveau du Souvenir. Nous discuterons de ce qu\il nous faut avec Dagran.', '', '', '', '', '', 'Retournez voir Dagran dans le caveau du Souvenir.', 57534),
(82676, 'frFR', 'Mascarade brise', 'Terrassez Onyxia remmore pendant un vnement d\chos radieux.', 'Je ne sais plus comment j\ai atterri dans ce marais, mais la chance m\a souri. En me promenant, j\ai vu dame Katrana Prestor entrer dans une grotte trange pleine de crocs. Qu\est-ce qu\une femme de la noblesse pouvait bien faire dans un endroit aussi macabre?\n\nEn la filant  la trace, j\ai dcouvert dans le repaire une grande couve d\ufs de Dragon noir. La preuve est irrfutable: Katrana est dame Onyxia!\n\nJe vous en supplie, aidez-moi  occire cette vile Dragonne une fois pour toutes.', '', 'Une ambition si forte qu\elle persiste par un simple souvenir.', 'Onyxia remmore', '', '', '', 57534),
(82672, 'frFR', 'Une autre invitation qui arrive  temps', 'Rendez-vous  la fte qui se droule en Tanaris devant les grottes du Temps.', 'Le Vol draconique de bronze organise une grande fte juste devant les grottes du Temps, en Tanaris!\n\nIl y aura toutes sortes de nouvelles activits pour honorer l\occasion et se remmorer les vnements qui ont eu lieu au fil des ans.\n\nRendez-vous en Tanaris pour participer aux festivits.', '', '', '', '', '', '', 57534),
(82659, 'frFR', 'me-monde: palais des Nrub\ar', 'Terminez le raid du palais des Nrub\ar en mode normal ou suprieur.', 'La reine Ansurek s\est montre  la fois cruelle et ruse. Nous ne pouvons pas permettre  ses forces de gagner en puissance grce au Sang noir de Xal\atath.\n\nOn en est l. C\est une lourde tche, j\en conviens. Nous allons assiger le palais des Nrub\ar avec l\essentiel de nos troupes!', '', '', '', '', '', '', 57534),
(82653, 'frFR', 'Agrgation d\horreurs', '', '', '', '', '', '', '', '', 57534),
(82651, 'frFR', 'Prsages unifis', 'Trouvez une autre tincelle des prsages fracture.', 'Par les Titans! Regardez cet objet, $c.\n\n<Khubon vous montre un objet ressemblant  une pierre prcieuse fissure.>\n\nIl s\agit d\une tincelle des prsages fracture. Entre les mains d\un habile artisan, un tel ractif peut tre imprgn dans d\autres matriaux afin d\amliorer le produit final.\n\nToutefois, nous n\avons l qu\un simple fragment. Si par chance vous en trouvez d\autres au cours de vos aventures, apportez-les-moi. Je combinerai celui-ci aux vtres et vous aurez alors  votre disposition une authentique tincelle.', '', '', '', '', '', '', 57534),
(82639, 'frFR', 'Palais des Nrub\ar: rien que pour les yeux des Nrubiens', 'Collectez 3chevalires des Mille cicatrices et 3chevalires de Tournepeau dans le palais des Nrub\ar en mode mythique.', 'Nos tunnels n\ont pas t construits pour votre espce trop difficiles d\accs et trop dangereux pour les parcourir en solitaire.\n\nTrouvez-moi les chevalires de la cour Soyeuse, du seigneur scarabe Anub\arash et de Takazj Tournepeau et je vous ouvrirai un passage secret vers le palais.', '', '', '', '', '', '', 57534),
(82638, 'frFR', 'Palais des Nrub\ar: rien que pour les yeux des Nrubiens', 'Collectez 3chevalires des Mille cicatrices et 3chevalires de Tournepeau dans le palais des Nrub\ar en mode hroque.', 'Nos tunnels n\ont pas t construits pour votre espce trop difficiles d\accs et trop dangereux pour les parcourir en solitaire.\n\nTrouvez-moi les chevalires de la cour Soyeuse, du seigneur scarabe Anub\arash et de Takazj Tournepeau et je vous ouvrirai un passage secret vers le palais.', '', '', '', '', '', '', 57534),
(82629, 'frFR', 'Palais des Nrub\ar: rien que pour les yeux des Nrubiens', 'Collectez 3chevalires des Mille cicatrices et 3chevalires de Tournepeau dans le palais des Nrub\ar en mode normal.', 'Nos tunnels n\ont pas t construits pour votre espce trop difficiles d\accs et trop dangereux pour les parcourir en solitaire.\n\nTrouvez-moi les chevalires de la cour Soyeuse, du seigneur scarabe Anub\arash et de Takazj Tournepeau et je vous ouvrirai un passage secret vers le palais.', '', '', '', '', '', '', 57534),
(82628, 'frFR', 'Les frres Braunpique', 'Retrouvez les frres Braunpique prs du terrain d\Adulation.', 'Le baron Braunpique et son frre essaient de rgler le problme rcurrent des Kobyss prs du terrain d\Adulation.\n\nAllez les rencontrer sur place et voyez comment vous pouvez les aider.', '', '', '', '', '', '', 57534),
