(82540, 'frFR', 'Souvenirs d\aventures passes', 'Rendez-vous dans la Salle des portraits de Dalaran et utilisez un portail lumineux pour participer  un vnement d\chos radieux. Pour terminer l\vnement, liminez le boss de la zone.', 'Azeroth semble tre en proie  une certaine agitation. Quelque chose a d se produire lorsque Magni a essay de communiquer avec elle.\n\nLes vnements passs sont de nouveau  l\ordre du jour. Je crois qu\il s\agit des souvenirs d\Azeroth.\n\nMme si ce ne sont que des souvenirs, ces chos radieux sont bien rels et constituent une srieuse menace s\ils sont laisss sans surveillance. Je vous demande d\enquter sur l\un d\entre eux et d\apporter votre aide dans la mesure du possible.', '', '', '', '', '', '', 57534),
(82539, 'frFR', 'Des chos radieux', 'Allez voir Khadgar  Dalaran.', '<Une missive vous est adresse.>\n\n$p, rejoignez sans dlai Dalaran. D\tranges phnomnes se manifestent dans tout Azeroth. Nous pensons qu\ils sont lis au chant radieux. J\aimerais que vous meniez une enqute.', '', '', '', '', '', '', 57534),
