(82516, 'frFR', 'me-monde: forger un pacte', 'Slectionnez un pacte des Fils tranchs pour le reprsenter  Azj-Kahet, remplissez des objectifs en son nom et tuez des cratures rares en Khaz Algar.', 'On m\a envoy des informations sur les vnements d\Azj-Kahet. Les Nrubiens massacrent mon peuple sans piti depuis notre arrive il est trs difficile de les imaginer s\allier  nous.\n\nMais je comprends ce qu\on ressent en tant diffrent du reste de son peuple. Ces Nrubiens qui s\intressent  nous sont peut-tre aussi diffrents.\n\n<Faerin soupire.>\n\nCote que cote il serait inenvisageable de ne pas leur laisser une chance. Ces Nrubiens aussi sont des habitants de Khaz Algar.\n\nVoyez quelle aide vous pourrez leur apporter, mon $gami:amie;.', '', '', '', '', '', '', 57534),
(82512, 'frFR', 'me-monde: boss hors instance', 'Terrassez un boss hors instance et 5cratures rares en Khaz Algar.', 'Sainte-Chute n\est pas le seul endroit assig par nos adversaires.\n\nDe grands monstres arpentent toute l\tendue de Khaz Algar. Des btes sauvages comme des cratures intelligentes. Et ces choses font des victimes arathies ou terrestres sans discrimination, sans parler des aventuriers et aventurires qu\elles tuent. Sans se soucier que leurs proies portent des armes ou des outils des champs, d\ailleurs.\n\nJe sais que la Flamme sacre brle en vous. Vous tre notre seul espoir d\liminer ces dangers.', '', '', '', '', '', '', 57534),
(82511, 'frFR', 'me-monde: Machine d\veil', 'Vainquez $1oavagues d\adversaires au total dans la Machine d\veil.', 'Les Terrestres m\ont parl de cette Machine d\veil qui joue un rle dans leur cycle de vie.\n\nElle les imprgne d\nergie, ce qui tait autrefois un cadeau des Titans, et dsormais de l\me-monde.\n\n<Faerin affiche un lger sourire et hoche la tte en signe d\approbation.>\n\nIls la tiennent en haute estime, tout comme nous avec Beledar. \n\nJe me battrai pour la protger comme je le ferai pour notre toile! \n\nAidez-moi, $n. Nous ne pouvons pas les laisser tomber.', '', '', '', '', '', '', 57534),
(82510, 'frFR', 'me-monde: palais des Nrub\ar', 'Terminez le raid du palais des Nrub\ar en mode hroque ou suprieur.', 'La reine Ansurek s\est montre  la fois cruelle et ruse. Nous ne pouvons pas permettre  ses forces de gagner en puissance grce au Sang noir de Xal\atath.\n\nOn en est l. C\est une lourde tche, j\en conviens. Nous allons assiger le palais des Nrub\ar avec l\essentiel de nos troupes!', '', '', '', '', '', '', 57534),
(82509, 'frFR', 'me-monde: palais des Nrub\ar', 'Terminez le raid du palais des Nrub\ar en mode outil Raids ou suprieur.', 'La reine Ansurek s\est montre  la fois cruelle et ruse. Nous ne pouvons pas permettre  ses forces de gagner en puissance grce au Sang noir de Xal\atath.\n\nOn en est l. C\est une lourde tche, j\en conviens. Nous allons assiger le palais des Nrub\ar avec l\essentiel de nos troupes!', '', '', '', '', '', '', 57534),
(82508, 'frFR', 'me-monde: la colonie', 'Terminez le donjon de la colonie en mode mythique ou suprieur.', 'Les freux de la tempte dont ces Terrestres s\occupent sont merveilleux! Quel plumage magnifique, quelle personnalit farouche!\n\nCe doit tre un honneur de s\occuper de telles cratures. Mais il parat qu\il y a des problmes  la colonie et au quartier gnral des chevaucheurs et chevaucheuses de tempte, le Perchoir-Tempte. On ne m\a pas donn beaucoup de dtails, mais je suis sre que les Terrestres apprcieraient un coup de main.\n\nAllez donc voir, $n.', '', '', '', '', '', '', 57534),
(82507, 'frFR', 'me-monde: prieur de la Flamme sacre', 'Terminez le donjon du prieur de la Flamme sacre en mode mythique ou suprieur.', 'Mon peuple a toujours possd un lien trs troit avec la Lumire. Une foi que j\ai toujours estime inbranlable. Mais certains gens\n\n<Faerin marque une pause pour chercher ses mots.>\n\nCertains gens pensent que la foi doit tre impose. a a toujours t un sujet dlicat dans la culture arathie, mme  l\poque de l\empire.\n\nMais cela va trop loin. Ces fanatiques ont pris le prieur de la Flamme sacre. Et font des victimes!\n\nLa Lumire n\a jamais voulu a, $n. Arrtez-les.', '', '', '', '', '', '', 57534),
(82506, 'frFR', 'me-monde: faille de Flamme-Noire', 'Terminer le donjon de la faille de Flamme-Noire en mode mythique ou suprieur', 'Des Kobolds! Ce sont des bestioles cruelles, mais oh, j\ai l\impression de les comprendre, quand mme!\n\nLeur petites bougies Cette maniaquerie pour entretenir leur flamme\n\n<Faerin pose la main sur sa poitrine avec un sourire.>\n\nIls sont si courageux! a ferait des falotiers parfaits, s\ils acceptaient de partager! Et s\ils ne risquaient pas de nous arracher les yeux.\n\nLes rapports de leur activit  la faille de Flamme-Noire inquitent les Terrestres. J\aimerais que les Kobolds soient plus bienveillants, mais nous ne pouvons pas les laisser nuire  nos allies et allis. Allez enquter!', '', '', '', '', '', '', 57534),
(82505, 'frFR', 'me-monde: la Cavepierre', 'Terminez le donjon de la Cavepierre en mode mythique ou suprieur.', 'Brinthe a t d\une aide merveilleuse pour aider les peuples arathi et terrestre  renouer. Elle m\a racont tout ce qui est arriv rcemment  ses congnres dans les abmes Retentissants.\n\nJe comprends qu\on soit frustr par les dcisions de son peuple. Heureusement, Heurtacier est une chef plus raisonnable que ce haut-mandataire Eirich.\n\nCe flon s\est rfugi  la Cavepierre pour rassembler ses forces. Je sais que Brinthe et son peuple apprcieraient que vous alliez l\en empcher!', '', '', '', '', '', '', 57534),
(82504, 'frFR', 'me-monde: cit des Fils', 'Terminez le donjon de la cit des Fils en mode mythique ou suprieur.', 'Xal\atath a offert le Sang noir  ses Nrubiens pour leur donner les moyens de se sublimer en cratures encore plus terribles qu\avant.\n\nNous devons profiter de la confusion dans la ville. Rassemblez des renforts et prparez-vous  partir en infiltration nous devons les arrter!', '', '', '', '', '', '', 57534),
(82503, 'frFR', 'me-monde: hydromellerie de Brassecendre', 'Terminez le donjon de l\hydromellerie de Brassecendre en mode mythique ou suprieur.', 'Ah, la Brassecendre. C\est un breuvage aussi cors qu\on le dit.\n\nJe ne peux pas m\empcher de penser qu\elle a le got qu\aurait Beledar\n\nLes Terrestres adorent! Et a fait partie intgrante de leur hritage. C\est pourquoi on ne peut pas laisser l\hydromellerie tomber entre de mauvaises mains.\n\nMais faites attention aux cendrabeilles. Il parat que leurs piqres sont Enfin, je ne voudrais pas vous faire peur. Mais je vous laisse vous en charger avec plaisir.', '', '', '', '', '', '', 57534),
(82502, 'frFR', 'me-monde: Ara-Kara, la cit des chos', 'Terminez le donjon d\Ara-Kara, la cit des chos en mode mythique ou suprieur.', 'Les renseignements qui nous proviennent d\Azj-Kahet ont plus souvent l\aspect de rumeurs que de rapports. Nous manquons d\informations.\n\nOn parle d\une ville sous la ville. Elle s\appellerait Ara-Kara. Nous ignorons tous les dtails, mais il y aurait un trafic de Sang noir, l-bas.\n\nIl faut en avoir le cur net. Mobilisez vos renforts les plus puissants et allez enquter!', '', '', '', '', '', '', 57534),
(82501, 'frFR', 'me-monde: Brise-Aube', 'Terminez le donjon du Brise-Aube en mode mythique ou suprieur.', 'Le Brise-Aube Le chef-d\uvre de l\ingnierie arathie de Sainte-Chute. Le navire qui doit mettre un terme  la guerre.\n\nIl est prt  faire voile. Acceptez-vous d\accompagner sa charge? Il ne manquera pas d\adversaires  terrasser.', '', '', '', '', '', '', 57534);
