(82483, 'frFR', 'me-monde: propager la lumire', 'Accomplissez les objectifs de Propager la lumire et tuez des cratures rares dans Khaz Algar.', 'Les tnbres continuent de se rpandre dans Sainte-Chute. Nous avons besoin de votre aide pour empcher les feux de s\teindre!\n\nLes tnbres sont profondes et obscures. Mon peuple est fort, mais on n\a jamais trop d\espoir. Jamais trop d\tincelles pour la flamme. Et vous tes la plus vive de toutes nos tincelles.', '', '', '', '', '', '', 57534),
(82482, 'frFR', 'me-monde: flair', 'Trouvez les tas de sol drang  flairer et dcouvrez les granules de l\me-monde en vol dynamique autour de Khaz Algar.', 'a fait si longtemps que je voulais explorer l\extrieur des cavernes de Sainte-Chute. Bien sr, je n\ai pas le temps, mais quand ce sera le cas il y a tellement de surprises un peu partout!\n\nDes trsors, de nouvelles connaissances dans le besoin, des adversaires de tous calibres tout cela est merveilleux.\n\nIl faudra que je le vive par votre intermdiaire, c\est tout. Tant d\exploits  accomplir! Allez chercher des surprises dans tous les recoins. Vous trouverez certainement de quoi vous occuper!', '', '', '', '', '', '', 57534),
(82481, 'frFR', 'Extermination des massacreurs', '', '', '', '', '', '', '', '', 57534),
(82480, 'frFR', 'Robot tueur d\emplois mais pas seulement', 'Arrtez MARIE.', 'Je n\aurais pas d envoyer MARIE avec pour seule instruction de rassembler le plus de nourriture possible. Elle travaillait dur, mais quand un wagon charg de nourriture pour Mereldar est pass, elle a couru pour le rattraper! Et elle ne me laissait pas accder  ses pignons de dcision, ni  ses ressorts tendeurs!\n\nJ\ai essay encore et encore, mais MARIE ne voulait pas s\arrter. Elle a fini par me semer. $p, j\ai besoin que vous l\arrtiez avant qu\elle ne tue quelqu\un.', '', 'La machine d\Orren est hors de contrle et doit tre arrte.', 'MARIE', '', '', '', 57534),
(82479, 'frFR', 'L\pe est plus forte', 'Aidez Aemyra  choisir les bons mots pour son message  Orren.', 'J\avais dit  Orren que je serais rentre, mais les problmes  la Prtention de Velhan sont bien plus importants que prvu. Les gens d\ici ont besoin de mon aide contre les Kobyss.\n\n$p, j\ai toujours t plus doue avec une pe qu\avec une plume. La force des sentiments et la distance rendent les choses encore plus difficiles.\n\nJe prfre largement protger les gens vulnrables au fait de me sentir vulnrable.\n\nSi je vous dis quel message je veux faire passer, vous pourriez l\crire pour moi?', '', '', '', '', '', 'Retournez voir Orren  la Manne de Beledar.', 57534),
(82478, 'frFR', 'Routine de maintenance', 'Apportez le message d\Orren, $2oacharmeurs carlates et $3oafleurs d\ambre  Aemyra  la Prtention de Velhan.', 'J\ai un autre problme un peu plus personnel, $p.\n\nMa petite amie, Aemyra, est falotire. Elle devrait dj tre rentre de mission. Elle allait  la Prtention de Velhan.\n\nVous pourriez aller vous assurer qu\elle va bien et lui apporter ce message de ma part? Je suis si inquiet que je ne pense plus qu\ a.\n\nVous pourriez peut-tre aussi cueillir quelques-unes de ses fleurs prfres, sur cette colline?\n\nJe prfrerais le faire moi-mme, mais si j\arrive  faire fonctionner MARIE, Sainte-Chute aura beaucoup plus  manger. Et a me permettra de passer plus de temps avec Aemyra, en plus!', '', '', '', '', '', 'Transmettez le message d\Orren  Aemyra dans la Prtention de Velhan.', 57534),
(82477, 'frFR', 'Une main de plus pour la moisson', 'Rcuprez $1oachantillons de rcolte lgrement mchouills auprs des rampegueules gloutons.', 'Salutations, $p, je m\appelle Orren. Nous avons tout un tas de rampegueules qui sont sortis de terre pour attaquer les rcoltes. $gUn:Une:c; $c de votre trempe devrait pouvoir nous aider!\n\nLa faim nous guette constamment  Sainte-Chute, alors ma priorit est de sauver ces rcoltes.\n\nCela dit, si vous acceptez de les chasser pour moi, je pourrai me concentrer sur mon projet  long terme visant  nourrir plus efficacement la population.\n\nRetrouvez-moi prs de la remise! Et rapportez toute la nourriture qui n\a pas t trop mchouille.', '', '', '', '', '', 'Retrouvez Orren prs de l\abri.', 57534),
(82468, 'frFR', 'Qu\ils gagnent', '', '', '', '', '', '', '', '', 57534),
(82467, 'frFR', 'Les gemmes sont ternelles', 'Attirez Basalteux en plaant un noyau prs de chaque pierre dresse.', 'Je suis trs proche, je le sens au plus profond de moi.\n\nPlacez les noyaux  ct de chaque pierre. Il est temps d\invoquer Basalteux.', '', '', '', '', '', '', 57534),
(82466, 'frFR', 'Gemmes  tout prix', 'Rcuprez $1oaNoyaux lmentaires des lmentaires de sable igns.', 'D\aprs les Terrestres, nous devons attirer l\esprit. Ou le dranger. Un truc comme a.\n\nLes quatre pierres dresses dont ils ont parl sont entoures de noyaux lmentaires vides. Il y a des lmentaires igns dehors et sur la plage au nord. Vous pensez  la mme chose que moi?\n\nPourriez-vous m\apporter des noyaux lmentaires? Une poigne, peut-tre? Nous sommes si proches du but, ce serait bte de ne pas essayer', '', '', '', '', '', '', 57534),
(82465, 'frFR', 'Gemmes prcieuses', 'Retrouvez Natalia prs de la grotte de Basalteux.', 'Ils nous ont donc simplement laiss un emplacement et une nigme cryptique\n\nAu moins, cela nous fait un point de dpart.\n\nJ\y vois dj plus clair. Une fois le savoir de Basalteux en ma possession, nobles, marchands et marchandes feront la queue devant mon atelier. Que dis-je, devant mon manoir!\n\nLes Terrestres ont bien dit que c\tait au sud-ouest? Je vais trouver la grotte, rejoignez-moi l-bas. Vite!', '', '', '', '', '', '', 57534),
(82453, 'frFR', 'me-monde: rappel!', 'Participez  l\vnement de la troupe de thtre et accomplissez des expditions en Khaz Algar.', 'Vous avez vu ces annonces? Des pices de thtre terrestres vont tre joues au Proscenium!\n\nJe ne me souviens plus de la dernire fois o j\ai assist  une reprsentation, mais je ne sais plus o donner de la tte, comme toujours. Vous irez, n\est-ce pas?\n\nJe suis sre qu\une pice, ce sera excellent pour le moral de tout le monde. Faites-en une soire mmorable!', '', '', '', '', '', '', 57534),
(82452, 'frFR', 'me-monde: expditions', 'Accomplissez des expditions de Khaz Algar.', 'Il y a tant de choses  faire, nous n\aurons jamais le temps!\n\nBrinthe et moi avons rassembl les appels  l\aide venus de tout Khaz Algar. Il y en a trop!\n\nAllez aider ces gens. Votre intervention rapprochera nos congnres et nous serons plus fort, ensemble.', '', '', '', '', '', '', 57534),
