(82441, 'frFR', 'Car j\aime les gemmes', 'Obtenez des informations au sujet de Basalteux auprs des villageois et villageoises terrestres.', 'Avant la chute de Dalaran, j\tais une experte en gemmes de renom. Mais comme tout le monde ici, j\ai tout perdu: mes gemmes, mes livres, mes parchemins\n\nImaginez donc ma surprise lorsque j\ai appris qu\une crature du nom de Basalteux possdait un savoir sur les gemmes antrieur encore  la Fracture!\n\nJe veux m\approprier ce savoir. Je suis prte  tout pour m\en emparer.\n\nMais ces malotrus  la peau de pierre refusent de m\en apprendre davantage au sujet de Basalteux. Pourriez-vous soutirer ces informations aux Terrestres?', '', '', '', '', '', '', 57534),
