(82340, 'frFR', 'Risques et prils', 'Assistez M.Tournesol durant la sance de Vi\azl.', 'Heureuses salutations! Je suis M.Tournesol et voici mon salon de th et mon espace thrapeutique. C\est un endroit o chacun peut se sentir en scurit!\n\nJe me demande si vous ne pourriez pas aider un de mes patients. Vi\azl a une peur bleue des cratures dpourvues de membres. Cette phobie s\est dveloppe jusqu\ devenir trs intense. J\essaie de faire la lumire sur ce problme.\n\nPourriez-vous lui parler et lui dmontrer que mme si vous ne possdez pas huit membres, vous n\tes pas un tre si effrayant que a?', '', '', '', '', '', '', 57534),
(82339, 'frFR', 'Une excution sans honneur', 'Rcuprez le registre et dcouvrez ce qui est arriv  Anub\okki.', 'Si a peut vous faire partir plus vite, je vais vous dire ce que j\ai vu.\n\nJe n\ai pas vu ce qui est arriv  Anub\okki, mais je peux vous dire qu\on jette des corps dans le nid du pilier Xesh pour les faire disparatre. L\quipe de nettoyage a emmen Anub\okki il n\y a pas trs longtemps.\n\nEn vous dpchant, vous devriez pouvoir examiner sa dpouille avant qu\il n\en reste rien.', '', '', '', '', '', 'Rapportez le registre et la dague  Anub\azal dans le repaire de la Tisserande.', 57534),
(82338, 'frFR', 'Commission absente', 'Cherchez l\assistant d\Anub\azal dans les cheveaux de Nrub\ar.', 'Vous avez trouv un registre dans le bureau de Zev\kall, vous vous souvenez? Il contenait des informations essentielles sur la faon dont il a abus de notre peuple. Je l\ai donn  mon assistant, Anub\okki, pour qu\il l\apporte aux historiens et historiennes des cheveaux.\n\nCependant, je n\ai plus de nouvelles de mon assistant. Je crains qu\il ne lui soit arriv malheur. Allez voir si quelqu\un dans les cheveaux ne l\aurait pas vu!', '', '', '', '', '', 'Parlez  Ukos\via dans les cheveaux.', 57534),
(82337, 'frFR', 'Test Quest - First time Rewards (DNT)', 'Tuez $1oafltrisseuses hurlevols et $2oagriffe-sorts hurlevols.', 'This quest should give the following rewards for first time completions / additional completions on the account\n\nCurrencies:\nDragon Isles Supplies: 100/25\nSoul Ash: 10/100\n\nRep Currencies:\nValdrakken Accord Rep: 100/25\nMaruuk Centaur Rep: 10/100\n\nItems:\nDraconium Ore: 100/25\nHochenblume: 10/100\n(DNT)', '', '', '', '', '', '', 57534),
