(82284, 'frFR', 'En souvenir des dfunts', 'Placez la cuirasse et la poudrire dans la forge de Mereldar.', 'La coutume veut qu\on rende hommage aux personnes dfuntes en brlant ce que nous avons pu rcuprer de leurs affaires. En gnral, ce sont ces poudrires, qui sont plus faciles  transporter. Nous rendons ces objets  la flamme.\n\nNous avons pu rcuprer la poudrire de sire Cendraume, et la cuirasse de Ryton fera l\affaire pour honorer sa mmoire.\n\nVous avez mis votre vie en danger non seulement pour moi, mais pour toute Sainte-Chute. Je serais honore si vous m\aidiez pour ce dernier hommage  nos gens disparus.', '', '', '', '', '', '', 57534),
(82268, 'frFR', 'Triste retour au foyer', 'Faites  Faerin l\honneur d\apporter la cuirasse de Ryton Noirholme  Mereldar,  Sainte-Chute.', 'Je compte brler la cuirasse de Ryton et la poudrire de Sire Cendraume  Mereldar. Je serais honore si vous acceptiez de m\accompagner.\n\nPourriez-vous y porter la cuirasse?', '', '', '', '', '', 'Livrez la cuirasse de Ryton Noirholme  Faerin Lothar  Mereldar,  Sainte-Chute.', 57534),
