(82248, 'frFR', 'Avancer jusqu\ Faerin', 'Parlez  Faerin Lothar  l\avance de Faerin.', 'J\ai une petite friandise tout emballe dans un coin de ma toile. Devrais-je la partager avec vous? Elle causerait votre perte, $r.\n\nTrs bien je sens votre impatience. J\ai envoy ce petit Gobelin tout vert que vous appelez Gazleu vers le nord-est. Il m\a dit que la reine et le grand gnral rassemblent leurs troupes d\assaut d\lite. Sans doute pour envahir Sainte-Chute.\n\nRetournez auprs de votre amie falotire. Elle voudra certainement tout dtruire.', '', '', '', '', '', '', 57534),
