(82226, 'frFR', 'Papiers? S\il vous plat!', 'Vrifiez les documents au bureau de surveillant  la halte de l\Aubaine.', 'H, qu\est-ce qu\il faut faire pour avoir la paix?\n\nUn voyage, a vous dit? Un NORME voyage\n\nJ\ai dit  boss Tirtincelle que c\est moi qui gre le chantier euh, la station! Oui, que je vais m\occuper de la rception pendant un moment.\n\nEnvie de prendre ma place? C\est un travail de gratte-papier. Vrifier les accrditations, surveiller les sabotages d\entreprise, demander une frappe arienne occasionnelle\n\n<Garv s\est dj rendormi.>', '', '', '', '', '', '', 57534),
