(82224, 'frFR', 'Prenez des nouvelles du compilateur.', 'Prenez des nouvelles de Brennok.', 'Il n\y a rien de plus ici. Pourriez-vous aller voir Brennok? Les rcitations sont parfois prouvantes. Il apprciera srement votre aide.', '', '', '', '', '', '', 57534),
(82223, 'frFR', 'Un repas maison', 'Mangez chez les Heurtacier de Mereldar  Sainte-Chute.', 'Un ragot maison. C\est ce qui se fait de mieux. \n\nD\accord, ce n\est peut-tre pas aussi bon que le ragot de l\auberge des Confins de l\empire. Mais c\est ma famille qui l\a prpar. C\est un gage de saveur.\n\nInstallez-vous avec nous. Vous l\avez largement mrit.', '', '', '', '', '', '', 57534),
(82222, 'frFR', 'Cuisiner avec classe', 'Aidez les Heurtacier  prparer un repas  Mereldar.', 'Dsole que ma fille vous ait $gml:mle;  tout a. Je suis sre que vous aviez mieux  faire.\n\nElle n\a aucune manire. Il va falloir que je parle  celle ou celui qui l\a leve.\n\n<La gnrale a un rictus rapide.>\n\nEnfin, puisque vous tes ici, vous voulez vous joindre  nous pour une activit plus agrable? Nous allions cuisiner.', '', '', '', '', '', '', 57534),
(82221, 'frFR', 'Grande tenue', 'Aidez les Heurtacier  dcorer leur maison  Mereldar en prparation du repas  venir.', 'Au cours d\un repas de famille arathi traditionnel, on expose les diffrentes mdailles, dcorations et souvenirs de la famille. Vu la carrire illustre de ma mre, a va prendre du temps. \n\nVous pourriez nous aider avec certaines de ces dcorations?', '', '', '', '', '', '', 57534),
(82220, 'frFR', 'il d\aigle, deuil d\aigle', 'Collectez $1oaFilets d\aigle.', 'Les aigles prs des fonds Marins sont baigns par la lumire de Beledar, et cela les rend particulirement savoureux.\n\nVous pourriez me rcuprer quelques filets d\aigle? Prenez ce harpon, ils ne se laissent pas faire.', '', '', '', '', '', 'Retrouvez Auralia Heurtacier  la maison des Heurtacier  Mereldar.', 57534),
(82219, 'frFR', 'Je suis venu te dire que je mangeais', 'Cueillez $1oalotus baigns de lumire  Sainte-Chute.', 'La bndiction de la flamme soit sur vous, $n.\n\nLe commerce se porte bien, maintenant que les abmes Retentissants sont  nouveau en scurit. La situation s\est relativement calme. Mais hlas, notre gnrale ne dcompresse pas pour autant. Elle est crispe, et ce n\est pas sain. Une gnrale qui ne va pas bien, a donne une arme qui va mal.\n\nAlors une petite journe en famille Vous pourriez aller me chercher des herbes pour le repas? Il en faut des grosses, ne vous encombrez mme pas des petites.', '', '', '', '', '', 'Retrouvez Auralia Heurtacier  la maison des Heurtacier  Mereldar.', 57534),
(82217, 'frFR', 'Une conomie souterraine', 'Aidez la dlgation arathie dans les ngociations commerciales avec la Bont de Dunelle.', 'Aprs le Jour des Tnbres, nous n\avons plus vu ni entendu parler du Terrestre. Je ne sais pas pourquoi.\n\nNous tions en bons termes. J\aurais mme considr Merrix comme un ami, mme s\il tait bizarre.\n\nNous avons besoin que les choses se droulent au mieux.', '', '', '', '', '', '', 57534),
(82216, 'frFR', 'Demande conomique', 'Rdigez une lettre de recommandation  Mereldar  Sainte-Chute.', 'Il parat que vous arrivez de la surface? Avez-vous rencontr les Terrestres?\n\nOn commerait avec eux, autrefois, mais depuis le Jour des Tnbres, nous n\arrivons plus  envoyer d\missaires. Les personnes qui partent ne reviennent jamais. Franchement, on a cru qu\elles avaient pri.\n\nJe vais essayer de les contacter  nouveau. Pourriez-vous crire une lettre de recommandation, au cas o nous aurions fait quelque chose qui les aurait vexs?', '', '', '', '', '', '', 57534),
(82215, 'frFR', 'Fibre ordinaire', 'Collectez $1oafibres de lierre robuste.', 'Il y a une plante fibreuse qui pousse  Rhum-Enclave et aux Crocs qui permet de fabriquer d\excellentes cordes.  cause des frelons, cela fait longtemps que nous n\avons pas pu aller en cueillir, et nos rserves viennent  manquer.\n\nPendant que vous serez dans la rgion, vous pourriez en cueillir quelques-unes?', '', '', '', '', '', 'Retrouvez Auralia Heurtacier  la Bont de Dunelle.', 57534),
(82214, 'frFR', 'Quelqu\un aime les gupes?', 'Tuez $1oafrelons croc-aux-fers.', 'Nous n\avons pas pu rcuprer de ressources car des frelons se sont installs rcemment dans la rgion.\n\nNous avons besoin de nos troupes sur le mur et il ne restait personne pour s\en occuper. Si vous pouviez rgler le problme, vous auriez notre reconnaissance.', '', '', '', '', '', 'Retrouvez Auralia Heurtacier  la Bont de Dunelle.', 57534),
(82213, 'frFR', 'Une demande qui bat de l\aile', 'Rcoltez $1oamorceaux de viande de chauve-souris croc-aux-fers.', 'Je vais rassembler une slection de nos productions principales avant de partir pour cette rencontre, et je ne dirais pas non  un coup de main pour collecter des denres supplmentaires.\n\nCes derniers temps, nous avons du mal  nous fournir la meilleure viande de chauve-souris de Sainte-Chute. Vous pourriez en rcuprer un peu avant de venir  la Bont de Dunelle?', '', '', '', '', '', 'Retrouvez Auralia Heurtacier  la Bont de Dunelle.', 57534),
