(82195, 'frFR', 'Rouille et rdemption', 'Collectez $1oaextraits de rampante purs provenant de rampants sous-goutte et de jeunes pousses rampantes au sein des abmes Retentissants.', 'Alors que vous approchez, un levier rouill attire votre attention. Il semble coinc dans une position.\n\nCe truc n\a pas boug depuis des lustres, songez-vous en remarquant que le mtal rche rsiste  tout contact.\n\nEn examinant les alentours, vous remarquez les reflets huileux sur des rampantes ressemblant  des plantes. Peut-tre qu\un peu de lubrifiant naturel ferait l\affaire, pensez-vous, ralisant que ces ennemis de la flore pourraient vous fournir ce dont vous avez besoin pour desserrer le levier.', '', '', '', '', '', '', 57534),
