(82153, 'frFR', 'Ambassades et missaires', 'Installez l\ambassade de votre faction  Dornogal.', 'Notre voyage m\a sembl durer une ternit. Je l\avoue, j\ai parfois redout que nous arrivions trop tard.\n\nMais voir tout le monde runi fait renatre l\espoir en moi.\n\nAvant de rflchir aux prparatifs, nous devons tablir une base oprationnelle ici,  Dornogal.', '', '', '', '', '', 'Trouvez Moiral  Dornogal et prsentez votre rapport.', 57534),
