(82144, 'frFR', 'Sur la route', 'Trouvez Brennok.', 'C\est la seule route qui mne  l\ascenseur, il devrait dj tre l. \n\n moins qu\il ne soit pas pass par la route! Il voulait faire profil bas. \n\nIl ne sait pas  quel point les abmes peuvent tre dangereux. Nous devons le trouver!', '', '', '', '', '', '', 57534),
(82143, 'frFR', 'Le chemin de la dissonance', 'Retrouvez Orweyna et Hannan  l\extrieur de la grotte des caniveaux Saliens.', 'Hannan a raison, mais seulement sur le fait que ma prsence ici n\est pas formellement autorise.\n\nToutefois, cette corruption rsonne dans mon esprit, comme un accord perturbant dans le chant autrement pur du monde. Comme un appel  l\aide.\n\nJe dois y rpondre. Je dois suivre la dissonance jusqu\ son point d\origine et trouver d\o elle mane afin de pouvoir dcouvrir comment l\liminer.\n\nJoignez-vous  moi.', '', '', '', '', '', '', 57534),
(82141, 'frFR', 'Tuer une reine', 'Tuez la reine Ansurek.', 'Je m\attendais  ce que la reine renforce sont emprise sur ses sujets. Mais forcer la population  subir la Sublimation a va trop loin. \n\nLa reine Ansurek est tombe plus bas que je ne l\aurais cru. Je ne peux pas la laisser mener notre peuple  la ruine sans rien faire.\n\nLe moment est venu. Nous devons tuer la reine Ansurek et offrir un avenir meilleur  notre peuple. Sinon qui sait o elle s\arrtera?', '', 'Le rgne de la reine Ansurek a marqu d\une pierre noire l\histoire d\Azj-Kahet. Elle s\est illustre par son contrle autoritaire sur son peuple et son alliance prcaire avec Xal\atath. Devenue de plus en plus paranoaque, elle a fini par se reclure dans son palais des Nrub\ar.', 'Reine Ansurek', '', '', '', 57534),
(82133, 'frFR', 'Documentation: manuel de terrain', '', '', '', '', '', '', '', '', 57534),
(82130, 'frFR', 'Viser la tte', 'Tuez le matre ravisseur.', 'Pendant votre absence, je ne me suis pas tourn les pouces. \n\nVos exploits aux Terriers ont attir l\attention d\une personne haut place. Une entit trange, couverte de bandages, avec une odeur de dsespoir.\n\nHeureusement, ce monstre inhabituel s\est rendu dans les Terriers pour dcouvrir pourquoi ses agents disparaissent. C\est l\occasion de frapper et de dmanteler toute son opration.', '', 'La personne  la tte des Ravisseurs qui terrorisent les habitants des Terriers. Elle n\est pas originaire d\Azj-Kahet, et on ignore ses intentions, autant que son identit.', 'Arzda le ravisseur', '', '', '', 57534),
(82127, 'frFR', 'Les proies dans l\ombre', 'Tuez $1oaravisseurs et ravisseuses dans les Terriers.', 'Personne n\est de taille  s\opposer  ces enlvements. Je crois qu\il est temps d\intervenir. \n\nLes groupes d\assaut rdent dans les Terriers, ils se croient invisibles mais je les vois. Nous les voyons tous. Simplement, personne ici n\est capable de leur rsister. C\est l que vous intervenez.\n\nTraquez ces infmes tortionnaires et montrez-leur qui est la vraie proie.', '', '', '', '', '', '', 57534),
(82126, 'frFR', 'La dfense du peuple', 'Librez $1oacitoyens et citoyennes dans les Terriers.', 'Le vizir a d vous expliquer les dtails. Les habitantes et les habitants des Terriers disparaissent, vous tes au courant.\n\nMais les murmures du vent racontent une histoire plus complexe. On a suivi la trace de ces victimes jusqu\ la Transformacie, mais elles n\en sont jamais revenues!\n\nNous devons mettre un terme  cette tragdie, cote que cote. Il n\est pas trop tard pour sauver les dernires victimes, elles se trouvent encore dans les Terriers. Trouvez-les et librez-les.', '', '', '', '', '', '', 57534),
(82125, 'frFR', 'Un espion comme les autres', 'Retrouvez Gut\usul dans les Terriers.', 'Nous avons reu des nouvelles inquitantes des Terriers. Un plan sinistre prend forme dans les profondeurs. On ne compte plus les disparitions d\habitantes et d\habitants de ce quartier.\n\nTakazj Tournepeau et Anub\arash ont la subtilit d\un marteau. Je doute que ce soit leur uvre. C\est la marque d\une personne plus subtile.\n\nJ\ai un contact dans les Terriers. Il s\appelle Gut\usul. Retrouvez-le sur place et dcouvrez ce qui se passe l-bas.', '', '', '', '', '', '', 57534),
(82124, 'frFR', 'Le dbut de la fin', 'Provoquez des perturbations dans le bazar Ombreux.', 'La reine Ansurek ne chme pas depuis la tentative d\assassinat. Elle resserre son emprise sur Azj-Kahet, et les nobles qui lui sont fidles se plient  tous ses caprices. \n\nAu nom de la reine, ses deux nobles les plus loyaux, Takazj Tournepeau et Anub\arash, ont ferm le bazar Ombreux. \n\nLa propagande insupportable de Takazj et la prsence militaire accrue d\Anub\arash ne laissent aucun doute: c\est la Sublimation ou la mort.\n\nVous devez aller au bazar Ombreux et dfaire leur emprise.', '', '', '', '', '', '', 57534),
(82123, 'frFR', 'Conviction du gnral', 'Informez la veuve Arak\nai de ce qui s\est pass.', '<Anub\azal vomit brutalement. L\ichor jaillit de sa mchoire disjointe.>\n\nL\obligation de ma cohorte envers les Fils tranchs demeure. Vous devriez rapporter ce que vous avez vu  la Tisserande. Elle me fait parfois enrager, mais elle aura peut-tre une ide intressante pour la suite.', '', '', '', '', '', '', 57534),
(82122, 'frFR', 'Duel de destins', 'Dfendez Anub\azal contre les sbires de Zev\kall.', 'Je ne suis pas un rustre naf, $n. Je ne m\attends pas  ce que Zev\kall honore la nature de ce dfi, mme en apparence.\n\nNous nous trouvons dans la forteresse de l\adversaire, au milieu de ses adeptes les plus fanatiques. Rien ne sera fait pour nous aider.\n\nJ\ai deux ordres pour vous. D\abord, vous repousserez les personnes mcontentes qui voudront interrompre le duel. Et surtout, vous n\emploierez ni pe ni sort contre Zev\kall lui-mme.\n\nIl doit tomber sous mes griffes.', '', '', '', '', '', '', 57534),
(82121, 'frFR', 'Exiger une rponse adquate', 'Plantez l\tendard d\Anub\azal dans le bastion du Sige  Azj-Kahet.', 'Cela fait un moment que nous travaillons ensemble, $n. J\espre que vous avez un certain respect pour ma vision de l\art de la guerre. Comme toujours, il y a des rgles  suivre. Des lignes  ne pas franchir.\n\nZev\kall doit mourir, et c\est moi qui dois porter le coup de grce. Chaque jour o ce ruffian sublim continue de pitiner les idaux de la guerre, la rputation de notre royaume se ternit un peu plus.\n\nJe vous en prie, accomplissez cette dernire mission pour moi. Rendez-vous dans la forteresse adverse et plantez ce drapeau sur son perron. Nous allons faire les choses en bonne et due forme.', '', '', '', '', '', '', 57534),
(82088, 'frFR', 'Kobyss repetita', '', '', '', '', '', '', '', '', 57534),
(82059, 'frFR', 'Atelier de transmutation', 'Apportez 15cus gravs de messagre  Vaskarn  Dornogal, puis changez-les contre une bourse d\cus abms de messagre.', 'Mon $gami:amie;, ces cus sont magnifiques. On dirait qu\on peut les transformer selon diffrents paliers!\n\nSi vous vous retrouvez avec une multitude d\cus de palier infrieur, vous pourrez en faire un plus puissant! Je crois. J\y travaille encore. Je vous prviendrai quand j\aurai tout compris. Mais nous pouvons les transmuter en la version la plus faible ds maintenant!\n\nRegardez. Voici quelques cus gravs de messagre. Si vous me le demandez, je les transformerai en cus abms, tout cela sans entropie ni excdent d\nergie!', '', '', '', '', '', '', 57534),
(82050, 'frFR', 'La messagre des cus', 'Obtenez 15cus abms de messagre en terrassant des cratures uniques, en venant  bout de raids, en terminant des activits ou en pillant des caches. Puis retournez voir Vaskarn  Dornogal.', 'Votre aide est toujours la bienvenue.  prsent, vous savez que pouvez venir ici pour amliorer votre quipement de bas niveau.\n\nBien sr, les pierres de vaillance ont leurs limites. Vous aurez besoin de ces cus de messagre pour amliorer vos meilleures pices d\quipement d\aventure. Ces cus, tout comme les pierres, s\obtiennent en participant  diffrentes activits. Il existe quatre niveaux d\cus de messagre, et les meilleurs sont rservs aux tches les plus dangereuses.\n\nApportez-moi quinze cus abms de messagre et nous vous aiderons  amliorer votre quipement.', '', '', '', '', '', '', 57534),
(82042, 'frFR', 'Il n\y a que vaille qui m\aille', 'Collectez 50pierres de vaillance lors de vos aventures en Khaz Algar, puis retournez voir Couzolth et amliorez une pice d\quipement de la saison1.', 'Dornogal! Un nouveau lieu fascinant pour tout le monde, et pas juste les Dracthyrs!\n\nDe nouvelles zones fascinantes avec de nouveaux composants fascinants  trouver et  tudier. Comme les pierres de vaillance!\n\nDans tout Azeroth, j\ai vu des objets similaires utiliss pour amliorer les armes et armures. J\imagine que ces pierres fonctionneront de la mme manire.\n\nFaites avancer mes recherches en me rapportant toutes les pierres de vaillance que vous trouverez. J\amliorerai une pice de votre quipement pour vous remercier!', '', '', '', '', '', '', 57534),
(82007, 'frFR', 'Fauve qui peut', 'Trouvez Haricots, Buf, Tonnerre et Cap\taine Elaena. Puis ramenez-les  Attica Valmoustache.', 'Les bbs lynx se sont encore chapps!\n\nCes petites canailles passent leur temps  faire des btises et  me filer entre les doigts. Grognon a disparu et il ne reste plus que moi et Vesper pour dfendre cet endroit. J\aurais bien besoin de votre aide!\n\nJe suis sr que ces fichus flins ne sont pas bien loin. Tchez de me les ramener.\n\n votre place, j\utiliserais une lampe pour fouiller la grotte, la zone pleine d\araignes au sud et la cte, au nord.', '', '', '', '', '', '', 57534),
(81999, 'frFR', 'Nouvelle maison, nouvelle bougie!', 'Rencontrez Tocard sur la Braiselande.', 'Tocard entendre dire qu\abeilles de feu gantes tre  la surface.\n\nAbeilles de feu faire cire de feu, non? Et si moi faire bougies en cire d\abeille de feu? a donner quoi?\n\nTocard devoir le savoir!', '', '', '', '', '', 'Rencontrez Tocard sur la Braiselande.', 57534),
(81994, 'frFR', 'Un lien sacr', 'Collectez $1oaesprits de tempte en tuant de puissantes cratures des les aux Dragons.', 'Oui, ce freux commence  nous apprcier. Mais le lien entre la monture et $gson cavalier:sa cavalire; se forge au fil de nombreuses preuves.\n\nVous avez peut-tre l\esprit pour a, mais voyons si vous le matrisez. Il va falloir faire vos preuves au combat.', '', '', '', '', '', '', 57534),
(81993, 'frFR', 'Le lien du chevaucheur de tempte', 'Collectez $1oaesprits de tempte en tuant de puissantes cratures des les aux Dragons.', 'Cette beaut n\est pas un griffon ordinaire. Il a la tempte en lui. J\essaie de le calmer depuis ce matin.\n\na me rappelle une vieille lgende des Marteaux-Hardis. On les appelait les freux de la tempte. Ils n\acceptaient que les chevaucheurs et les chevaucheuses de tempte de renom.\n\nSi vous lui montrez que vous avez l\esprit de la tempte, peut-tre qu\il vous acceptera. Essayez de faire vos preuves au combat.', '', '', '', '', '', '', 57534),
(81990, 'frFR', 'L\Appel de la Lumire', 'Allez voir Keyrra Forteflamme pour lui proposer vos services.', 'Habitants et habitantes de Sainte-Chute, votre attention!\n\nNous avons besoin de votre aide de toute urgence pour reprendre le contrle des alentours.\n\nLes tnbres prennent des fermes des mains d\innombrables familles et vous devez allumer la Flamme sacre pour que nos terres retrouvent la paix.', '', '', '', '', '', 'Allez voir Keyrra Forteflamme pour lui proposer vos services.', 57534),
