(81981, 'frFR', 'Arme quoi?', '', '', '', '', '', '', '', '', 57534),
(81969, 'frFR', 'Une fin  la Fin', 'Aidez Faerin et Gazleu  liminer la monstruosit appele Surek\tak le Scind.', 'Je veux rendre hommage  mon ami. Mais pour commencer, nous devons porter le coup de grce  cet endroit que la Lumire a abandonn.\n\nOn sait que le gnral Zev\kall supervise la cration d\une monstruosit Un Nrubien difforme, corrompu par le Vide. Nos missions de reconnaissance ont permis d\identifier un emplacement au sommet du canyon.\n\nNous allons le priver de son horrible bestiole. Cela devrait mettre un terme  ses plans de conqute de Sainte-Chute. Du moins pour un moment.', '', 'Le grand gnral Zev\kall s\apprte  lancer cette crature difforme sur Sainte-Chute.', 'Surek\tak le Scind', '', '', 'Parlez  Faerin Lothar devant le Creuset du Scind,  la Fin des Arathis.', 57534),
(81966, 'frFR', 'Sommeil de pierre', 'Retourner  Dalaran', 'P\pa est rveill, $gchampion:championne;. Vous devriez rentrer  Dalaran.', '', '', '', '', '', '', 57534),
(81965, 'frFR', 'Perturbation d\invasion', 'Perturbez les efforts d\invasion nrubiens  la Fin des Arathis.', 'Nous ne pouvons pas liminer la menace des Nrubiens  cet endroit, mais nous pouvons perturber leurs plans d\invasion.\n\nNous ne manquons pas d\occasion d\accomplir notre objectif. Voyons comment nous pouvons les embter.', '', '', '', '', '', '', 57534),
(81964, 'frFR', 'Le sort du forgeron', 'Aidez Faerin Lothar  dcouvrir ce qu\est devenu Ryton Noirholme.', 'Pendant que nous sommes ici, je dois dcouvrir ce qu\est devenu mon vieil ami, Ryton Noirholme. C\tait le meilleur forgeron de Sainte-Chute. Mais il a t emport lors d\une attaque surprise nrubienne. Je n\ai pas pu le sauver.\n\nJe l\ai cherch, mais je n\ai retrouv que son casque couvert de sang. J\ai donc renonc. Mais rcemment, une personne rescape qu\on avait tout juste rappele du mur de l\gide m\a parl d\un forgeron.\n\nPourrait-il s\agir de Ryton? Pourriez-vous m\aider, $n?', '', '', '', '', '', 'Donnez la cuirasse de forgeron  Faerin.', 57534),
(81963, 'frFR', 'Les fruits de notre travail', 'Livrez $1oaPotions de Vivombre aux habitantes et habitants du quartier Soyeux.', 'Vous avez fait le spectacle, on dirait! Les commandes ont dj commenc  arriver. Tout le monde a hte de tremper ses mandibules dans mes potions.\n\nJ\ai une dernire mission  vous confier. J\aimerais que vous alliez livrer ces commandes. Vous voulez bien?\n\nLes citoyens et citoyennes frtillent d\impatience. C\est le moment de montrer aux Cingletrames ples ce dont nous sommes capables. Si quelqu\un essaie de vous arrter, vous savez quoi faire.', '', '', '', '', '', '', 57534),
(81962, 'frFR', 'Un coup de pouce dans la bonne direction', 'Tuez $1oaCingletrames ples dans le quartier Soyeux.', 'Merveilleux, merveilleux! Maintenant que nous avons rcupr mes potions de Vivombre, je veux que vous alliez les montrer dans le quartier Soyeux.\n\nCela attirera sans doute la colre des Cingletrames ples, mais je veux montrer  la population que rien ne nous oblige  vivre sous leur coupe. Avec un peu de motivation agressive, nous pourrons nous dbrouiller sans leur contrle.\n\nOui, oui, a fera l\affaire! Faites le tour du quartier Soyeux et tuez les Cingletrames ples. Mes potions donneront aux gens de l-bas un coup de fouet bienvenu dont on me dira des nouvelles.', '', '', '', '', '', '', 57534),
(81959, 'frFR', 'Collecte de dcoction', 'Rcuprez $1oaPotions de Vivombre aux falaises Murmurantes.', 'Les Cingletrames ples ont vraiment jet mes fournitures d\alchimie au pied de la falaise. Ces potions donneront aux habitants et habitantes du quartier Soyeux l\avantage ncessaire pour se soulever.\n\nJ\ai besoin que quelqu\un descende au pied des falaises Murmurantes pour rcuprer les bouteilles qui ont rsist  la chute. J\irais volontiers moi-mme, mais les Kobyss ont fait de l\endroit un terrain de chasse, et le combat n\est pas ma spcialit.\n\nPour une personne comme vous, a ne semble pas trop compliqu, hein?', '', '', '', '', '', '', 57534),
(81950, 'frFR', 'Une EXPLOSION de saveur!', 'Placez des en-carabes pour attirer les hannetons chargs de bombes afin qu\ils dtruisent les balistes nrubiennes.', 'Si nous voulons stopper cette invasion, il va falloir commencer par liminer leurs gros calibres. Et par gros calibres, je veux dire leurs balistes.\n\nVous vous souvenez quand je vous ai demand de me ramener ces en-carabes? Vous allez comprendre. Les Nrubiens font transporter leurs bombes par des scarabes, et ces petits fripons ne disent jamais non  une sucrerie. Comment les blmer?\n\nPlacez la nourriture  ct d\une baliste: quand un scarabe viendra la grignoter, boum!', '', '', '', '', '', 'Parlez  Monte Gazleu  la Fin des Arathis.', 57534),
(81945, 'frFR', ' la Fin des Arathis', 'Retrouvez Faerin et Gazleu  la Fin des Arathis.', 'Nous allons nous regrouper  la sortie de la Fin des Arathis,  l\est.\n\nLeurs forces sont presque prtes, il sera bientt trop tard, $n.', '', '', '', '', '', 'Retrouvez Faerin et Gazleu  la Fin des Arathis.', 57534),
(81930, 'frFR', 'Le Conflit intrieur', 'Allez en Silithus pour parler  Jaina des visions qui apparaissent  travers Azeroth.', 'Certaines personnes en Azeroth ont des visions et entendent un chant radieux. Nous pensons qu\il s\agit d\une sorte d\avertissement.\n\nRetrouvez-moi en Silithus. Peut-tre que l\orateur d\Azeroth saura nous clairer sur la signification de ce message.', '', '', '', '', '', 'Retrouvez Jaina en Silithus.', 57534),
(81929, 'frFR', 'Voici le plan', 'Aidez Faerin  se prparer pendant qu\elle explique son plan.', '$n, le moment est venu de nous occuper de l\arme nrubienne. Le gnral Zev\kall runit une force considrable  l\est. Il compte franchir le mur et envahir Sainte-Chute. Nous manquons de temps.\n\nNous n\avons pas les moyens d\assumer un assaut d\envergure. Mais la Tisserande nous a envoy Gazleu, ici prsent. Je ferai tout ce qu\il faut pour sauver mon peuple.\n\nEt le destin a voulu que j\aie une affaire personnelle  rgler pendant que nous sommes l-bas.', '', '', '', '', '', '', 57534),
(81928, 'frFR', 'La voix du peuple', 'Parlez  $1oahabitants et habitantes du quartier Soyeux.', 'Comme vous l\avez peut-tre appris, la vie dans le quartier Soyeux a rserv quelques surprises. Les Cingletrames ples oppriment les habitants et habitantes.\n\nJe n\ai pas pu apprendre grand-chose avant que la garde sublime me fasse dguerpir. Mais vous tes une nouvelle tte, alors parlez aux gens du quartier et vous trouverez peut-tre un moyen de les aider.\n\nEssayez aussi de trouver l\alchimiste Talbax: son nom est revenu  plusieurs reprises. Il pourrait tre un contact utile.', '', '', '', '', '', 'Parlez  l\alchimiste Talbax.', 57534),
(81915, 'frFR', 'De retour au perchoir', 'Retournez  Dhar Oztan.', 'Vous nous avez dj rendu un grand service, $n. Nous continuerons  suivre votre exemple.\n\nVous devriez retourner  Dhar Oztan et vous occuper des nouvelles recrues chevaucheuses de tempte. Elles ne pourront que bnficier de la diligence dont vous avez fait preuve ici.\n\nDe plus, vous n\aurez plus  supporter ces deux-l et leurs grands airs. Je vous envie, $n', '', '', '', '', '', 'Dhar Oztan atteint.', 57534),
(81914, 'frFR', 'Dhar Oztan', 'Rendez-vous  Dhar Oztan.', 'J\adore les freux de la tempte. J\avais pour consigne de m\occuper d\eux, j\ai pass ma vie  leurs cts. Malgr cela, il y a encore beaucoup de questions  leur sujet dont je n\ai pas les rponses.\n\nLe vritable expert, c\tait Baelgrim, le clbre garde-tempte. Ds que l\occasion se prsentait, je le bombardais de questions. Et il rpondait du mieux qu\il pouvait.\n\nIl m\a racont l\invocation des freux  Dhar Oztan. C\est un vieil avant-poste des chevaucheurs et chevaucheuses de tempte qui date de bien avant le Perchoir-Tempte. Si vous voulez en savoir plus sur les freux, c\est l qu\il faut nous rendre.', '', '', '', '', '', 'Dhar Oztan atteint.', 57534),
(81913, 'frFR', 'Trois-troduction aux techniques de vol', 'Aidez Kurdran  former les recrues au combat arien.', 'Ces recrues semblent trpigner d\impatience. Donnons-leur de quoi satisfaire leur soif d\action!\n\nJ\ai vu un malheureux Gant au large de la cte assailli par une nue de diables volants. Voyons si ces freux peuvent leur arracher les ailes et lui apporter un peu de rpit.\n\nShraubendre et vous-mme savez montrer l\exemple. Continuez ainsi!', '', '', '', '', '', 'Retrouvez Olbarig prs de l\hydromellerie.', 57534),
(81912, 'frFR', 'Deux-troduction aux techniques de vol', 'Aidez Kurdran  former les recrues au tir arien.', 'N\allez pas croire que j\avais pas remarqu les freux qui crachaient des clairs. Toujours mieux que d\lancer des marteaux. Mais a sert  rien si les chevaucheurs et chevaucheuses de tempte peuvent pas toucher leurs cibles.\n\nVrifions leur vise. J\ai ici quelques engins gnomes qui projetteront des cibles faciles pour l\entranement. Amenez Shraubendre l-bas et montrez-leur comment on fait!', '', '', '', '', '', 'Retrouvez Kurdran au nord des confins de Golgrin.', 57534),
(81910, 'frFR', 'Une grande responsabilit', 'Acceptez la poudrire.', 'Une telle corruption est vraiment troublante.\n\nMalgr l\nergie sombre qui sature cette poudrire, il reste un soupon de Flamme sacre qui tente de se librer. Je refuse de dtruire cette tincelle, $gchampion:championne;.\n\nMais je n\ose pas non plus conserver cet objet plus longtemps.\n\nVotre puret d\esprit vous suffira peut-tre  rester hermtique aux tnbres qu\il renferme. Je vous en prie, $n, prenez-le avec vous. Protgez cette tincelle de puret qui brille encore et aidez-la  se librer de la magie noire qui l\entrave.', '', '', '', '', '', '', 57534),
(81909, 'frFR', 'Le pouvoir absolu', 'Parlez de la destruction de la poudrire avec Ct\nak.', 'L\aura malfique de cet objet dpasse de trs loin mes attentes. Je sens le pouvoir monter en moi.\n\nNous devons en tudier les mystres.\n\nMais il ne serait pas prudent d\en discuter ouvertement. Suivez-moi  l\intrieur, nous pourrons y poursuivre notre rflexion.', '', '', '', '', '', 'Apportez la poudrire rcupre  Raen Aubecavalyr  Sainte-Chute pour la dtruire.', 57534),
(81908, 'frFR', 'Une flamme dans l\obscurit', 'Fouillez diffrents conteneurs dans le donjon de l\Abme pour rassembler $3oapoudrires non identifies et la poudrire corrompue d\Aelric.', 'Dans la Transformacie se trouve la poudrire qui aurait appartenu  feu Aelric Leid.\n\nL\objet dborde d\une nergie puissante et corruptrice. Beaucoup de Nrubiens ont dj t altrs par sa prsence immdiate.\n\nVotre tche consiste  la rcuprer et  me l\apporter. Pour ne courir aucun risque, prenez toutes les poudrires que vous trouverez: nous les dtruirons toutes, par prcaution.', '', '', '', '', '', 'Retournez voir Ct\nak aux Terriers d\Azj-Kahet.', 57534),
(81906, 'frFR', 'Des murmures dans la toile', 'Retrouvez Ct\nak dans les Terriers d\Azj-Kahet.', 'H! Oh!\n\n<La jeune fille agite les bras pour vous faire signe. Vous remarquez dans sa main un papier froiss.>\n\nVous n\allez pas me croire, mais j\ai trouv un petit chiot trop mignon! Avec une clochette! Autour du cou!\n\nIl m\a donn ceci, c\est pour vous. Prenez-le vite: moi, je retourne jouer avec le petit chien!\n\n<La missive, rdige dans une criture fine et lgante, rclame votre venue  Azj-Kahet.>', '', '', '', '', '', '', 57534),
(81896, 'frFR', 'Revu et amlior', 'Acceptez la poudrire amliore de Kuldas.', 'J\ai termin les modifications. Je dois dire qu\il s\agit de l\une de mes plus belles ralisations!\n\nMalgr sa conception modeste, un peu d\huile de rouage et de poussire de coude l\ont transforme en un appareil que mme les adorateurs de la flamme les plus hostiles pourraient admirer.\n\nSi l\un d\entre eux veut en savoir plus, qu\il me contacte.', '', '', '', '', '', '', 57534),
(81890, 'frFR', 'Commandes en souffrance', 'Retrouvez Sum\latha au quartier Soyeux.', 'Il parat que le quartier Soyeux subit les dprdations d\un groupe de personnes sublimes appel les Cingletrames ples.\n\nCe nouveau quartier devait offrir un nouveau dpart aux habitants et habitantes de la capitale,  en croire la reine. Au lieu de cela, elle s\en sert pour resserrer son emprise sur les personnes dont elle se mfie.\n\nAllez voir mon assistante Sum\latha. Je l\ai envoye collecter des renseignements. Elle pourra vous expliquer tous les dtails.', '', '', '', '', '', 'Retrouvez Sum\latha au quartier Soyeux.', 57534),
(81889, 'frFR', 'Terra incognita', 'Parlez  Chromie.', 'Bonjour. Je suis l\ambassadeur Gardenoire.\n\nC\est un honneur de vous accueillir  Orgrimmar, $r.\n\n<Il sourit d\un air peu convaincu.>\n\nDe nombreuses aventures vous attendent, recevez donc l\assurance de Rah\n\nVous savez quoi? Je n\ai pas arrt de rpter ce maudit discours d\accueil toute la journe. J\en ai assez!\n\nAllez parler  Chromie sur son sablier et ensuite,  votre missaire. Ouste!', '', '', '', '', '', '', 57534),
(81888, 'frFR', 'Pour la Horde', 'Allez voir l\ambassadeur Gardenoire  l\ambassade  Orgrimmar.', 'Pour la premire fois de notre histoire, nous voil libres de dcouvrir et d\explorer le monde extrieur.\n\nUne faction venue de loin appele la Horde est venue sauver notre peuple. Puissante et spirituelle, l\honorable Horde nous ouvre ses bras.\n\nN\avez-vous pas envie d\aller plus loin que tous les Terrestres avant vous? D\arpenter leurs terres, d\apprendre leurs chansons et de connatre leur peuple?\n\nSi vous embrassez ce destin, j\espre que vous reviendrez partager vos expriences afin de montrer aux Terrestres tout ce que le monde a  offrir.', '', '', '', '', '', 'Allez voir l\ambassadeur Gardenoire  l\Ambassade,  Orgrimmar.', 57534),
(81887, 'frFR', 'Terra incognita', 'Parlez  Chromie  Hurlevent.', 'Bienvenue  Hurlevent, $r! Je vous invite  dcouvrir notre jolie ville. Dites, vous tes du genre  apprcier la belle maonnerie, je me trompe? Nous avons de nombreux btiments de pierre trs impressionnants, et de belles murailles.\n\nMais tout cela peut attendre. Une Dragonne de bronze a demand  vous parler. Vous la trouverez assise sous l\arbre juste  ct, et sur un sablier, trs bizarrement!\n\nAprs a, votre missaire attendra pour vous accueillir en ville. On peut dire que vous avez du pain sur la planche!\n\nJe vous souhaite un excellent sjour, $n!', '', '', '', '', '', '', 57534),
(81886, 'frFR', 'Pour l\Alliance', 'Allez voir l\ambassadeur Mauregarde  l\ambassade,  Hurlevent.', 'Pour la premire fois de notre histoire, nous voil libres de dcouvrir et d\explorer le monde extrieur.\n\nUne faction venue de loin appele l\Alliance est venue sauver notre peuple. Sage et vaillante, la fidle Alliance nous tend la main.\n\nSerez-vous parmi les premiers et premires  visiter leurs terres, couter leurs histoires et marcher parmi leur peuple?\n\nSi vous embrassez ce destin, j\espre que vous reviendrez partager vos expriences afin de montrer aux Terrestres tout ce que le monde a  offrir.', '', '', '', '', '', 'Allez voir l\ambassadeur Mauregarde  l\ambassade,  Hurlevent.', 57534),
(81869, 'frFR', 'Du miel aux flammes', 'Collectez $1oachantillons de miel-feu pur auprs des bourdons surchargs  Cendreplateau.', 'Crer  partir de flammes ncessite un combustible capable de produire un feu pur et durable. Parmi ces combustibles, le miel cr par les abeilles de Braiselande se distingue tout particulirement! Une source de feu lmentaire, saine et biologique.\n\nJ\ai toujours voulu me procurer ce miel, mais je n\en ai jamais eu l\occasion.\n\nPrenez mon rcolteur et rcuprez-en une certaine quantit pour notre usage. Nous en imprgnerons votre poudrire. Faites preuve de prudence, car il y a des Terrestres qui vnrent ces abeilles comme des cratures sacres.', '', '', '', '', '', '', 57534),
