(81798, 'frFR', 'Retourner voir Moira', 'Retournez voir Moira dans les Ouvrages terrestres.', 'La mandataire Brinthe fait preuve d\une impulsivit excessive.\n\nVous feriez mieux de retourner auprs de vos camarades et de leur faire part de ses intentions!', '', '', '', '', '', '', 57534),
(81797, 'frFR', 'Reconnaissance cible', 'Tuez trois sculptombres kobyss  la grve Sans-Soleil.', 'Si vous avez pass un peu de temps  Sainte-Chute, vous avez sans doute crois l\immonde magie des Kobyss. Les opinions divergent au sein de l\arme arathie au sujet de l\volution de leurs illusions.\n\nUn point de vue externe comme le vtre tombe  pic. Rendez-vous jusqu\ la grve Sans-Soleil, tuez quelques-uns de leurs assassins illusoires, puis revenez me voir. Vous les trouverez sans doute tapis dans l\obscurit.', '', '', '', '', '', '', 57534),
(81795, 'frFR', 'tincelles de la guerre: Sainte-Chute', 'Obtenez $1oatincelles de guerre  Sainte-Chute en mode Guerre.', 'La lumire ici-bas est capricieuse, mais elle vous sauvera des tnbres si vous parvenez  l\apprivoiser.\n\nAllez-y. Faites route vers Sainte-Chute et prtez votre force au peuple arathi.', '', '', '', '', '', 'Parlez  Ruffio  Dornogal.', 57534),
(81793, 'frFR', 'tincelles de la guerre: le de Dorn', 'Obtenez $1oatincelles de guerre sur l\le de Dorn en mode Guerre.', 'De puissantes cratures font des ravages sur l\le de Dorn.\n\nAllez-y et dlogez-les!', '', '', '', '', '', 'Parlez  Ruffio  Dornogal.', 57534),
(81751, 'frFR', 'Feu et gemme', 'Obtenez un rouage veill lors de l\veil de la machine et une gemme retentissante en flairant avec une taupe.', 'Qu\est-ce que c\est? Une poudrire?\n\nJ\ai entendu parler de cet engin arathi, mais c\est la premire fois que j\en tiens un dans mes mains. Je l\aurais imagin plus grand que a\n\nUne version amliore, dites-vous? Ha! C\est dans nos cordes. La prochaine fois que nous rveillerons la Machine, cherchez un rouage veill. Oh, et pendant que vous flairez, essayez de poser votre truffe sur une gemme rsonnante, nous en aurons bien besoin! Rongetout devrait pouvoir vous indiquer la bonne direction.', '', '', '', '', '', '', 57534),
(81750, 'frFR', 'Culture de nuages', '', '', '', '', '', '', '', '', 57534),
