(81713, 'frFR', 'Limondius', 'Tuez $1oageles et Limondius.', 'J\ai essay de ramener Lisky moi-mme, mais elle s\est enfuie au fond de la grotte. Toute cette zone est envahie par des vers rpugnants.\n\nEt comme si ce n\tait pas assez, tout au fond, il y a une crature si ignoble, si visqueuse et si gluante que j\ai pris mes jambes  mon cou!\n\nNon, je ne suis pas fier d\avoir abandonn ma Lisky. J\tais sur le point de rassembler le courage ncessaire pour y retourner quand vous tes $garriv:arrive;. Profitez-en pour liminer les choses rpugnantes qui se trouvent l-dedans! Je suis sr qu\elles se multiplient!', '', 'Une masse glatineuse chancelante, o flottent des os et des bouts de chair en dcomposition.', 'Limondius', '', '', '', 57534),
(81712, 'frFR', 'C\est l que a pche', 'Sauvez Lisky de la grotte.', 'Hrandaz va devoir attendre. Ma Lisky bien-aime a disparu! Elle est entre dans cette grotte et n\en est pas ressortie. Cette odeur nausabonde a d attirer son attention.\n\nJe vous en prie, entrez et trouvez ma Lisky. Elle n\a pas encore attir l\attention des horribles cratures  l\intrieur, mais ce n\est qu\une question de temps!', '', '', '', '', '', '', 57534),
(81710, 'frFR', 'Hydromel pour l\inventaire', '', '', '', '', '', '', '', '', 57534),
(81693, 'frFR', 'Recherche dsespre de Skorthuz', 'Partez  la recherche de Skorthuz vers le repaire Cliquetant.', 'Hein? Qui tes-vous? Oh c\est vrai, j\ai entendu dire que de nouvelles ttes sont apparues dans le coin.\n\nVous vous dirigez vers le nord? Si c\est le cas, essayez de reprer mon ami, Skorthuz, voulez-vous? Ce tranard aurait d revenir il y a une heure, mais il est introuvable. On m\a dit qu\il se dirigeait vers le repaire Cliquetant pour une raison obscure.\n\nSi vous le voyez, dites-lui de se dpcher et de revenir ici, ou je vais picoler tout seul!', '', '', '', '', '', 'Partez  la recherche de Skorthuz vers le repaire Cliquetant.', 57534),
(81692, 'frFR', 'Flamme intrieure', 'Demandez l\aide du mandataire Kuldas  Gundargaz.', 'Si vous allumez la poudrire, elle cre une flamme qui incarne l\essence de la vie de celui ou celle qui la porte. C\est un vritable reflet de votre force et de votre dtermination.\n\nAu cours de vos voyages, ceux et celles que vous avez rencontrs nous ont aids  fabriquer une poudrire capable de produire une flamme digne de votre incroyable courage.\n\nAllez demander l\aide du mandataire Kuldas  Gundargaz. La connaissance des Terrestres permettra de crer une poudrire plus puissante encore.', '', '', '', '', '', 'Demandez l\aide du mandataire Kuldas  Gundargaz.', 57534),
(81691, 'frFR', 'Mission spciale: ombres souterraines', '', '', '', '', '', '', '', '', 57534),
(81690, 'frFR', 'La lumire au bout du tunnel', 'chappez-vous du berceau de Sombre-Combe avec Faerin et Anduin.', 'Je n\avais encore jamais vu d\ombres d\une telle profondeur. D\une telle cruaut. \n\nOn dirait presque qu\elles essaient de nous attraper. \n\n<Faerin est parcourue d\un frisson.>\n\nNe restons pas l.', '', '', '', '', '', 'Parlez  Alleria  l\entre du berceau de Sombre-Combe.', 57534),
(81689, 'frFR', 'Orientation: Gundargaz', 'Retrouvez le cireur Squick  Gundargaz.', 'Nos nouveaux amis kobolds s\installent dans Gundargaz. Ils ont ramen un peu de tout ce qu\ils avaient trouv du ct des abmes Retentissants.\n\nVous feriez bien de parler  leur intendant! Allez donc voir ce qu\ils ont pu collecter et nous verrons ensuite comment procder.\n\nJ\ai entendu dire qu\Anduin se trouvait dans les environs. Il a sans doute dj des projets en tte pour Sainte-Chute. Nous aurons besoin d\autant d\alliances que possible face aux Nrubiens.', '', '', '', '', '', '', 57534),
(81688, 'frFR', 'Couper le fil', 'Remettez la soie tisse de secrets  la Tisserande dans son repaire.', 'Il sera intressant d\assister  la suite des vnements Mais connaissant la Tisserande, je m\attends  ce qu\elle tire quelques ficelles pour retourner la situation en sa faveur.\n\nC\est le secret que je cherchais  lui transmettre lorsque la situation a commenc  dgnrer. Pourquoi ne pas lui en faire part vous-mme, pour lui signifier la russite de votre mission?\n\nElle sera sans doute ravie de savoir qu\elle a toujours des yeux  Rak-Ahat.', '', '', '', '', '', '', 57534),
(81687, 'frFR', 'Je ne peux plus vous voir en teinture', 'Tuez $1oaNrubiens de la teinturerie avec les pouvoirs confrs par les bains de teinture amliors.', 'Je m\imaginais qu\en les montant l\un contre l\autre, je pourrais agir dans l\ombre, mais ce conflit a plong tout Rak-Ahat dans le chaos! C\est dsormais notre opration tout entire qui est en pril!\n\nVous avez entendu ce qu\a dit Antourix: elle a dj augment les bains de teinture grce aux composants que vous avez rcuprs. Je ne sais pas ce qu\elle mijote, mais si jamais elle prvoit de les utiliser contre Ren\Khat Je ne vois pas pourquoi vous ne pourriez pas en faire de mme pour liminer ses sbires.\n\nEssayez ces bains de teinture, et voyons s\ils peuvent nettoyer la teinturerie de cette vermine!', '', '', '', '', '', 'Rejoignez Teth  l\entre de Rak-Ahat.', 57534);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(81686, 'frFR', 'Soyeux subterfuge', 'Rejoignez Teth  Rak-Ahat.', 'J\attends une cargaison de soie. Elle n\est toujours pas arrive et cela m\inquite.\n\nL\immense majorit de la soie d\Azj-Kahet, du fil le plus subtil  la soie guerrire la plus rsistante, provient de Rak-Ahat. Cela fait de cet endroit le canal idal pour faire circuler des informations confidentielles.\n\nL\une de mes espionnes me fait parvenir des secrets militaires tisss au sein mme de la soie. Elle m\a rcemment fait tat d\un conflit de pouvoir mergent  Rak-Ahat Mais depuis, plus de nouvelles.\n\nAllez  sa rencontre et assurez-vous que ce retard ne se reproduise pas.', '', '', '', '', '', 'Rejoignez Teth  Rak-Ahat.', 57534),
(81685, 'frFR', 'Prochain matre teinturier d\Azj-Kahet', 'Tuez Ren\khat et la grande surfileuse Antourix.', 'Ren\khat et la surfileuse se battent dans la filire. Ils sont seuls, aucun tmoin pour entendre le fracas des pinces et des griffes.\n\nVoil notre ouverture. Si jamais aucun des deux n\en sortait vivant Avec les seconds d\Antourix envoys ad patres et le gratin de Rak-Ahat en droute, la personne la plus  mme de diriger serait probablement la responsable de la caravane. Autrement dit, moi.\n\nJe ne suis pas du genre  tirer la couverture  moi, mais notre entreprise secrte serait la grande gagnante d\un combat fatal aux deux belligrants.', '', 'Ren\khat et la surfileuse en sont venus aux mains. Achevez-les!', 'Ren\khat et la surfileuse', '', '', 'Rejoignez Teth  l\entre de Rak-Ahat.', 57534),
(81683, 'frFR', 'Soyeuse collection de printemps', 'Collectez $1oacatalyseurs rcuprs, $2oachantillons de sve d\trangleur lumineuse, $3oaptales aveugles et $4oacochenilles rampantes.', 'Cet asticot de Ren\khat veut prendre ma place, n\est-ce pas? Qu\il essaie donc.\n\nTous les rsidus de nos productions se dversent dans la source qui passe en contrebas de Rak-Ahat: des dcennies de catalyseurs, de mordants de teinture et de dcoctions alchimiques ont fini par y former quelque chose de trs costaud.\n\nN\ayez pas peur des effets secondaires. Apportez-moi simplement un panel de ces teintures et je vous prparerai des couleurs capables de vous faire pousser une deuxime paire de gambettes.', '', '', '', '', '', 'Retournez voir la grande surfileuse Antourix  la filire de Rak-Ahat.', 57534),
(81675, 'frFR', 'Abreuver les moutons', '', '', '', '', '', '', '', '', 57534),
(81673, 'frFR', 'Des efforts rcompenss', 'Acceptez l\honneur de recevoir une poudrire de Sainte-Chute.', 'Bien que je ne sois que d\un rang modeste, je vous dcerne cet honneur: une poudrire qui symbolise les liens d\amiti qui vous lient  cette expdition ainsi que l\estime que vous porte Sainte-Chute. \n\nSi vous veniez  tomber au combat, votre poudrire serait place auprs des autres grands hros et hrones morts pour dfendre ces terres.\n\nJ\espre que vous accepterez cet honneur.', '', '', '', '', '', '', 57534),
(81672, 'frFR', 'Une pince de rancune', 'Tuez Smaragthr.', 'Je pense que je dois vous expliquer clairement pourquoi je vous ai demand de rassembler cette viande.\n\nLa vrit, c\est qu\une horrible bte hante le dsert. Un monstre se nourrissant des personnes imprudentes. Ses tenailles peuvent transpercer la roche et les os comme un couteau traverse du beurre tide.\n\nSon nom est Smaragthr, et c\est  cause de cette salet que je n\ai plus qu\un il et que mes pierres prcieuses sont fles. Je ne suis pas de taille  l\affronter, mais vous vous pourriez me venger.\n\nAbattez Smaragthr pour librer le dsert!', '', 'Les pinces acres et dvastatrices rsonnent violemment, mais il faut surtout se mfier de la queue venimeuse de Smaragthr.', 'Smaragthr', '', '', '', 57534),
(81671, 'frFR', 'UNUSED [DNT]', 'Trouvez la vraie taupe dans le bureau de la surfileuse.', '<C\est un nouveau message cod qui ne vient pas de l\Arriviste! Il doit provenir du bureau de la Coupeuse en chef c\est peut-tre elle qui envoie les messages, aprs tout?>', '', '', '', '', '', '', 57534),
(81670, 'frFR', 'Soyeux saccage', 'Remplir la barre TOUT dtruire, tuer TOUT LE MONDE', 'Rien de tel pour attirer l\attention de la Coupeuse en chef et perturber ses oprations que de dtruire son quipement! Allez tout saccager, pour faire passer clairement le message.', '', '', '', '', '', '', 57534),
(81669, 'frFR', 'Btons et ossements', 'Brlez $1oanids de flagelleurs des profondeurs.', 'Contrairement aux krolusks qui aiment attaquer par en dessous, le dsert Grondant hberge galement un prdateur qui prfre attaquer d\en haut. Les flagelleurs des profondeurs ont construit des nids sur les sommets et les crtes qui entourent le dsert.\n\nDtruisez ces nids et montrez-leur qu\ils ne sont pas les bienvenus ici.', '', '', '', '', '', '', 57534),
(81668, 'frFR', 'Mesurer une fois, couper trois fois', 'Tuez le plie-toile Tath\rhiz, l\arrache-coutures Zhir\ix et la colorimancienne Nirethi.', 'Lorsque j\ai quitt la ville pour Rak-Ahat, on m\avait promis un poste de prestige,  l\importance capitale, que l\on me jalouserait.\n\nPersonne ne me jalousera ce travail  l\entrept, sans aucune importance et encore moins de prestige.\n\nLa grande surfileuse Antourix est au pouvoir depuis bien trop longtemps dj. Elle ne comprend rien  mon projet. Tout ce qu\elle veut, ce sont des bourdons qui font ce qu\elle demande, comme elle le demande.\n\nEnlevez-lui ses travailleuses et travailleurs les plus loyaux, et nous verrons comment elle s\en sortira lorsque je serai  la tte de la teinturerie.', '', '', '', '', '', 'Retournez voir Ren\khat  la filire de Rak-Ahat.', 57534),
(81667, 'frFR', 'L\arriviste', 'Offrez vos services  Ren\kha contre la grande surfileuse Antourix.', 'Vous tes la tierce personne indpendante de la Tisserande? Excellent. Vous tes un catalyseur parfait pour un coup d\tat.\n\nLa cit des Fils a envoy un arriviste ici pour prendre le contrle de Rak-Ahat. \n\nLa venue de Ren\khat vient tout chambouler. Il se prsente comme une sorte de visionnaire de la soie originaire de la mtropole et remet en cause l\autorit de la Surfileuse qui a refus de cder le contrle.\n\nLe malheur des uns fait le bonheur des autres. Alors, parlez  Ren\khat et alimentez son ambition. Aidez-le  lutter contre la surfileuse.', '', '', '', '', '', '', 57534),
(81661, 'frFR', 'Vers la cime plore', 'Retrouvez Urtago  l\avant-poste de Bordechute.', 'Bonjour, $gtranger:trangre;. Je m\appelle Urtago, et je suis l\apprentie du gardien Korgran au mmorial de la cime plore.\n\nCes petits malins de Kobolds brle-bougie ont envahi la cime plore et nous cherchons de l\aide. Pouvez-vous me rejoindre  l\avant-poste de Bordechute? Vous le trouverez au nord d\ici. Je vous en dirai plus sur place.', '', '', '', '', '', '', 57534),
(81655, 'frFR', 'Pice de viande juteuse de krolusk', 'Rcuprez $1oapices de viande de krolusk.', 'Salutations! Je m\appelle Kagfritha. J\tais autrefois superviseuse de site pour les oprations dans le dsert Grondant, au sud d\ici. Mais le temps a eu raison de nos activits et nous avons d abandonner la rgion.\n\nLe moment est venu de reprendre le travail, mais pendant notre absence, des cratures peu recommandables ont investi les lieux. J\ai un plan pour m\occuper des plus nuisibles d\entre elles, mais d\abord, il nous faut un appt.\n\nSi vous voulez nous aider, allez chasser ces krolusks qui aiment plonger dans la poussire et rapportez-moi leur viande.', '', '', '', '', '', '', 57534),
