(81632, 'frFR', 'Lzards pillards', 'Tuez Nauscailles et rcuprez $1oafournitures de campement.', 'Malgr le chtiment que reprsente notre affectation ici, la vie n\est pas entirement dplaisante. La capitaine Lancekat nous a laiss des provisions gnreuses. \n\nEnfin, c\tait le cas il y a peu. Un gros lzard est parti avec!\n\nVous pourriez rcuprer les fournitures de campement et vous occuper de ce chapardeur?', '', 'Ce lzard a imprgn de sa puanteur toute la cte, laissant un souvenir pestilentiel de sa prsence.', 'Nauscailles', '', '', '', 57534),
