(81613, 'frFR', 'Ne l\inquitons pas', 'Retournez voir Haimaz  la halte d\Ombreveine.', 'Bon, nous ferions mieux de retourner voir Haimaz avant qu\elle ne se doute de quelque chose.\n\nS\il vous plat, ne lui dites rien. Son devoir est de me guider et de me protger dans mon rle de compilateur.\n\nSi elle savait que je prvoyais de partir je ne sais pas comment elle ragirait.', '', '', '', '', '', '', 57534),
(81596, 'frFR', 'Exploration des Gouffres', 'Apprenez-en davantage au sujet de Zekvir, Main de la messagre.', 'Plusieurs membres de l\exploration sont revenus en piteux tat des Gouffres. Ils font mention d\un terrible monstre rpondant au nom de Zekvir.\n\nVous avez peut-tre entendu parler de cette crature? Permettez-moi de vous en dire plus sur ce que nous avons appris.', '', '', '', '', '', 'Parlez  Brann Barbe-de-Bronze dans le quartier gnral des archologues.', 57534),
(81595, 'frFR', 'Dbut de la saison', 'Voir les rcompenses proposes par Reno Jackson, Sir Finley Mrrgglton et le Guide du Gouffre.', 'Nous avons dcouvert une multitude de nouveaux trsors  aller chercher dans les Gouffres!\n\nNe perdons pas de temps: je vais vous expliquer les bases, et en piste!', '', '', '', '', '', '', 57534),
(81593, 'frFR', 'Potentiel maximal', 'Aidez Brann Barbe-de-Bronze  atteindre le niveau10.', 'On a du pain sur la planche avec le Gouffre. On va devoir devenir plus balaises si on veut s\attaquer  tout ce qu\il y a l-dedans!', '', '', '', '', '', '', 57534),
(81574, 'frFR', 'Croissance sporadique', 'Tuez Tristepousse et $1oacroissances crpusculaires avec la torche de patrouille.', 'Les croissances fongiques continuent de se rpandre librement depuis la grotte de Mycomancie voisine. Le dernier afflux a fait dtaler mes recrues.\n\nJ\ai un besoin urgent de votre aide pour endiguer une croissance fongique particulirement inquitante.\n\nPrenez ma torche de patrouille et radiquez Tristepousse et les croissances avoisinantes qui en dpendent. La torche devrait se charger des plus petites, mais Tristepousse demandera une approche plus directe.', '', 'Laiss sans surveillance, ce champignon s\est rpandu  une vitesse alarmante.', 'Tristepousse', '', '', '', 57534),
