(81559, 'frFR', 'Traque de brume', 'Aidez Noli  trouver l\origine des btes de brume grce  sa technique de pistage.', 'En attachant les traceurs, nous devrions pouvoir dcouvrir la provenance des btes de brume. Les traceurs laissent un dpt dans l\air. Il est invisible  l\il nu, mais je peux utiliser la brume pour rvler sa prsence l o sa concentration est suffisamment leve.\n\nThoriquement, cette dmarche devrait nous mener aux endroits qu\ils frquentent le plus. Peut-tre qu\il existe un nid! Il faudra que je fasse un rapport  mon employeur hum.\n\nEnfin bref. Voyons ce qui nous attend.', '', '', '', '', '', '', 57534),
(81558, 'frFR', 'Prdateurs contre-nature', 'Tuez les flagelleurs des profondeurs.', 'Rien ne sert de marquer les btes de brume pour les tudier si elles venaient  toutes prir, n\est-ce pas?\n\nPourriez-vous liminer certains des flagelleurs des profondeurs? Ces cratures hostiles se rgalent des btes de brume.\n\nSi on ne les neutralise pas rapidement, ils dtruiront mes donnes, j\en ai bien peur.', '', '', '', '', '', '', 57534),
(81557, 'frFR', 'tiquettes  brume', 'Attachez des traceurs aux btes de brume  l\intrieur et autour de Taelloch.', 'En attendant d\analyser ces chantillons de brouillard, j\ai une autre tche  vous proposer.\n\nLes gens qui m\emploient m\ont demand de dterminer l\origine de ces btes de brume. J\ai donc mis au point ces traceurs. Si vous le permettez, attachez-les  un groupe de btes de brume. \n\nVous devrez vous en approcher, alors faites attention. Avec un peu de chance, elles ne s\intresseront pas  vous.', '', '', '', '', '', '', 57534),
(81556, 'frFR', 'Brume trangre', 'Placez le collecteur de brume et prlevez des chantillons dans diffrentes zones occupes par des btes de brume.', 'C\est un plaisir de vous rencontrer, $gaventurier:aventurire;. Je me demande si vous accepteriez de m\aider pour des recherches.\n\nVous avez d remarquer les btes de brume qui commencent  s\inviter dans la rgion.\n\nLes gens les considrent comme un mauvais prsage, elles apparaissent toujours pendant des priodes de dsquilibre cologique. Mais je ne suis pas d\accord avec eux. \n\ntant experte de toutes les magies qui touchent  la vapeur, on m\a engage pour dcouvrir d\o elles viennent, afin de les arrter  la source.', '', '', '', '', '', '', 57534),
