(81514, 'frFR', 'Gouffres abondants', 'Terminez des expditions spciales, des activits ou des qutes hebdomadaires pour rcuprer une cl de coffret rpare ou des fragments de cl de coffret afin de dverrouiller le coffre d\un Gouffre abondant.', 'Nous aurons besoin d\normment de ressources pour repousser Xal\atath. Vous avez de la chance: on vient d\en dcouvrir!\n\nOn a mis la main sur des Gouffres particulirement juteux, autant vous dire qu\ils regorgent de trsors. Toutefois, ces trsors ne peuvent tre ouverts qu\avec des cls spciales que l\on ne trouve qu\en Khaz Algar.\n\nCes cls et fragments de cls se trouvent un peu partout. Quand vous en aurez trouv assez, vous pourrez vous faire un de ces Gouffres abondants et faire fortune!', '', '', '', '', '', '', 57534),
(81510, 'frFR', 'En livraison!', 'Parlez  Brann Barbe-de-Bronze.', 'Quelle prise! J\ai russi  donner un peu de ce qu\on a trouv  Dragan pour qu\il termine un de ses projets. Il devrait arriver sous peu.\n\nAssez tourn autour du pot, j\ai une surprise! Voici un cadeau pour vous aider  vous dplacer.', '', '', '', '', '', '', 57534),
