(80689, 'frFR', 'Au secours d\Ausgazur', 'Rencontrez Batzvara aux chutes des Brumes chatoyantes.', 'Les tches assignes ont t effectues! Je reviendrai voir ces personnes lors de ma prochaine patrouille.\n\nJe dois encore m\occuper d\un Terrestre aujourd\hui. Il tait Il est trs spcial  mes yeux.\n\nVous avez t $gun:une; collgue particulirement $gprvenant:prvenante;, aussi aimerais-je que vous le rencontriez. Allons un peu  l\ouest, vers les chutes.', '', '', '', '', '', 'Rencontrez Batzvara aux chutes des Brumes chatoyantes.', 57534),
