(80682, 'frFR', 'Une dernire histoire', 'Assistez  la rcitation.', 'C\est l\heure. Je ferai la rcitation  l\entre de la mine. Je vous invite  y assister, mais ne vous sentez pas $goblig:oblige; de rester toute la crmonie.\n\nJe laisse mon livre  Haimaz. Elle en prendra soin.\n\nAprs la crmonie, je voudrais vous dire au revoir en bonne et due forme. Retrouvez-moi prs du pont  l\extrieur de la ville. Je m\y rendrai aprs la rcitation.', '', '', '', '', '', '', 57534),
