(80678, 'frFR', 'Temps perdu', 'Trouvez $1oasouvenirs perdus.', 'Maintenant que vous avez termin, laissez-moi vous dire une chose:  chaque fois que je passe par ici, j\en profite pour regarder si des objets de valeur ne sont pas tombs des quais. Ces trucs-l ont tendance  s\parpiller quand on charge les navires. Parfois, les gens les balancent par superstition ou de colre, ou autre.\n\nMais certains de ces objets reclent des souvenirs, le genre de chose si prcieuse que les perdre, ce serait comme perdre un peu de votre cur. Je vous serais reconnaissante de m\aider  mettre la main dessus.', '', '', '', '', '', '', 57534),
(80677, 'frFR', 'Lumires incendiaires', 'Brlez $1oaufs de phalne.', 'On peut craser tout un tas de phalnes, mais si on ne s\occupe pas de leurs ufs, ils reviendront sans cesse. \n\nPrenez cette arme  feu et utilisez-la pour brler des ufs au sommet de la canope.', '', '', '', '', '', '', 57534),
(80676, 'frFR', 'Mmoire fragmentaire', 'Rcuprez les $2oapages manquantes du livre de Brennok.', 'J\ai fait le serment d\tre un compilateur. Je recueille et relate les histoires de notre peuple.\n\n<Brennok soupire.>\n\nLes rcits raconts par quelqu\un qui ne les a jamais vcus peuvent-ils inspirer la sagesse? Je n\ai jamais t un aventurier. J\ai eu peur de dnaturer les histoires qui m\ont t confies.\n\nJ\ai donc commenc  les transcrire dans un livre que j\ai cach ici. Chaque fois que nous repassons  la halte d\Ombreveine, je le complte.\n\nJe comptais partir et lguer le livre, mais mes scorpides l\ont saccag. S\il vous plat, trouvez les pages manquantes avant qu\ils ne les utilisent pour construire leurs nids!', '', '', '', '', '', '', 57534),
(80673, 'frFR', 'Sap comme un pouvantail', 'Tuez $1oaphalnes soit en les percutant en vol, soit de manire classique.', 'Salut.\n\nMacMag\ et moi, on se charge gnralement de dgager l\espace arien de cette zone, quand on passe par ici. Si on n\limine pas les phalnes, ils se rpandent jusqu\aux plateformes d\amarrage et pondent dans les mcanismes de nos vaisseaux.\n\nMalheureusement, avec le temps, on a un peu perdu en vivacit. Est-ce que vous pourriez nous donner un coup de main? Ces phalnes ne sont pas bien costauds, ils se feront craser par le moindre objet volant  grande vitesse. Sinon, vous pouvez toujours vous attaquer au problme  l\ancienne.', '', '', '', '', '', '', 57534),
(80672, 'frFR', 'La main du vizir', 'Poursuivez vos efforts pour aider le vizir  Azj-Kahet.', 'Le vizir s\emploie  tendre l\influence de notre clique jusqu\aux membres les plus fortuns du gratin azj-kaheti. Son poste l\empche toutefois de nous faire bnficier d\un soutien matriel.\n\nC\est l que vous entrez en jeu. Votre rputation croissante vous prcde: l o le vizir doit s\effacer, vous pouvez agir. Faites simplement attention  ne pas vous faire avaler, compris?', '', '', '', '', '', '', 57534),
(80671, 'frFR', 'La lame du gnral', 'Poursuivez vos efforts pour aider le gnral  Azj-Kahet.', 'Encore aujourd\hui, les forces du gnral Anub\azal uvrent sans relche  la scurit d\Azj-Kahet.\n\nL\influence d\Ansurek s\tend jusqu\aux moindres recoins de son domaine. Le gnral semble contester son autorit militaire. Si nous parvenons  lui couper les vivres, de nouvelles opportunits de frapper pourraient s\offrir  nous.', '', '', '', '', '', '', 57534),
(80670, 'frFR', 'Les yeux de la Tisserande', 'Poursuivez vos efforts pour aider la Tisserande  Azj-Kahet.', 'La Tisserande a une multitude d\yeux qui surveillent la ville, traquant dans ses moindres recoins ce qu\il y a  apprendre au sujet des machinations d\Ansurek.\n\nMais ce tissu d\espions ne sera pas suffisant pour inverser le rapport de force face aux Surekis. La Tisserande a besoin que quelqu\un se salisse un peu les mains.\n\nVous tombez  pic.', '', '', '', '', '', '', 57534),
(80593, 'frFR', 'Descendre des cendres', 'Remplissez un tonneau avec de l\hydromel Brassecendre.', 'Il reste une dernire chose  faire. Sans hydromel, la crmonie de rcitation ne serait pas digne de ce nom.\n\nMais le garde-foyer Zirc m\a dit que les dernires livraisons de Brassecendre n\taient pas encore arrives. Il semblerait que les corcheurs du dsert Grondant en raffolent et pillent les cargaisons.\n\nPrenez un tonneau de rechange. Voyez si vous pouvez en rcuprer suffisamment auprs des corcheurs.', '', '', '', '', '', '', 57534),
(80592, 'frFR', 'Forger un pacte', 'Choisissez un pacte des Fils tranchs.', 'Je vous propose de renouveler votre pacte.\n\nN\oubliez pas, vous ne pouvez conclure de pacte qu\avec un des Fils tranchs  la fois. Ces contrats sont temporaires, cela dit, vous aurez donc l\opportunit de faire vos preuves auprs de chacun des trois.', '', '', '', '', '', '', 57534),
(80578, 'frFR', 'La tenue ordinaire', 'Trouvez des vtements de minage de rechange.', 'Je m\clipserai aprs la rcitation de l\histoire. Il n\est gure compliqu de se faire oublier au milieu d\une foule de Terrestres abreuvs de Brassecendre.\n\nMais nul ne doit me reconnatre. Personne ne doit m\arrter, ou pire, s\imaginer que je renonce  mon serment. Mieux vaut prendre la poudre d\escampette.\n\nSi vous pouviez me procurer des vtements de minage de rechange, je serais en mesure de m\enfuir sans me faire remarquer.', '', '', '', '', '', '', 57534),
(80577, 'frFR', 'Prparatifs de la rcitation', 'Prparez le site de rcitation.', 'Une fois par an, Brennok et moi prenons la longue route qui mne aux abmes Retentissants.\n\nNous nous arrtons  chaque avant-poste, et Brennok raconte aux rsidents une histoire de leur pass. Une histoire qu\ils lui ont confie. Pour qu\il s\en souvienne aprs qu\ils l\auront oublie. \n\nIl est de mon devoir de veiller  ce que le site de la crmonie soit prt. Voulez-vous m\accompagner? Votre assistance serait la bienvenue.', '', '', '', '', '', '', 57534),
(80576, 'frFR', 'Public perdu', 'Trouvez Brennok.', 'Une envie de tout faire sauter!\n\nBrennok et moi tions en route pour la halte d\Ombreveine, o nous devions conduire une crmonie de rcitation. Nous avons t attaqus par des scorpides. Maintenant, un dard de scorpide est log dans l\engrenage du transporteur, et Brennok a disparu.\n\nIl voulait se dgourdir les jambes pendant que je rparais le transporteur, mais je ne l\ai pas vu depuis un moment. J\ai besoin de ractiver le robot. Pouvez-vous partir  sa recherche?', '', '', '', '', '', '', 57534),
(80572, 'frFR', 'Mesures discordantes', 'Obtenez 50charges de Transfert vers l\Invisible et 3chantillons sur des adversaires d\lite qui ont disparu dans l\Invisible.\n\nEn plus de dtruire les extracteurs, vous pouvez galement obtenir des charges de Transfert vers l\Invisible en vous tenant dans des mares de Sang noir. Mais faites attention, car les charges se cumuleront alors rapidement.', 'Je ne peux pas regarder cela plus longtemps. Il me faut agir.\n\n$n.Vous avez dj survcu  l\Invisible. Maintenant, nous devons y aller ensemble. Je dois le voir de mes propres yeux si je veux me convaincre que ce lieu infme ne peut pas tre nettoy.\n\nNous tuerons tout ce que nous pourrons et nous chercherons une lueur d\espoir pour restaurer cette terre.', '', '', '', '', '', '', 57534),
(80571, 'frFR', 'Dchiffrer la cacophonie', 'Collectez $1oaessences discordantes sur des units adverses discordantes dans l\Invisible.', 'C\est bien pire que ce que je pensais. C\est  croire qu\ils alimentent la corruption, qu\ils l\encouragent. La dissonance est de plus en plus forte\n\n<Orweyna a l\air affecte, mais n\en reste pas moins dtermine.>\n\nJe n\entends plus que a. Ma tte va clater. J\ai J\ai besoin de voir  quel point cette terre est vraiment dvaste.\n\n$n. Ramenez-moi quelque chose de l\Invisible.', '', '', '', '', '', '', 57534),
(80570, 'frFR', 'Couper le flot', 'Dtruisez $1oaextracteurs.', 'Comprennent-ils au moins ce qu\ils font?\n\n<Orweyna grince des dents, elle grogne presque.>\n\nDtruisez autant d\extracteurs que possible. Brisez les bulbes, arrachez les membres, brlez les restes.\n\nNous ne pourrons pas tous les arrter en une simple journe, mais une session de destruction apaisera quelque peu mon courroux.', '', '', '', '', '', '', 57534),
(80569, 'frFR', 'Approche harmonieuse', 'Tuez le gardien de la rcolte Izk\tilak.', 'Je sais que je ne parviendrai pas  empcher Orweyna de descendre et rvler ainsi notre prsence.\n\nCependant nous pouvons peut-tre faire en sorte que l\information ne soit pas relaye.\n\nTrouvez qui est responsable de ce site de fouilles et faites le ncessaire pour que cette personne ne puisse pas passer le mot aux autres.', '', 'Un personnage important responsable de la rcolte de Sang noir. Tout ce qu\il remarque ici sera signal  sa hirarchie.', 'Gardien de la rcolte Izk\tilak', '', '', '', 57534),
(80568, 'frFR', 'Sans laisser de trace', 'Collectez $1oatraces magiques sur la faux de Hannan.', 'Je dois m\assurer qu\elle va bien. Ce que j\ai vu dans cette grotte Si elle est plus sensible  cette\n\n<Hannan retient un grognement.>\n\nMais elle sme la pagaille ici. Elle attire l\attention et laisse des traces qui mnent les trangers et trangres jusqu\ elle! Jusqu\ nous.\n\nNous sommes censs faire preuve de subtilit. Rester discrets, dans les broussailles. Nous cacher sous d\autres formes autant que possible.\n\nJ\aurais prfr ne pas avoir  vous demander a, mais pouvez-vous prendre ma faux et vous charger des preuves pendant que je m\occupe d\elle?', '', '', '', '', '', 'Retrouvez Orweyna dans les profondeurs Dmentielles.', 57534),
(80567, 'frFR', 'Le chant de la restauration', 'Utilisez l\instrument d\harmonisation.', '<Orweyna semble soulage  la vue de Hannan, mais demeure concentre sur sa tche.>\n\nJe ne peux pas dire que je sois surprise par vos dcouvertes dans cette grotte. Des Nrubiens coincs dans l\Invisible, pigs dans un royaume de monstres et de folie\n\nJe les plaindrais presque, mais ils l\ont cherch.\n\nVous, en revanche, devez faire machine arrire, pour viter que le Sang noir n\altre trop fortement votre esprit.', '', '', '', '', '', '', 57534),
(80566, 'frFR', 'Nos adversaires sont lgion', 'Trouvez et tuez les araignes.', '<Hannan semble incapable de rpondre et parat  peine tangible. Il s\est aventur bien plus profondment que vous dans l\Invisible.>\n\nDes cuves ont explos Puis les araignes sont arrives\n\nTuez-les Tuez les araignes!', '', '', '', '', '', 'Retrouvez Hannan et Orweyna  l\extrieur de la grotte du site de rcolte abandonn dans les caniveaux Saliens.', 57534),
(80565, 'frFR', 'Rpercussions pesantes', 'Retrouvez Hannan dans le site de rcolte abandonn  l\intrieur de la grotte.', 'Je n\avais pas l\intention de\n\n<Les yeux d\Orweyna se plissent.>\n\nAllez le chercher, $n. Vous avez galement t $gexpos:expose; au Sang noir. Mais Hannan en a absorb la plus grande partie.\n\nIl est entr dans l\Invisible. Aprs avoir t expos au Sang noir, son esprit s\est dplac dans un royaume au-del des limites de notre vision. Vous allez peut-tre devoir le rejoindre, o qu\il soit, pour le retrouver.\n\nJe vais activer l\instrument de purification nrubien pour votre retour.\n\nNe vous perdez pas dans cet tat altr.', '', '', '', '', '', '', 57534),
(80564, 'frFR', 'Recherches sur le terrain', 'Inspectez le site de rcolte de Sang noir.', 'Les Nrubiens rcoltent du Sang noir non loin d\ici.\n\nSi nous les laissons agir, la corruption cause par l\excavation des veines risque de s\tendre. Elle continuera de se rpandre jusqu\ tout consumer.\n\nJe n\ai pas l\intention de rester les bras croiss en attendant que les racines soient souilles. J\essaie d\apprendre et de comprendre leurs mthodes afin de frapper l o a fait mal.\n\nVous pouvez vous joindre  moi.\n\nSi, bien sr, vous souhaitez viter que votre monde ne se noie dans des mares de Sang noir.', '', '', '', '', '', '', 57534),
(80563, 'frFR', 'Outil d\harmonisation', 'Trouvez un cristal de rglage.', 'Les Nrubiens doivent avoir dcouvert un moyen de se purifier aprs avoir t exposs au Sang noir. Sinon, ils n\auraient jamais pu mener  bien leur rcolte avec tant de succs.\n\nPour ma part, je peux aisment m\ouvrir  l\harmonie de ce monde pour restaurer mon esprit et retrouver cette ralit. Mais Hannan et vous auriez tout intrt  vous approprier leur mthode miraculeuse.\n\nVous pouvez videmment faire sans si toutefois vous acceptez le risque de fractionner votre conscience entre deux ralits pour toujours.', '', '', '', '', '', '', 57534),
(80562, 'frFR', 'Dlice en fleurs', 'Cueillez $1oachampignons d\ternelle floraison dans la grotte de Mycomancie.', 'Peu d\adeptes de la lumire oseraient tenter de prparer le plat que je compte cuisiner. Un mlange d\pices impriales traditionnelles avec la rcolte interdite des floraisons fongiques locales.\n\nCe plat ravira les palais et rappellera l\un des esprits aventuriers qui avaient fond l\expdition de Sainte-Chute.\n\nRendez-vous dans la grotte de Mycomancie toute proche et rcoltez ce dont j\ai besoin.', '', '', '', '', '', '', 57534),
(80558, 'frFR', 'KapitalTrankil', 'Dcouvrez tout ce que vous pouvez sur les Gobelins de Mmarl.', 'Ces Flairans sont ici depuis longtemps, assez longtemps pour construire un village et tablir des relations commerciales avec les Nrubiens. Certains d\entre eux sont mme capables de commercer dans la grande ville nrubienne!\n\nMais les Gobelins? Ils viennent de la KapitalRisk. Pas tonnant que le gnral Anub\azal se soit montr sceptique  mon gard, s\il a l\habitude de faire affaire avec eux.\n\nQue font-ils ici? Essayons d\en savoir plus sur ce qui les a conduits ici.', '', '', '', '', '', '', 57534),
(80517, 'frFR', 'Retour au point de dpart', 'Retrouvez Brinthe et Dagran devant la golemerie des Forge-Profonde.', '<Zed-Zed est prte  retourner  la golemerie des Forge-Profonde.>', '', '', '', '', '', '', 57534),
(80516, 'frFR', 'Changement de direction', 'Tuez boss Fouette-Moustache.', 'Cette Kobold connat son affaire. Scrit dit que boss Fouette-Moustache dispose de son propre groupe d\araignes dans une grotte avoisinante. Ne vous inquitez pas, je m\occupe de mener la charge.\n\nAllez, on a un chef  abattre.', '', 'Certains Kobolds savent entendre raison. D\autres sont sensibles aux menaces. D\autres encore ne respectent que les btons pointus.', 'Boss Fouette-Moustache', '', '', '', 57534),
(80515, 'frFR', 'Et que a brille', 'Librez les mouches-bougies et recueillez leur luminescence.', 'Moi dtester admettre, mais bruyant Terrestre avoir raison. Boss Fouette-Moustache avoir insectes plus puissants. Mais tous avoir faiblesses.\n\nAraignes avoir peur lumire, et ami  nous trs brillant. Si nous rendre plus brillant, aucune araigne vouloir combattre.\n\nGang Boudecroc capturer beaucoup mouches-bougies. Librez insectes, utilisez poussire tincelante. Nous faire grand Terrestre grande source lumire!', '', '', '', '', '', '', 57534),
(80514, 'frFR', 'La cavale de Berrund!', 'Escortez Berrund hors du camp.', 'Vous bien travailler. Eux vous laisser maintenant entrer dans arne pour combattre Terrestre. Vous entrer quand vous tre $gprt:prte;. Bougies Cendre-boum pouvoir se consumer vite.\n\nMoi retourner au camp. Retrouver vous l-bas, vous et Terrestre.\n\nVous bonne personne. Pas mourir.', '', '', '', '', '', '', 57534),
(80513, 'frFR', 'Un groin de sabotage', 'Placez des bougies Cendre-boum et relchez des insectes.', 'Vous avoir besoin bonne diversion pour faire sortir Terrestre. Moi, besoin d\arrter gang Boudecroc. Possder ncessaire pour deux.\n\nImbcile mlanger Brassecendre avec cire bougie dans Ddales. Bougies brlent normalement, puis boum. Gros boum. Placez bougies autour camp. Explosions faire parfaite diversion pour fuite.\n\nProfitez occasion pour relcher insectes. Laissez gang Boudecroc dcouvrir comment insectes pouvoir tre trs effrayants.', '', '', '', '', '', '', 57534),
(80512, 'frFR', 'Mieux que les meilleurs', 'Vainquez les dresseurs d\insectes.', 'Si gang Boudecroc gagner, Terrestre premier de beaucoup captifs. Nous devoir librer lui.\n\nLui avoir valeur. Tous Kobolds ici vouloir combattre. Nous devoir gagner notre place.\n\nVous battre insectes puissants, et eux considrer moi comme entraneuse forte. Puis eux vous laisser participer combat.\n\nQue gagne meilleur insecte.', '', '', '', '', '', '', 57534),
(80511, 'frFR', 'Reprage au camp', 'Inspectez le camp du gang Boudecroc.', 'Maintenant, nous emmener vous au camp. Vous voir quoi boss Fouette-Moustache faire. Mettre dguisement insecte lorsque nous proches du camp. Vous laisser moi parler.', '', '', '', '', '', '', 57534),
(80510, 'frFR', 'Soigner la source', 'Retirez $1oamorceaux de ferraille cireuse.', 'Gang Boudecroc gaspiller beaucoup! Beaucoup ferraille dans l\eau. Mauvais pour eau. Mauvais pour ferraille. Vous aller nettoyer.', '', '', '', '', '', '', 57534),
(80509, 'frFR', 'Tenue en gele', 'Collectez $1oacires collantes des suintements cireux et des sautilleurs cireux.', 'Gang Boudecroc pas laisser vous entrer dans camp dans cette tenue. Devoir se dguiser. Se faire passer pour insecte, et ensuite entrer.\n\nD\abord, prvoir cire. Il y a beaucoup cire ici. Prlever cire sur geles monstrueuses ou craser sautilleurs.\n\nEnsuite, mettre cire sur vous. Collez morceaux insectes sur cire. Dguisement parfait.', '', '', '', '', '', '', 57534),
(80508, 'frFR', 'Effroi dans l\antre', 'Retrouvez Scrit  son camp au repaire Cliquetant.', 'Vous tre $gami:amie; des Kobolds, hein? Besoin d\aide. Mauvaises choses se passer dans repaire Cliquetant. \n\nGang Boudecroc installer campement. Acolytes du roi-bougie vouloir guerre avec Terrestres.\n\nPas pouvoir arrter eux seule. Rendez-vous camp.', '', '', '', '', '', '', 57534),
(80502, 'frFR', 'Ne pleure pas pour moi, Azj-Kahet', 'Vengez Klaskin et tuez Arax\ne dans le bazar Ombreux.', '<Vous trouvez une page de journal chiffonne, enroule autour d\une petite cl.>\n\nJ\ai toujours souponn Arax\ne d\tre traditionaliste, mais je ne pensais pas qu\elle irait aussi loin. Je ne sais pas o je vais, mais je dois m\loigner d\elle.\n\nMessage  quiconque trouve ceci, cela signifie que le pire est arriv. Cette cl ouvre un coffre qui contient tous mes biens. Ils sont  vous.\n\nEn change, je vous demande simplement de me venger en tuant Arax\ne.', '', 'Arax\ne a suivi l\ancienne tradition nrubienne et a mang son mari Klaskin aprs leur mariage.\n\nKlaskin se doutait que cela pouvait arriver, et il a crit une note avec une cl cache sur son corps, demandant  tre veng.', 'Arax\ne', '', '', '', 57534),
(80500, 'frFR', 'La famille Barbe-de-Bronze', 'Allez voir Brann et Dagran  l\accueil des visiteurs de Dalaran afin de leur raconter ce qui est arriv  Magni.', '<Moira inspire profondment pour se recentrer.>\n\nNous devons avertir Brann et mon fils Dagran de ce qui est arriv. Ils se trouvent  l\accueil des visiteurs de Dalaran.\n\nEst-ce que vous pouvez aller les chercher? Pre a besoin de voir sa famille.', '', '', '', '', '', '', 57534),
(80457, 'frFR', 'Au service de la reine', '', '', '', '', '', '', '', '', 57534),
(80456, 'frFR', 'Un Arathi irritable', 'Parlez au garde-paix Leif  Dornogal.', 'On m\a rapport qu\un Arathi cherche querelle en ville. D\aprs les rumeurs, il s\en serait pris aux garde-paix.\n\nVous qui avez travaill avec des groupes arathis par le pass, peut-tre parviendrez-vous  apaiser les tensions?', '', '', '', '', '', 'Parlez au garde-paix Leif  Dornogal.', 57534),
(80434, 'frFR', 'Dans l\abysse', 'Rejoignez la mandataire Brinthe au fond de la galerie Primaire.', 'Eh bien allons de l\avant, descente maximale. Suivons la mandataire Brinthe et voyons dans quel tat les Nrubiens ont mis son foyer.\n\nMagni, Dagran et moi vous rejoindrons. Vous pourriez partir devant, pour vrifier que nous serons accueillis chaleureusement?', '', '', '', '', '', '', 57534),
(80412, 'frFR', 'Repousser les tnbres', '', '', '', '', '', '', '', '', 57534),
(80409, 'frFR', 'Polaris', '', '', '', '', '', '', '', '', 57534),
(80408, 'frFR', 'Chutes des Brumes chatoyantes', 'Rencontrez Batzvara aux chutes des Brumes chatoyantes.', ' l\ouest de Gundargaz se trouve un autre espace vert, une zone charmante avec des cascades et d\autres terrasses. Mon emploi du temps me conduit dans cette direction, et je serais trs heureuse d\avoir votre compagnie pour m\occuper de la faune et de la flore de cette rgion.\n\nRendez-vous l-bas, si vous n\avez pas d\autres tches  accomplir.', '', '', '', '', '', 'Rencontrez Batzvara aux chutes des Brumes chatoyantes.', 57534),
(80407, 'frFR', 'Scintillemche la voleuse de gemmes', 'Tuez Scintillemche.', 'Le Kobold a mentionn Scintillemche, exact? On dirait qu\elle est la tte pensante de ces vols de pierres prcieuses. Je parierai ma barbe qu\elle dtient la dernire gemme d\Ausgazur!\n\nCherchez-la au moulin  eau afin de vrifier si elle dtient bien la gemme. Elle pourrait aussi tre  l\origine de l\attaque en cours: l\liminer tirerait une fire pine du pied de l\quipe de dfense.', '', 'Couronn d\une bougie dont la mche est orne de bijoux vols, Scintillemche n\a de cesse de trouver d\autres pierres prcieuses pour sa collection.', 'Scintillemche', '', '', '', 57534),
(80406, 'frFR', ' la recherche des gemmes d\Ausgazur', 'Rcuprez $1oagemmes d\Ausgazur.', 'Ce sont donc les Kobolds qui se sont empars des gemmes d\Ausgazur. Je n\avais pas ralis que le moulin  eau tait attaqu. Notre arrive s\avre fortuite pour l\quipe de dfense en contrebas!\n\nNous devons rcuprer ces gemmes! Je vais rester ici et garder les gemmes restantes, mais je vous demande d\accomplir une tche essentielle: descendre dans le moulin et rcuprer les autres.', '', '', '', '', '', '', 57534),
(80405, 'frFR', 'Trop de caillasse', 'Examinez Ausgazur pour trouver des indices.', 'Voici Ausgazur. Ses mains contiennent gnralement une slection de ses pierres prcieuses prfres. Nous ne savons pas vraiment ce qui se passe lorsque nous entrons en stase, mais il voulait passer ses derniers instants  contempler la beaut naturelle d\Azeroth et ses richesses.\n\nJe crains que quelqu\un ou quelque chose ne se soit empar des gemmes qu\il dtient en temps normal. Regardons autour de nous. Voyons si nous pouvons trouver des indices sur l\endroit o elles ont pu tre emportes.', '', '', '', '', '', '', 57534),
(80404, 'frFR', 'Terrestres moussus', 'Prenez soin de $1oaTerrestres moussus.', 'Vous avez fait un excellent travail en rassemblant tous les lments. J\ai mlang le solvant pour vous.\n\nIl ne reste plus qu\ nettoyer dlicatement nos amis moussus.', '', '', '', '', '', '', 57534),
(80402, 'frFR', 'Tonneaux et floraisons', 'Collectez $1oafloraisons caustiques et trouvez le tonneau disparu.', 'En bas, parmi les cinglonites rampantes, pousse une fleur orange. Mlanges  de l\eau, ses fleurs produisent un solvant caustique qui est parfait pour enlever la mousse de la peau des Terrestres.\n\nLa dernire fois que je suis venue ici, j\ai galement laiss un tonneau  ct de ce Terrestre, que j\utilise pour fabriquer le solvant. Quelque chose semble s\en tre empar.\n\nPuis-je vous confier la tche de tout rassembler? Je vais attendre ici. Les taupes de la terrasse m\ont donn assez de sensations pour aujourd\hui.', '', '', '', '', '', '', 57534),
(80401, 'frFR', 'Une ponge parfaite', 'Procurez-vous un chapeau de cinglonite parfait.', 'Bienvenue  Brumes chatoyantes, fidle collgue! Ici, il fait toujours humide. C\est un paradis pour les organismes vgtaux. Malheureusement, c\est aussi le climat idal pour que la mousse se dveloppe sur mes chers Terrestres inertes.\n\nNous allons devoir rassembler quelques fournitures pour enlever la mousse. Tout d\abord, nous avons besoin d\une ponge pour laver leurs surfaces. Elle doit tre assez douce pour ne pas les abmer, mais assez solide pour rsister  la peau de pierre rugueuse des Terrestres.\n\nLes chapeaux des cinglonites en bas sont parfaits pour a!', '', '', '', '', '', '', 57534),
(80400, 'frFR', 'Item Collection [DNT]', 'Rcuprez $1oaY.', 'Farmez.', '', '', '', '', '', '', 57534),
(80399, 'frFR', 'Rations et rvlations', 'Distribuez $1oarations arathies.', 'Nous avons dcouvert que ces prisonniers fuyaient une base militaire nrubienne proche.\n\nLes circonstances de leur vasion sont floues, mme pour eux. Comme si quelqu\un d\autre avait cr l\opportunit dont ils avaient besoin pour s\chapper.\n\nIls ont besoin de repos, mais nous devons dcouvrir ce qui s\est pass l-dedans.\n\nIls doivent d\abord manger. Peut-tre qu\une fois qu\ils auront repris des forces, ils se souviendront de quelque chose.', '', '', '', '', '', '', 57534),
(80395, 'frFR', 'Excavation lmentaire', '', '', '', '', '', '', '', '', 57534),
(80394, 'frFR', 'Pour le plaisir', '', '', '', '', '', '', '', '', 57534),
(80392, 'frFR', 'La gardienne de la terrasse de Brunwin', 'Offrez de la Brassecendre  $1oaTerrestres inertes et tuez $2oahume-bon.', 'Salutations, $gtranger:trangre;. Vous devez tre la personne qui rsout les problmes dont j\ai entendu parler! Je suis la gardienne Batzvara. Je m\occupe des Terrestres en stase, comme notre ami.\n\nJe patrouille souvent  la terrasse de Brunwin pour honorer mes compagnons en leur offrant de la Brassecendre. Rcemment, cependant, j\ai attir l\attention d\une espce locale de taupes. Elles ont un penchant pour les sucreries, et des griffes voraces pour tout le reste.\n\nVous avez l\air de savoir vous dfendre. Pouvez-vous m\accompagner pour rendre hommage  celles et ceux qui sont entrs en stase?', '', '', '', '', '', 'Parlez  Batzvara  la terrasse de Brunwin.', 57534),
(80382, 'frFR', 'Tous les ufs dans le mme panier', 'Rcuprez $1oaufs de Heaume-Colline  dposer dans ce panier.', '<Cette commande n\a pas t honore. Aliya Heaume-Colline apprcierait srement que vous vous en occupiez.>', '', '', '', '', '', '', 57534),
(80378, 'frFR', 'Une lumire des tnbres', 'Procurez-vous du Sang noir coagul et apportez-le  Tocard, le fabricant de bougies kobold de Gundargaz.', 'L\image d\une bougie violette, brlant d\un pouvoir grandiose, s\impose dans votre esprit, tandis que vous contemplez la crasse putrfie devant vous, puis un murmure rsonne doucement dans votre tte: Une bougie pour les gouverner tous, et dans sa clart les lier.\n\nApportez assez de Sang noir coagul  Tocard, le fabricant de bougies kobold de Gundargaz, pour fabriquer une bougie de grand malheur.', '', '', '', '', '', '', 57534),
(80334, 'frFR', 'Flches brises', 'Retrouvez Aethas  la grve Tranquille.', 'Les flches de Dalaran s\effondrent, sans rien pour contenir leur puissance arcanique.\n\nSi nous laissons leur nergie s\couler sans contrle, cette puissance pourrait dstabiliser et dtruire ce qu\il reste de nos troupes.\n\nTrouvez Aethas! Il saura quoi faire.', '', '', '', '', '', '', 57534),
(80323, 'frFR', 'Affrontement brumeux', '', '', '', '', '', '', '', '', 57534),
(80321, 'frFR', 'Dpart', 'Trouvez Khadgar  la surface.', 'Mieux vaut qu\on se spare ici. Je vais guider tous ces gens en lieu sr et organiser leur vacuation.\n\nPendant ce temps, cherchez Khadgar. Il a srement aussi besoin de votre aide.\n\nVous trouverez une autre sortie plus loin, elle devrait vous ramener  la surface.', '', '', '', '', '', 'Utilisez le portail pour aller en Khaz Algar.', 57534),
(80316, 'frFR', 'Retour  la mer', 'Emmenez le poisson trange en eau profonde.', 'Je reste affaibli par tout ce temps pass si prs de la lumire brlante de la surface. Je vous demande de me conduire dans des eaux plus profondes, loin de ces Kobyss, o je pourrai retrouver les miens.', '', '', '', '', '', '', 57534),
(80315, 'frFR', 'Une offre allchante', 'Leurrez et assassinez Taille-branchies et ses marchaux des mares kobyss sur l\le au large de la grve Sans-Soleil.', 'C\est fait. Prenez ce charme des vagues, embrassez la noirceur de l\ocan et neutralisez les Kobyss. Leurs units d\lite se rassemblent pour comploter contre votre espce sur cette le centrale. Grce au leurre, ils ne vous verront pas $gtel:telle; que vous tes. Servez-vous de cet avantage pour prendre le meilleur.\n\nMais, contrairement aux Kobyss, comprenez bien que ce pouvoir n\est pas le vtre. Il appartient  l\ocan.', '', 'Isol par les forces kobyss, Taille-branchies renforce ses troupes  l\assaut contre les marche-surface.', 'Chef Taille-branchies', '', '', '', 57534),
(80314, 'frFR', 'Les voix des profondeurs', 'tudiez trois sites rituels pour en savoir plus sur les Kobyss.', 'Tromper les sens de ces Kobyss est une chose. Savoir comment les captiver en est une autre. Ils salivent  l\ide de dvorer votre espce. Mais les voix des profondeurs les fascinent et les font baisser leur garde. C\est  cet instant que vous frapperez.\n\nCherchez leurs autels pour dcouvrir ce que ces sclrats tiennent pour sacr. Voyez comme ils ont dform les cris empreints de vrit qui viennent d\en bas.', '', '', '', '', '', '', 57534),
(80313, 'frFR', 'Les charmes des flots', 'Collectez 12clats sans-soleil sur les Kobyss de la grve Sans-Soleil.', '<Lorsque le poisson vous parle, ses lvres ne bougent pas. Vous entendez sa voix dans votre tte.>\n\nVous vous tes sans doute rendu compte que vous ne pouviez pas vous fier  vos sens lorsque vous combattez les Kobyss. Ils manient un grand pouvoir, n\est-ce pas? Il serait bon que vous leur montriez que celui-ci ne leur est pas exclusif.\n\nJe vais vous apprendre  fabriquer un outil permettant de les attirer et de les dtruire. Vous trouverez sur leurs cadavres des clats arrachs aux profondeurs. Apportez-les-moi.', '', '', '', '', '', '', 57534),
(80312, 'frFR', 'Une plainte  bout de souffle', 'Retournez l\trange poisson dans des eaux sres, prs du camp kobyss de la grve Sans-Soleil.', '<Un poisson mal en point trouv sur le corps d\un Kobyss s\agite mollement dans votre main. Son il rond tressaille, et vous entendez une voix haletante au plus profond de votre esprit.>\n\nDe l\eau. Emmenez-moi dans l\eau. Loin de ces maudits Kobyss. Loin du ciel.', '', '', '', '', '', '', 57534),
