(80255, 'frFR', 'Parcours de la halte de l\Aubaine  Invers', 'Traversez les anneaux en planant.', 'Je connais ce parcours par cur, je pourrais probablement le faire  l\envers. Vous aussi, sans doute!\n\nMais loin de moi l\ide de vous perdre: vous n\avez qu\ voler  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80254, 'frFR', 'Approche de Taelloch  Inverse', 'Traversez les anneaux en planant.', 'Les mandataires des machines ont pour destin de travailler, tout comme les chevaucheuses et chevaucheurs de Dragons ont celui de faire la course! Qu\importe si leurs quipages nous demandent d\arrter de les distraire!\n\nIl vous suffit de voler  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80253, 'frFR', 'Croisire de la Cataracte  Inverse', 'Traversez les anneaux en planant.', 'Rien  dire, vous pouvez finir le circuit rapidement. Mais seriez-vous capable de le faire  l\envers? Non, pas en volant  l\envers! En faisant le circuit  l\envers!\n\nComme d\habitude, vous n\avez qu\ voler  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80252, 'frFR', 'Course cliquetante  Inverse', 'Traversez les anneaux en planant.', 'Profitez de cette magnifique vue  L\ENVERS! Assurez-vous de garder un il sur les perons rocheux tout au long du parcours.\n\nVous devrez galement voler  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80251, 'frFR', 'Cours des abmes Retentissants  Invers', 'Traversez les anneaux en planant.', 'Votre tte vous fait mal? La mienne, oui. Je me suis emml les mninges  prendre le circuit  l\envers.\n\nVous ne feriez jamais a, hein? Bien sr que non! Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80250, 'frFR', 'Virages des Ouvrages terrestres  Inverss', 'Traversez les anneaux en planant.', 'Les Virages des Ouvrages terrestres sont remplis de magma et pas qu\un peu! Essayez de ne pas regarder en bas et de ne pas penser  la chute vers une mort certaine dans un cauchemar incendiaire bouillonnant de lave mortelle.\n\nConcentrez-vous sur votre navigation  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80249, 'frFR', 'Parcours de la halte de l\Aubaine  Avanc', 'Traversez les anneaux en planant.', 'H, j\ai trouv une brochure! a dit:\n\nRalisez feintes et esquives entre les imposants pics rocheux, plongez dans des gouffres engloutis et lzardez le ciel de votre trane vloce jusqu\ la ligne d\arrive!\n\nJe sais que vous savez ce que cela signifie vraiment: volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80248, 'frFR', 'Approche de Taelloch  Avance', 'Traversez les anneaux en planant.', 'Regardez-les travailler, l-dessous! Est-ce que ces bonnes gens s\arrtent pour profiter des courses, de temps  autre?\n\nCela importe peu, j\imagine, vous allez quand mme voler  travers les anneaux qui jalonnent le circuit!', '', '', '', '', '', '', 57534),
(80247, 'frFR', 'Croisire de la Cataracte  Avance', 'Traversez les anneaux en planant.', 'Si vous voulez vous frotter  un circuit plus cors, essayez de terminer celui-ci plus rapidement et passez moins de temps  admirer le paysage!\n\nVolez simplement  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80246, 'frFR', 'Course cliquetante  Avance', 'Traversez les anneaux en planant.', 'Vous avez dj fait a? Avez-vous vu cette magnifique faune? Ces rivires tumultueuses? Ces chutes d\eau en cascade?\n\nAh, vous voulez juste faire la course? Bon, alors c\est simple. Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80245, 'frFR', 'Cours des abmes Retentissants  Avanc', 'Traversez les anneaux en planant.', 'Vous n\allez pas le croire.  la prochaine course, il y aura des panoramas verdoyants et des pics rocheux qui se dressent, imposants, faisant siffler sur leurs flancs la douce brise!\n\nVolez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80244, 'frFR', 'Virages des Ouvrages terrestres  Avancs', 'Traversez les anneaux en planant.', 'Les Terrestres l-dessous uvrent sans relche aux mmes tches rptitives jour aprs jour.\n\nMais vous, vous risquez votre vie en fonant dans le ciel au-dessus du magma en fusion dans des courses ariennes dlirantes d\imprudence!\n\nSi vous osez le refaire, alors volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80243, 'frFR', 'Parcours de la halte de l\Aubaine', 'Traversez les anneaux en planant.', 'La partie sud des abmes Retentissants a l\air un peu diffrente de celle du nord.\n\nQuoi qu\il en soit, d\est en ouest, du nord au sud, il vous faudra de bons rflexes et beaucoup de courage pour faire la course!\n\nAprs avoir fait le grand saut vers le ciel, volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80242, 'frFR', 'Approche de Taelloch', 'Traversez les anneaux en planant.', 'Ne vous laissez pas endormir par ce morne paysage.\n\nLa ville minire a subi quelques transformations, mais force est de constater que la vue est spectaculaire! \n\nSi vous avez des nerfs d\acier, essayez de voler  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80240, 'frFR', 'Croisire de la Cataracte', 'Traversez les anneaux en planant.', 'Les panoramas  couper le souffle de la rivire et de ses chutes d\eau majestueuses font de cette course arienne une exprience absolument remarquable!\n\nFoncez dans les airs  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80239, 'frFR', 'Course cliquetante', 'Traversez les anneaux en planant.', 'Je vous offre un voyage arien qui vient avec une vue panoramique imprenable. On y voit d\innombrables cratures grouillant dans un paisible panorama de nature sauvage souterraine.\n\nVous savez ce qui est plus palpitant? Une course! Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80238, 'frFR', 'Cours des abmes Retentissants', 'Traversez les anneaux en planant.', 'Vous avez l\me vagabonde? Eh bien vagabondons!\n\nTant que vous arrivez toujours  distinguer o est le haut et o est le bas, vous devriez vous en sortir.\n\nMaintenant que cette question est claircie, vous devez simplement voler  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(80237, 'frFR', 'Virages des Ouvrages terrestres', 'Traversez les anneaux en planant.', 'De prilleuses manuvres ariennes vous attendent sur le parcours o vous braverez la mort dans des poursuites effrnes au-dessus d\un paysage magmatique cauchemardesque!\n\nSi vous avez le cran de relever le dfi, volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
