(80218, 'frFR', 'Aux abois  Sylvesoie', 'Collectez des barils explosifs de Sylvesoie, puis faites sauter le tunnel nrubien de la grotte de Sylvesoie.', 'L\ordre fait passer le bois par les Nrubiens. Leif dit avoir vu la charpentire quitter la grotte et se diriger vers la plage.\n\nLe tunnel nrubien doit se trouver l-bas. Il va falloir sceller ce maudit passage.\n\nEn me faufilant, j\ai remarqu que l\ordre avait apport des barils d\explosifs avec lui. Trouvez-en quelques-uns et utilisez-les pour faire sauter le tunnel.\n\nAllez-y, $n. Je vous suis.', '', '', '', '', '', ' rendre', 57534),
(80217, 'frFR', 'De la lumire pour la charpentire', 'Affrontez la charpentire de marine arathie.', 'O est donc pass Kaerter? Il est encore parti tout seul de son ct?\n\n<Leif soupire.>\n\nNous avons secouru les Terrestres et limin nombre d\adversaires, mais notre tche est loin d\tre termine.\n\nPeu avant votre arrive, nous avons repr un groupe d\individus arathis qui remontait cette colline. Parmi eux se trouvait la fameuse charpentire de marine arathie.\n\nC\est sans nul doute elle qui dirige le groupe. Sans leur cheffe, les membres auront toutes les peines du monde  se servir de la scierie.\n\nHtez-vous de gravir la colline pour la trouver avant qu\elle ne s\chappe.', '', '', '', '', '', 'Retrouvez le garde-paix Leif au nord de la scierie de Skolzgal.', 57534),
(80216, 'frFR', 'Offensive dans la sylve', 'liminez les troupes ombresoie  la scierie de Skolzgal.', 'Les Nrubiens semblent tre de mche avec le peuple arathi. Beaucoup d\entre eux dfendent la scierie, mais je suis sr qu\ils sont plus nombreux que nous le pensons.\n\nIl est impossible de laisser tant de forces ennemies oprer librement si prs de la Randonneraie.\n\nLes Nrubiens ont attaqu et dtruit de grandes parties de Dornogal il n\y a pas si longtemps. L\Ordre de la nuit arathi capture notre peuple et le rduit en esclavage.\n\nNous devons en liminer le plus grand nombre possible. La totalit, idalement.', '', '', '', '', '', ' rendre', 57534),
(80215, 'frFR', 'Libration sans condition', 'Librez $1oabcherons et bcheronnes enleves.', 'Mme si je prends plaisir  massacrer du Nrubien, il faut d\abord sauver les Terrestres en captivit.\n\nJ\ai vu qu\on leur avait mis des boulets arathis. Quelqu\un comme vous devrait tre en mesure de les briser assez facilement. Il suffit de faire comme vous avez l\habitude!\n\nOh, et nous devrions nous sparer pour couvrir plus de terrain. Oui, Leif va se plaindre, mais il est toujours en train de rler de toute faon.', '', '', '', '', '', ' rendre', 57534),
(80214, 'frFR', 'Du rififi  la scierie', 'Retrouvez le falotier Kaerter devant la scierie de Skolzgal.', 'Voyons si j\ai bien compris: la charpentire de marine monte une petite quipe afin de rcuprer du bois de construction pour les aronefs.\n\nMais cette charpentire s\avre appartenir en ralit  l\Ordre de la nuit, tout comme la plupart des membres de son groupe. Ils assassinent alors les fidles arathis, kidnappent les Terrestres et les forcent  travailler dans la scierie ici.\n\nEt maintenant, nous devons nous occuper de l\Ordre et de leurs nouveaux copains.\n\n<Kaerter pousse un juron et secoue la tte.>\n\nTrs bien, allons  la scierie. On a un paquet de mchants  tuer et le temps presse.', '', '', '', '', '', 'Retrouvez le falotier Kaerter devant la scierie de Skolzgal.', 57534),
(80213, 'frFR', 'Flammes sacres  la Randonneraie', 'Utilisez les encensoirs de flammclair pour rvler les membres de l\Ordre de la nuit  la Randonneraie, les liminer et les fouiller pour trouver des indices.', 'Je suis sr qu\il y a peut-tre encore des gens de l\ordre qui rdent en ville. Ils pourraient porter des messages sur eux, comme  Landefrey.\n\nNous allons le dcouvrir.\n\nPrenez ces encensoirs. Ils ressemblent  de minuscules brleurs d\encens, mais je les ai enchants avec le pouvoir de la Flamme sacre.\n\nJetez-en un et vous obtiendrez une grande explosion avec un clair lumineux! Cela devrait suffire  tourdir toute personne qui rde dans les parages.\n\nMais n\en jetez pas sur moi! Compris?', '', '', '', '', '', 'Retrouvez le falotier Kaerter  l\est de la Randonneraie.', 57534),
(80212, 'frFR', 'Obstructeurs de ravisseurs', 'Retrouvez le garde-paix Leif  la Randonneraie.', 'L\Ordre de la nuit montre un intrt certain pour nos ressources. Ils ont enlev des Terrestres pour les exploiter et risquent de continuer  en capturer d\autres. Il faut les arrter.\n\nLa deuxime plus grande colonie de Terrestres est Randonneraie. Si l\Ordre a besoin de plus de main-d\uvre, c\est l qu\ils iront piocher.\n\nAllez-y, $n. Je dois d\abord m\entretenir avec Kaerter pour dterminer les motivations du peuple arathi.', '', '', '', '', '', 'Retrouvez le garde-paix Leif  la Randonneraie.', 57534),
(80211, 'frFR', 'Le pillage de Landefrey', 'Cherchez des indices sur la destination de l\quipage arathi.', 'La charpentire de marine arathie tait l, mais elle est partie avec la majeure partie de son quipe. Elle a bien laiss quelques Arathis derrire elle, mais\n\nPeu aprs le dpart de la charpentire, les Terrestres ont commenc  disparatre. Les villageois souponnaient les Arathis, mais ils taient incapables de le prouver. Un jour, les derniers Arathis ont quitt la ville au milieu de la nuit.\n\nLes rsidents affirment que les Arathis ont sjourn  l\auberge. Pouvez-vous y chercher des indices permettant de dterminer o ils se trouvent maintenant?\n\nVu la mfiance des villageois, le falotier et moi-mme allons rester ici pour le moment.', '', '', '', '', '', '', 57534),
(80210, 'frFR', 'Dlier parmi les Dlis', 'Retrouvez le garde-paix Leif devant Landefrey.', 'Ce falotier recherche ses camarades arathis. Selon le contrematre, il a dirig une charpentire de marine arathie vers Landefrey.\n\nMes suprieurs insistent pour que les gardes-paix ne quittent pas Dornogal Mais selon leurs instructions, je dois aider Kaerter. Et pour ce faire, je n\ai d\autre choix que de quitter la ville.\n\n<Leif s\empresse de dissimuler un sourire.>\n\nC\est donc dcid. Si cela vous convient, rejoignez-nous  Landefrey. Votre aide est toujours la bienvenue.', '', '', '', '', '', 'Retrouvez le garde-paix Leif devant Landefrey.', 57534),
(80209, 'frFR', 'Un excentrique  Dornogal', 'Interrogez les habitantes et habitants inquiets de Dornogal pour localiser le falotier arathi.', 'Nous avons reu des rapports signalant la prsence d\un Arathi excentrique parmi nos concitoyens. Nous n\avons que peu d\exprience avec les trangers et mes suprieurs craignent un incident diplomatique.\n\nJ\ai t charg de trouver ce falotier et de remdier  son problme. Vous avez dj travaill avec les Arathis. Pouvez-vous m\aider?\n\nJ\ai une liste de Terrestres qui ont dpos des plaintes. Je vous propose d\interroger la moiti de la liste.  nous deux, nous devrions parvenir  le localiser avant qu\il n\importune d\autres citoyens.', '', '', '', '', '', 'Parlez au garde-paix Leif  la monte de Gardepierre  Dornogal.', 57534),
(80208, 'frFR', 'Les problmes, a creuse', '', '', '', '', '', '', '', '', 57534),
(80207, 'frFR', 'C\est scandaleux', 'Enqutez sur les perturbations prs de la Placeforge  Dornogal.', 'Vous avez vu quelque chose?\n\nJe reviens de la Placeforge, o je passais rcuprer une commande de bijoux, quand tout d\un coup, tout le monde s\est mis  hurler comme si la galerie Primaire tait  nouveau attaque!\n\nMais ce n\est pas tout\n\nPlusieurs garde-paix se rendaient vers le dpt o les cargaisons d\artisanat sont envoyes depuis les abmes. Je parie qu\il y a un lien avec les mandataires des machines!\n\nLes garde-paix ont fait vacuer tout le monde avant que je ne puisse voir ce qui s\tait pass. Peut-tre parviendrez-vous  vous y faufiler pour jeter un il?', '', '', '', '', '', 'Trouvez le garde-paix Kragad prs de la Placeforge  Dornogal.', 57534),
(80206, 'frFR', ' la merci des marionnettes', 'Trouvez le srum antiparalytique du matre des marionnettes.', 'C\est parfait! Le matre des marionnettes est ravi  l\ide de vous ajouter  sa collection, il nous a littralement invits  aller secourir le magistrat.\n\nNon pas que je me sers de vous comme d\un appt depuis le dbut, mais disons que j\ai pris des risques contrls et que a a pay.\n\nMme un artiste aussi talentueux doit avoir un moyen de corriger des erreurs potentielles. Il doit bien y avoir une sorte d\antitoxine contre cette paralysie quelque part dans le coin!\n\nTrouvez-la. Et nous nous assurerons de l\essayer avant de la donner au magistrat. Juste au cas o.', '', '', '', '', '', '', 57534),
(80205, 'frFR', 'Tirer sur les fils', 'Affrontez le matre des marionnettes pour sauver le haut-lvateur Etak\kaht.', 'Rendez-vous compte! Des rampe-surfaces, des individus prisonniers de guerre, des populations civiles, des Nrubiens, des gens nobles kidnapps et transforms en marionnettes sous le nez du Magistrat.\n\nC\est horrible et c\est exactement ce dont j\avais besoin! Si nous parvenons  viter ce sort au Magistrat, il m\en sera redevable. Pas seulement pour lui avoir sauv la vie, mais aussi pour avoir cach tout a.\n\nDirection le thtre. Occupez le matre des marionnettes, je me charge de librer le haut-lvateur Etak\kaht de son emprise.\n\nJ\espre qu\il ne fait pas encore partie du spectacle.', '', '', '', '', '', '', 57534),
(80204, 'frFR', 'Espionnage et ventriloquisme', 'Enqutez dans l\atelier du matre des marionnettes.', 'Le matre des marionnettes est notre meilleure piste pour retrouver le magistrat.\n\nMais est-ce que c\est moi, ou est-ce que ces marionnettes semblent horriblement ralistes? Si cet artiste est  l\origine de la disparition du magistrat, il n\est pas sorti pour une simple reprsentation.\n\nNous devrions enquter dans l\atelier du matre des marionnettes. L\interroger si possible, mais au moins fouiller tout son local jusqu\ trouver une piste.\n\nVous devrez continuer  jouer votre rle indigne dans cette mascarade, mais le jeu en vaut la chandelle.', '', '', '', '', '', '', 57534),
(80203, 'frFR', 'Repres sociaux', 'Aidez la mandataire Tx\itk  trouver le magistrat.', '<La Nrubienne parle  voix basse tout en observant les gardes qui se trouvent derrire vous.>\n\nC\est la Tisserande qui vous envoie? Je suis venue qurir l\approbation du magistrat pour la Sublimation. Dans le seul but d\infiltrer la haute socit, cela va de soi.\n\nMais il n\est pas l, ce qui perturbe fortement mon plan.\n\nIl faut que j\aille  la pche aux renseignements, autant dire que vous tombez  pic! Vous pourriez dire que vous tes mon esclave. Ou mon animal de compagnie? Je vous laisse le choix.\n\nIl m\arrive rarement d\avoir un compagnon de route: nous allons bien nous amuser, camarade $gespion:espionne;.', '', '', '', '', '', '', 57534),
(80202, 'frFR', 'Servir le pollen tant qu\il est chaud', 'Rcoltez du pollen de cendrelles riches en pollen et apportez-le aux abeilles proches avant qu\il ne s\teigne.', 'Faut bien veiller  pas en prendre trop. Vous assurer que ruche saine pour qu\elle revenir.\n\nAbeilles se nourrir de pollen, non? Et abeilles de feu, alors? De pollen de feu? Oui.\n\nVous apporter pollen de feu aux abeilles. a les rendre fortes. Productives.\n\nVous chercher prs des ruches fleurs qu\abeilles pas encore avoir butines. Si vous prendre feu, vous avoir trouv.', '', '', '', '', '', '', 57534),
(80189, 'frFR', 'Se prserver par le travail d\quipe', 'Obtenez des points d\honneur en champ de bataille Blitz ct ou en champ de bataille cot.', 'La capacit d\tablir des stratgies collectives pour capturer des objectifs est essentielle pour atteindre la vritable excellence martiale. Allez sur le champ de bataille, puis revenez me voir.', '', '', '', '', '', '', 57534),
(80188, 'frFR', 'Se prserver en arne', 'Obtenez des points d\honneur en arne cote avec un groupe.', 'Un combat rapide et bien coordonn est l\preuve ultime. Trouvez d\autres personnes avec qui affronter des adversaires dignes de ce nom dans l\arne.', '', '', '', '', '', '', 57534),
(80187, 'frFR', 'Se prserver en escarmouche', 'Obtenez des points d\honneur lors d\escarmouches en arne.', 'L\apprentissage passe toujours par la rptition. Il parat que d\autres, comme vous, participent  des accrochages de petite envergure. Allez trouver des partenaires contre qui vous entraner, puis revenez me voir.\n\nVoyons ce que vous pourrez prouver, puis revenez me voir.', '', '', '', '', '', '', 57534),
(80186, 'frFR', 'Se prserver  la guerre', 'Obtenez des points d\honneur sur des champs de bataille piques.', 'En participant  des conflits de grande envergure, vous apprendrez  envisager les plans dans leur ensemble. Allez profiter de cette exprience, puis revenez me voir.', '', '', '', '', '', '', 57534),
(80185, 'frFR', 'Se prserver en solo', 'Terminez 12manches de Brassage solo.', 'Si vous vous battez sans aide, cela dveloppera votre force et votre courage. Faites la preuve de vos capacits en solitaire dans de petits accrochages, puis revenez me voir.', '', '', '', '', '', '', 57534),
(80184, 'frFR', 'Se prserver au combat', 'Obtenez des points d\honneur sur des champs de bataille alatoires.', 'Nous avons beaucoup de choses  apprendre sur le champ de bataille, mme dans les environnements les moins coordonns. Essayez donc.', '', '', '', '', '', '', 57534),
(80179, 'frFR', 'En qute de justice', 'Pistez l\assassin de Wenren.', '<Les pices s\imbriquent pour former une image simple, mais sombre.\n\nL\Ordre de la nuit ne voulait pas que Wenren ouvre un portail vers l\Empire. Du ravitaillement et des renforts auraient pu compromettre leur mission. \n\nAlors on l\a poignard, puis on a brl ses recherches et dtruit ses outils. \n\nMais ce focalisateur des arcanes prsente encore de lgres traces de rsidu arcanique. De la poussire arcanique se serait-elle dpose sur notre assassin? \n\nSuivez cette piste et dcouvrez ce qu\il en est.>', '', '', '', '', '', 'Faites votre rapport  la gnrale Heurtacier.', 57534),
(80178, 'frFR', 'Un meurtre des plus abjects', 'Enqutez sur le meurtre de Wenren.', '<Quelqu\un ne voulait pas que Wenren termine son sort.\n\nDcouvrez qui.>', '', '', '', '', '', '', 57534),
(80177, 'frFR', 'Des expriences arcaniques', 'Aidez Wenren  mener ses expriences.', 'C\est a! L\nergie qui se dgage de ces crabes est charge de magie de tlportation! Je dois simplement l\extraire et ajuster la formule\n\nJe peux y arriver! J\ai juste besoin d\un nouveau petit coup de main! Vous m\aidez  tester ceci?', '', '', '', '', '', '', 57534),
(80176, 'frFR', 'Tressaillement d\arcanes', 'Obtenez $1oaorganes saturs d\arcanes sur des clampants du rivage prs du Mereldar.', 'J\y suis presque!\n\nJe cre un nouveau sort de tlportation qui nous permettra de regagner l\Empire.\n\nEt ces crabes pourraient bien m\tre utiles. Ils dgagent une magie de tlportation arcanique!\n\nJ\ai besoin d\tudier plus d\chantillons.\n\nPrenez ce focalisateur, il vous permettra de reprer les traces d\arcanes. Il n\y a pas beaucoup d\autres sources d\arcane par ici: il devrait vous mener droit aux crabes en question!', '', '', '', '', '', '', 57534),
(80175, 'frFR', 'Le dernier mage', 'Allez voir Wenren Althal  la Manne de Beledar.', 'Je voudrais que vous rendiez visite  quelqu\un. C\est un mage Le seul qui nous reste. Les autres n\ont pas survcu  l\impact.\n\nIl tente d\ouvrir un portail pour regagner l\Empire et y puiser des renforts.\n\nNous savons bien que c\est perdu d\avance, mais il n\a pas encore baiss les bras. \n\nPeut-tre que parler avec $gun voyageur chevronn:une voyageuse chevronne; comme vous lui permettra de revenir sur terre. Vous voulez bien aller le voir?', '', '', '', '', '', 'Allez voir Wenren Althal  la Manne de Beledar.', 57534),
(80145, 'frFR', 'Le Filon', 'Activez les craseurs restants dans la grotte d\Ombreveine.', '<Les entrailles de Zed-Zed commencent  bourdonner doucement lorsque son projecteur atteint la temprature de fonctionnement nominale.>', '', '', '', '', '', '', 57534),
(80082, 'frFR', 'Retour  Gundargaz', 'Retournez  Gundargaz.', 'Nous n\avons peut-tre pas renvers le roi-bougie, mais notre travail a soulag un peu la pression qui pesait sur Gundargaz. Et il nous a valu quelques nouveaux allis.\n\nNous n\oublierons pas nos nouveaux amis et nos nouvelles amies, je vous en donne ma parole de mandataire. Il y a une quantit regrettable de logements disponibles  Gundargaz, depuis peu. Il sera plaisant de voir la ville reprendre vie, et nous aurons besoin de main-d\uvre.\n\nDevons-nous les rapatrier, $n?', '', '', '', '', '', 'Retournez  Gundargaz.', 57534),
(80079, 'frFR', 'La machine se grippe', 'Encouragez les membres de la foule  exprimer leurs dolances.', 'Le haut-mandataire semble s\adresser  sa main d\uvre. On dirait que quelque chose a fini par les rveiller de leur torpeur, et le temps pass loin de la Machine d\veil commence  les affecter.\n\n<Moira marque une pause pour pousseter la manche de sa robe.>\n\nCe serait peut-tre le bon moment pour que tout le monde entende ce qu\il a  dire?\n\nNous devrions convaincre ces mandataires des machines de prendre la parole.', '', '', '', '', '', '', 57534),
(80062, 'frFR', 'Basic Kill Quest [DNT]', '', '', '', '', '', '', '', '', 57534),
(80058, 'frFR', 'Nettoyage kobold', 'Nettoyez Gundargaz.', 'Nouvelle demeure tre un peu dlabre. Pas bien, plein de trucs bizarres et misrables. Y a longtemps, tout le monde tre mort et a se dlabrer.\n\nOn va donner coup de main! Y a plein de Kobolds maintenant, alors nous rendre endroit prsentable pour Ttes-de-Caillasse. Pour qu\eux se sentir chez eux.\n\nVous aller vous y mettre aussi. Prendre un balai, aller!', '', '', '', '', '', '', 57534),
(80049, 'frFR', 'La flamme brle encore', 'Prenez des nouvelles des survivantes et des survivants arathis au terrain d\Adulation de Sainte-Chute.', 'C\est pass trop prs.\n\nCette attaque aura laiss des traces  tout le monde. Beaucoup de nous en garderons des blessures, physiques ou psychologiques.\n\nPouvez-vous prendre des nouvelles des gens? Pour voir comment tout le monde va?', '', '', '', '', '', '', 57534),
(80023, 'frFR', 'Cloning Conundrum [DNT]', 'Tuez $1oaclones de Bobbi la forgeronne dans la mine d\Opalecreg.', 'Ma jumelle, la mineuse Mobbi, m\a clone par accident. \n\nEt mes clones sont en train d\envahir la mine! Vous devez nous aider!', '', '', '', '', '', 'Allez voir la mineuse Mobbi pour obtenir votre rcompense.', 57534),
(80022, 'frFR', 'Appel aux freux', 'Retrouvez Baelgrim devant le Perchoir-Tempte, puis parlez-lui pour le suivre dans la colonie.\n\nCe dfi peut tre accompli en solo ou avec jusqu\ 3membres du groupe.', 'Je connais la capacit du peuple dli  rparer et  dbloquer la galerie Primaire rapidement, mais je connais galement les Nrubiens. S\ils voient une occasion de tendre une embuscade, ils la saisiront.\n\nEn ayant le dos tourn et en nous concentrant sur la galerie, nous constituons des cibles de choix.\n\nJ\ai besoin de rassembler mes chevaucheurs et chevaucheuses de tempte pour former un primtre autour de Dornogal en cas d\attaque, qu\elle vienne de l\intrieur ou de l\extrieur.\n\nRetrouvez-moi devant le Perchoir-Tempte. J\y rassemblerai mes troupes.', '', '', '', '', '', '', 57534),
(80005, 'frFR', 'Attrape-crabes  Activer', '', '', '', '', '', '', '', '', 57534),
(80004, 'frFR', 'Attrape-crabes', 'Pchez $1oacrabes ombrevagues au large du rivage Estomp.', '<L\arrive des Kobyss a empch le peuple arathi d\exploiter ces rives. Une cage pleine de crabes frais serait d\un grand secours pour la population affame.>', '', '', '', '', '', '', 57534),
(80000, 'frFR', 'Morabeilles', 'Tuez Morabeilles.', 'Mites tuer abeilles de feu. Pas bon!\n\nTocard dtester mites. Elles vous mordre mme quand vous pas voler de cire. Et elles mme pas fabriquer de cire!\n\nVous donner chance aux abeilles. Vous tuer plus grosse mite avant que elle dvorer d\autres abeilles.', '', 'Gros mchant insecte! Mordre abeilles, toi mourir!\n\n Tocard', 'Morabeilles', '', '', '', 57534),
(79999, 'frFR', 'Ranimer l\espoir', 'Rcuprez $1oavestiges briss et utilisez-les pour alimenter la flammecl d\gide.', 'Une tour de l\aube est tombe, mais une faible lueur d\espoir demeure grce  la petite flammecl au sommet du mur. \n\nLes Nrubiens ont emport les vestiges briss ncessaires pour entretenir cette lumire.\n\nRcuprez les vestiges sur les Nrubiens que vous tuerez pour nous aider  embraser un signal d\espoir!', '', '', '', '', '', 'Retrouvez Faerin au sommet du mur de l\gide.', 57534),
(79998, 'frFR', 'Mchantes mites', 'Purifiez les abeilles de feu de leur infestation avec la fume parfume de Tocard et tuez les mites incrimines.', 'a pas tre bon. Abeilles de feu chic avoir des mites!\n\nTocard avoir dj vu a. Ruche tre infeste, bons insectes se faire dvorer. Mauvaise fin. Il faut faire quelque chose!\n\nSouffler abeilles avec fume, faire dormir abeilles, mais mites dtester fume!\n\nQuand elles sauter, vous les craser avant qu\elles mordre abeilles  nouveau.', '', '', '', '', '', '', 57534),
(79966, 'frFR', 'Qute de test', 'Test', 'Test', '', '', '', '', '', '', 57534),
(79959, 'frFR', 'Vercraft Rumble', '', '', '', '', '', '', '', '', 57534),
(79957, 'frFR', 'Des asticots dans les yeux', 'Apportez la tte d\Albert aux guides  l\avance de Faerin.', '<Albert n\est plus de ce monde. Il ne reste que sa tte, encore pleine d\asticots.\n\nLa ramener aux guides semble tre le plus sage.>', '', '', '', '', '', 'Apportez la tte d\Albert aux guides  l\avance de Faerin.', 57534),
(79956, 'frFR', 'Des pattes dans le plafond', 'Si les araignes n\ont pas encore attaqu, tirez sur la toile d\araigne et tuez tout ce qui surgit.', 'Je ne cherche pas la vengeance pour moi, mais pour mes camarades qui ont fini par se faire dvorer. Je ne pensais pas l\horreur de Xesh relle, mais force est de constater qu\elle l\est. Xishirra. Une ombre, un vritable cauchemar qui, hors de porte de nos armes, donne sans cesse naissance  de nouvelles couves de monstres.\n\nCette horreur ancestrale qui nous surplombe va goter  nos glaives vengeurs! Tirez sur un des fils de sa toile au besoin, et quarrissez tout ce qui apparatra. Nous partirons une fois justice rendue!', '', '', '', '', '', '', 57534),
(79955, 'frFR', ' Et maintenant, je suis arachnophobe', 'Trouvez les amis d\Albert dans les murs.', 'Qui est l? Il y a quelqu\un? Je ne vous imagine pas?\n\nJe suis Albert. J\tais autrefois guide. Maintenant que je suis aveugle, je ne vois plus aucun sens  ma vie. Il me semble inappropri de m\appeler le guide Henson. Mais j\entends. Je les entends manger. Ils mangent les parties fraches.\n\nMes yeux. Mes entrailles.\n\nJe souffre en permanence. Ils ne veulent pas de mes organes putrfis. Les parties dcomposes sont tout ce qu\il me reste. Le pire de moi-mme.\n\nJe n\tais pas seul ici, j\avais des camarades guides. Je continue d\entendre des gmissements provenant des murs. Les entendez-vous aussi?', '', '', '', '', '', '', 57534);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(79954, 'frFR', 'Des araignes!', 'Trouvez la cl perdue d\Ag\thax dans le nid du pilier Xesh.', 'Bonjour, $gmon petit:ma petite; $pr. Vous semblez pouvoir me venir en aide.\n\nMa tendre compagne Ami\thax est tombe sur une dague tranchante. Son corps a t emmen au nid du pilier Xesh, juste en dessous de l\endroit o nous nous trouvons. Xesh est utilis pour se dbarrasser de toutes sortes de corps dont on ne parle plus jamais.\n\nMalheureusement, je dois parler d\Ami\thax, car elle avait sur elle la cl de mon nouveau terrier de Haut-Creux lorsqu\elle est morte. C\est quand mme pas de chance. Pourriez-vous aller la rcuprer?\n\nAttention aux araignes, j\ai besoin de ma cl.', '', '', '', '', '', '', 57534),
(79944, 'frFR', 'Failles dchanes', 'Dtruisez $1oafailles et dcouvrez leur point d\origine dans la grotte.', 'Les lmentaires viennent de cette grotte. Nous n\y avons avanc qu\un peu avant de devoir nous replier. \n\nJ\ai aperu des lueurs plus loin, une trange masse brillante semblable  une faille dans l\espace par laquelle les lmentaires passaient! Nous avons russi  fermer l\un de ces portails, mais il y en a d\autres.\n\nJe dois rester avec Nanthaz. Je vous confie la suite, si vous en tes capable. Dtruisez les failles et trouvez leur point d\origine. Je pense qu\il se situe plus loin dans la grotte.', '', '', '', '', '', '', 57534),
(79730, 'frFR', 'Poursuite obstine', 'Vainquez Rez\kal, le courtier royal.', 'Bien entendu, se contenter de voler les reliques ne suffit pas. Il faut donner une bonne leon aux vers de terre de la reine afin qu\ils ne recommencent plus!\n\nCe bouffon qui crie prs du passage central est Rez\kal, un membre de l\entourage acadmique personnel d\Ansurek. Il n\est pas trs fut, mais il compense par une force suffisante pour nous faire traverser un mur.\n\nJe n\ai pas envie de me mesurer  ce grand dadais aujourd\hui. Pourriez-vous me rendre un dernier service?', '', 'Un homme de main sureki charg de supprimer les vieilles histoires du conservatoire Royal.', 'Courtier royal Rez\kal', '', '', '', 57534),
(79729, 'frFR', 'Une bonne leon', 'Trafiquez les lance-ombres se trouvant devant chacune des quatre reliques de la fondation.', 'Les reliques de la fondation ont toujours t les pices matresses de la collection du conservatoire. Ensemble, ces quatre artfacts racontent notre histoire la plus vnrable: celle de la fondation d\Azj-Kahet et du rejet de nos vieux matres par notre peuple.\n\nAvec un peu de chance, ils se trouveront encore dans le conservatoire. Une fois  l\intrieur, je veux que vous trafiquiez les lance-ombres installs devant chacune des reliques. Faites en sorte que leurs messages soient entendus par quiconque se trouve  proximit, qu\il le veuille ou non.', '', '', '', '', '', '', 57534),
(79728, 'frFR', 'C\est probablement rien', 'Interagissez avec l\orbe des Titans.', 'Vous avez trouv un orbe bzzt-bzzt!\n\nEuh, c\est comme a que les Flairans et Flairanes l\appellent, alors je fais pareil.\n\nIl est toujours en bon tat. Toujours en train de bourdonner, de fredonner et chaud au toucher! Je n\en ai pas vu depuis la grotte de Zaralek!\n\n$n, si vous le voulez bien, vous devriez essayer de le faire fonctionner. Je vais rester en retrait, ici, juste au cas o il serait peu aimable.\n\nIl n\y a pas de quoi s\inquiter, j\en suis sr.', '', '', '', '', '', '', 57534),
(79727, 'frFR', 'Babiole qui brille', 'Rcuprez l\artfact de l\immense Gorloc.', 'Pendant que ces deux-l vous donnaient des ordres, je me suis dit que j\allais faire quelque chose d\utile et m\assurer que les Gorlocs ne viendraient pas nous prendre par surprise sur la plage.\n\nAucun ne semblait s\intresser  nous, mais c\est alors que j\en ai vu un immense.\n\nIl a tu certains de ses semblables plus petits et s\est enfui. Il tenait quelque chose de brillant dans ses griffes!\n\nCe devait tre un artfact. Et il avait l\air de fonctionner! Nous devons le rcuprer.\n\nEt par nous, j\entends vous. Les Gorlocs plus grands que la moyenne sont au-dessus de mon salaire du Dracaret.', '', 'Cet norme Gorloc a tu d\autres membres de son espce pour obtenir un artfact des Titans brillant et chauffant.', 'Gramouarle', '', '', '', 57534),
(79726, 'frFR', 'Mon inventaire  moi', 'Rcuprez 7artfacts des Titans.', 'Comme vous le savez, nous sommes ici pour collecter de jolies babioles des Titans!\n\nEt Rannan se dit que plus nous trouverons de bab euh, d\artfacts, plus nous aurons de chances d\en savoir plus sur les Titans.\n\nIl sera ravi, mais je ferai en sorte d\en rcuprer assez pour en rapporter pour ma boutique.\n\nMon pouse, Perisimona, m\attend  Terreau. Je ne peux pas revenir les mains vides!', '', '', '', '', '', '', 57534),
(79725, 'frFR', 'Des bouillottes lgendaires', 'Rannan vous demande de tuer 12Gorlocs.', 'Tharessa est partie en mission de reconnaissance pour nous. Elle a dcouvert que les Gorlocs dterraient des artfacts pour les enlacer.\n\nJ\imagine que ces artfacts mettent de la chaleur? Peut-tre que certains d\entre eux sont encore fonctionnels?\n\nImaginez un peu: les Titans ont cr une technologie pour modeler le monde et, maintenant, de la poiscaille s\en sert pour se rchauffer les branchies. Ha ha!\n\nLes Gorlocs ne s\en spareront pas et je n\ai pas spcialement envie de finir en brochette. Cela me gne de vous le demander, parce qu\ils ne cherchent qu\ se rchauffer, mais vous pourriez vous occuper d\eux?', '', '', '', '', '', '', 57534),
(79724, 'frFR', 'Une expdition titanesque!', 'Retrouvez Rannan aux Trois-Boucliers.', 'Une amie marchande nous a parl de petites les au nord-est appeles les Trois-Boucliers.\n\nApparemment, les Titans y furent trs actifs il y a bien longtemps. Selon moi, ils y effectuaient des recherches et du dveloppement. C\est palpitant!\n\nJe vais aller inspecter la zone avec Tuberros. Tharessa, ma nouvelle recrue de l\Expdition algarie, nous accompagne pour voir de vritables spcialistes  l\uvre.\n\na vous dit de vous joindre  nous?', '', '', '', '', '', '', 57534),
(79723, 'frFR', 'Rapatriement par soustraction', 'Rcuprez 6trophes pills dans la rserve royale.', 'Ansurek et ses pareils sont si peu perspicaces. Ils pensent qu\en remplissant notre muse de trophes de leurs rcentes conqutes au lieu des reliques de notre histoire, nous serons moins enclins  nous remmorer d\o nous venons.\n\nIls ont sans doute raison, sur le long terme en tout cas. L\histoire a l\habitude de se plier  la voix de celui qui la raconte.\n\nMais c\est l que nous intervenons, $n. Ces reliques que les forces surekis ont voles? Il est temps de les rcuprer.', '', '', '', '', '', '', 57534),
(79721, 'frFR', 'Le feu au terrier', 'Utilisez la Brassecendre pour repousser l\assaut nrubien contre le Proscenium.', 'Qui tes-vous? $gUn autre tranger:Une autre trangre;, je prsume! Je me prsente: Wenbrandt, matre des cendrabeilles et inventeur de la Brassecendre.\n\n<Wenbrandt bombe le torse, s\attendant  vous voir $gimpressionn:impressionne;.>\n\nJ\ai apport des tonneaux de ma meilleure Brassecendre pour aider les personnes blesses, avec l\espoir qu\un petit coup soulagerait la douleur. Mais dans la plupart des cas, cela l\a plutt attise.\n\nJe refuse de voir mon brassin ainsi gaspill. Peut-tre pourrions-nous en faire une arme? Les Nrubiens restent des insectes, faits de chair et surtout inflammables.\n\nLeur terrier ferait un beau terrain d\exprience.', '', '', '', '', '', 'Rejoignez Wenbrandt au sommet du Proscenium.', 57534),
(79718, 'frFR', 'Dans les rues des cheveaux', 'Tuez des agents surekis au conservatoire Royal.', 'Mon plus grand dsir serait d\entrer et d\liminer quelques-uns de ces royalistes surekis prtentieux. a faciliterait nettement notre infiltration, et a leur apprendrait  pitiner notre histoire. Mais impossible d\approcher sans attirer une horde de gardes sur les cheveaux.\n\nVous, en revanche? Personne ne bronchera si un rampe-surface sme la violence gratuitement. Que diriez-vous d\entrer pour claircir leurs rangs?\n\nOh, ne me regardez pas comme a. Vous alliez le faire de toute faon.', '', '', '', '', '', '', 57534),
(79717, 'frFR', 'Les moyens d\entrer', 'Inspectez trois entres potentielles dans le conservatoire Royal.', 'Ah, regardez-vous! Vous tes exactement ce qu\il me faut.\n\nJe m\appelle Ar\syn, je suis un grand connaisseur de l\histoire et des arts de notre peuple. J\ai l\intention de pntrer dans le conservatoire Royal, la grande enclave qui se trouve juste l-bas, pour la piller.\n\nHlas, les gardes ne me laisseront jamais approcher assez prs pour examiner la scurit! Si seulement j\avais quelqu\un pour m\aider  trouver un moyen plus subtil d\entrer dans ce btiment.\n\n<Ar\syn vous lance un regard loquent.>', '', '', '', '', '', '', 57534),
(79716, 'frFR', 'Histoire souterraine', 'Collectez $1oafragments de relique brise sur les lmentaires dans les confins de Golgrin.', 'La console des Titans est une dcouverte majeure. Et regardez-moi ces ruines! Il doit y en avoir d\autres!\n\nMais circuler sur le site est dangereux. D\aprs Brinthe, maintenant que le caveau des Titans a t exhum, des lmentaires ont fait leur apparition.\n\nCes lmentaires n\aiment pas la magie de l\Ordre, et les reliques des Titans en sont tout simplement imprgnes. Ils sont donc dchans!\n\nPouvez-vous vous rendre sur place et rcuprer des reliques auprs des lmentaires? Il faut sauver ce qui peut l\tre!', '', '', '', '', '', '', 57534),
(79715, 'frFR', 'Des solutions audacieuses', 'Rcuprez le cerveau de Grande Gloutonnerie.', 'Il ne me manque plus que quelques donnes.\n\nCes btes sont capables de penser. De s\organiser. De se coordonner. Pour tre tout  fait honnte, il n\y a rien de pire qu\un amphibien capable de manier un boulier.\n\nCe sera donc l\ultime tche que je vous confierai: apportez-moi le cerveau de la plus grosse de ces btes. Il me le faut encore frais, de prfrence non liqufi.\n\nSi vous avez de la chance, il se pourrait que cela les ralentisse.', '', 'Un spcimen unique de la race kobyss, pourvu d\un lobe frontal amlior artificiellement. Il a aussi huit dents surnumraires.', 'Grande Gloutonnerie', '', '', '', 57534),
(79714, 'frFR', 'Des vivres pour vivre', 'Sauvez $2oaKahetis en captivit.', 'En attendant que vous reveniez de votre qute les mains pleines de tripes, j\ai pu constater une activit assez fascinante. Une procession ininterrompue de Kobyss repche les corps des miens dans les eaux du lac puis les trane vers leurs cavernes,  l\ouest.\n\nQu\est-ce que j\en dduis? Que ces btes chassent les Nrubiens et les entreposent dans le lac avant de s\en repatre.\n\n ce stade, ce n\est plus de la recherche scientifique, mais un devoir civique: rendez-moi service, sauvez les miens de ce triste destin.', '', '', '', '', '', '', 57534),
(79713, 'frFR', 'Baignade brutale au clair de lune', 'Collectez des intestins de cherchefoie et un estomac de mcheur de jambe.', 'Une patte de Nrubien sublim\n\nQu\une tribu de Kobyss se repaisse d\une ou deux douzaines de vraie-ligne ou de grouilleurs, voire d\un sage comme moi, passe encore, mais un Nrubien sublim, c\est une autre histoire.\n\nTchons d\aborder les choses de faon intelligente et utilisons les outils dont nous disposons pour recueillir davantage de donnes. Quels outils avons-nous? Vous. C\est vous, l\outil. Un outil intelligent pour l\limination des Kobyss.\n\nPlongez au fond du lac. Tuez la plus grande de ces cratures ou leurs mascottes.\n\nEt, bien sr, apportez-moi les entrailles.', '', '', '', '', '', '', 57534),
(79711, 'frFR', 'C\est assez immonde', 'Rapportez l\appendice  l\air familier  Al\kubian.', '<Vous retirez un appendice  l\aspect familier de la vase.\n\nIl n\a pas franchement l\air de provenir d\un Kobyss, mais un spcimen unique incitera peut-tre Al\kubian  augmenter votre rcompense.>', '', '', '', '', '', '', 57534),
(79710, 'frFR', 'Une nageoire de chaque sorte', 'Remplissez le sac  entrailles de Kobyss.', 'Oh! Bont divine! DES JAMBES!\n\nVous tes la perfection incarne! Un petit bipde parfait pour mes hautes uvres.\n\nMa discipline est l\alchimie, et un bon alchimiste se doit d\avoir de bons ingrdients. Vous voyez ces Kobyss l-dessous? Cela fait des semaines que je campe ici pour les observer.\n\nIls ont l\air plus robustes que le Kobyss moyen. Qu\est-ce que j\en dduis? Qu\ils doivent tre constitus d\une matire plus robuste! Il me la faut!\n\nPrenez ce sac. Remplissez-le! Remplissez-le de leurs entrailles! Autant que vous pourrez en porter!', '', '', '', '', '', '', 57534),
(79703, 'frFR', 'L\espoir, une anomalie', 'Fabriquez une pice de poterie avec Hreka.', '<Hreka inspecte un par un les objets que vous avez rapports.>\n\nVous avez donc risqu votre vie pour trouver notre amie.\n\nModhina n\est plus. Ses notes traitent des minerais rares de la grotte. En les faisant fondre, on obtient un sublime vernis pour les poteries.\n\nQue puis-je faire? Je ne suis pas une combattante. Je ne peux la venger. D\ailleurs, la terre a dj revendiqu son corps,  en juger par l\tat de son fragment de gemme mmorielle.\n\nIl ne me reste plus qu\ concevoir une poterie. Vous voudriez bien m\aider?', '', '', '', '', '', '', 57534),
(79701, 'frFR', 'La cavalerie est arrive', 'Repoussez l\attaque nrubienne au Proscenium.', '<Baelgrim tremble de rage.>\n\nMaudits Nrubiens! Attaquer un site de soins! Toutes ces personnes blesses et sans dfense Malgr les circonstances, vous leur avez fait voir du pays!\n\nNous ferons mordre la poussire  ces maudits insectes, jusqu\au dernier.', '', '', '', '', '', 'Rejoignez Baelgrim au sommet du Proscenium.', 57534),
(79692, 'frFR', 'Enterre mais pas oublie', 'Trouvez Modhina et ses affaires dans les tunnels aux filons prcieux.', 'Il y a plusieurs soleils de cela, mon amie Modhina s\est aventure dans la carrire. Elle souhaitait trouver des minerais rares pour Hreka afin de l\aider dans ses crations. Modhina tait trs enthousiaste  cette ide, je m\en souviens bien. C\est rare pour une Terrestre.\n\nElle n\est jamais revenue. Les fongiciens nous empchent de fouiller la zone.\n\nVous nous feriez une grande faveur en la cherchant. J\ignorais qu\il tait possible de passer tant de temps  s\inquiter pour quelqu\un.', '', '', '', '', '', '', 57534),
(79691, 'frFR', 'Des monstres dans le noir', 'Terrassez le traqueur en pierre cendr dans les tunnels aux filons prcieux.', 'La carrire locale tait une de nos sources principales d\argile et de minerai avant que les fongiciens ne l\envahissent.\n\nNous craignions qu\ils ne s\en prennent au village, mais ce n\est pas tout.\n\nOn nous a signal une crature bien plus imposante que les btes du coin. Elle apparatrait la nuit.\n\nJe crains que la disparition de Modhina ne soit pas qu\une concidence. Elle s\est rendue dans la carrire rcemment et n\est jamais rentre.\n\nVous nous rendriez un grand service en acceptant de fouiller les tunnels.', '', 'Un traqueur des profondeurs de la terre capable de dvorer les cratures les plus coriaces.', 'Traqueur en pierre cendr', '', '', '', 57534),
(79686, 'frFR', ' propos des fongiciens', 'Collectez les notes de recherche restantes et apportez-les  leur propritaire  Landefrey.', '<Abandonn dans une pice faiblement claire, le parchemin, froiss et us, porte les traces de quelques notes griffonnes  la hte.>\n\nEntre de journal 235-18-7\nDate: quart du cycle de la fabrication\n\nObservation: les fongiciens prsentent une croissance acclre et une agressivit territoriale accrue. La dispersion des spores semble avoir quadrupl par rapport aux derniers taux enregistrs.', '', '', '', '', '', 'Apportez les notes  Yeonin,  l\herboristerie de Landefrey.', 57534),
(79683, 'frFR', 'On n\est vraiment bien qu\avec une bougie', 'Aidez la contremtre Grimes, Tocard et mamie Gribouille.', 'Agrable d\avoir un nouvel endroit  appeler maison, $n.\n\nMais nous pas tre tout  fait installs. Nous pas connatre Gundargaz. Gundargaz pas connatre nous.\n\nIl est temps de changer choses! Nous dcouvrir comment aider autour d\ici tout en apprenant nouveaux amis  notre sujet. Kobolds tre aussi intelligents qu\amicaux, devrait tre facile!\n\nCommencer par aider trois Kobolds.\n\nContremtre Grimes vouloir travailler tout de suite. Elle tre trs travail.\n\nMamie Gribouille tout vous raconter sur culture kobold.\n\nEt Tocard vouloir monter un nouveau commerce en ville, vendre des bougies  Gundargaz.', '', '', '', '', '', '', 57534),
(79682, 'frFR', 'Pression critique!', 'Ouvrez la soupape de dcharge principale et ragissez en fonction de ce qui arrivera.', 'Pression rester trop leve! Y avoir un autre problme, a pas venir que des vieilles conduites.\n\nVous ouvrir soupape de dcharge principale avant que queq\chose exploser. Pas le temps de suivre manuel.\n\nNous s\occuper des consquences plus tard!', '', '', '', '', '', '', 57534),
(79681, 'frFR', 'Le pouvoir de la plomberie', 'Utilisez l\accs aux tunnels pour dessiner le trac des conduites de vapeur  Gundargaz.', 'Conduites qui fuir pas toutes accessibles de l\extrieur. Y en avoir dans tunnels sous Gundargaz.\n\nTunnels trop petits pour Ttes-de-Caillasse, mais Kobolds adorent tunnels! Faut juste que quelqu\un leur montrer disposition. Vous tre quelqu\un.\n\nVous aller voir chef d\quipe en cas de problme. Lui vous aider avec cartes.', '', '', '', '', '', '', 57534),
(79680, 'frFR', 'Colmatage de fuites', 'Approchez en volant des conduites de vapeur qui fuient au-dessus de Gundargaz pour les colmater avec la colle kobold.', 'Vieilles conduites pas apprcier secousses. Vapeur s\chapper un peu partout. Surtout de celles hors d\atteinte.\n\n<La contremtre Grimes vous montre les conduites qui partent de Gundargaz vers la surface.>\n\nTtes-de-Caillasse pas avoir de pices de rechange officielles, mais nous pas pouvoir attendre.\n\nVous prendre colle et aller boucher failles avec votre bestiole volante. Bonne colle d\insectes, avoir fait bouillir moi-mme. a suffire pour aujourd\hui.', '', '', '', '', '', '', 57534),
(79679, 'frFR', 'Un esprit embrum dans la mine', 'Cherchez Munderut dans la mine de Nibelgaz.', 'Les ouvriers et les ouvrires disent avoir vu Munderut vers le fond de la zone d\extraction. Trouvez-le et dites-lui qu\il doit venir me voir. \n\nIl est possible qu\il ne se souvienne pas de moi et qu\il ait aussi oubli que je suis sa fusionne. Dites-lui de regarder le mdaillon qu\il porte sur sa poitrine. Ses souvenirs des moments que nous avons partags s\effacent, mais le mdaillon est un tmoignage ternel de notre histoire et notre lien.', '', '', '', '', '', '', 57534),
(79669, 'frFR', 'Moi prendre bougie!', '', '', '', '', '', '', '', '', 57534),
(79667, 'frFR', 'C\est lmentaire', '', '', '', '', '', '', '', '', 57534),
(79659, 'frFR', 'Les Fils tranchs', '', '', '', '', '', '', '', '', 57534),
(79655, 'frFR', 'Arathis de Sainte-Chute', '', '', '', '', '', '', '', '', 57534),
(79651, 'frFR', 'Partenaires commerciaux', 'Dcouvrez Mmarl.', 'Avez-vous visit Mmarl? C\est une ville marchande situe au sud-est d\ici.\n\nPendant que vous y tes, gotez au barbecue de Corby!', '', '', '', '', '', 'Allez  Mmarl  Azj\Kahet.', 57534),
(79650, 'frFR', 'Prieur de la Flamme sacre: le chagrin d\un frre', 'Affrontez la prieuresse Haelsey Murrpray au prieur de la Flamme sacre.', 'Je crains que la prieuresse ne soit  l\origine de la disparition des corps et du baron. Sybaestan s\est lui aussi volatilis et je ne crois pas aux concidences. \n\nSybaestan et elle n\ont pas russi  accepter nos rcentes pertes. J\ai peur que leur chagrin abme leurs mes. Nous devons les retrouver et les ramener  la raison si c\est possible.\n\nRptez  la gnrale Heurtacier ce que vous avez dcouvert. Nous aurons peut-tre besoin de son aide. Je vous attendrai ici.', '', '', '', '', '', '', 57534),
(79649, 'frFR', 'Inquisition de la Flamme sacre', 'Interrogez le clerg local.', 'Tous les morts se sont volatiliss? Comment est-ce possible? Ils taient tous allongs l, dans l\attente de leur crmation. Qui a bien pu les dplacer? Il doit bien y avoir des tmoins.\n\nAllez voir tous les gens du coin susceptibles d\avoir vu quelque chose pendant que je vais parler  mes suprieurs. Nous dcouvrirons le fin mot de l\histoire et retrouverons nos morts pour leur offrir le repos ternel qu\ils mritent.', '', '', '', '', '', 'Retrouvez sur Blayze sur les marches du prieur.', 57534),
(79648, 'frFR', 'Proche disparu', 'Collectez les restes de Thlon.', 'Thlon tait un brave garon, mais nous devons maintenant offrir son corps aux flammes.\n\nSybaestan n\est pas en tat de porter son frre. Pourriez-vous prendre ses restes parmi les autres personnes attendant leur dernier repos?', '', '', '', '', '', '', 57534),
(79647, 'frFR', 'Brlantes rflexions', 'Aidez Sybaestan  faire le deuil de son frre.', 'Sybaestan aurait sans doute besoin de soutien. Son petit frre tait aussi son meilleur ami. Seule la mort pouvait les sparer et c\est justement ce qu\il s\est pass. Il le prend trs mal.\n\nNous avons pour coutume de brler des mots voquant nos souvenirs des dfunts. En les remettant aux flammes, nous soulageons nos curs et laissons la chaleur de ces souvenirs nous soigner. C\est un moment mouvant. Vous avez assist  la fin de Thlon. Sybaestan devrait apprcier.', '', '', '', '', '', 'Retrouvez sur Blayze prs de la flamme du souvenir.', 57534),
(79646, 'frFR', 'Vin du souvenir', 'Prparez du vin du souvenir avec le frre Abalard.', 'Oh, Thlon. Il suivait son grand frre partout. \n\nPendant que nous le prparons pour son dernier repos, voulez-vous bien aider le frre Abalard  prparer le vin du souvenir pour la crmonie?', '', '', '', '', '', '', 57534),
(79645, 'frFR', 'Infestation de pique-sucres', 'Collectez 10fioles de venin de gupe.', 'Pauvre Thlon. C\est moi qui lui avais appris les bases du combat. Je prendrai soin de lui jusqu\ sa crmation.\n\nQuant  vous\n\n J\ai tent d\endiguer une infestation de pique-sucres qui menaait nos oprations vinicoles. J\ai besoin de quelqu\un pour finir le travail pendant que je m\occupe de Thlon.\n\nAvec un peu de ruse et d\adresse, vous devriez parvenir  rcolter un peu de leur venin. Nous en ferons un poison pour les sites de nidification afin de nous dbarrasser de ces nuisibles pour de bon.', '', '', '', '', '', '', 57534),
(79644, 'frFR', 'Rendez-vous au prieur.', 'Retrouvez sur Etna Blayze au prieur de la Flamme sacre.', 'Je Je n\ai pas les mots. Thlon\n\nJe vais rcuprer son corps. Ils sauront quoi faire au prieur.\n\nOh, mon frre a ne devait pas se passer comme a', '', '', '', '', '', 'Retrouvez sur Etna Blayze au prieur de la Flamme sacre.', 57534),
(79643, 'frFR', 'L\effroyable Croc-d\Effroi', 'Tuez Croc-d\Effroi l\Impitoyable.', 'Mon frre et moi avons port un grand coup aux Kobyss, $n, mais vous auriez pu en faire davantage.\n\nLe plus terrible d\entre eux doit encore goter  ma lame. Si nous abattons leur chef, le reste de la meute ne tardera pas  regagner les eaux qu\ils n\auraient jamais d quitter.\n\nAllons nous occuper de Croc-d\Effroi!', '', 'Tuez Croc-d\Effroi l\Impitoyable.', 'Croc-d\Effroi l\Impitoyable', '', '', '', 57534),
(79642, 'frFR', 'Retour de bton', 'Collectez 5btons des eaux sombres.', 'Sans leurs armes magiques, les lanceurs de sorts kobyss ne pourront plus faire appel  leur ignoble ncromancie.\n\nVolez leurs btons, nous les jetterons dans la Flamme sacre pour en tre dbarrasss.', '', '', '', '', '', '', 57534),
(79641, 'frFR', 'Effacer leur sourire', 'Collectez des dents de Kobyss sur les Kobyss tus.', 'Les Kobyss ont du cran de penser qu\ils peuvent profaner librement notre terrain d\Adulation. Je propose de prlever leurs dents pour effacer leurs sourires arrogants.\n\nVenez! Mon frre et moi, nous allons dbarrasser ces terres de ces cratures. Essayez de suivre!', '', '', '', '', '', '', 57534),
(79636, 'frFR', 'missaire de l\assemble', '', '', '', '', '', '', '', '', 57534),
(79634, 'frFR', 'NE PAS UTILISER  Renomme auprs de l\Assemble des profondeurs', '', '', '', '', '', '', '', '', 57534),
(79633, 'frFR', 'L\hritage de la Tisserande', 'Ramenez Meesk la Langue de venin jusqu\ la Tisserande.', 'Je frmis d\impatience! Rencontrer quelqu\un devant qui mme les rampe-surfaces s\agenouillent? Cela faisait longtemps que j\attendais pareille entrevue.\n\nJ\espre que ce n\est pas trop loin. J\organise un dner mondain ce soir pour des Surekis.', '', '', '', '', '', 'Retournez voir la veuve Arak\nai au repaire de la Tisserande.', 57534),
(79631, 'frFR', 'La grande vasion de Klaskin', 'Ramenez Klaskin auprs d\Arax\ne au bazar Ombreux.', 'Par les fils de soie, je suis sauv!\n\nIl est capital que je rentre  la maison sans que ma femme me voie.\n\nJe suis parti aprs nos noces, la nuit dernire, alors si elle me voit, je suis mort! Si les gardes me trouvent, ils prviendront srement Arax\ne.\n\nPourriez-vous m\aider  rentrer chez moi en vitant les gardes?', '', '', '', '', '', '', 57534),
(79630, 'frFR', 'Recherches dans la toile', 'Localisez Klaskin, le mari d\Arax\ne, au bazar Ombreux.', 'Oh, les creux soient lous! Vous devriez pouvoir m\aider.\n\n<La Nrubienne tapote ses multiples yeux avec un mouchoir en soie.>\n\nC\est horrible! C\est terrible! C\est une tragdie! Mon mari a disparu! Nous nous sommes maris hier! La crmonie s\est droule  merveille\n\nMais au moment de nous retirer pour la nuit, il avait disparu.\n\n<Elle renifle de faon thtrale.>\n\nJe vous en prie, pourriez-vous le retrouver et me le ramener  la maison?', '', '', '', '', '', '', 57534),
(79628, 'frFR', 'missaire du conseil', '', '', '', '', '', '', '', '', 57534),
(79627, 'frFR', 'Vin pour Vendetta', 'Trouvez un moyen de charmer Meesk la Langue de venin.', 'Tout devient clair, ma friandise. Le trac de notre future tapisserie se rvle sous nos yeux.\n\nMeesk est sous bonne garde. Il s\imagine tre en scurit, et c\est l que rside son point faible.\n\nRendez-vous en ville et procurez-vous une bouteille de sa boisson prfre. Vous la lui prsenterez comme un cadeau de votre bienfaitrice. Une fois notre larron sduit par vos charmes, vous l\amnerez  Haut-Creux pour qu\il reoive enfin ce qu\il mrite.\n\nJe vous fais confiance, $n. Si notre plan habilement tiss se droule comme prvu, je vous promets un spectacle mmorable.', '', '', '', '', '', 'Retrouvez Meesk la Langue de venin au bazar Ombreux.', 57534),
(79625, 'frFR', 'Pas tout  fait mort', 'Examinez le tas de dtritus au bastion du Sige.', 'Je suis le gnral Anub\azal.\n\nJe dteste que de minuscules bipdes comme vous se trouvent au bastion du Sige, mais a ne dpend plus de moi. Zev\kall est en train de me chasser de ma forteresse militaire et de rassembler des rampe-surfaces! La reine a jug bon de le nommer grand gnral, mais c\est une aberration de la nature, indigne de ce poste. Je ne le tolrerai pas! \n\nJ\ai dcid de vous utiliser, vous et votre race, contre lui. Et, oui, vous y trouverez votre compte.\n\nFouillez ce tas de dtritus l-bas, vous verrez.', '', '', '', '', '', '', 57534),
(79622, 'frFR', 'Warband Test Quest (DNT)', '', '', '', '', '', '', '', '', 57534),
(79580, 'frFR', 'Contre offensif', 'Tuez $1oaNrubiens.', 'Je ne cderai pas ce terrain.\n\nAllez tuer tout ce qui a plus de deux jambes!', '', '', '', '', '', '', 57534),
(79579, 'frFR', 'Mine de rien', 'Traversez $1oamines nrubiennes en volant sous l\effet de Lance sacre.', 'Notre supriorit arienne nous fournit un avantage, mais elle est compromise par les mines nrubiennes.\n\nVotre monture est plus maniable que nos canots. Envolez-vous et allez dtruire ces mines.\n\nJe vais dployer les ressources disponibles afin de vous bnir pour amliorer vos capacits.', '', '', '', '', '', '', 57534),
(79574, 'frFR', 'Le second front', 'Marquez la zone d\atterrissage.', 'Nos renforts sont dj en route.\n\nCes araignes ont dcid o on va placer notre prochain mur. Dgagez une zone d\atterrissage pour la gnrale Heurtacier.', '', '', '', '', '', 'Prsentez-vous  la gnrale Heurtacier.', 57534),
(79565, 'frFR', 'Les bougies de Tocard', 'Procurez-vous les pices dont Tocard a besoin pour construire son tal  Gundargaz.', 'Maintenant que nouvelles bougies tre prtes, reste qu\ installer tal! Pour proposer bougies de qualit  bon prix! a, Tocard le garantir.\n\nProblme tre que moi pas avoir d\tal. Vous pouvoir aller parler  Bosh,  Gun-dar-ghaz, pour moi? Lui avoir tout ce qu\il faut.\n\nFalloir peut-tre marchander, mais vous parler bien! Vous obtenir les pices.\n\nMoi vous retrouver l-bas!', '', '', '', '', '', '', 57534),
(79556, 'frFR', 'Formation sur le tas', 'Aidez Hurlt Garde-vapeur  rparer les installations  vapeur.', 'Les Ttes-de-Caillasse faire tout fonctionner avec vapeur ici. Il y avoir lave, eau, tre logique.\n\nRparations mal se passent, parat. Pas de pices neuves d\usine. Pas tre rglementaire d\utiliser ferraille.\n\nAider  faire fonctionner les vieilles machines. On va observer, apprendre. Peut-tre que pouvoir aider sans se faire crier dessus.', '', '', '', '', '', '', 57534),
(79555, 'frFR', 'Cire exprimentale', 'Rcuprez des excrtions cireuses et apportez-les  Tocard de Gundargaz.', 'Sa rcolte n\est pas agrable, mais cette substance cireuse pourrait faire de bonnes bougies.\n\nElle pourrait intresser Tocard, le fabricant de bougies de Gundargaz.', '', '', '', '', '', '', 57534),
(79554, 'frFR', 'Hydrocarbures sacrs', 'Rcuprez des bougies votives pour Tocard de Gundargaz.', 'Ces bougies votives pourraient intresser Tocard, le fabricant de bougies kobold de Gundargaz.', '', '', '', '', '', '', 57534),
(79553, 'frFR', 'Remde naturel', 'Collectez $1oaquartiers de fongiciens dans la Mineroc.', 'Nous avons stabilis l\tat de la plupart des personnes blesses, mais beaucoup de Terrestres  qui vous avez port secours ont besoin d\assistance. Les Nrubiens ont souvent recours  des poisons si corrosifs qu\ils rongent mme nos corps de pierre.\n\nNos spcialistes en gurison utilisent depuis longtemps la chair de fongicien pour ses vertus curatives. Par consquent, l\invasion de notre carrire par les fongiciens est presque une aubaine,  nous de savoir nous adapter.\n\n<Malgr son regard sombre, Adelgonn transpire la fiert.>\n\n nous de savoir nous adapter. Comme l\ont toujours fait les Terrestres.\n\nMais je ne peux abandonner Ebona. Pourrez-vous m\aider?', '', '', '', '', '', '', 57534),
(79552, 'frFR', 'Cire chaude', 'Rcuprez $1oachantillons de cire d\abeille de feu sur la Braiselande.', 'Oh. Abeilles de feu plus grosses que Tocard penser. Mchantes!\n\nAutres ruches encore plus mchantes. Ici tre mieux.\n\nToi aller chercher cire. Tocard rester ici pour superviser. Voil!', '', '', '', '', '', '', 57534),
(79546, 'frFR', 'Le cland des machines', 'Entrez dans le bar clandestin situ dans les tunnels sous Dornogal, puis confrontez-vous  Obstorn.', 'Les mandataires des machines sont des entits mystrieuses qui avancent masques. Certaines sont de grandes paranoaques.\n\nCela dit, je pense que leur ressentiment  l\gard de Veinacier doit tre apais.\n\nComme vous avez pu le remarquer sur la Forgeplace, la querelle avec un simple contrebandier a mis l\quilibre de la ville en pril. En tant que conseiller, je ne peux le tolrer.\n\nAllons demander  Obstorn, l\employ d\Ardgrin, s\il peut livrer un message diplomatique  son superviseur dans les abmes.\n\nJe vous retrouverai dans les tunnels.', '', 'Merrix pense que ce litige peut tre rgl pacifiquement et sans conflit.', 'Obstorn', '', '', '', 57534),
(79545, 'frFR', 'La prfte de la Placeforge', 'Procurez-vous une fiole d\opale liquide auprs de Vokgret.', 'J\ai toujours entendu dire que l\opale liquide avait un got dlicieux, mais j\ai beau plucher les ventes aux enchres, je n\ai jamais vu qui que ce soit en vendre. C\est une denre rare.\n\nHeureusement pour vous, je connais une personne qui peut s\en procurer. Vokgret, la prfte de la Placeforge. Aucune marchandise ne circule en ville sans qu\elle ne soit au courant.\n\nJ\vite de faire affaire avec quelqu\un d\aussi connect qu\elle, mais vous, a ne vous drangera pas, j\en suis sre!\n\n cette heure, vous devriez la trouver  l\auberge.', '', '', '', '', '', 'Retournez voir Vokgret  l\auberge.', 57534),
(79544, 'frFR', 'Scurit ngocie', 'Convainquez Bevrusi de vous donner accs au bar clandestin de Brassecendre.', 'Si nous voulons rsoudre  l\amiable cette querelle entre Veinacier et Ardgrin, nous devrons nouer de nouvelles amitis.\n\nObstorn, un employ d\Ardgrin, frquente un bar clandestin de Brassecendre  Dornogal. Seuls les mandataires des machines y sont admis.\n\nMme en tant que conseiller, je n\y suis pas le bienvenu. Mais ce n\est pas le cas d\autres personnes en ville.\n\nBevrusi, une commerante de Gundargaz, devrait pouvoir vous aider. Si vous parvenez  lui graisser la patte, elle pourra peut-tre vous accorder un accs.', '', '', '', '', '', '', 57534),
(79543, 'frFR', 'Bienfaiteur de Dornogal', 'Livrez les marchandises de contrebande dans tout Dornogal.', 'Vous avez une opportunit inoue, $n. L\opportunit d\apprendre.\n\nVous avez rencontr ceux et celles qui ont tran les personnes ayant enfreint les dits devant la justice, mais qu\en est-il du peuple de Dornogal? Que pensent les Terrestres de Veinacier?\n\nRendez-moi service. Apportez les marchandises de contrebande que vous avez interceptes  leurs destinataires d\origine. Dites-leur qu\il s\agit de cadeaux de la part d\un ami commun.\n\nCela vous surprendrait de savoir  qui profitent ces activits illicites.', '', '', '', '', '', 'Allez voir Merrix  la terrasse des Gardiens.', 57534),
(79542, 'frFR', 'Convocation du conseiller', 'Retrouvez Merrix  l\Ascension du conseiller  Dornogal.', 'Le conseiller Merrix requiert votre prsence  son bureau.\n\nIl a reu les documents que vous lui avez remis et souhaite s\entretenir plus longuement avec vous de Veinacier.\n\n<Saradi vous observe sans sourciller. La loquacit de la Terrestre ne semble pas tre sa qualit premire.>', '', '', '', '', '', 'Retrouvez Merrix  l\Ascension du conseiller.', 57534),
(79541, 'frFR', 'Nettoyage par le feu', 'Brlez les curs du nid du pilier et remplacez l\encens dans la grotte de Mmarl.', 'Comme a, les gens de chez nous ont retir l\encens que les agents flairans utilisaient pour maintenir ces horribles bestioles  distance parce qu\il sentait mauvais?\n\nFranchement, a ne me surprend pas. On doit pouvoir montrer  ces gens qu\ils doivent travailler ensemble. Il faut leur montrer l\exemple! Tenez, je vais vous prter un lance-flammes. Je sais que le mien fonctionne. Et sans effets volaillers bizarres.\n\nEntrez, nettoyez les nids et remettez le bon encens en place!', '', '', '', '', '', '', 57534),
(79540, 'frFR', 'La fte est finie', 'Inspectez la zone du bassin de Mmarl.', 'Non, non, non!\n\ncoutez, j\ai l\habitude de m\occuper des additifs dans notre bassin de baignade, je m\assure que tout reste  un niveau de dangerosit ngligeable, mais ces araignes qui surgissent pour nous dvorer? C\est totalement inacceptable. \n\nNous sommes ici CHEZ NOUS, pourquoi viennent-elles nous ennuyer?', '', '', '', '', '', '', 57534),
(79539, 'frFR', 'lectrisant!', 'Faites la promotion du chapeau de dsinsectisation en frappant des essaimites de Noth avec  l\extrieur de Mmarl.', 'Vous voulez aider la KapitalRisk? Et vous ne voyez pas d\inconvnient  vous mettre en danger?\n\nAlors coutez. Lorsque nous avons pos le pied ici, il n\y avait aucun monstre en ville. Mais aujourd\hui, nous retrouvons des travailleuses et travailleurs morts avec des marques de morsures. C\est mauvais pour les affaires.\n\nHeureusement, j\ai trouv un moyen d\en tirer de l\argent: un casque d\lectrocution. Je l\ai appel mon chapeau de dsinsectisation.\n\nPrenez le dernier modle pour aller l\essayer hors de la ville. Tuez des insectes. La populace flairane vous verra faire, notera que le chapeau de dsinsectisation fonctionne et saura que c\est de la qualit.', '', '', '', '', '', '', 57534),
(79538, 'frFR', 'Buissons odorants', 'Collectez des branches de saugeparfum pour Rhubarn.', 'Jenni ici prsente affirme qu\elle a observ des rampants qui attaquent les cratures gobelines. Je n\en ai pas vu de mes yeux, mais c\est une belle occasion!\n\nNous avons notre propre parfum anti-rampant. C\est la mme recette que l\encens que nous utilisons en ville. Appliquez-le, et personne ne vous approchera! Je parie qu\on pourrait en vendre au peuple gobelin.\n\nMais je suis  court de composants, de branches de saugeparfum, en particulier. Si vous allez m\en chercher, je vous donnerai une part des bnfices!', '', '', '', '', '', '', 57534),
(79532, 'frFR', 'Au service de son araigne', 'coutez les rumeurs au sujet de Meesk la Langue de venin auprs des habitants du bazar Ombreux.', 'Merci d\avoir sauv ma petite Broche de ce mauvais pas, ma petite friandise. En guise de rcompense, je vous fais le privilge de vous laisser vous installer  mon mtier  tisser pour y tracer les lignes de ma prochaine tapisserie.\n\nMeesk la Langue de venin s\en prend  mes tisse-rats. Il salit le nom de ma reine. Et il alimente la campagne de dsinformation d\Ansurek sans mme songer aux consquences.\n\nJe pense qu\il est grand temps de faire passer un message  Meesk et aux mcrants dans son genre. Rendez-vous en ville et apprenez-en autant que vous pourrez sur notre Langue de venin.', '', '', '', '', '', 'Retournez voir la Tisserande non loin du bazar Ombreux.', 57534),
(79530, 'frFR', 'Sale affaire', 'Retrouvez Veinacier dans les abmes Retentissants prs de la porte de Sainte-Chute, puis affrontez le surveillant Ardgrin.', 'Je ne me suis pas rendu dans les abmes depuis l\arrt des machines. Obstorn devra nous guider jusqu\au dpt d\Ardgrin.\n\nUne fois sur place, j\initierai la conversation. S\il se montre draisonnable, ce qui ne m\tonnerait gure, nous rpondrons avec tout autant de violence. Notre objectif est de le faire rentrer dans le rang, pas de le soumettre par la force. Rgner par la peur n\inspire que du ressentiment.\n\nNous vous retrouverons dans les abmes. Ne tranez pas et, bien videmment, n\en parlez  personne.', '', 'Si Ardgrin continue de semer la discorde  Dornogal, le peuple terrestre tout entier va en ptir.', 'Surveillant Ardgrin', '', '', '', 57534),
(79529, 'frFR', 'Forcer ma main', 'Aidez Merrix  se dguiser en Veinacier.', 'Je ne sais pas si Ardgrin essayait vraiment de me saborder ou s\il voulait forcer la confrontation. Dans tous les cas, cette confrontation aura bien lieu.\n\nJ\estime que ce problme peut tre rsolu pacifiquement, mais je ne peux pas m\en charger en tant que conseiller. Veinacier ne s\est encore jamais montr en pierre et en os, mais nous allons corriger cela. Je parlementerai avec Ardgrin dans les abmes afin de mettre fin  cette situation.\n\nJ\aimerais que vous m\accompagniez, mais il vous faut savoir quelques petites choses avant cela. Aidez-moi  me prparer et je vous dirai tout.', '', '', '', '', '', '', 57534),
(79528, 'frFR', 'Dissiper les rumeurs', 'Dispersez $1oagarde-paix murmurants  Dornogal.', 'Beaucoup de mes garde-paix ont dj eu vent de la sdition d\Ardgrin.\n\nOn m\a rapport que des gens ont perdu foi en mon intgrit de conseiller, pensant que j\ai accept des pots-de-vin de la part de contrebandiers pour remplir mes coffres.\n\nJe peux fournir la preuve que ces transactions n\ont jamais eu lieu, bien videmment, mais nous devons les empcher de se concerter et de propager la rumeur. C\est en les martelant qu\on transforme des mensonges en vrits.\n\nSi vous croisez des groupes abordant ce sujet, dispersez-les calmement.', '', '', '', '', '', '', 57534),
(79527, 'frFR', 'Limiter les dgts', 'Arrachez $1oaaffiches sditieuses  Dornogal.', 'Obstorn a confirm qu\Ardgrin, le superviseur de ma chane d\approvisionnement qui va des abmes  Dornogal, est celui qui a alert mes garde-paix.\n\nJ\en dduis donc qu\il est galement  l\origine de cette insurrection. Il a d envoyer ses manuvres afficher les tracts dans la ville.\n\nNous devons  tout prix les arracher avant que la rumeur se propage. Chargez-vous-en pour moi.', '', '', '', '', '', '', 57534),
(79526, 'frFR', 'Sdition', 'Parlez  Merrix  l\Ascension du conseiller  Dornogal.', '<Sur l\affiche, on peut lire:>\n\nMERRIX est CORROMPU! VEINACIER est FAIBLE!\n\nIls sont incapables de protger les Terrestres! Ils se moquent de tout le monde! Ils crachent sur les dits!\n\nMerrix a t SOUDOY pour relancer l\opration de contrebande de Veinacier! Veinacier se CACHE derrire l\autorit de Merrix!\n\nIls vident VOS poches pour remplir les LEURS!\n\nN\COUTEZ PAS LEURS MENSONGES!', '', '', '', '', '', 'Parlez  Merrix  l\Ascension du conseiller  Dornogal.', 57534),
(79525, 'frFR', 'Rapport au conseiller', 'Apportez les reus de Veinacier  Merrix  l\Ascension du conseiller  Dornogal.', 'Ces reus que vous avez trouvs Veinacier est un contrebandier connu que nous traquons depuis belle lurette. Le conseiller sera ravi d\avoir enfin une preuve tangible de ses activits, et peut-tre mme sa position.\n\nApportez immdiatement ces reus  Merrix. Il voudra les tudier en dtail. Il a dit qu\il allait retourner  son bureau, vous le trouverez donc  l\Ascension du conseiller.\n\nJe vais rassembler le reste des preuves pour les lui livrer plus tard. C\tait du bon travail.', '', '', '', '', '', 'Trouvez le bureau de Merrix  l\Ascension du conseiller  Dornogal.', 57534),
(79523, 'frFR', 'Dissimulation de biens', 'Brisez $1oacaisses  faux fond et rassemblez les preuves trouves  l\intrieur.', 'Alors comme a, ces gens craient des compartiments dans les caisses pour y cacher des marchandises supplmentaires? Voil comment ils ont fait entrer et sortir de la contrebande  Dornogal sans que personne ne s\en rende compte.\n\nExcellent travail, $n! Passons  la partie amusante: ces caisses doivent tre forces et les marchandises illgales saisies comme preuves.\n\nDfoncez les doubles fonds des caisses et rapportez-moi tout ce que vous trouverez.', '', '', '', '', '', '', 57534),
(79522, 'frFR', 'Rtention d\informations', 'Interrogez $1oatravailleurs et travailleuses  la chane dans l\espoir d\en apprendre plus sur les cargaisons.', 'Nous avons d passer  ct de quelque chose. Notre source est tout  fait digne de confiance. Nous n\avons aucune raison de penser qu\il s\agit d\une fausse piste.\n\nLe conseiller voudra savoir le fin mot de l\histoire et je refuse de le dcevoir.\n\nNous n\avons pas pu tirer d\autres informations de la main-d\uvre, mais vous aurez peut-tre plus de chance.\n\nParlez avec les gens qui sont dtenus ici et voyez si vous pouvez apprendre quelque chose.', '', '', '', '', '', '', 57534),
(79521, 'frFR', 'Collecte de preuves', 'Collectez $1oacargaisons saisies.', 'Le conseiller Merrix a donn son autorisation pour que les marchandises des abmes soient achemines dans ce dpt. Cependant, on nous a informs qu\il y transitait autre chose que des composants d\artisanat.\n\nDornogal se montre trs strict sur les marchandises que nous changeons et avec qui. Le commerce doit servir les dits et pas les intrts individuels. Nous ne tolrerons aucune transaction non autorise.\n\nNous avons fouill certaines de ces caisses  la recherche de marchandises de contrebande, mais n\avons rien trouv pour le moment. Aidez-nous  jeter un il.', '', '', '', '', '', '', 57534),
(79510, 'frFR', 'La bougie sans mche', 'Revivez l\histoire de mamie Gribouille.', 'Maintenant, raconter histoire d\un endroit trs lointain appel surface. Nouveaux tres amis venir de l-bas, oui, donc savoir de quoi mamie Gribouille parler.\n\n<Mamie Gribouille fait un signe de tte averti en vous montrant du doigt.>\n\nHistoire de dcouverte de la surface par Kobolds et de ce qu\ils avoir trouv. Histoire de bougie sans mche', '', '', '', '', '', '', 57534),
(79508, 'frFR', 'La chevauche sauvage des taupes', 'Revivez l\histoire de mamie Gribouille.', 'Heure pour histoire heureuse. Tous les jours pas tre mauvais.\n\n<Mamie Gribouille gratte doucement Chnouff derrire les oreilles.>\n\nRaconter histoire d\amiti avec taupes. Histoire de Mipsy chevauche-taupes', '', '', '', '', '', '', 57534),
(79507, 'frFR', 'Le jour o les Ttes-de-Caillasse sont arrives', 'Revivez l\histoire de mamie Gribouille.', 'Comment? Vous vouloir histoire effrayante?\n\nVous demander. Mamie Gribouille donner ce que vous vouloir. Et vous rester assis comme bons tendres-pattes.\n\nHistoire la plus effrayante que mamie connatre, oui. Histoire du jour o Ttes-de-Caillasse venir', '', '', '', '', '', '', 57534),
(79505, 'frFR', 'Mchouar et l\effondrement', 'Revivez l\histoire de mamie Gribouille.', 'Asseyez-vous, arrter de parler, et mamie Gribouille racontera une histoire.\n\nHistoire qui vous sauvera peut-tre la vie un jour. Sur ce qui se passe quand pas respecter la parole des vieux sages kobolds. Comme moi!\n\nL\histoire de Mchouar et l\effondrement', '', '', '', '', '', '', 57534),
(79504, 'frFR', 'Gouttine a oubli sa bougie', 'Revivez l\histoire de mamie Gribouille.', 'Runissez-vous, tendres-pattes, et mamie Gribouille racontera une histoire.\n\nHistoire de ce qui s\est pass quand Gouttine avoir oubli sa bougie.\n\nGouttine, petit tendres-pattes comme vous, s\est loign de la tribu', '', '', '', '', '', '', 57534),
(79481, 'frFR', 'Au secours des individus terrifis', 'Sauvez $1oasoigne-larves terrifis.', 'Tout arriv si vite. Nous rcolter ufs et larves, et instant d\aprs, grouiller d\araigne.\n\nNebb traner moi jusqu\ici, beaucoup d\autres pigs. Pris dans toiles pour servir de repas. Faut sauver les soigne-larves. \n\nNous soigner, pas se battre. Pas laisser mes camarades se faire dvorer.', '', '', '', '', '', '', 57534),
(79480, 'frFR', 'Dernier hommage', 'liminez les tranards nrubiens.', 'Je vous prie de pardonner mon absence. Je n\ai jamais eu l\intention de tourner le dos aux chevaucheurs et chevaucheuses de tempte, vraiment. Mais j\ai ressenti le besoin de venir ici rendre hommage  Baelgrim.\n\nMalheureusement, ces satans Nrubiens rdent toujours ici. Je dirais qu\ils cherchent quelque chose, mais j\ignore quoi. Dans tous les cas, je ne tolrerai pas leur prsence l o Baelgrim est tomb.', '', '', '', '', '', 'Retrouvez Olbarig sur le surplomb.', 57534),
(79477, 'frFR', 'En errance', 'Rassemblez les recrues gares.', 'Kurdran Marteau-Hardi est venu entraner les nouvelles recrues chevaucheuses de tempte aux manuvres ariennes. Thrall a dit que son clan chevauchait des griffons comme les chevaucheurs et chevaucheuses de tempte montaient les freux. Il devrait tre d\une grande aide.\n\nMalheureusement, certaines de nos recrues sont parties en vadrouille avec leurs freux de la tempte. Je voulais leur laisser l\occasion de nouer des liens, mais il est temps de rentrer.\n\nPourriez-vous les rassembler? Thrall et moi-mme prparons une surprise pour les leons de ces novices.', '', '', '', '', '', '', 57534),
(79476, 'frFR', 'couter l\appel', 'Aidez $1oaplerines et plerins chous sur la montagne.', 'Des Terrestres de toute l\le se sont fait attirer ici. Quelle trange concidence de vous y voir aussi.\n\nC\est peut-tre li  la disparition de Baelgrim ou  l\arrive d\un nouveau garde-tempte. Ou peut-tre est-ce simplement la pression atmosphrique\n\nEnfin! Ces thories attendront. Dans l\immdiat, nous devons nous occuper des gens en plerinage qui ont btement dcid de se lancer  l\assaut du sommet sans prparation. Ils ne doivent pas nous distraire pendant que nous invoquerons les freux de la tempte.', '', '', '', '', '', '', 57534),
(79475, 'frFR', 'Le pic d\nergie', 'Chargez le conduit d\nergie lmentaire.', 'Avant que ce conduit ne puisse servir  invoquer les freux de la tempte, nous devons le recharger. Il existe d\autres moyens plus conventionnels d\y parvenir, mais nous devrons nous contenter de ce qui est  notre porte. \n\nLe chemin menant au pic est envahi d\lmentaires hostiles jects de la tempte. En les renvoyant dans leur plan, nous pourrons recueillir une partie de leur nergie rsiduelle et recharger le conduit.\n\nPendant que vous vous occupez de cela, nous allons prparer le rituel du pic.', '', '', '', '', '', '', 57534),
