(79372, 'frFR', 'Un fil d\espoir', 'Apportez l\uf  Nebb.', '<La mre des couves est morte, en couvrant un uf de son corps. Elle a donn sa vie pour le protger des araignes.\n\nVous devriez l\apporter  Nebb. Les autres soigne-larves et lui sauraient quoi en faire.>', '', '', '', '', '', 'Apportez l\uf  Nebb.', 57534),
(79371, 'frFR', 'Un remde royal', 'Rcuprez le venin de la reine Rickiticka afin de prparer un nouveau cataplasme pour Mche-pousse.', 'Le cataplasme pas marche! Cire convenir, pas venin?\n\nOui, oui! Pour remde plus puissant, faut venin plus puissant. Nebb voir rampante. Reine rouge et noire, trop grosse pour s\intresser aux Kobolds. Avoir senti larves juteuses et fil dans grotte.\n\nVous devoir la suivre. Rcuprer venin royal. Mche-pousse avoir peu de temps.', '', 'La reine des rampantes rpand sa couve dans le repaire Cliquetant.', 'Reine Rickiticka', '', '', '', 57534),
(79370, 'frFR', 'Un cataplasme contre le poison', 'Utilisez le cataplasme de Nebb sur Mche-pousse.', 'Un peu venin, un peu cire\n\n<Nebb plonge la main dans sa bourse et vous donne une poigne de cire paisse  l\odeur cre.>\n\nOui, oui, a devoir marcher. Trs bon cataplasme, recette de famille. Vite, donner  Mche-pousse. Lui se sentir mieux.', '', '', '', '', '', '', 57534),
(79369, 'frFR', 'Protger la rcolte', 'Rcuprez $1oaufs de larves.', 'Nebb jeune, pas voir plus loin que l\bout du museau. Si rcolte perdue, perdre beaucoup de Kobolds. Pas juste Mche-pousse.\n\nPas de temps  perdre. Kobolds mourir de faim si araignes se gaver de larves et d\ufs.\n\nSauver-les, rassembler ufs. Tout ce que pouvoir porter avant qu\araignes voler.', '', '', '', '', '', '', 57534),
(79368, 'frFR', 'Suspendu  un fil', 'Rcuprez $1oachantillons de venin de rampe-fonds.', 'Lumire bien, mais pas tout. \n\nAraignes arriver de partout. Nebb rapide, Nebb les entendre. Mais mon ami Mche-pousse mordu. tre malade maintenant.\n\nNebb savoir peut-tre comment faire remde avec venin. Faut gurir poison par poison.\n\nRapporter venin. Vite!', '', '', '', '', '', '', 57534),
(79367, 'frFR', 'Un Nebb dans le besoin', 'Rcuprez le lot de bougies et placez-en le long de la barricade.', 'Vous! Pas tre araigne. Devoir m\aider avant qu\araignes revenir. \n\nNebb connatre repaire Cliquetant. Jamais avoir d\araignes ici avant. Elles manger larves, Kobolds. Mais sombres araignes venir des endroits sombres. Elles dtester lumire.\n\nJ\pas pouvoir quitter poste. Vous prendre les bougies? clairer barricade. Garder araignes  distance.', '', '', '', '', '', '', 57534),
(79357, 'frFR', 'Retirer le chapeau', 'Tuez Agaricus Suppure-Fleur.', 'Aemara a parl d\un grand fongicien qui planterait les bogues fongiques. a m\inquite. Il doit y avoir quelque chose dans cette grotte.\n\nOn peut pas se permettre d\attendre que les fongiciens attaquent avec une meute de btes sous leur emprise. Il faut couper leur plan  la racine avant qu\il n\ait le temps de pousser.\n\nAllez au nid du pilier Vosh et tuez le chef des fongiciens!', '', 'Agaricus Suppure-Fleur est le fongicien qui a pris le contrle des btes au nid du pilier Vosh.', 'Agaricus Suppure-Fleur', '', '', '', 57534),
(79356, 'frFR', 'Boute-flammes antifongique', 'Brlez 8bogues de spores fongiques.', 'C\est juste une impression, mais je dirais que les spores qui sortent des bogues fongiques et ceux qui affectent les btes sont lis.\n\n mon avis, si on dtruit les bogues fongiques, a rduira un peu l\emprise qu\ont les fongiciens sur les btes.\n\nPrenez ces bombes incendiaires antifongiques et cramez autant de bogues que possible!', '', '', '', '', '', '', 57534),
(79355, 'frFR', 'Prservation des prisonniers', 'Trouvez $1oamembres de l\expdition.', 'Les btes ont captur des gens  nous! Elles les ont emports pendant qu\on se reposait pour la premire fois depuis notre vasion!\n\nOn vient tout juste d\chapper aux Nrubiens, on peut pas se permettre de les perdre.\n\nFouillez le nid du pilier Vosh. C\est de l que venaient les btes. Avec un peu de chance, les autres sont encore en vie.', '', '', '', '', '', '', 57534),
(79354, 'frFR', 'Les mandataires des machines', 'Assistez  la conversation entre Moira et la mandataire Brinthe  Gundargaz.', 'Ah, $p! Notre $r du jour On parlait de vous justement.\n\n<Moira fait un signe en direction de la mandataire Brinthe.>\n\nIl nous reste quelques affaires  rgler, maintenant que les transgressions du haut-mandataire ont t corriges et que la Machine d\veil a de nouveau t rpare.\n\nVous pourriez rester un peu dans les parages?', '', '', '', '', '', '', 57534),
