(79349, 'frFR', 'Entrepreneur, SA', 'Trouvez Tirenouille  Mmarl.', 'Bravo, vous m\avez impressionne. Vous voil officiellement $gmon:ma; champice! C\est un peu comme $gun champion:une championne;, sauf que je vous paie pour faire des trucs. $GUn:Une; mercenaire, mais en plus classe.\n\nVous devriez rencontrer mon associ, Tirenouille. Il travaille sur des dossiers avec ses propres champices et le peuple flairan de Mmarl. Il aura peut-tre d\autres choses pour vous, mme si je vous dconseille d\acheter ce qu\il tentera de vous vendre.\n\nVous trouverez Mmarl  l\est. Fiez-vous  votre flair, on sent l\odeur  un kilomtre.', '', '', '', '', '', 'Parlez  Tirenouille  Mmarl.', 57534),
(79346, 'frFR', 'Mche a pour voir', 'Collectez $1oapieds de noctetige sur les grandes plantes poussant dans les tnbres.', 'Pcher ici n\est pas une mince affaire, surtout lorsque les tranges bruits venus des ombres commencent  vous taper sur les nerfs.\n\nJ\ai commenc  chiquer les pieds de noctetige que l\on trouve non loin. C\est sucr et caoutchouteux, a occupe la bouche et a m\aide  passer le temps!\n\nSi vous pouviez me donner un coup de main en collectant des pieds de noctetige avec votre monture volante, je vous en serais trs reconnaissant.', '', '', '', '', '', '', 57534),
(79344, 'frFR', 'Odysse urbaine', 'Interrogez les habitantes et habitants de Dornogal pour savoir qui ils soutiennent dans le conflit latent.', 'Vous avez entendu, $n?\n\nDe nombreuses personnes en ville sont disposes  nous prter main-forte en soutenant notre attaque contre les Nrubiens et Xal\atath. Je pense qu\il serait utile d\aller les trouver pour voir comment elles pourraient s\impliquer.\n\nPlus nous rassemblons de soutien, mieux c\est.', '', '', '', '', '', '', 57534),
(79343, 'frFR', ' chaque jour suffit son snif', 'Apportez le drle de globule de cire  Rongetout  Gundargaz.', 'Peut-tre que ce drle de globule de cire intressera les Kobolds de Gundargaz.', '', '', '', '', '', '', 57534),
(79342, 'frFR', 'Dans son dpart', 'Aidez Urtago et Korgran  mener la crmonie.', 'La crmonie peut commencer, $n.\n\nPlacez le bol de cendreplis prs de Korgran, puis donnez-lui la corne.\n\nUne fois la crmonie termine, je serai la nouvelle gardienne. Puis, je gratifierai mon ami d\un ultime adieu.\n\nKorgran s\teindra paisiblement, en sachant que nous tions avec lui dans un lieu qu\il affectionnait particulirement. J\espre qu\il en sera de mme pour moi lorsque mon heure viendra.\n\nC\est un moment difficile, mais c\est un grand honneur d\tre l avec lui et avec vous.', '', '', '', '', '', '', 57534),
(79341, 'frFR', 'Cendres purifiantes', 'Collectez $1oacendreplis prs de l\estuaire Agit.', 'Le peuple dli pratique une crmonie symbolique de purification. Nous l\effectuons avant une dsactivation.\n\nC\est un procd rituel cens nous dbarrasser de nos impurets. Pour le prparer, nous avons besoin de cendrepli, une fleur qui pousse sur l\le. Nous laissons la fume des fleurs brles pntrer dans les fissures de nos corps pour en retirer symboliquement les impurets.\n\nNous sommes ensuite en condition pour vivre nos derniers instants.\n\n<Urtago observe Korgran, la main sur la poitrine. Son visage se dcompose.>', '', '', '', '', '', '', 57534),
(79340, 'frFR', 'Outils de dclaration', 'Collectez $1oacornes en parfait tat prs de l\estuaire Agit.', 'Chez le peuple dli, lorsqu\un gardien ou une gardienne passe les rnes  la personne forme, ce geste fait l\objet d\une tradition.\n\nC\est mtaphorique, bien sr.\n\nKorgran aura besoin d\un cor.\n\nPuis il me fera face et soufflera dedans, me transmettant ainsi symboliquement la charge de gardienne de la cime plore.\n\nJ\ai repr des cornes-de-schiste  l\ouest d\ici; je vous serais reconnaissante de bien vouloir m\en apporter quelques cornes. Je choisirai la plus adapte.', '', '', '', '', '', '', 57534),
(79339, 'frFR', 'Changement dans la tradition', 'Retrouvez Urtago et Korgran sur le rivage.', 'Une personne dlie ne peut pas retourner dans la galerie Primaire. C\est pour cette raison qu\existe la cime plore. Cependant, quand je vois Korgran et que je me souviens de notre dernire conversation\n\nJe ne suis peut-tre pas encore gardienne de la cime, mais dans l\tat o il se trouve, c\est  moi d\endosser cette responsabilit.\n\nLe peuple dli a ses propres rgles et ses propres traditions. Korgran ne veut pas finir  la cime plore? Qu\importe. Il aura sa crmonie en bord de mer.\n\n$n, retrouvez-moi sur le rivage situ au sud-est.', '', '', '', '', '', '', 57534),
(79338, 'frFR', 'Le Terrestre perdu', 'Aidez Urtago  retrouver Korgran.', 'C\est terrible! Je savais que j\aurais d le surveiller de plus prs.\n\nLa dsorientation est l\ultime symptme prcdant une dsactivation, lorsque notre mmoire atteint ses limites et se met  craser des donnes. Plus une personne terrestre se fatigue, plus sa perte d\nergie se traduit en perte de souvenirs. Korgran ne sait peut-tre plus o il est, ni mme qui il est. Il doit avoir si peur!\n\nQuelle imbcile je fais!\n\n$n, je crois que je l\ai vu partir  l\est, vers les arbres. Retrouvons-nous l-bas, sur la route!', '', '', '', '', '', '', 57534),
(79337, 'frFR', 'Le dernier voyage', 'Attendez Korgran puis rejoignez Urtago devant l\avant-poste de Bordechute.', 'Cette lanterne est parfaite.\n\nInutile de tergiverser. Le moment est venu! Je sens ma mmoire se troubler. Nous devons y aller, Urtago nous attend. Elle nous accompagnera pour mon dernier voyage vers la cime plore, o se tiendra une crmonie.\n\n<Korgran se force  sourire.>\n\nRien de trop labor, je vous rassure. Ce sera plus symbolique qu\autre chose.\n\nJ\ai la tte lourde. O est-ce que j\en tais, dj? Ah, oui! Allons retrouver Urtago.', '', '', '', '', '', 'Rejoignez Urtago devant l\avant-poste de Bordechute.', 57534),
(79336, 'frFR', 'Au creuset des souvenirs', 'Aidez Korgran  forger sa lanterne.', 'Avant qu\elle ne s\teigne, nous, les Terrestres, descendions dans la Machine d\veil en contrebas et renouvelions notre cycle. Mais maintenant, mme si elle fonctionnait encore, je verrais mon cycle bris et on se souviendrait de moi tel que je suis.\n\n<Korgran laisse chapper un profond soupir.>\n\nCes mains ont l\air robustes, mais elles s\alourdissent  chaque instant. La raideur de mes poignets et de mes coudes ne me permet plus de transporter les objets jusqu\ la forge.\n\nS\il vous plat, ajoutez les bons matriaux  la forge en fonction de mes besoins.', '', '', '', '', '', '', 57534),
(79335, 'frFR', 'Une dernire tradition', 'Collectez $1oa$lchantillon:chantillons; de minerai et $2oa$lnoyau charg:noyaux chargs;  l\avant-poste de Bordechute.', 'Avant de me dsactiver, je dois fabriquer un objet qui m\est prcieux.\n\ntant li  la pierre, j\ai travaill dans les mines. Je m\tais fait une lanterne, mais je l\ai perdue dans un effondrement. Peu aprs, je suis devenu un Dli.\n\nJe souhaite forger une nouvelle lanterne qui me guidera dans mes derniers instants.\n\nL\ancienne tait faite d\un minerai prsent en petite quantit dans les alentours. J\y avais galement mis un noyau charg comme on en trouve  l\intrieur des crocs-des-temptes qui rdent dans les collines.\n\nAllez me trouver ces composants et je fabriquerai la lanterne.', '', '', '', '', '', '', 57534),
(79333, 'frFR', 'La flotte arrive', 'Effectuez une reconnaissance du port pour reprer d\ventuels vaisseaux des flottes de la Horde et de l\Alliance.', 'Avant mme de dbarquer sur cette le, il tait dj clair comme de l\eau de roche que nous aurions besoin de crer des alliances pour affronter Xal\atath.\n\nJaina et Thrall sont partis chercher du renfort, quant  vous et moi, on a vu ce qu\on pouvait faire du ct des Terrestres.\n\nJ\ai envie de dire qu\on a plutt fait du bon boulot!\n\n<Moira vous sourit, le regard empli de fiert.>\n\nMais il semblerait que nos renforts soient enfin arrivs. Les garde-paix ont repr des navires faisant voile vers nous. Allez voir a de vos propres yeux et vous me confirmerez la bonne nouvelle!', '', '', '', '', '', 'Accueillez Jaina et Thrall  Dornogal.', 57534),
(79329, 'frFR', 'Une moisson luisante', '', '', '', '', '', '', '', '', 57534),
(79328, 'frFR', 'Ambassades et missaires', 'Installez l\ambassade de votre faction  Dornogal.', 'Je craignais ce que nous risquions de trouver en revenant ici, mais c\est avec fiert que je constate que bien que nous ayons t forcs de partir, vous avez pu forger une amiti solide avec les Terrestres pour rsister aux Nrubiens.\n\nAvec votre force, nous l\emporterons. Mais d\abord, il nous faut un plan, et pour l\laborer nous avons besoin d\un endroit o discuter ici,  Dornogal.', '', '', '', '', '', 'Trouvez Moiral  Dornogal et prsentez votre rapport.', 57534),
(79327, 'frFR', 'L\clat scintillant', 'Apportez l\argile scintillante  Orsenth prs de la mine de Nibelgaz.', '<Scintillant d\une lumire intrieure, cet clat de cristal est chaud au toucher.\n\nCe minerai pourrait intresser Orsenth.>', '', '', '', '', '', '', 57534),
(79325, 'frFR', 'Site d\extraction d\Ombreveine', 'Retrouvez ZZ-01-47 au site d\extraction d\Ombreveine.', 'J\ai envoy Zed-Zed vers le site d\extraction d\Ombreveine.\n\nD\aprs ses premires transmissions, la zone est envahie de vers de roche et couverte de cette scrtion. Je lui ai envoy une amlioration en vous attendant.\n\nJ\ignore si ce sera vraiment efficace au combat, mais a devrait au moins faire un choc  quiconque oserait s\en prendre  Zed-Zed.', '', '', '', '', '', 'Retrouvez ZZ-01-47 au site d\extraction d\Ombreveine.', 57534),
(79324, 'frFR', 'Tous au moulin  eau', 'Retrouvez Dagran et ZZ-01-47 au moulin  eau.', 'Notre premier objectif est de relancer le moulin  eau. Rien ne pourra se faire tant que nous n\aurons pas aliment l\usine en nergie.\n\nRetrouvez Dagran et ZZ-01-47 ds que vous serez sur place. Et gardez un il sur eux. Je ne voudrais pas avoir  expliquer  Moira que son fils a t bless, encore moins alors qu\il tait sous ma surveillance.', '', '', '', '', '', 'Retrouvez Dagran et ZZ-01-47 au moulin  eau.', 57534),
(79313, 'frFR', 'Ce qui grandit dans l\obscurit', 'Tuez Barbecreuse.', 'On nous dit de ne jamais marcher dans les tnbres. D\emporter de la lumire partout. La simple ide de retourner par l me terrifiait. \n\nMais vous brillez par votre courage, $n. Vous illuminerez mon chemin si je vous accompagne.\n\nFini de me cacher. Une chitine noire a beau la protger, la bte qui a tu mes camarades va mourir dans cette grotte. Je vous suis.', '', 'Un parasite ignoble que l\on a laiss se renforcer trop longtemps dans les tnbres.', 'Barbecreuse', '', '', 'Retournez voir la capitaine Vrayflamme  la Bont de Dunelle.', 57534),
(79312, 'frFR', 'Fauchage de masse', 'Fauchez 8frondes de souillenectar.', 'Maevest et moi nous sommes spars des autres et avons fui, en laissant leurs cris derrire nous. Une substance immonde a touff nos lanternes et nous nous sommes retrouvs  trbucher dans le noir, de l\eau jusqu\aux genoux. J\ai entendu un floc, comme si elle tait tombe dans l\eau, mais je n\ai pu me rsoudre  regarder derrire moi.\n\nCe n\est que plus tard que j\ai remarqu les minuscules traces de morsures sur mes chevilles. Mfiez-vous, il y a quelque chose dans l\eau.\n\nJ\ai aperu des frondes poussant dans les mares. Des insectes se nourrissent de leur nectar malsain. Dtruisez ces plantes pour affamer les btes.', '', '', '', '', '', 'Retournez voir l\claireur Heaumevoie  Bourbe-Obscure.', 57534),
(79311, 'frFR', 'Endiguer le flot', 'Tuez 12aiguillonneurs pustuleux ou infestateurs fongiques.', 'Les routes auraient d tre claires. Mais le chemin tait envahi par la vgtation, et les lanternes teintes. a grouillait, cumait et empestait la charogne. Tout est all si vite. Lorsque nous avons pris conscience du danger, les btes taient dj sur nous. La plus grosse d\entre elles tait immense et noire comme la nuit.\n\nNous avons le devoir de tuer les monstres et de repousser les tnbres. Mais la simple ide d\y retourner me terrifie.\n\nJe n\en ai plus le courage. Mais vous, $gtranger:trangre;, vous pouvez encore faire quelque chose.', '', '', '', '', '', 'Retournez voir l\claireur Heaumevoie  Bourbe-Obscure.', 57534),
(79310, 'frFR', ' la recherche des disparus', 'Cherchez un membre de l\unit de Heaumevoie.', 'Garder nos voies, repousser les tnbres. Civiliser cette rgion corrompue. Tout a au nom de notre empire. Telle est la mission de l\arme arathie. Une mission que je ne peux plus accomplir.\n\nJ\ai trop peur.\n\nJe ne retournerai pas dans l\obscurit. Pas aprs ce que j\ai vu. Si Maevest ou n\importe qui d\autre de mon unit a survcu, la clmence d\une mort rapide doit leur sembler bien tentante. Et moi, j\ai abandonn mes camarades face  cette terreur.\n\nDites  la capitaine Vrayflamme que toute sa patrouille a pri dans les tnbres.', '', '', '', '', '', 'Retournez voir l\claireur Heaumevoie  l\extrieur de Bourbe-Obscure.', 57534),
(79309, 'frFR', 'Rapport de situation', 'Localisez la patrouille disparue de l\arme arathie.', 'Les aronefs permettent  l\arme arathie de contrler le ciel, mais les empires subsistent grce aux routes. Mes claireurs et claireuses protgent et clairent les passages de Sainte-Chute pour la population.\n\nUne patrouille aurait d me faire un rapport sur la route est depuis un moment. De la fume ou des flammes vous signaleront sa prsence. Les gens d\armes arathis savent qu\il ne faut pas traner dans le noir.', '', '', '', '', '', '', 57534),
(79304, 'frFR', 'Colis surprise', 'Apportez le colis surprise  Sophietta Lynflayme  l\cole de l\air de Luilumire.', 'Ma cousine Sophietta et moi sommes venus travailler en mme temps  Sainte-Chute comme fidles. Depuis notre arrive il y a plusieurs annes de cela, nous avons toujours vcu  la Bont de Dunelle. Mais elle est partie l\an dernier pour suivre son rve de devenir capitaine d\aronef, ou au moins d\intgrer un quipage.\n\nElle est forte, mais je n\ai pas de nouvelles d\elle. Les pains au lait de l\aubergiste Valrin doivent tellement lui manquer! On n\en trouve pas  l\cole de l\air de Luilumire. Pouvez-vous lui apporter ceci et vrifier qu\elle va bien?', '', '', '', '', '', '', 57534),
(79303, 'frFR', 'Les principes du proviseur', 'Faites parvenir le rapport de Sophietta au proviseur Fynch.', 'Excellent travail, et merci beaucoup d\avoir runi ces feuillets. J\en ai trouv plusieurs voletant ici ou l, et je crois mme que nous avons retrouv toutes les pages! Apportons tout cela au proviseur Fynch, il est probablement dans sa salle de classe.\n\nJ\espre qu\il acceptera de corriger mon travail. D\habitude, il refuse les devoirs en retard, mais il y a quand mme des circonstances attnuantes dans mon cas. Sinon, je serais force de servir sous le commandement d\Edwyn, et je ne suis pas sre d\y arriver aprs ce qui s\est pass.', '', '', '', '', '', '', 57534),
(79302, 'frFR', 'Autant en emporte le vent', 'Rcuprez $1oapages du rapport de Sophietta.', 'Je n\arrive pas  croire qu\Edwyn a jet mon rapport aux quatre vents. \n\nEst-ce que vous pouvez essayer d\en retrouver quelques feuillets tout au moins? Je vais tenter d\en localiser autour de l\cole. Vous, essayez de jeter un il dans la valle. \n\nJe suis dj en retard pour rendre ce rapport mais j\y avais mis quelques bonnes ides sur les capacits des aronefs. Si le proviseur Fynch les voit, il me permettra peut-tre de le rendre, mme tardivement.\n\nAlors, amenez-moi tout ce que vous trouverez, chaque feuillet compte!', '', '', '', '', '', '', 57534),
(79301, 'frFR', 'Le club des pilotes', 'Interrogez Edwyn  propos du carnet.', 'J\en ai ma claque de cet Edwyn. Depuis le jour de notre arrive, il rabche  tout le monde que c\est lui qui sera nomm capitaine.\n\nC\est un excellent pilote, trs talentueux, et il connat la musique. Mais son ego surdimensionn fait qu\il ne traite pas les gens correctement. Et il sait que mes notes et mon score de pilotage sont meilleurs que les siens.\n\nMais si je ne peux pas rendre mon rapport, il sera le prochain capitaine. Reprenez-le-lui!', '', 'Edwyn possde la dernire tche de Sophietta.', 'Edwyn Forgevent', '', '', '', 57534),
(79300, 'frFR', 'Le carnet', 'Aidez Sophietta  retrouver son carnet.', '$p, j\ai besoin de votre aide. Tout mon futur est en jeu! Je suis venue  Luilumire pour tre capitaine d\aronef et j\ai redoubl d\efforts pour exceller. Mais mon carnet de bord a disparu, et il contient mon rapport final!\n\nJe suis premire de ma promotion, mais si je ne le ramne pas trs bientt, je ne deviendrai pas capitaine du prochain aronef. Je vous en prie, aidez-moi  le retrouver.\n\nIl me semblait l\avoir laiss dans le canyon o l\on passe en revue notre pilotage d\arocanot, mais quand je suis alle vrifier, il n\y tait pas. Pourriez-vous m\aider  le retrouver?', '', '', '', '', '', 'Retrouvez Sophietta prs du dock arien.', 57534),
(79297, 'frFR', 'Guet de nuit', 'Collectez $1oadocuments de propagande de l\Ordre de la nuit.', 'Xal\atath se sert de l\Ordre de la nuit pour satisfaire ses caprices.\n\nJ\ai entendu certains individus parmi le peuple arathi se plaindre d\une nouvelle campagne de propagande dploye du ct de Mereldar. Voyez ce qu\il en est et faites part de vos dcouvertes  la gnrale Heurtacier. Je tcherai de vous rejoindre le plus vite possible.\n\nIl faut russir  lui faire comprendre la gravit de cette menace.', '', '', '', '', '', '', 57534),
(79295, 'frFR', 'Arrosez-les  Activer', '', '', '', '', '', '', '', '', 57534),
(79282, 'frFR', 'Grande premire', 'Terminez un vnement de la troupe de thtre au Proscenium.', 'Le Proscenium a retrouv son allure! $gPrt:Prte;  monter sur scne?\n\nDonnez un coup de main  la troupe, et on vous donnera quelques rpliques.\n\nAlors, a vous intresse?', '', '', '', '', '', '', 57534),
(79276, 'frFR', 'The Squishier, the Better [DNT]', 'Rcuprez la cl de Nebb et utilisez-la pour rcuprer le trsor de Nebb.', 'Des araignes m\ont vol ma cl. Je peux pas accder  mon trsor sans elle!', '', '', '', '', '', '', 57534),
(79267, 'frFR', 'Un beau feu d\artificire', 'Sabotez les cuves de cire dans les Ddales.', 'Les bougies tiennent une place de choix dans la socit kobold, et j\ai une ide qui pourrait perturber leur production ou du moins, crer une bien mauvaise surprise pour notre adversaire.\n\nPrenez cette Brassecendre. Versez-en dans les grandes cuves de cire que les Kobolds prparent au sommet de cette colline. C\est un puissant explosif,  haut pouvoir inflammable. Tchez de ne pas en renverser.\n\nCela devrait rendre les bougies fabriques avec cette cire un poil plus festives, une fois allumes.', '', '', '', '', '', '', 57534),
(79266, 'frFR', 'L\hritage de Barbe-de-Bronze', 'Allez voir Moira Thaurissan  Gundargaz.', 'Bien, on a accompli ce qu\on voulait et mme plus encore On a trouv Brise-peur et il nous a permis de faire le bien.\n\n prsent, il est temps de le rapporter  Magni.\n\nJ\espre que Berrund retiendra la leon, mme si je parie qu\il trouvera encore le moyen de se fourrer dans le ptrin Esprons que ce sera au moins pour les bonnes raisons et avec le soutien des bonnes personnes.', '', '', '', '', '', 'Allez voir Moira Thaurissan  Gundargaz.', 57534),
(79265, 'frFR', 'Brise-peur', 'Tuez des Skardyns et sauvez des Terrestres dans le dsert Grondant avec Moira Thaurissan.', 'Les Skardyns ont pris le contrle des oprations dans le dsert Grondant. C\est pour cette raison que Berrund pensait avoir besoin de Brise-peur.\n\nNous allons finir le boulot avant que je rapporte le marteau  Magni.\n\nQuelle reine serais-je si je n\tais pas prte  courir des risques pour le bien d\autrui? Allons-y et tchons de sauver un maximum de monde.', '', '', '', '', '', 'Retournez  la halte d\Ombreveine avec Moira Thaurissan.', 57534),
(79264, 'frFR', 'Des mains puissantes', 'Observez Moira Thaurissan.', '<Berrund le Scintillant tousse et crache de la poussire.>\n\nJe savais que je ne pouvais pas affronter les Skardyns sans aide. Je me disais qu\avec ce marteau magique, rien ne pourrait m\arrter. Je devais l\avoir, sinon je n\tais peut-tre pas celui que j\tais cens tre.\n\nMais il n\arrtait pas de me glisser des mains. Comme s\il ne voulait surtout pas que je m\en serve. Il m\a chapp au pire moment et voil <Il se remet  tousser.>\n\nIl n\est clairement pas  moi. Il ne l\a jamais t. Je je suis dsol.', '', '', '', '', '', '', 57534),
(79263, 'frFR', 'Lignes de fracture', 'Trouvez Berrund le Scintillant dans le dsert Grondant.', 'Berrund a pris Brise-peur. Je suppose qu\il pensait pouvoir sauver ces personnes. tre le hros.\n\nMais la fin ne justifie pas toujours les moyens. Je le sais d\exprience. Quand la pierre est creuse, vous aurez beau la jeter de toutes vos forces, elle pourra jamais rsonner.\n\nC\est lui qu\on va devoir aller sauver, j\en suis sre. Essayons de le trouver dans ce trou  rats.', '', '', '', '', '', 'Trouvez Berrund le Scintillant dans le dsert Grondant.', 57534),
(79262, 'frFR', 'Ranger la maison', 'Tuez les cratures agites au dsert Grondant.', 'La destruction autour de la galerie Primaire a entran plus que quelques chutes de pierre ici. Cela a veill toutes sortes de choses nfastes.\n\nC\tait peut-tre une exploitation minire florissante, mais c\est fini  prsent.\n\nOn doit aider les Terrestres  reprendre le contrle ici, et a commence par liminer ces cratures.', '', '', '', '', '', 'Retrouvez Moira au dsert Grondant.', 57534),
(79261, 'frFR', 'Colre noire', 'Suivez Berrund et Brise-peur  travers les abmes Retentissants.', 'Cet ingrat  la cervelle graveleuse! Il a pris Brise-peur et s\est enfui vers le nord!\n\nIl n\est mme pas pour moi ce marteau. Pas du tout. Mais il appartient au clan Barde-de-Bronze. Il doit tre entre les mains de quelqu\un qui respecte sa puissance!\n\nOn doit le retrouver avant qu\il ne se blesse ou ne blesse quelqu\un avec ce marteau!', '', '', '', '', '', 'Retrouvez Moira prs du dsert Grondant.', 57534),
(79260, 'frFR', 'picentre', 'Approchez-vous du mastodonte verdoyant.', 'Voil la crature qui se tient entre nous et ce marteau magique. Il a certainement fait un impact quand il a atterri ici dans les abmes Retentissants, pas vrai? Regardez la taille de ce cratre!\n\nAvec le pollen et l\eau qui nous enveloppent, il doit tre possible de s\approcher de la bte, thoriquement sans se faire blesser. Vous vous fondrez dans la masse!\n\nMais si elle devient agressive, ne vous inquitez pas, je serai juste derrire vous.\n\nNous sortirons ce marteau d\ici en toute scurit!', '', 'Attir par l\nergie puissante qui se dgage de Brise-peur, il ne cdera pas son territoire sans se battre.', 'Mastodonte verdoyant', '', '', 'Retrouvez Moira Thaurissan dans la grotte Vivante.', 57534),
(79259, 'frFR', 'Soigner son apparence', 'Collectez de la poussire de cinglonite auprs de cinglonites dans la grotte Vivante.', 'Berrund prtend que l\immense bte assise sur Brise-peur n\autorise que certaines cratures  s\approcher d\elle.\n\nSi on arrive  se camoufler, on pourra s\approcher assez prs pour rcuprer le marteau. Mais pour a, on doit se couvrir de poussire et de pollen avant d\entrer dans la grotte.\n\nCes cinglonites m\ont l\air de convenir.\n\nTout a m\a l\air trs suspect, mais je veux bien jouer le jeu jusqu\ ce que je puisse rapporter Brise-peur  mon pre.', '', '', '', '', '', 'Retrouvez Berrund le Scintillant dans la grotte Vivante.', 57534),
(79258, 'frFR', 'Les malheurs de l\eau minrale', 'Obtenez de l\eau minrale  la bonne temprature  la source de la grotte Vivante.', 'Quand ce marteau magique est tomb dans les profondeurs, j\ai su que ce serait une arme formidable contre les Skardyns. Votre amie m\a prvenu qu\elle tait difficile quand il s\agit de retrouver son matre.\n\nHeureusement, je suis un hros!\n\nEt en tant que hros, je sais que pour nous en approcher, il faut qu\on s\enduise d\un savant mlange de pollen et d\eau. Avec a, la bte qui se tient dessus nous prendra pour quelqu\un des siens.\n\nCette eau minrale doit tre  la bonne temprature si on veut qu\elle se mlange bien  la poussire de cinglonite.', '', '', '', '', '', 'Retrouvez Moira Thaurissan prs du cratre de Brise-peur dans la grotte Vivante.', 57534),
