(79256, 'frFR', 'Une sensation de peur', 'Retrouvez Moira Thaurissan prs du camp Murroch.', 'Mon pre croit qu\alors qu\il combattait les Skardyns au sud d\ici avec Dagran, il a eu la sensation d\avoir en main son vieux marteau, Brise-peur.\n\nIl dit qu\il lui a chapp des mains pendant l\attaque sur Dalaran, et a le tracasse terriblement depuis. Ce marteau appartient au clan Barbe-de-Bronze depuis des gnrations. Mais il n\est plus tout  fait lui-mme ces derniers temps.\n\nJe veux bien aller jeter un coup d\il, histoire de le rassurer. Retrouvez-moi au camp Murroch, on fera un tour dans les environs.', '', '', '', '', '', 'Retrouvez Moira Thaurissan prs du camp Murroch.', 57534),
(79255, 'frFR', 'Crunchy Competition [DNT]', 'Tuez la reine Rickiticka au repaire Cliquetant.\nTuez $2oaaraignes au repaire Cliquetant.', 'Araignes voler nos proies! Manger bonnes larves et laisser rien pour nous!\n\nNon, plus de larves pour Kobolds quand araignes l.\n\nTuer araignes et repaire Cliquetant tre rien qu\ nous.', '', 'La progniture de la reine Rickiticka a envahi tout le repaire Cliquetant.', 'Reine Rickiticka', '', '', 'Retrouvez Mche-pousse au repaire Cliquetant pour obtenir votre rcompense.', 57534),
(79245, 'frFR', '[Unused - Reuse Quest Bit]', '', '', '', '', '', '', '', '', 57534),
(79244, 'frFR', 'Des nouvelles d\en bas', 'Informez la veuve Arak\nai de votre dcouverte  la Transformacie. Ensuite, retournez voir Alleria  Dornogal, sur l\le de Dorn.', 'J\ai entendu les explosions d\ici. a nous fera gagner du temps. Je pourrais presque tre soulage si tout ne s\tait pas aussi mal pass.\n\nY\tekhi est  l\arrire, d\o il est impossible d\entendre quoi que ce soit. Je ne sais pas ce que lui a fait Xal\atath mais a n\est toujours pas pass. La Tisserande a somm une quipe d\enquter, mais a s\annonce plutt mal.\n\nAlleria voudra un rapport, maintenant. Bonne chance.', '', '', '', '', '', '', 57534),
(79243, 'frFR', 'Mutinerie manufacture', 'Tuez le marchal de sige Tekhzok et l\intendant royal Ze\erik.', 'Nous n\avons pas la puissance de feu pour saboter l\ensemble de leur opration, mais il nous reste deux fioles de phromones d\agressivit. Autant qu\elles nous servent.\n\nIl y a une marchale de sige et un intendant qui supervisent les prparations et donnent des ordres. Ils sont affects au ravitaillement, mais ils savent se battre. C\est l que les phromones entrent en jeu.\n\nJetez-leur une fiole dessus et leurs propres armes se retourneront contre eux. liminez les deux et nous pourrons regarder leur machination s\effondrer sous nos yeux.', '', '', '', '', '', 'Retournez voir Lilian Voss au repaire de la Tisserande.', 57534),
(79241, 'frFR', 'Adieu finesse', 'Posez 6charges nrubiennes rquisitionnes aux endroits spcifis le long du convoi, puis faites-les exploser  distance.', 'Tant pis pour la discrtion. Mais maintenant que notre couverture est perdue, on va pouvoir tout saboter plus librement.\n\nIls conservent des armes de l\autre ct du pont, au sud. Si on les retourne contre eux, ils devront rquiper toute leur arme. a nous fera gagner du temps, au moins.\n\nJ\ai identifi six points faibles le long du convoi. Posez des bombes aux six endroits, puis fichez le camp et admirez le feu d\artifice.', '', '', '', '', '', 'Retournez voir Lilian Voss au repaire de la Tisserande.', 57534),
(79240, 'frFR', 'Agent rengat', 'Soumettez Y\tekhi.', 'Nous avons perdu Y\tekhi.\n\nNous nous en inquiterons plus tard. Dans l\immdiat, nous devons les arrter avant que la situation ne dgnre.\n\n<Lilian renifle.>\n\nNotre objectif en venant ici tait de savoir ce que cachait Xal\atath On aurait peut-tre mieux fait de rester en dehors de a.', '', 'Y\tekhi se comporte bizarrement.', 'Y\tekhi', '', '', '', 57534),
(79239, 'frFR', 'La reine enchane', 'Dtruisez les chanes de Neferess.', 'Ansurek cette vermine, cette espce de misrable\n\n<Y\tekhi marmonne en luttant pour garder son calme.>\n\nS\il s\agit bien de la vrit sur Neferess, alors nous devons la librer. C\est notre reine. Ma matresse saura quoi faire.\n\nQuand la Tisserande apprendra ce qu\ils ont fait, pas la moindre crevasse ne les protgera de sa fureur.', '', '', '', '', '', '', 57534),
(79237, 'frFR', 'La cration d\un monstre', 'Accdez au laboratoire du Grand Faisceau par la trappe du toit, puis recherchez des indices pour comprendre l\objectif de la Premire Sublime.', 'Nous avons un nouvel objectif: dcouvrir les plans d\Ansurek pour cette chose.\n\nNous trouverons des rponses dans le laboratoire du Grand Faisceau. Je pourrais parier mes lames l-dessus.\n\nJ\ai repr une trappe d\entretien sur le toit que vous pouvez escalader. Y\tekhi a prpar une trange concoction qui devrait nous permettre de progresser dans la zone. Beurk.\n\nOn se retrouve l-bas.', '', '', '', '', '', '', 57534),
(79234, 'frFR', 'Un petit sac de graines', 'Apportez ce petit sac de graines  Aliya  la ferme de Heaume-Colline.', '<Quelqu\un a manifestement oubli ce petit sac de graines. Il pourrait tre utile  Aliya Heaume-Colline.>', '', '', '', '', '', '', 57534),
(79233, 'frFR', 'Accs au labo', 'Collectez $1oachantillons de scrtions loyalistes auprs des loyalistes nrubiens proches de la Transformacie.', 'Croyez bien que j\adore rder dans l\obscurit, mais les informations les plus utiles se trouvent dans le laboratoire du Grand Faisceau.\n\nBien sr, il vous faudra les bonnes phromones une fois  l\intrieur, mais nous pouvons remdier  ce problme par une petite contrefaon biologique.\n\nLes loyalistes nrubiens qui se trouvent ici doivent figurer sur la liste des invits. Six chantillons de leurs scrtions devraient permettre de nous dguiser.', '', '', '', '', '', '', 57534),
(79232, 'frFR', 'Les personnes tombes au champ d\honneur', 'Localisez les restes d\Oskaer Daleheurte, de Dalian Chanefer et d\Idona Pierredevoyance, et rcuprez leurs poudrires.', 'Depuis le jour des ombres, ces terres sont un endroit dangereux. \n\nLes Kobyss se sont enhardis, les Nrubiens empitent sur notre territoire, des cratures faites de pures tnbres ont commenc  apparatre.\n\nNous sommes hants par le souvenir des proches qui ont disparu. Nous devons chercher leurs restes pour retrouver la paix intrieure. \n\nPartez en qute des poudrires de ces membres de l\expdition et rapportez-les-moi.', '', 'Un amas congel d\os et de gele, m par une ncromancie inconnue.', 'Trempecrne', '', '', '', 57534),
(79230, 'frFR', 'Se faufiler dans les couloirs', 'Menez l\enqute dans l\arsenal  l\ouest, l\entrept central et les rserves royales de la Transformacie, en utilisant des phromones d\agressivit pour distraire les gardes et viter qu\ils ne vous reprent.', 'J\ai localis trois lieux dignes d\intrt.\n\nUn arsenal  l\est du complexe, un entrept au centre puis ce grand entrept avec les drapeaux royaux surekis  l\extrieur. Ce sera notre point de rencontre.\n\nNous agirons sparment dans la zone. Nous aurons moins de chances de nous faire prendre. Vous chapperez sans doute  la plupart des Nrubiens, mais les Sublims ne s\y tromperont pas. Jetez-leur ces phromones d\agressivit si vous tes en mauvaise posture, a les distraira.\n\nN\oubliez pas, concentration et discrtion.', '', '', '', '', '', '', 57534),
(79227, 'frFR', 'Une vision d\araigne', 'Placez les lance-ombres pour un rendez-vous avec les claireurs de la Tisserande dans le bazar Ombreux, le viaduc Oriental et la gorge Frmissante.', 'J\ai des yeux dans tous les recoins de la cit, sauf un qui m\a chapp.\n\nLa Transformacie abrite les serviteurs d\Ansurek les plus prcoces et priss. C\est l que le processus de Sublimation a t mis au point. Je viens juste d\en apprendre l\existence, grce  notre Y\tekhi. Et il y a encore beaucoup de choses que j\ignore sur ce lieu.\n\nUne approche un peu plus directe est de rigueur. Placez des lance-ombres pour recueillir les informations de mes claireurs, puis retrouvez Y\tekhi et votre chre matresse des espions Voss dans un lieu discret du quartier.', '', '', '', '', '', 'Retrouvez Y\tekhi et Lilian Voss  la Transformacie.', 57534),
(79225, 'frFR', 'La flamme perdue', 'Apportez la poudrire d\expdition  Keyrra Forteflamme dans les vignes du bosquet Obscur.', '<Une poudrire de l\expdition de Sainte-Chute. Sa restitution permettrait d\honorer la mmoire des victimes qui ont donn courageusement leur vie.\n\nUn claireur ou une claireuse de l\expdition pourrait en savoir plus sur cet objet.>', '', '', '', '', '', '', 57534),
(79224, 'frFR', 'Chasse aux renseignements', 'Parlez  la veuve Arak\nai au repaire de la Tisserande  Azj-Kahet.', 'La veuve Arak\nai a envoy un message par un de ces tisse-rats. Elle a une piste qui pourrait servir notre cause et souhaite que nous enqutions dessus. Il est inutile de s\entraner tant que l\on ne connat pas son adversaire.\n\nMes travaux de reconnaissance dans Azj-Kahet ont donn des rsultats mitigs, comme vous vous en souvenez peut-tre. J\avoue que je n\ai pas envie d\y retourner de sitt. Heureusement, des renforts sont arrivs avec l\aide d\une personne comptente en espionnage.\n\nMalheureusement, elle est Eh bien, vous verrez.', '', '', '', '', '', '', 57534),
(79222, 'frFR', 'Ressort principal tremp dans les ombres', 'Apportez cet objet  Kuldas  Gundargaz.', '<C\est peut-tre d aux effets des tnbres persistantes ou aux bricolages d\Ezgi Fermatos, mais la puissance de ce ressort devrait beaucoup intresser le mandataire Kuldas  Gundargaz.>', '', '', '', '', '', '', 57534),
(79221, 'frFR', 'L\insecte trange', 'Apportez l\insecte trange  la veuve Arak\nai,  Rak-Ush.', 'Cette petite araigne trange pourrait intresser les Nrubiens du Rak-Ush.', '', '', '', '', '', '', 57534),
(79220, 'frFR', 'Renomme auprs de l\Assemble des profondeurs', 'Parlez au cireur Squick  Gundargaz.', 'Tout travail mriter salaire!\n\nAssemble satisfaite. Squick le cireur satisfait. Beaucoup de fournitures pour tmoigner gratitude.\n\nVenir voir Squick le cireur  Gundargaz.', '', '', '', '', '', '', 57534),
(79219, 'frFR', 'Renomme auprs du conseil de Dornogal', 'Parlez  l\auditeur Balwurz  Dornogal.', 'La dette du conseil  votre gard demeure pleine et entire.\n\nSi vous passez par Dornogal, je vous donnerai des fournitures pour recouvrir partiellement cette dette.', '', '', '', '', '', '', 57534),
(79218, 'frFR', 'Renomme auprs des Arathis de Sainte-Chute', 'Parlez  Auralia Heurtacier  Mereldar.', 'Sachez que vos efforts  l\adresse de notre peuple ne sont pas passs inaperus. Sachez galement qu\ils seront rcompenss.\n\nRetrouvez-moi  Mereldar.', '', '', '', '', '', '', 57534),
(79217, 'frFR', 'Retour  la base', 'Retrouvez Brinthe  Gundargaz.', 'Il ne sera pas ais de faire fonctionner  nouveau cette usine, mais nous trouverons bien une solution. Retournons  Gundargaz, je dois discuter avec l\un de nos amis.\n\nSon intelligence nous sera d\un grand secours ici.', '', '', '', '', '', '', 57534),
(79216, 'frFR', 'Une toile de manipulation', 'Explorez la zone escarpe proche et occupez-vous des menaces prsentes sur place.', 'Cette ville est en tat de sige, elle est envahie par des araignes! On a beau les liminer, il en revient sans cesse d\autres.\n\nCes attaques cachent quelque chose!\n\nCes araignes vivent sur une petite zone escarpe au nord-est de la Floraison lumineuse. Allez explorer cette corniche. Dcouvrez ce qui pousse ces araignes  nous attaquer et mettez-y un terme!', '', 'Les intentions du Nrubien sont loin d\tre pacifiques.', 'Sakret\na', '', '', '', 57534),
(79213, 'frFR', 'Anachronisme', 'Activez la console dterre et utilisez l\appareil pour vaincre le gardien sargassien aux confins de Golgrin.', 'Insrez les batteries dans les orifices cylindriques de la console.\n\nEnsuite, si telle est la volont des Titans, nous en saurons plus.', '', 'Cette fusion de sable et d\eau de mer est renforce par des brassards antiques forgs par les Titans.', 'Gardien sargassien', '', '', '', 57534),
(79206, 'frFR', 'Souvenirs briss', 'Apportez la gemme mmorielle estompe  Brinthe.', 'Cette gemme dgage quelque chose de spcial. Il vaudrait peut-tre mieux l\apporter  la mandataire Brinthe.', '', '', '', '', '', 'Apportez la gemme mmorielle estompe  la mandataire Brinthe.', 57534),
(79205, 'frFR', 'Dchets bienvenus', 'Ramassez des bouts de ferraille potentiellement utiles prs des Ddales.', 'Tout avoir usage, mon $gami:amie;. Mme choses que Ttes-de-Caillasse voir comme inutiles et jeter.\n\nKobolds tre plus malins.\n\nVous partir et ramasser choses. Besoin rcolter beaucoup ferraille. Assez pour Kobolds construire nouvelles maisons!', '', '', '', '', '', '', 57534),
(79204, 'frFR', 'Qui vous voudrez', 'Parlez  Aurore pour terminer votre protocole d\veil.', 'Aprs un tel protocole d\veil, je comprends pourquoi Aurore vous trouve unique.\n\nLe monde n\est sans doute pas prt pour des Terrestres comme vous.\n\n<Kuldas vous donne une tape dans le dos en gloussant.>\n\nAurore et le contrematre vous attendent dans le vestibule de l\veil.\n\nAllez-y!\n\nTerminez votre protocole d\veil et sortez d\ici!', '', '', '', '', '', '', 57534),
(79203, 'frFR', 'Autorisation: ngative', 'Terrassez la phalange d\Autorisation dans le rempart d\Autorisation.', 'Le rempart d\Autorisation! Tel tait jadis le nom de cette salle.\n\nJe travaillais d\arrache-pied  la remettre dans sa configuration d\origine, quand tout d\un coup, la pice tout entire s\est mise  trembler.\n\nUn golem est sorti de nulle part et s\est mis  attaquer mes machinistes! Nous avons pu nous chapper, mais le golem a verrouill les salles.\n\nAurore semble estimer que vous tes capable de vous en charger. Vous sentez-vous  la hauteur du dfi?', '', 'Du fait d\une surabondance d\nergies de l\me-monde dtecte  l\intrieur, la salle de l\veil a dclench son programme de purge pour liminer toutes les menaces.', 'Phalange d\Autorisation', '', '', 'Retrouvez le mandataire Kuldas dans le couloir d\Autorisation.', 57534),
(79202, 'frFR', 'La pierre bat la pierre', 'Entranez-vous avec 6Terrestres qui viennent de s\veiller.', 'Bienvenue au forum Procdural.\n\nLe contrematre Uzjax m\informe que cette salle servait autrefois  effectuer des tests d\aptitudes.\n\nAvec son aide, nous l\avons reconvertie.\n\nLa conception des Terrestres ne prvoyait pas le combat, et cette salle permet  prsent de prparer les personnes qui s\veillent pour les dfis du monde inexplor qui s\ouvre  nous.', '', '', '', '', '', 'Retrouvez Aurore dans le couloir Procdural.', 57534),
(79201, 'frFR', 'L\Interface d\analyse', 'Compltez la squence d\analyse dans l\Interface d\analyse.', 'Voici l\Interface d\analyse.\n\nAfin d\assurer que notre programme principal reste intact, ces consoles furent installes avec une srie d\interrogations pour valuer la matrice mmorielle des Terrestres qui venaient de s\veiller.\n\nBien qu\Aurore vous encourage  rpondre comme vous le voulez, je eh bien, j\espre que vous rpondrez honntement.\n\nQuand vous voudrez.', '', '', '', '', '', 'Parlez avec Aurore dans le forum Procdural.', 57534),
(79200, 'frFR', 'Qui suis-je?', 'Terminez la premire tape du protocole d\veil.', 'Contente de voir que vous tes $grveill:rveille;. Vous vous posez sans doute bien des questions: nous sommes l pour y rpondre. Je suis Aurore, et voici le contrematre Uzjax.\n\nBeaucoup de choses ont chang depuis votre dernier sommeil, y compris notre protocole d\veil. Rassurez-vous, nous allons vous guider.\n\nComme de nombreux veills avant vous, vous avez entendu un chant  la fois distant et distinct rsonner en vous, comme un appel au changement.\n\nRpondez  son appel.', '', '', '', '', '', 'Retrouvez Aurore dans l\Interface d\analyse, dans la salle suivante.', 57534),
(79197, 'frFR', 'Liaison de surface', 'Retrouvez Moira Thaurissan et vos camarades  Dornogal, sur l\le de Dorn.', '$n, le moment est venu. Nous devons vite rejoindre Dornogal, o nos camarades nous attendent.\n\nC\est seulement en nous unissant que nous avons une chance de repousser les machinations de la messagre.', '', '', '', '', '', '', 57534),
(79196, 'frFR', 'Renomme auprs des Fils tranchs', 'Parlez  dame Vinazian au repaire de la Tisserande.', 'La Tisserande vous a $gobserv:observe; d\un il attentif, et elle estime que vous lui serez plus utile avec davantage de ressources  votre disposition.\n\nVenez au repaire de la Tisserande: j\ai un paquet qui n\attend que vous.', '', '', '', '', '', '', 57534),
(79194, 'frFR', 'Remonter la source', 'Retrouvez Keldaz  l\extrieur de la mine nord-est.', 'Orsenth m\a dit que vous aviez jou un rle crucial contre les lmentaires de la mine. Je m\appelle Keldaz, je suis superviseuse de la milice. Nous sommes venus ds que la nouvelle de l\attaque nous est parvenue  Gundargaz. Le personnel de la mine sauv a indiqu que les lmentaires venaient de la galerie du nord-est.\n\nJe vais conduire une partie de mes troupes l-bas pour les aider et apporter des renforts. Si vous voulez encore nous aider, retrouvez-moi  l\extrieur de la grotte et nous chercherons ensemble comment tarir le flot des lmentaires.', '', '', '', '', '', '', 57534),
(79193, 'frFR', 'Spores  pic', 'Ramassez $1oaaiguillons sporiques pour Munderut.', 'C\est Orsenth qui vous envoie? Et nous sommes fusionns? Je porte un mdaillon, oui. Mais je n\ai aucun souvenir! Enfin, ce n\est pas le moment.\n\nVous avez vu les spores tournoyantes en arrivant ici? Il me faudrait les aiguillons qu\on trouve dessus pour il me les faut pour pour quoi dj? Ah oui! C\est le meilleur outil pour graver les dtails les plus fins sur les gemmes que je taille. Vous pouvez aller m\en chercher?\n\nJe vais rentrer  la raffinerie. J\ai hte de retrouver et rencontrer cette Orsenth.', '', '', '', '', '', 'Rapporter les aiguillons  Munderut prs de la raffinerie', 57534),
(79176, 'frFR', 'Opales et runes', 'changez la fiole d\opale liquide contre la rune de passage du bar auprs de Bevrusi.', 'Vous m\avez enlev une sacre pine du pied, $n.\n\nVous avez les remerciements de la Placeforge et de ceux et celles qui assurent son fonctionnement.\n\n<Vokgret vous adresse un clin d\il et un sourire entendu.>\n\nBevrusi a eu raison de vous envoyer. Dites-lui bien de nous donner des nouvelles. Je serais contente d\avoir plus de camarades dans les abmes.\n\nTenez, c\est son opale liquide. Vous pourrez la lui donner avec mes remerciements.', '', '', '', '', '', 'Allez voir Merrix dans l\atrium du sculpte-pierre.', 57534),
(79175, 'frFR', 'Rejoindre la classe ouvrire', 'Autorisez Anub\azal  vous embaumer de ses phromones.', 'Voil, un bel lan de gnrosit. Je vous ai trouv un compagnon gobelin. Je sais combien les membres de votre espce aiment se rchauffer en se collant les uns contre les autres.\n\nEt maintenant, vous abattrez deux fois plus de travail pour moi. Tout d\abord, je vais vous faire profiter de ma scrtion de phromones. Elle dissuadera ma fidle arme de vous attaquer. Elle vous marque comme tant ma proprit.', '', '', '', '', '', '', 57534),
(79174, 'frFR', 'Infestation d\infests', 'Tuez $1oabtes affectes par les spores au nid du pilier Vosh.', 'Les btes affectes par les spores au nid du pilier Vosh sont une pine dans notre pied depuis la fondation de l\avance de Faerin. Elles dgagent d\pais nuages de spores. J\avais jamais vu a.\n\nElles ont dj attaqu une fois. Et elles tarderont pas  recommencer. Si on veut survivre, il faut  tout prix rduire leur nombre.\n\nRejoignez le nid du pilier Vosh et abattez une partie de ces btes infestes.', '', '', '', '', '', '', 57534),
(79173, 'frFR', 'Opration de ravitaillement', 'Rcuprez des objets vols dans les environs pour que nous ayons de quoi rpondre  nos besoins.', 'Quand l\ombre a envelopp notre ville, des fournitures indispensables ont disparu dans les tnbres.\n\nMaintenant que la lumire est revenue, il est temps de rebtir, mais nous devons au pralable rcuprer ce que nous avons perdu.\n\nFouillez les environs et rcuprez tout ce qui pourrait s\avrer utile.', '', '', '', '', '', '', 57534),
(79168, 'frFR', 'Le Gambit de la Lumire', 'Prenez la pice de la tour pour lancer une partie de Gambit de la Lumire avec Faerin et Anduin.', 'Pas d\inquitude! On expliquera le reste des rgles plus tard!\n\nC\est la phase de combat qui a le plus d\intrt, de toute manire!\n\nAnduin et vous n\avez qu\ faire quipe contre moi. Peut-tre qu\ vous deux, vous aurez une chance!\n\n<Faerin clate de rire.>', '', '', '', '', '', '', 57534),
(79167, 'frFR', 'Collecte de pices', 'Collectez $1oapices de jeu en parlant aux Arathis et Arathies  Mereldar.', 'Le Gambit de la Lumire est un jeu ancien et trs aim. Ce n\est pas pour rien que chez le peuple arathi, on y joue autant!\n\nIl peut vous en apprendre long sur la stratgie. Et vous en apprendrez beaucoup sur vos adversaires par la mme occasion.\n\n<L\enthousiasme de Faerin retombe.>\n\nMais il nous manque encore quelques pices pour pouvoir y jouer.\n\nParfois, des gens de Mereldar nous prtent des pices pour une partie. Vous pourriez leur demander?', '', '', '', '', '', 'Retrouvez Faerin et Anduin au deuxime tage du quartier gnral des falotiers.', 57534),
(79166, 'frFR', 'Pices gares', 'Collectez $1oaeffets personnels perdus sur des adversaires dans les profondeurs Dchirantes.', 'Il fut un temps o j\eus trouv les mots pour l\aider.\n\nMais aujourd\hui il semblerait que je les ai perdus en mme temps que tout le reste.\n\n<Anduin soupire.>\n\nIl y a srement quelque chose  faire. Son ancienne me sur falotire, Andari, devait possder une de ces poudrires, non? Elles semblent importantes pour leurs rites funraires.\n\nJe vais raccompagner Faerin  Mereldar et je vous y retrouverai. Si vous pensez pouvoir retrouver les affaires perdues d\Andari vous pourriez aller jeter un il?', '', '', '', '', '', 'Trouvez Faerin et Anduin  Mereldar.', 57534),
(79165, 'frFR', 'Un moment de rpit', 'Trouvez Faerin non loin de la redoute de la Lumire.', 'Bien, vous voil, vous deux.\n\nJ\ai une requte  vous faire.\n\nFaerin est partie. Je crois qu\il vaudrait mieux que vous alliez la retrouviez, vous et votre ami chevel.\n\nElle doit tre  la redoute de la Lumire.', '', '', '', '', '', 'Trouvez Faerin non loin de la redoute de la Lumire.', 57534),
(79162, 'frFR', 'Incandescence', 'Retournez voir Endiri Montelaube  Mereldar.', 'Retournez voir le commandant Montelaube et dites-lui que je suis sincrement dsol de ne pas tre prsent. Je me soumettrai  toutes les punitions qu\on me rservera aprs mon service.', '', '', '', '', '', 'Retournez voir Endiri Montelaube  Mereldar.', 57534),
(79160, 'frFR', 'Pcher gurit l\me', 'Retrouvez Shinda au coin de pche.', 'J\allais pcher au lac du coin avec ma mre quand j\tais enfant. Ce n\tait pas le poisson qui m\intressait, car ma mre cuisinait affreusement mal, mais la tranquillit du lieu et le moment que nous passions ensemble.\n\nPeut-tre pourrai-je retrouver un peu de cette paix ici. J\ai repr un coin au sud de Mereldar o les gens vont pcher. Je vous y retrouverai!', '', '', '', '', '', '', 57534),
(79159, 'frFR', 'Manquer  son devoir', 'Trouvez Shinda Piquecredo dans Mereldar  Sainte-Chute.', 'Vous avez un moment  m\accorder?\n\nL\un de mes lieutenants, Shinda Piquecredo, ne s\est pas prsent au feu. a ne vous parat peut-tre pas si grave, mais le peuple arathi de Sainte-Chute ne survit que parce que nous suivons les ordres et veillons sur nos camarades.\n\nJe ne suis pas cruel. Je ne voudrais pas punir un homme pour sa faiblesse dans un environnement aussi hostile. Pourriez-vous le trouver et le ramener?\n\nPrenez le temps qu\il faudra.', '', '', '', '', '', '', 57534),
(79158, 'frFR', 'Graines du salut', 'Rcuprez les graines et plantez-en $2oa dans le sol prt  semer.', 'Ces robots moissonneurs autrefois si obissants sont devenus fous et sment le chaos dans les champs.\n\nLe succs de notre communaut repose sur la plantation de graines, mais la plupart se trouvent en possession de ces moissonneurs!\n\nPourriez-vous aller dans les champs, neutraliser ces machines folles, rcuprer les graines et les planter?', '', '', '', '', '', '', 57534),
(79157, 'frFR', 'Scurit titanesque', 'liminez l\assemblage des Titans colossal.', 'Les Titans ont envoy leurs antiques machines punir leurs enfants rebelles.\n\nNos crateurs voudraient-ils nous voir protger la galerie Primaire  n\importe quel prix? Devons-nous aller jusqu\ sacrifier Azeroth? Notre destin est-il de rgner sur une route vide menant au cur dessch du monde?\n\nNon. Aujourd\hui, nous sommes le peuple dli, et nous nous battons pour notre libert. Pour Azeroth!', '', 'Cette ancienne machine de guerre des Titans a surgi des profondeurs de l\ocan pour radiquer les Terrestres rebelles de Dorn.', 'Assemblage des Titans colossal', '', '', 'Retournez voir Alleria  Dornogal.', 57534),
(79156, 'frFR', 'Les dits', 'Faites votre rapport  Merrix et Adelgonn.', 'Merrix et Adelgonn voudront sans doute qu\on les tienne au courant. En arrivant, j\ai entendu dire que tout le monde se dirigeait vers le Proscenium pour s\engager officiellement dans cette guerre. Vous devriez aller leur faire savoir que tout est prt du ct des chevaucheurs et chevaucheuses de tempte.\n\nJe dois encore dire quelque chose  Zarein, mais nous vous rejoindrons bientt, et l\esprit de Baelgrim sera avec nous.', '', '', '', '', '', '', 57534),
(79154, 'frFR', 'Des adieux', 'Aidez Alyza  dire au revoir au bassin Dvorant  Sainte-Chute.', 'Bon, parents vengs, poisson tu, autres poissons tus, gros poisson tu.\n\na fait une bonne journe.\n\nIl me reste plus qu\ aller brler des trucs.', '', '', '', '', '', 'Retournez voir Alyza  l\orphelinat  Mereldar.', 57534),
(79153, 'frFR', 'Vivae Vivictis', 'liminez Vivcaille le Dvoreur et rcuprez sa tte dans le bassin Dvorant  Sainte-Chute.', 'Ah, nous y voil.\n\nTuez leur chef. Versez du sel sur ses os, prenez sa tte et clatez de rire en voyant sa tribu se disperser!\n\nVivcaille vit ses derniers instants, et il est trop bte pour s\en rendre compte.\n\nImbcile de poiscaille.', '', 'Vivcaille terrorise le bassin Dvorant depuis un bon moment.', 'Vivcaille le Dvoreur', '', '', '', 57534),
(79152, 'frFR', 'Vider le bassin', 'liminez $1oaKobyss dans le bassin Dvorant  Sainte-Chute.', 'Les Kobyss sont un peu plus imposants que ce que je m\tais imagin, et je pourrais possiblement avoir plus de mal avec eux que prvu.\n\nMassacrez toute la poiscaille que vous verrez.', '', '', '', '', '', '', 57534),
(79151, 'frFR', 'La demande d\une orpheline', 'Retrouvez l\ours en peluche trs apprci d\Alyza dans le bassin Dvorant  Sainte-Chute.', 'Ouah, vous avez l\air $gfort:forte;! Vous voulez bien me donner un coup de main?\n\nMes parents ont t tus par les vilains Kobyss. Mais en partant, j\ai oubli de prendre mon ours en peluche prfr.\n\nVous pourriez aller me le chercher?', '', '', '', '', '', '', 57534),
(79150, 'frFR', 'Sur les planches du Proscenium', 'Aidez l\architecte Brokfor  retaper le Proscenium.', 'Lorsque j\ai demand au peuple dli de prsenter leurs pices  Dornogal, je ne savais pas  quoi m\attendre. Ni que mon aide viendrait interfrer.\n\nMon vieil ami Brokfor n\arrte pas de nous bassiner avec son perfectionnisme. Nous essayons de monter un dcor, et il interrompt tout le monde pour inspecter le moindre clou. Nous essayons de peindre, et il se plaint du manque d\homognit des couleurs Vous voyez le tableau.\n\nSelon moi, il faudrait donner  Brokfor un projet  part entire. Par exemple nettoyer le Proscenium? Demandez-lui de vous aider et occupez-le.', '', '', '', '', '', '', 57534),
(79149, 'frFR', 'Panique  la raffinerie', 'Tuez $1oalmentaires dchans.', 'Catastrophe! Oh c\est affreux. Affreux! Ces maudites vermines d\lmentaires empchent mon personnel de faire son travail  la raffinerie.\n\nNotre travail n\attend pas. De tels dlais sont intolrables. Vous m\avez l\air assez $gdbrouillard:dbrouillarde;, alors allez-y, descendez et dtruisez-moi ces lmentaires. La production doit repartir!', '', '', '', '', '', '', 57534),
(79148, 'frFR', 'La raffinerie de Nibelgaz', 'Sauvez $1oamembres du personnel de la raffinerie et cherchez Munderut.', 'Vite! Les lmentaires ont envahi la mine de Nibelgaz, et tout le personnel de la raffinerie est pig l-dessous avec eux.\n\nJe m\inquite surtout pour mon fusionn, Munderut. Sa mmoire n\est plus ce qu\elle tait ces temps-ci. Si vous tes mon $gami:amie;, allez les sauver, lui et les autres.\n\nTenez, prenez cette argile rgnratrice. a ne fait pas des miracles, mais a aidera les personnes blesses  faire le chemin du retour. Le mieux, ce serait un cristal de soin, mais il ne faut pas rver non plus.', '', '', '', '', '', '', 57534),
(79147, 'frFR', 'Introduction aux techniques de vol', 'Aidez Kurdran  former les recrues aux manuvres ariennes.', 'Voir toutes les recrues runies ainsi, a m\donne des ailes! Des ailes Vous avez compris? Non?\n\nBref. On va montrer  la bleusaille comment a s\passe, en commenant par les bases de la manuvre arienne  vitesse relle. On va tcher de dmontrer la prcision ncessaire pour voler en sous-sol. \n\nEnsuite, on verra de quoi ces freux sont capables, et j\crois bien que Thrall et Lufsela ont prpar un p\tit quelque chose.', '', '', '', '', '', 'Retrouvez Kurdran au nord de la Mineroc.', 57534),
(79146, 'frFR', 'Pitaille', 'Allez voir Adelgonn, Geya\rah et Turalyon.', 'Les chevaucheurs et chevaucheuses ont besoin de temps pour se rapprocher de leurs freux. \n\nVous devriez peut-tre en profiter pour aller voir nos autres recrues. \n\nLes chevaucheurs et chevaucheuses de tempte reprsentent l\arme traditionnelle des Terrestres, mais de nombreux tres dlis et asserments ont exprim la volont de se battre  nos cts suite  l\aide apporte pour la rparation de leurs machines.\n\nAdelgonn, Geya\rah, et Turalyon s\occupent de leur entranement. Allez voir s\ils sont besoin d\aide.', '', '', '', '', '', '', 57534),
(79145, 'frFR', 'Le mtal et la pierre', 'Armez les recrues terrestres.', 'Certaines de ces recrues ont du mal avec la discipline, mais la plupart travaillent bien. Tout ce qu\il leur faut, c\est de l\entranement et de l\quipement.\n\nLes Terrestres qui fabriquent des armes et des armures ne mnagent pas leur peine pour quiper cette lgion de bleusailles, mais un peu d\aide pour la distribution ne serait pas de refus, histoire que les novices se fassent plus rapidement la main.', '', '', '', '', '', '', 57534),
(79140, 'frFR', 'Tire-au-flanc', 'Entranez-vous avec les recrues terrestres indisciplines.', 'C\est avec a que nous sommes censs vaincre Xal\atath? Les tres dlis se dfinissent par leur dsertion. Et le peuple asserment a beau tre constitu de pierre, il n\en est pas moins mou. La vie citadine ne leur a pas fait de cadeaux. \n\nNous avons du pain sur la planche.\n\nAllez donner  ces Terrestres une petite ide de ce qu\est un vrai combat. Tchez de ne pas en dsactiver, mais avec une mutilation de-ci de-l, les autres comprendront le message.', '', '', '', '', '', '', 57534),
(79139, 'frFR', 'Seul dans la nuit', 'Examinez l\il d\Ansurek.', 'Mon peuple ne pense pas que ce Sang noir soit une menace pour le monde. Il est inerte depuis la nuit des temps. Pourquoi les choses devraient-elles changer maintenant?\n\nEnfin, le monde volue plus vite que ce que mes congnres veulent bien croire. La dcision des Nrubiens d\extraire ce sang en est la preuve.\n\nLes Nrubiens tiennent une tour de guet non loin d\ici. Ceux qui ont survcu  la fosse ne doivent pas tre bien loin. Il faut vite se mettre  leur poursuite.', '', '', '', '', '', '', 57534),
(79129, 'frFR', 'Afflux de freux', 'Protgez le rituel d\invocation.', 'Maintenant que vous avez charg le conduit, j\imagine que nous devrions les rejoindre au pic. \n\nThrall m\a expliqu  quoi je dois m\attendre, mais il m\a aussi dit que pour invoquer les freux de la tempte, je devrai me fier  mes motions et mon instinct.\n\nPour les Terrestres, cela reprsente un certain dfi.\n\nVous allez m\aider, pas vrai? Je ne suis pas trs  l\aise au combat et a a l\air dangereux. \n\nS\il m\arrive quelque chose, je vous en prie, protgez Shraubendre. S\il vous plat.', '', '', '', '', '', '', 57534),
(79124, 'frFR', 'Conduit de l\orage du sud', 'Trouvez le conduit de l\orage du sud.', 'Je vais vous rpondre la mme chose qu\ Baelgrim lors de notre dernire conversation. Nous avons tort de forcer les freux de la tempte  nous obir. Ces cratures sont aussi intelligentes que les Terrestres, pour ne pas dire davantage.\n\nCela tant dit Lufsela a comme un don. Si son freux de la tempte la suit de son propre chef, alors peut-tre que ses semblables prendront la dcision de rpondre galement  son appel.\n\nPour rallier davantage de freux, nous aurons besoin du conduit de Baelgrim. Il est quelque part par ici. Fouillez un peu. Vous pourriez peut-tre demander  ces gens en plerinage ce qu\ils ont vu.', '', '', '', '', '', '', 57534),
(79123, 'frFR', 'Emploi prenne', 'Parlez  Saffrine dans Rak-Ush.', 'Rak-Ush commence  ressembler  une vritable grouillerie.\n\nDlguer toutes ces tches nous russit,  Vix\aron et moi. Continuez  aider les cratures flairanes. En change, vous pouvez conserver une partie des richesses produites par les grouillebtes.\n\nSaffrin possde des plans plus dtaills sur le dveloppement de la grouillerie. Allez lui parler. Moi, je n\ai plus rien  vous dire.', '', '', '', '', '', '', 57534),
(79122, 'frFR', 'Reconnaissance de hanneton', 'Utilisez un lucane rak-ush pour trouver $4oatruffes kahetis.', 'Les lucanes sont d\une importance capitale pour la campagne militaire d\Anub\azal. Nous avons un odorat fort dvelopp, mais seuls les lucanes sont capables de dnicher les prcieuses truffes kahetis.\n\nLes truffes sont l\ingrdient principal de plusieurs lixirs explosifs, voyez-vous. Si vous voulez plus de dtails, Aromash pourra vous en fournir.', '', '', '', '', '', '', 57534),
(79121, 'frFR', 'Chasse aux insectes', 'Parlez  Aromash et occupez-vous des lucanes  Rak-Ush.', 'Oh, pardonnez-moi, vous pensiez peut-tre qu\il s\agissait d\une tche unique? Si c\est le cas, Vix\aron n\hsitera pas  vous indiquer la porte, pour ainsi dire. Les lucanes demandent un entretien rgulier. De la nourriture. De l\eau. Tout a.\n\na me peine de l\admettre, mais le peuple flairan est bien plus dou pour s\occuper des grouillebtes que Vix\aron et moi.\n\nSi mes explications ne vous ont pas suffi, n\hsitez pas  solliciter leurs connaissances.', '', '', '', '', '', '', 57534),
(79120, 'frFR', 'Un hanneton dans une botte de foin', 'Capturez et ramenez  Rak-Ush six lucanes sauvages.', 'Des lucanes sauvages se trouvent aux alentours de Rak-Ush.\n\nCette grenade odorifrante devrait suffire  les tourdir et alerter les agents flairans quant  leur position.\n\nUne fois qu\ils seront tourdis, l\un des rats les ramnera vers leur cavit.\n\nCapturez-les et ramenez-les. Nous vous attendons.', '', '', '', '', '', '', 57534),
(79119, 'frFR', 'Dur dur d\tre un insecte!', 'Nettoyez la grange  Rak-Ush.', 'Anub\azal a donn ses ordres! Nous sommes les nouveaux responsables de Rak-Ush! Mais Vix\aron a piqu une crise de colre et a dtruit notre grange.\n\nPuisque cet imbcile refuse de suivre les ordres, peut-tre le ferez-vous  sa place, rampe-surface. Peut-tre mme consentirons-nous  vous laisser vivre malgr votre indiscrtion. Et nous vous rcompenserons, j\imagine.\n\nAllez-y. Nous devons restaurer les cavits des lucanes et y faire prolifrer les grouillebtes.', '', '', '', '', '', '', 57534),
(79118, 'frFR', 'Remaniement  Rak-Ush', 'Retournez voir Vix\aron  Rak-Ush.', 'Bon, vous avez votre main-d\uvre, maintenant.\n\nQu\est-ce que vous faites encore ici? Allez-y, vous n\avez pas besoin de ma permission!\n\nMais assurez-vous que les Nrubiens les traitent correctement.', '', '', '', '', '', 'Retournez voir Vix\aron  Rak-Ush.', 57534),
(79117, 'frFR', 'Flairan jeune et brillant', 'Trouvez $1oaarachnologues flairans devant Mmarl pour qu\ils rejoignent Rak-Ush.', 'Il vous faut des bras en plus, hein?\n\nLa dernire fois que les Nrubiens avaient besoin de notre aide, ils ont tent de nous forcer. Ce sont de trs mauvais ngociateurs! On voulait juste une petite compensation.\n\nNous avons plusieurs arachnologues, mais la plupart s\affairent  tenir les voltigeurs  distance. Je ne les imagine pas refuser une occasion d\tudier les grouillebtes de prs!\n\nSi vous parvenez  allger leur charge de travail, peut-tre que les arachnologues accepteront de vous aider.', '', '', '', '', '', '', 57534),
(79115, 'frFR', 'Consultant expert', 'Parlez  la personne dirigeant Mmarl pour recruter des bras supplmentaires.', 'Vous ne nous suffisez plus. Il nous faut de l\aide supplmentaire. Les rampegueules et autres fileurs ont aussi besoin d\tre surveills.\n\nIl y a un hameau flairan non loin, Mmarl. Hlas, les prcdentes tentatives de conscription force ont chou. Les Nrubiens y sont dsormais interdits. Il nous faut quelqu\un pour dialoguer  notre place.\n\nAllez faire affaire avec les rats. Revenez avec des corps aptes au travail.', '', '', '', '', '', 'Parlez  Vtivrienne  Mmarl.', 57534),
(79114, 'frFR', 'Projet d\embellissement', 'liminez les plantes envahissantes dans les cavits des lucanes.', 'C\est du bon travail, pour quelqu\un de votre acabit.\n\nSi vous voulez continuer  respirer, je vous conseille de nous aider un peu plus. Vous y trouverez peut-tre mme votre compte si vous acceptez.\n\nL\ancien matre de Rak-Ush a laiss les lucanes redevenir sauvages et a abandonn les cavits  leur sort. Au fil du temps, des espces vgtales invasives ont infest les anciennes cavits.\n\nTrouvez un moyen de les rcuprer. Je ne veux pas savoir comment.', '', '', '', '', '', '', 57534),
(79113, 'frFR', 'UNUSED PLACEHOLDER', '', 'En arrivant dans un ranch  hannetons dsert, le personnage-joueur dcouvre 2Nrubiens en pleine dispute.\n\nLe plus gros des deux s\en va, vex.\n\nLe Nrubien restant vous informe que le plus gros a t affect  ce ranch en sa compagnie, et qu\il ne s\y plat pas du tout.\n\nIl vous demande de suivre le gros jusqu\ la grange.', '', '', '', '', '', '', 57534),
(79111, 'frFR', 'Lynx disparu', '', '', '', '', '', '', '', '', 57534),
(79110, 'frFR', 'Sauver Thomoty', 'Sauvez Tomothy Heaume-Colline des tnbres avides.', '<Miral vous regarde avec espoir avant de tourner son regard vers les ruines, puis vers vous, puis  nouveau vers les ruines. Vous comprenez qu\elle veut vous emmener l-bas. Peut-tre est-ce l que Tomothy s\est perdu?>', '', 'Sauvez Tomothy Heaume-Colline des tnbres avides.', 'Les tnbres avides', '', '', '', 57534),
(79109, 'frFR', 'Suivre Miral', 'Dcouvrez ce qui perturbe Miral Pattes-de-Tuerie.', 'Miral, le lynx de Thomoty, n\arrte pas de m\embter. Je ne sais pas ce qu\elle veut, mais a fait bizarre de la voir sans lui. Elle aide beaucoup  la ferme, mais a ne reste qu\un gros chat, peut-tre qu\elle en a juste eu marre de lui? Je ne sais pas. Ou alors, peut-tre qu\il a des ennuis.\n\nVous pourriez tenter de dcouvrir ce qui la perturbe?', '', '', '', '', '', '', 57534),
(79108, 'frFR', 'Graines malfiques', 'Rcuprez des graines de feuillenoire corrompue.', '$C, certaines pousses de feuillenoire sont plus drangeantes que d\autres. Je ne sais pas trop comment vous les dcrire.\n\nMon imbcile de frre, Tomothy, tait cens m\aider  m\en dbarrasser, mais il est introuvable et je ne peux plus me permettre d\attendre.\n\nIl ne faudrait surtout pas qu\elles se reproduisent, vous devez donc en abattre autant que possible, avant de prendre leurs graines. Nous les ferons brler dans la Flamme sacre pour nous assurer de contenir cette invasion.', '', '', '', '', '', '', 57534),
(79107, 'frFR', 'Aprs la tempte', 'Prenez des nouvelles des chevaucheurs et chevaucheuses de tempte.', 'Turalyon et Geya\rah ont dj commenc  entraner les troupes de Terrestres qui ont dcid de s\allier  nous. Mais il nous faudra plus de monde dans nos rangs, et surtout les chevaucheurs et chevaucheuses de tempte.\n\nNous en avons perdu un grand nombre durant l\attaque du Perchoir-Tempte, et plus encore aux griffes des Nrubiens. Leur chef, le garde-tempte Baelgrim, a pri les armes  la main.\n\nLes autres sont en convalescence non loin d\ici. Nous devons faire tout le ncessaire pour les remettre sur leurs freux. Ce sera l\arme la plus puissante des Terrestres dans les combats  venir.', '', '', '', '', '', 'Lufsela la nourrice suivie', 57534),
(79106, 'frFR', 'Rupture', 'Sauvez Dalaran.', 'Suivez-moi. Nous allons chercher toutes les personnes qui doivent tre mises  l\abri.', '', '', '', '', '', '', 57534),
(79105, 'frFR', 'Brche', 'Rassemblez les civils et civiles sur le terrain pour les mettre  l\abri.', 'J\adorerais traquer Xal\atath jusqu\aux confins du monde, mais notre priorit est de mettre les civils et civiles  l\abri.\n\nSauvez-en le plus possible et dites-leur de se regrouper sur l\aire tout prs. Je trouverai des mages pour tlporter tout le monde loin d\ici.', '', '', '', '', '', 'Parler  Alleria sur l\aire de Krasus.', 57534),
(79089, 'frFR', 'Nettoyage consacr', 'Restaurez le terrain d\Adulation  Sainte-Chute.', 'Notre terrain d\Adulation a t profan. Sa beaut est entache.\n\nCela demandera bien des efforts, mais si vous pouviez dj nous aider  faire un brin de mnage, je vous en serais reconnaissante.', '', '', '', '', '', '', 57534),
(79085, 'frFR', 'Un tas de poissons', 'Chargez $1oapoissons auprs du pousseur de chariot de poissons.', '<Une pile de poissons qui pourraient tre livrs en chariot  Sraphine Germecur.>', '', '', '', '', '', '', 57534),
(79030, 'frFR', 'La voix des mandataires', 'Retournez voir Alleria  Dornogal.', 'Allez annoncer notre victoire  Alleria,  Dornogal. Je suis sre que nos camarades seront en joie d\apprendre ce que nous allons offrir  l\effort de guerre.', '', '', '', '', '', '', 57534),
(79029, 'frFR', 'C\est du sabotage', 'Semez le chaos, accdez  la manufacture et relancez l\usine.', 'Nous sommes de retour et nous allons pouvoir commencer sans plus attendre.\n\nVous et ZZ-01-47 allez entrer pour crer la confusion. Faites exploser des trucs et semez la pagaille pour les attirer hors de la manufacture. Je profiterai du chaos pour me faufiler  l\intrieur. Rejoignez-moi ds que possible et nous aurons une chance de relancer l\usine et de les en chasser pour de bon.\n\nInutile de tous les liminer. Concentrez-vous sur le chef des imprgns de tnbres en charge des oprations, cela devrait suffire  les mettre en droute.\n\nLes autres individus imprgns de tnbres iront voir ailleurs si l\argent arrte de couler  flots.', '', '', '', '', '', '', 57534),
(79028, 'frFR', 'Nous avons besoin de plus de minraux.', 'Remettez le site d\Ombreveine en tat de marche.', 'Zed-Zed est prte  vous aider  remettre le site d\Ombreveine en tat de marche.', '', '', '', '', '', '', 57534),
(79027, 'frFR', 'Trpidation lmentaire', 'Terrassez des lmentaires.', '<ZZ-01-47 s\agite d\avant en arrire, ses capteurs analysant tout continuellement. Zed-Zed semble avoir peur de cet endroit, si un tel sentiment lui est possible. Il vaudrait peut-tre mieux liminer quelques lmentaires pour l\apaiser.>', '', '', '', '', '', '', 57534),
(79026, 'frFR', 'Un moulin qui mouline', 'Faites fonctionner le moulin  eau.', 'Des Kobolds compltement excits, des lmentaires en colre et une usine en rade. Il n\y a rien qui va ici!\n\nVous voyez ces grandes roues de chaque ct? Elles devraient tourner, mais elles ne tournent pas. Il faut les faire fonctionner si nous voulons rparer ce site.', '', '', '', '', '', '', 57534),
(79025, 'frFR', 'Un plan se forme', 'Passez le plan en revue avec Brinthe et Dagran.', 'C\est un sacr dfi qui nous attend, $n. Mais avec l\aide de Dagran, nous pouvons y arriver progressivement.\n\nPourquoi ne pas nous prsenter ce que vous avez dj appris?', '', '', '', '', '', '', 57534),
(79024, 'frFR', 'Reconnaissance de l\usine', 'Utilisez ZZ-01-47 pour explorer l\usine de golems.', 'ZZ-01-47 devrait pouvoir se faufiler sans trop attirer l\attention.\n\nMais attention! Ces Gobelins ont un apptit insatiable ds qu\il s\agit de matriaux bruts. S\ils reprent notre robot, ils ne lui feront pas de cadeau.', '', '', '', '', '', '', 57534),
(79023, 'frFR', 'Petite acolyte pour grands projets', 'Prsentez-vous  la machine de maintenance.', 'J\ai relev un signal de dtresse qui m\a amene jusqu\ cette petite machine de maintenance. Une trouvaille tonnante, mais le vritable trsor est cette usine de golems de guerre  l\arrt situe au sud-est.\n\nSi nous pouvions produire  nouveau des golems de guerre, nous contribuerions grandement  l\effort de guerre. Hlas, une quipe de rcupration gobeline a dj pris possession des lieux. Il nous faudrait entrer et vrifier si le btiment est toujours en tat de marche.\n\nHeureusement, j\ai un plan et il implique notre chre amie ici prsente. Prsentez-vous donc!', '', '', '', '', '', '', 57534),
(79022, 'frFR', 'Un mystrieux signal', 'Retrouvez Brinthe prs de la golemerie des Forge-Profonde dans les abmes Retentissants.', 'La haute-mandataire Brinthe a envoy une missive urgente  votre attention, $n.\n\nElle souhaite participer  l\effort de guerre  venir et enqute sur un mystrieux signal provenant de la golemerie des Forge-Profonde, une ancienne usine de fabrication de golems situe dans les abmes Retentissants.\n\nPourriez-vous la retrouver et lui apporter votre expertise?', '', '', '', '', '', '', 57534),
(79006, 'frFR', 'Changement de faction', 'Par dfaut', 'Par dfaut', '', '', '', '', '', '', 57534),
(79000, 'frFR', '[DNT]', '', '', '', '', '', '', '', '', 57534),
(78999, 'frFR', 'Le cur d\un hros', 'Vainquez les trois individus chamans qui dirigent les Gorlocs.', 'On dirait que les Gorlocs ont invoqu des lmentaires pour renforcer leur assaut. Cela explique pourquoi ils ont pu franchir nos dfenses aussi facilement.\n\nIl va nous falloir toutes nos forces pour repousser les colosses dj prsents. Vous devez les empcher d\en crer d\autres.\n\nPour crer des lmentaires de cette taille et de cette puissance, a ne peut tre l\uvre que de leur lite du chamanisme. Allez chercher les responsables derrire les lignes ennemies pour les liminer.\n\nCela devrait empcher les Gorlocs de nuire une bonne fois pour toutes.', '', '', '', '', '', 'Retrouvez Dorbund sur la cte Scintillante.', 57534),
(78998, 'frFR', 'Le fer et la nacre', 'Distribuez $1oacaisses d\armes aux dfenseurs et dfenseures des fermes de perles de la cte Scintillante.', 'La plupart des gens des fermes sont dj en train de dfendre leurs positions. Nous leur avons donn le meilleur entranement possible dans ces circonstances, mais ils n\ont que des outils agricoles pour se battre.\n\nVous devez distribuer les armes que vous avez rapportes aux personnes qui tiennent le front. Cela n\amliorera peut-tre pas leur adresse au combat, mais au moins les troupes prendront confiance et sauront qu\elles peuvent compter sur notre aide.', '', '', '', '', '', '', 57534),
(78997, 'frFR', 'Perles chapardes', 'Rcuprez $1oaperles chapardes sur les Gorlocs de la cte Scintillante.', 'Les perles cultives dans ces fermes sont pour ces gens la seule source de subsistance. Ces Terrestres considrent parfois que ces perles sont mme leur principale raison d\tre.\n\nLes Gorlocs continuent d\en voler chaque fois que possible. Lorsque vous liminerez de ces vermines, cherchez les perles drobes au passage. Rcuprons-en le plus possible.', '', '', '', '', '', '', 57534),
(78996, 'frFR', 'Des armes et des bras pour les manier', 'Ramassez $2oacaisses d\armes et recrutez $1oacombattantes et combattants de Landefrey et de Dhar Durgaz.', 'Des pillards gorlocs massacrent les gens de ces fermes pour leur voler leurs perles. Ils demandent notre protection, mais on ne suffira peut-tre pas.\n\nJe connais d\autres personnes dans les parages qui pourraient aider. Allez les voir et demandez-leur assistance. S\il faut les convaincre, promettez-leur des perles en paiement.\n\nEt il faudra armer ces fermires et fermiers pour qu\ils puissent se dfendre. Cherchez des armes et de l\quipement qui pourraient leur servir.\n\nJe vais faire de mon mieux pour les entraner en attendant.', '', '', '', '', '', 'Rejoignez Aggartha sur la cte Scintillante.', 57534),
(78995, 'frFR', 'Trufficotage', '', '', '', '', '', '', '', '', 57534);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(78972, 'frFR', 'Chaos de la moisson', 'Prenez le contrle du robot moissonneur Rmi pour charger $2oachoux et $3oacarottes dans les chariots. De plus, tuez $4oahannetons envahissants.', 'Nos parents sont partis affronter les monstres qui ont envahi notre ferme. Pendant leur absence, on essaie de travailler du mieux qu\on peut.\n\nOn a un robot moissonneur pour nous aider, mais je n\arrte pas de l\envoyer dans l\eau. On pourrait finir ce qu\on a  faire si vous nous aidiez  le piloter!', '', '', '', '', '', '', 57534),
(78954, 'frFR', 'Restaurer la flamme', 'Aidez Faerin  restaurer la Flamme sacre de la Balise des falaises.', 'Vous le sentez? L\espoir qui renat? \n\nMerci pour votre aide, $n.\n\nLa flamme de la tour de l\aube reste obscure. Mais cette fois, je pense que nous russirons  la restaurer. \n\nRetrouvons-nous  la tour.', '', '', '', '', '', '', 57534),
(78952, 'frFR', 'L\ultime rsistance', 'Dtruisez la faille d\ombre.', '<Faerin s\adresse  vous en murmurant malgr sa colre.>\n\nBeau travail. Mais avant de partir, nous devons faire autre chose.\n\nDe puissants prtres se trouvent par ici. Je crois qu\ils invoquent quelque chose. Quelque chose d\important. Probablement dans le but de nous attaquer et de nous chasser de la tour.\n\nCe sera trs dangereux, mais nous devons les arrter. Je peux compter sur vous?', '', '', '', '', '', 'Retrouvez Faerin et Anduin  la Balise des falaises.', 57534),
(78951, 'frFR', 'Des tnbres toujours plus profondes', 'Tuez $1oaadeptes de l\Ordre de la nuit dans la grotte sous la Balise des falaises.', 'Lorsque j\ai atteint la flamme, j\ai senti tout le dsespoir et la lassitude qu\on lui avait insuffls. \n\na me fait de la peine mais ma lumire seule ne suffira pas  bannir ces ombres. \n\nIl nous faut donc une approche plus directe. Si les sectatrices et sectateurs restants se sont replis au berceau de Sombre-Combe, c\est bien leur puissance combine qui doit maintenir la noirceur de la flamme. \n\nNous devons les arrter avant que les tnbres ne s\tendent.', '', '', '', '', '', 'Trouvez Faerin et Anduin dans la grotte sous la Balise des falaises.', 57534),
(78950, 'frFR', 'Couper les pattes', 'Tuez les lieutenants nrubiens.', 'Si nous devons encore localiser Xal\atath, on nous a signal la prsence de Nrubiens donnant des ordres sur le front. a ne suffira pas  nous faire gagner la guerre, mais toute victoire est bonne  prendre.\n\nliminez-les. a nous permettra de souffler un peu. \n\nParlez  Anduin une fois que ce sera fait. La fille arathie et lui sont partis  la poursuite d\Alleria.', '', '', '', '', '', '', 57534),
(78948, 'frFR', 'Une lumire dans l\ombre', 'Parlez  Anduin et pourchassez Xal\atath.', 'Nous avons un srieux problme.  mesure que la bataille progresse, chaque camp se montre plus agressif.\n\nAlleria semble savoir quelque chose. Elle a fui le combat  un moment. Nous sommes sur ses talons, mais je ne veux pas abandonner ces soldats  leur mort. Elle se trouve un peu plus loin, nous nous retrouverons tous ensemble plus tard.', '', '', '', '', '', '', 57534),
(78943, 'frFR', 'Flammes et acier', 'Ralliez $1oatroupes de l\Offensive algarie.', 'Notre arme est capable de tenir bon, mais vous voir au milieu de la mle pourrait renforcer leur moral. \n\nPrenez cette corne de guerre. Faites-la sonner et semez l\effroi dans le cur de nos adversaires. Quand vous aurez fini de rallier les troupes, prsentez-vous aux personnes qui les commandent.', '', '', '', '', '', 'Parlez aux commandants de la Horde et de l\Alliance  la Poigne sanguine.', 57534),
(78942, 'frFR', 'La puissance de Khaz Algar', 'Repoussez les Nrubiens.', 'La messagre pense pouvoir nous surprendre, mais elle se trompe si elle croit l\emporter.\n\nL\Offensive algarie est  vos cts, $n. Ne faites pas de quartier.', '', '', '', '', '', 'Parlez  Faerin  la Poigne sanguine.', 57534),
(78941, 'frFR', 'Une situation  renverser', 'Retrouvez la gnrale Heurtacier  Sainte-Chute.', 'L\arme de Xal\atath est en mesure de nous attaquer depuis dj bien longtemps. Pourquoi a-t-elle choisi ce moment prcis?\n\nC\est louche. Elle a attendu que nous ayons mobilis une arme face  sa menace pour lancer son assaut. Nous sautons  pieds joints dans un pige.\n\nInformez-en la gnrale arathie. Je me rends directement sur le champ de bataille.', '', '', '', '', '', '', 57534),
(78940, 'frFR', 'Qute 00', '', 'Placeholder for RP/Pacing as needed.', '', '', '', '', '', '', 57534),
(78939, 'frFR', 'La flamme de l\ombre', 'Enqutez sur la tour de l\aube corrompue.', 'Cet cet Ordre de la nuit, comme il se surnomme, a men un immonde rituel pour assombrir la flamme de la tour. Je ne sais pas lequel.\n\nNe devrions mener l\enqute.', '', '', '', '', '', '', 57534),
(78938, 'frFR', 'Champion des seigneurs des eaux', 'Terrassez Ragnaros remmor pendant un vnement d\chos radieux.', 'J\ai le regret de vous informer qu\une menace affreuse plane sur vos congnres du royaume des tres mortels. Un seigneur de feu lmentaire, Ragnaros, attend son heure avant de brler Azeroth entirement. Nous, les lmentaires d\eau, menons la guerre depuis la nuit des temps contre ces cratures infrieures. Soyez $gsr:sre; que la menace est srieuse.\n\nFaites la preuve de votre engagement! Tuez Ragnaros, une bonne fois pour toutes!', '', 'Trop tt', 'Ragnaros remmor', '', '', '', 57534),
(78937, 'frFR', 'Ombre sur ombre', 'Examinez la tour de l\aube  proximit.', '<Les grands yeux de Faerin semblent s\affoler tandis qu\elle regarde dans toutes les directions.>\n\nQue s\est-il pass? Vous avez vu cette ombre? Et le puits d\huile Les tnbres l\ont envahi? \n\nJe n\avais jamais rien vu de pareil. \n\nEst-ce la tour de l\aube non loin qui a fait cela? Dpchons-nous!', '', '', '', '', '', 'Allez voir Alleria  la Balise des falaises.', 57534),
(78936, 'frFR', 'De l\eau dans le gaz', 'Tuez Bourbpaisse, l\abominable Brisevague et le seigneur-mares Dentemisre  l\Envie de Sina.', 'Alors Faerin et vous avez russi  survivre et  sauver les gens de la plage? \n\n<Soulage, Heurtacier murmure une brve prire.> \n\nNous avons des ennuis, ici. Les Kobyss ont dpch certaines de leurs meilleures units aux pieds des villageois et villageoises. \n\nNous parvenons  peine  les contenir. Si vous arrivez  vaincre ces monstres, nous pourrons peut-tre reprendre l\avantage.', '', '', '', '', '', '', 57534),
(78934, 'frFR', 'Les lames du peuple arathi', 'Embrasez une torche  l\aide de la Flamme sacre et ralliez $2oagroupes de gens arathis dans l\Envie de Sina.', 'J\ai confiance en votre force. Je me dois de vous demander d\aller apporter votre aide  l\Envie de Sina. Anduin et moi-mme allons prter main-forte  mon peuple  la croise de Lorel.\n\nAu milieu des tnbres et des Kobyss, le cur des habitants de l\Envie de Sina risque de cder  la panique. Nous ne pouvons pas les abandonner  leur sort.\n\nEmbrasez une torche  l\aide de la Flamme sacre au centre de la ville et servez-vous-en pour restaurer le courage de ces gens. Rappelez-leur qu\ils sont forts, eux aussi.\n\nNous vous retrouverons ensuite. Que la flamme vous guide, mon $gami:amie;.', '', '', '', '', '', '', 57534),
(78933, 'frFR', 'La belle clipse', 'Collectez $2oaplaqueminiers sombracines, $1oaportions de caviar  la bave de crapaud et $3oaportions de sucre thr.', 'J\ai entrepris de crer un dessert qui transcendera l\ordinaire, que mme les adeptes de la Lumire  la dvotion la plus pure pourront savourer.\n\nPour obtenir un dessert au got quilibr, entre la lumire et l\ombre, il me faut des ingrdients que l\on trouve dans plusieurs zones des tnbres.\n\nS\il vous plat, aidez-moi  rcolter les ingrdients suivants: du caviar  la bave de crapaud, du plaqueminier sombracine et du sucre thr.', '', '', '', '', '', '', 57534),
(78932, 'frFR', 'Poisson diabolique et capricieux', 'liminez $1oaenvahisseurs kobyss.', 'Si j\en crois l\tincelle qui illumine votre regard, vous souhaitez rejoindre Faerin dans cette folie?\n\nEntrer dans les eaux des Kobyss? Dans les tnbres?\n\nC\est une vritable mission suicide.\n\nliminez autant de ces satans poissons que vous le pouvez, avant qu\ils ne vous entranent dans les profondeurs pour leur servir de dner.', '', '', '', '', '', '', 57534),
(78929, 'frFR', 'Les piges des tnbres', 'Sauvez $1oaprisonnires et prisonniers arathis.', 'Les Kobyss sont tapis dans leurs marcages et attrapent quiconque s\en approche d\un peu trop prs, vifs comme des serpents!\n\nMais a, c\est quand ils chassent seuls. En groupe, c\est une autre histoire. Ils harclent nos villages depuis notre arrive.\n\nIls mangent leurs victimes encore vivantes, quand ils le peuvent. Nous devons sauver les gens qu\ils ont dj emmens vers les eaux!', '', '', '', '', '', '', 57534),
(78918, 'frFR', 'Coup de poing de Brax', 'Tuez des cratures autour de Gundargaz pour trouver le coup de poing de Brax.', 'J\ai une proposition  vous faire.\n\na nous arrive d\avoir des clientes et clients un peu chahuteurs. Rien de grave, mais les gens du coin sont des costauds et les choses dgnrent plus vite qu\un marteau vient frapper l\enclume.\n\nD\habitude, je leur envoie un bon coup sur la tte histoire de rappeler les rgles de biensance, mais j\ai perdu mon coup de poing en laiton en allant liminer des monstres pour la gardienne Toki  la priphrie de la ville.\n\nVous pourriez aller me chercher mon coup de poing et leur envoyer quelques bourrades amicales?', '', '', '', '', '', '', 57534),
(78915, 'frFR', 'Courges menaantes', 'Retirez $1oacourges aigres-sombres et tuez $2oamites aigres-ombres.', 'J\ai besoin de votre aide!\n\nD\normes courges aigres-sombres ont commenc  pousser un peu partout. Elles dgagent une horrible puanteur et grouillent de mites.\n\nMaman et papa ont fait venir des aronefs pour nous aider  les arracher, mais c\est une entreprise risque avec tous ces insectes.\n\nPourriez-vous attacher des cordes  ces courges aigres-sombres pour que les aronefs les arrachent sans faire de dgts?', '', '', '', '', '', '', 57534),
(78902, 'frFR', 'Minage dlgu', 'Obtenez $1oamorceaux de sivpierre.', 'Bon, je sais reconnatre quand je suis vaincue. Je voudrais donc vous embaucher comme $gchampion:championne; de la pice ou champice.\n\nDans le cadre de ma nouvelle affaire. Ces vers que vous voyez sont aussi bons pour la chasse aux minraux rares que le peuple flairan pour les champignons de qualit.\n\nJe suis prte  parier tout ce que j\ai, et votre vie, qu\ils ont trouv une veine de sivpierre. Une merveille, mme si j\imagine qu\$gun:une; vulgaire $c ne connat rien  ces choses-l.\n\nVoil le march: apportez-moi de quoi remplir une cargaison et je fais moiti-moiti avec vous!', '', '', '', '', '', '', 57534),
(78901, 'frFR', ' l\aide!!!', 'Portez secours  Skedgit Cendrepan.', 'H! Vous!\n\nFaites-moi descendre!  l\abri de ces vers! Je vous en prie!\n\nJe vous paierai! Je vous le rendrai au centuple! Allez, je vous rencarderai mme sur n\importe quel membre du cartel!\n\nJe veux juste descendre!\n\nMais limitez vos dplacements. Ils peuvent entendre vos bruits de pas. Sautez de rocher en rocher si vous voulez viter qu\un groupe ne vous attaque.', '', 'Une opportuniste aux yeux plus gros que le ventre.', 'Skedgit Cendrepan', '', '', '', 57534),
(78900, 'frFR', 'Des ailes froides comme la mort', 'Pourchassez la mort retentissante  Gundargaz.', 'Vous avez parcouru toute la galerie Primaire, c\est a? De haut en bas?\n\n<Toki ricane.>\n\nAh, ils ont la vie facile, les Terrestres de la ville. L-dessous, la mort peut venir de partout.\n\nD\en bas. D\en haut.\n\n vous voir, je dirais que vous avez dj abattu un paquet de cratures. a vous dirait d\en ajouter une  la liste?', '', 'Elle plane au-dessus des recoins obscurs de Gundargaz avec ses ailes froides comme la mort.', 'La mort retentissante', '', '', '', 57534),
(78898, 'frFR', 'Intention contre instinct', 'Rcuprez une pierre chantante auprs du mande-ver Iz\tikrine.', 'Les fouisseurs cavernicoles ne sont gnralement pas des cratures trs sociables. Il est trange d\en voir autant en un mme lieu.\n\nUn mande-ver nrubien doit tre  l\uvre.\n\nTrouvez cette crature et rcuprez l\outil dont elle s\est servie pour appeler les vers. Avec cet instrument en notre possession, nous pourrons les loigner en un rien de temps.', '', 'Il n\est jamais seul.', 'Mande-ver Iz\tikrine', '', '', '', 57534),
(78897, 'frFR', 'La peste ou la colre', 'Abattez $1oavers des Terrevers.', 'Cet endroit est infest de fouisseurs cavernicoles. Ils menacent les immenses racines qui s\tendent  travers ce lieu.\n\nL\arbre permet  de nombreuses espces de vivre ici, certes, mais il ne s\agit pas de trois insectes qui grignoteraient une feuille. C\est un vritable flau. Nous devons rduire leur nombre pour le bien commun.\n\nMon serment m\interdit d\intervenir. Mais ce n\est pas votre cas. Allez-vous faire le ncessaire?', '', '', '', '', '', '', 57534),
(78895, 'frFR', 'L\ombre qui plane sur Gundargaz', 'Dcouvrez ce qui s\en prend aux Terrestres de Gundargaz.', 'Z\avez l\air $gdangereux:dangereuse;.\n\n<Toki crache par terre.>\n\nC\est bien. On a b\soin de gens dangereux. Quelque chose menace Gundargaz. \n\nUn sale truc. \n\nUn truc rcent. \n\nJuste avant que la galerie Primaire s\effondre, on a commenc  m\dire que des ouvriers et ouvrires disparaissaient en plein service. Tout ce qu\on a retrouv, c\est des morceaux de pierre. \n\nDes doigts, surtout.\n\nSi vous pouviez trouver c\qui s\attaque  ma ville, je vous en s\rais reconnaissante.', '', '', '', '', '', '', 57534),
(78879, 'frFR', 'Attiser la forge', 'Trouvez le moyen de raviver la forge en dehors de Gundargaz.', 'Grumpf! Cette maudite forge ne marche plus que sur une patte! On pourrait la rparer, mais le btisseur Itsak commenait son service  la station Portefer quand la galerie Primaire s\est effondre et enfin voil.\n\nIl n\y a plus personne pour la rparer.\n\nSi vous pouviez trouver le moyen de la faire chauffer  plein tube, vous rendriez un fier service  Gundargaz!', '', '', '', '', '', '', 57534),
(78877, 'frFR', 'Bnir les foyers', 'Allumez les encens prs de Gundargaz.', 'Prsence divine constate.\n\nChaque jour, aussi loin que je m\en souvienne, j\ai parcouru les chemins et allum les encens autour de nos foyers. a m\en a gt les jointures, mais c\est une tche importante.\n\nUne tche sacre.\n\nNous vivons des heures sombres Peut-tre pourriez-vous apporter votre contribution  notre petit rituel?', '', '', '', '', '', '', 57534),
(78874, 'frFR', 'Soutien invoqu', 'Invoquez de la nourriture pour Brax l\aubergiste  la taverne de Gundargaz.', 'Si c\est de la nourriture que vous cherchez, de la nourriture molle, j\ai bien peur qu\on n\en ait plus. Rien d\autre que nos bonnes pierres et nos gemmes pour le moment.\n\nMais a commence  devenir embtant, tout de mme.\n\nDites Vous ne pourriez pas faire quelque chose pour nous? Comme nous trouver des victuailles qui plaisent aux tres charnus?', '', '', '', '', '', '', 57534),
(78860, 'frFR', 'Encore bougies!', 'Volez plus de bougies pour la bouche d\aration suspecte  la taverne de Gundargaz.', 'Je, euh, on non, non, je! J\ai nouvelle offre pour vous, $gami:amie; des ombres.\n\nPlus de bougies!\n\nEn change, vous avoir euh\n\n<Des bruissements frntiques laissent la place  une nouvelle voix.>\n\nVous avoir plus de bougies! Et les donner  nous!  moi!\n\nDes bougies! Des bougies! Des bougies!\n\n<Les chuchotements enfivrs se poursuivent un certain temps.>', '', '', '', '', '', '', 57534),
(78839, 'frFR', 'Maudits Kobolds', 'Tuez les Kobolds envahisseurs dans les mines Perdues.', 'La premire mesure  prendre pour limiter nos pertes et reprendre les mines est simple, mme si elle est dsagrable. Sans sbires, ce roi-bougie sera moins menaant pour Gundargaz.\n\nVoyez si vous pouvez rduire l\essaim, $n, avant que le conflit ne dgnre.', '', '', '', '', '', '', 57534),
(78838, 'frFR', 'Des rouages dans la machine', 'Accompagnez Brinthe pendant qu\elle parle aux Terrestres dans Gundargaz.', 'Gundargaz est mon foyer. Du moins, c\tait le cas avant que le haut-mandataire ne juge bon de me raffecter  la surface. Mon chez-moi m\a manqu, mais il a chang.\n\nAlors que le nombre de mandataires des machines diminue, nous nous retrouvons dans une course contre la montre.\n\nCes derniers temps, les tches qui nous sont confies nous puisent particulirement, mais comme toujours, nous devons accepter notre fardeau.\n\nPermettez-moi de vous faire visiter les environs. Il y a quelques Terrestres que j\aimerais vous prsenter.', '', '', '', '', '', '', 57534),
(78837, 'frFR', 'Pompe et circonstance dsastreuse', 'Retrouvez la mandataire Brinthe  Gundargaz.', 'Beaucoup de ces inquitudes semblent lgitimes. Nous devons faire quelque chose concernant les Nrubiens mme si le haut-mandataire s\y refuse. S\il ne fait rien, je le ferai.\n\nLe haut-mandataire m\a envoye  la surface parce que je n\tais pas raisonnable. Je pense que nous devrions avoir une chance de discuter avec lui. Nous devons aller  Gundargaz.', '', '', '', '', '', 'Trouvez la mandataire Brinthe  Gundargaz.', 57534),
(78827, 'frFR', 'Vous ramener bougie!', 'Volez des bougies pour la bouche d\aration suspecte  la taverne de Gundargaz.', 'Pss, pss! Vous, l! Oui, vous!\n\n<Vous entendez comme une bousculade derrire la bouche d\aration, puis une nouvelle voix, plus raille, s\lve.>\n\nOn moi avoir travail pour vous! L\air malin, vous. Et rapide. La main agile, comme nous comme moi!\n\nRapporter  nous  moi, rapporter bougies! C\est a!\n\nPas de questions, juste chercher bougies.\n\nOn moi tre pro. C\est a. Entre pros, pas de questions.\n\nDes bougies, que a.', '', '', '', '', '', '', 57534),
(78761, 'frFR', 'Dans la Machine', 'Affrontez le haut-mandataire dans la salle de l\veil.', 'Pas le temps de reprendre notre souffle! Le haut-mandataire s\enfuit vers la machine la plus sacre des Terrestres. Nous devons le suivre.\n\nRappelez-vous, nous faisons cela pour les Terrestres! Pour la justice! Pour tous les frres et surs, tous les camarades qui sont tombs  cause de l\orgueil dmesur du haut-mandataire!', '', '', '', '', '', '', 57534),
(78760, 'frFR', 'Sombrefer venu d\en haut', 'Vainquez le superviseur Varric et ses troupes dans les Ouvrages terrestres.', 'Nous avons fait tout notre possible pour arrter les fidles du haut-mandataire, et avons russi  endiguer leur assaut avant qu\ils ne pillent tout ce qu\ils pouvaient trouver dans la salle de l\veil.\n\nIl ne nous reste plus qu\ nous occuper de leur commandant pour ne pas leur laisser le temps de s\organiser et de former une rsistance.\n\nCela vous convient-il, $n?', '', ' la tte des loyalistes du haut-mandataire Eirich aux Ouvrages terrestres. Voit tout non-conformisme comme un acte d\irrespect, de rbellion ou de dviance.', 'Superviseur Varric', '', '', '', 57534),
(78759, 'frFR', 'Rveiller un gant', 'Appliquez le baume lmentaire au gant des montagnes pour Harmot.', 'Par la galerie Primaire, ce machin, c\est du raide!\n\nEn combinant la vase curative avec les proprits de fusion du miel-feu, on a obtenu un baume  rveiller les montagnes!\n\na tombe bien, c\est ce qu\on veut faire. Apportez ce mlange  notre ami bless dans la mare de Farnee, et talez-lui a sur le flanc!\n\na devrait permettre de le rveiller et de soulager ses bobos.\n\nEnfin, j\espre.', '', '', '', '', '', '', 57534),
(78758, 'frFR', 'Un battement de terre', 'Placez 4pierres de secousses autour de l\tang.', 'Avant de rveiller un gant des montagnes qui dort, il vaut sans doute mieux savoir s\il dort profondment.\n\nMais si les Nrubiens qui creusent ne l\ont pas rveill, je ne sais pas ce qui pourra.\n\nPrenez ces clats de terre et plantez-les dans les cascades et collines autour du lac.\n\nUne fois qu\ils seront installs, je pourrai me faire une ide de l\tat de sant du gant.', '', '', '', '', '', '', 57534),
(78757, 'frFR', 'Mielargile et la douleur file', 'Aidez Harmot  prparer le baume pour Sabot de schiste.', 'Des blirithes! Magnifiques, hein? Cette bte est l\une des cratures lmentaires les plus incroyables de l\le.\n\nLa mauvaise nouvelle, c\est qu\elles ne sont pas  l\abri des blessures. Pauvre Sabot de schiste Des lmentaires veills ont svi dans la mare de Farnee.\n\nLa bonne nouvelle, c\est que nous avons tout ce qu\il faut pour nous occuper de lui.\n\nIl ne nous reste plus qu\ mlanger l\argile que vous avez trouve avec du miel-feu et  l\appliquer sur le jarret de Sabot de schiste!\n\nOn y va?', '', '', '', '', '', '', 57534),
(78756, 'frFR', 'Vraiment plein de miel-feu', 'Trouvez beaucoup de miel-feu.', 'Si Harmot veut qu\on rpare ce rocher endormi pour le sortir de mon tang, je suis d\accord.\n\nMalheureusement, nous avons utilis ce qu\il me restait de miel-feu pour la blessure de Sabot de schiste. Je n\ai pas eu le temps d\aller en chercher davantage  Braiselande, avec tous ces lmentaires qui se dchanent.\n\nDescendez sur place et rapportez-nous du miel. Il va vous en falloir beaucoup.', '', '', '', '', '', '', 57534),
(78755, 'frFR', 'Jouer dans la boue', 'Rcuprez 20poignes de vase  charge lmentaire.', 'Vous vous souvenez quand on a utilis l\argile et le miel-feu pour rparer Sabot de schiste? On devrait recommencer, mais en plus grand!\n\nLe problme, c\est qu\on n\a plus d\argile. Mais heureusement, avec toute l\activit sismique rcente, on a toute une avalanche d\lmentaires qui se sont rveills et se dchanent sur la plage  l\est!\n\nApportez-moi de la vase humide charge d\lments pour prparer notre remde!', '', '', '', '', '', '', 57534),
(78754, 'frFR', 'Livraison perdue', 'Livrez le paquet abandonn  la moissonneuse Farnee  la cabane de Durgaz.', '<Vous trouvez un petit colis, assez lourd, emball dans du cuir sur la route. Vous remarquez une tiquette.>\n\nMessageries Express de Gundargaz\n\nSERVICE RAPIDE\n\nPOUR:\nMoissonneuse Farnee\nCabane de Durgaz\n\nOUVRIR AVEC SOIN: contient du minerai lmentaire instable.', '', '', '', '', '', '', 57534),
(78749, 'frFR', 'Qui dirige ce bel tablissement?', 'Tuez le grand braqueur Bokk.', 'Pendant que vous vous occupiez des tunnels et des matres et matresses d\uvre, j\ai vu un Kobold particulier entrer dans une grotte au nord-ouest. Ses semblables avaient l\air de le respecter plus que les autres. Ils l\appelaient le grand braqueur Bokk et lui offraient de cette nourriture que vous appelez fromage. Cela me pousse  croire qu\il a tout organis.\n\nSi c\est bien ce Kobold qui a maniganc toute l\opration, nous devrions saisir l\occasion de l\liminer.\n\nJe vous retrouve devant sa caverne.', '', 'Le grand braqueur Bokk n\a rien d\autre  faire que chanter, prendre les meilleures bougies et manger plein de fromage.', 'Grand braqueur Bokk', '', '', 'Retournez voir Urtago  l\avant-poste de Bordechute.', 57534),
(78748, 'frFR', 'Couper la mche', 'Trouvez et tuez les matres et matresses d\uvre kobolds.', 'Connaissant les Kobolds, il devait y avoir plusieurs matres et matresses d\uvre pour diriger ce raid.\n\nTrouvez-les et liminez-les. Sans une autorit centrale, les autres se dsorganiseront, oublieront ce qui les amenait ici et devrait sans doute nous laisser tranquilles.', '', '', '', '', '', '', 57534),
(78747, 'frFR', 'Le Grand Effondrement', 'Utilisez les btons explosifs pour dtruire les tunnels des Kobolds.', 'Maintenant que nous leur avons port un coup dcisif, il est temps de reboucher leurs tunnels pour les empcher de revenir.\n\nVous vous souvenez de ce que Korgran nous a demand? Les btons explosifs sa recette. J\en ai apport suffisamment pour faire trembler une montagne! Bien assez pour les Kobolds.\n\nAidez-moi  montrer  ces vermines que nous avons dcid de dfendre ce qui nous appartient, pour leur faire passer l\envie de revenir!', '', '', '', '', '', '', 57534),
(78746, 'frFR', 'Lois universelles', 'Tuez des envahisseurs kobolds sur la cime plore.', 'La profanation de sites mmoriaux fait partie des pires tabous de la socit terrestre. Celui-ci est une fentre ouverte sur notre pass, nos souvenirs un endroit o nous pouvons communier avec celles et ceux qui ne sont plus l.\n\nMais il reste tant de ces Kobolds sur la cime plore. Ils mritent le pire des chtiments. Nous devons continuer de les liminer.', '', '', '', '', '', '', 57534),
(78745, 'frFR', 'Vous pas prendre butin!', 'Rcuprez les biens des Terrestres dans les tas de butin.', 'On dirait que les Kobolds ont pris les gemmes et les membres de ces Terrestres inertes.\n\nC\est abominable.\n\nDcouvrez o les Kobolds ont emport leur butin et rapportez-moi tout a pour que je les restitue  leurs propritaires.\n\nNous devons arrter ces vandales!', '', '', '', '', '', '', 57534),
(78744, 'frFR', 'Honorer leur souvenir', 'liminez l\invasion de Kobolds et placez des cadeaux prs des gardiennes et gardiens dsactivs.', 'Prenez ces cadeaux et placez-les prs des gardiennes et gardiens passs. Chaque objet est un hommage rendu  leur mmoire.\n\nJ\aimerais aussi que nous fassions un peu d\entretien sur le site. Malheureusement, il faudra des semaines pour rparer ce que les Kobolds ont fait.\n\nFaites-ce que vous pouvez  propos d\eux. Il ne faudrait pas laisser ces cadeaux en vidence tant que les dprdations se poursuivent.', '', '', '', '', '', '', 57534),
(78743, 'frFR', 'Avant mon dpart', 'Retrouvez Urtago au site du mmorial de la cime plore.', 'Je sens mes rserves d\nergie s\amenuiser.\n\nBientt, je ne pourrai plus remplir mes fonctions. Voil pourquoi je confie mes responsabilits  Urtago.\n\nAvant que mes systmes ne deviennent inertes, je dois m\assurer qu\il ne reste plus de Kobolds sur la cime plore. Ces cratures ont envahi le site du mmorial dont je m\occupe pour piller les sanctuaires dlis ainsi que les cadavres.\n\nVotre arrive est peut-tre opportune. Vous avez sans doute la force de nous aider.\n\nJe vous en prie, aidez Urtago  dloger les Kobolds.', '', '', '', '', '', 'Retrouvez Urtago au site du mmorial de la cime plore.', 57534),
(78742, 'frFR', 'Bataille des Ouvrages terrestres', 'Terrassez les mandataires des machines et les assemblages ennemis, et venez en aide aux ouvriers effrays dans les Ouvrages terrestres!', '$p! Une bataille se prpare! Nous devons aider les mandataires des machines fidles  notre cause et nous opposer  toute personne qui dfend le haut-mandataire.\n\nJe vais rester et laborer des plans avec Adelgonn. J\ai besoin de vous pour diriger nos troupes pendant que nous limitons les rpercussions des actes du haut-mandataire dans les Ouvrages terrestres. C\est notre premire mesure pour le destituer. Nous allons mettre un terme  ses horribles crimes une fois pour toutes.\n\nAlors, $p? Envie d\un bon combat?', '', '', '', '', '', '', 57534),
(78741, 'frFR', 'Mandataires compatissants', 'Cherchez des contrematres des mandataires des machines dans les Ouvrages terrestres avec la mandataire Brinthe.', 'Je dois empcher le haut-mandataire de fabriquer d\autres Skardyns.\n\nLe protocole des mandataires des machines veut que l\un des contrematres de cette zone dispose d\une cl de la salle de l\veil. Venez avec moi pour la trouver!', '', '', '', '', '', '', 57534),
(78738, 'frFR', 'Mandataire absent', 'Retrouvez la mandataire Brinthe dans les Ouvrages terrestres.', 'C\est un jour sombre pour les abmes Retentissants, $p.\n\nJ\ai toujours su que quelque chose clochait chez le haut-mandataire. Maintenant nous avons des preuves.\n\nAlors, place  la justice. S\il a des projets pour la Machine d\veil, nous devons l\arrter.', '', '', '', '', '', '', 57534),
(78722, 'frFR', 'En route vers Khaz Algar!', 'Dites  Khadgar que vous tes $gprt:prte;  partir.', 'De ce qu\a vu Magni, Khaz Algar n\est peut-tre pas la destination la plus sre qui soit. Nous aurons besoin de vous en cas de combat.\n\nVenez me voir quand vous serez $gprt:prte;  partir.', '', '', '', '', '', '', 57534),
(78721, 'frFR', 'Les quipes en lice', 'Allez voir l\expdition algarie.', 'Si nous voulons explorer les terres de Khaz Algar, nous aurons besoin de l\aide de la Ligue des explorateurs. Cela dit, la Ligne ne compte pas s\y attaquer seule. Elle va de nouveau s\associer au Reliquaire, comme sur les les aux Dragons. \n\nCette fois, ils ont pris le nom d\Expdition algarie.\n\nLe seul dtail qui me chagrine, c\est que je me demande s\ils arrivent encore  s\entendre. L\exploration peut sparer aussi bien qu\elle peut rassembler. Pourriez-vous aller les voir?', '', '', '', '', '', '', 57534),
(78719, 'frFR', 'Peuple de Dalaran', 'Aidez les citoyens de Dalaran  se prparer avant la tlportation.', 'Nos citoyens doivent se prparer  quitter Dalaran. Pouvez-vous demander en ville si quelqu\un a besoin d\aide?\n\nJ\aimerais aussi que vous alliez parler  Brann et  l\archimage Drenden. Tous deux ont des problmes qui mritent d\tre rgls avant notre dpart pour Khaz Algar.', '', '', '', '', '', '', 57534),
(78718, 'frFR', 'Protection renforce', 'Renforcez les dfenses de Dalaran.', 'La vision de Magni nous indique que Khaz Algar vit sans doute une priode trouble. C\est pour cela que Dalaran doit se prparer au pire.\n\nTenez, prenez cette baguette. Elle est en harmonie avec les dfenses magiques de Dalaran.\n\nAgitez-la prs des endroits stratgiques de la ville pour renforcer nos dfenses.', '', '', '', '', '', '', 57534),
(78717, 'frFR', 'Un mystrieux avertissement', 'Discutez des prochaines tapes, puis poursuivez avec Khadgar.', 'J\ai fait un sacr somme. Je ne pensais pas qu\Azeroth serait aussi bruyante. Elle ne fait qu\appeler doucement la plupart des gens, mais mon lien avec elle me permet de l\entendre hurler  m\en faire rsonner le cristal.\n\nCela dit, je l\ai vue. Khaz Algar, une le de Terrestres, noye sous les flammes et la fume. C\est l qu\Azeroth veut nous emmener.\n\nC\est cela que nous devons protger.', '', '', '', '', '', '', 57534),
(78716, 'frFR', 'Des leons douloureuses', 'Empruntez le portail vers Dalaran.', 'L\tat de Magni semble s\tre stabilis, mais il est toujours inconscient. Il nous faut vite trouver de quoi le soigner. Je vais ouvrir un portail vers Dalaran.\n\nSuivez-nous ds que vous le pourrez.', '', '', '', '', '', '', 57534),
(78715, 'frFR', 'La voix d\Azeroth', 'Aidez Magni  excuter le rituel.', 'Je n\ai pas communiqu avec Azeroth depuis des annes. Dans les premiers temps, je n\en ressentais pas le besoin. Puis je me suis rendu compte que je lui en voulais. De m\avoir laiss ainsi. Et aujourd\hui, je ne suis plus certain d\en tre capable.\n\nMais je connais les enjeux. Son chant radieux annonce une catastrophe imminente. Et nous devons savoir de quoi il s\agit.\n\nTout d\abord, nous devons prparer la chambre du Cur. Pouvez-vous allumer les consoles non loin?', '', '', '', '', '', '', 57534),
(78714, 'frFR', 'Un bien triste accueil', 'Allez dans la chambre du Cur et demandez  Magni de vous aider  dchiffrer le chant radieux.', 'Tout porte  croire que ce chant radieux est une mise en garde d\Azeroth elle-mme. Un appel  l\aide.\n\nC\est pourquoi nous sommes ici. Si cette vision est bien un message d\Azeroth, Magni saura ce qu\elle tente de nous dire.\n\nNous devrions le trouver dans la chambre du Cur. Allons-y.', '', '', '', '', '', '', 57534),
(78713, 'frFR', 'Le Conflit intrieur', 'Allez en Silithus pour parler  Thrall des visions qui apparaissent partout sur Azeroth.', 'Une vision est apparue  travers Azeroth. Un chant radieux. Nous pensons qu\il s\agit d\un avertissement, mais nous ignorons sa signification.\n\nRetrouvez-moi en Silithus. Nous devons demander  l\orateur d\Azeroth ce que signifie cette vision.', '', '', '', '', '', '', 57534),
(78706, 'frFR', 'Le secret du haut-mandataire', 'Retournez voir Brinthe  Gundargaz.', 'Nous avons obtenu ce que nous tions venus chercher. Nous devons retourner  Gundargaz. Brinthe doit savoir ce qui s\est pass ici.\n\nAllons-y, $p. On se retrouve  Gundargaz.', '', '', '', '', '', 'Retourner voir Brinthe  Gundargaz', 57534),
(78705, 'frFR', 'Ce qu\elle a vu', 'Inspectez la gemme laisse par le Skardyn.', 'Qu\est-ce que c\est? Cette chose que le Skardyn a laiss tomber avant que nous avant qu\il ne meure.\n\nJe crois que j\ai dj vu quelque chose comme a.', '', '', '', '', '', '', 57534),
(78704, 'frFR', 'Trouver la contrematresse', 'Trouvez la contrematresse.', 'Dagran avait raison. Je prsume que cela ne devrait plus me surprendre.\n\nTout indique qu\il y a quelque chose dans cette grotte. Peut-tre que la contrematresse se cache ici. Peut-tre peut-elle nous apporter des rponses.\n\nNous sommes arrivs jusqu\ici. Voyons ce qu\il y a  l\intrieur.', '', '', '', '', '', '', 57534),
(78703, 'frFR', 'Sous les pierres', 'Inspectez la grotte situe  l\arrire de la mine de Taelloch.', 'Il faut aller dans la grotte, celle qui est mentionne dans la dernire ardoise. Elle n\est pas signe, mais je pense que c\est l\criture de la contrematresse et nous avons cherch partout ailleurs. Il faut aller voir.', '', '', '', '', '', '', 57534),
(78701, 'frFR', 'La vrit dans la craie', 'Recherchez des messages dans la mine de Taelloch.', 'Ainsi la population de Taelloch utilise des craies et des ardoises pour se laisser des messages. Que d\indices! Mais qu\est-ce que a peut bien vouloir dire\n\nJe vois un schma, et je pense qu\il pointe vers les mines. Si la main d\uvre n\est pas encore porte disparue, je m\attends  ce qu\elle soit dans les mines.\n\nEt je sais que la contrematresse est la cl. C\est certain.', '', '', '', '', '', '', 57534),
(78700, 'frFR', 'Dmolition contrle', 'Tuez 18skardyns  Taelloch.', 'Je sais que nous avons dj combattu des Skardyns, $gchampion:championne;, mais a c\est encore pire.\n\nJe savais qu\ils transformaient les Terrestres en de nouveaux Skardyns, mais je ne m\attendais pas  ces cristaux ces pointes cette troublante nergie bleue et cette odeur! Bref, pas du tout ce  quoi je m\attendais.\n\nSi nous devons nous aventurer l-bas, j\abattrai quelques-unes de ces abominations en chemin.', '', '', '', '', '', '', 57534),
(78697, 'frFR', 'Les vestiges d\une ville industrielle', 'Utilisez la technique Inspecter pour trouver des indices sur ce qui s\est pass  Taelloch.', 'La contrematresse n\est pas l. De toute vidence. Mais il semblerait qu\elle ne soit pas partie depuis trs longtemps. Peut-tre se trouve-t-elle encore dans les parages?\n\nNous devrions aller plus loin dans la ville et voir si quelqu\un a une ide de l\endroit o elle pourrait se trouver.\n\nOu peut-tre que quelqu\un d\autre peut nous fournir les rponses dont nous avons besoin. Peut-tre que nous trouverons par nous-mmes! Peut-tre que c\tait une sorte d\attaque ou une sorte de dsol. Je m\emballe. Allons enquter!', '', '', '', '', '', '', 57534),
(78696, 'frFR', 'Nous n\allons pas  Taelloch', 'Dgagez l\entre de Taelloch des btes qui l\envahissent.', 'Ce mandataire des machines en dtresse tait venu dans un but prcis. Mais lequel? On dirait que quelque chose l\a srieusement endommag.\n\nIl ne faut pas traner.\n\nNous devons nous rendre  Taelloch et chercher la contrematresse. Pourriez-vous dgager l\entre de la ville? Quelqu\un pourrait tre bless!', '', '', '', '', '', '', 57534),
(78695, 'frFR', 'Allumage de lampe', 'Placez $1oatorches  la priphrie de la Prtention de Velhan, puis observez le rallumage de la tour de l\aube.', 'Les Kobyss vivent gnralement au plus profond sous l\eau, $p. Quand Beledar brille de toute sa force, ils ne nous ennuient pas. D\autres sources de lumire vives peuvent les tenir  distance et les affaiblir.\n\nNous, falotiers et falotires, pntrons dans l\obscurit pour protger les plus faibles, mais nous fournissons aussi la lumire qui garantira leur scurit. Allez placer ces torches  la priphrie, puis retrouvez-nous prs de la tour de l\aube derrire la Prtention de Velhan.', '', '', '', '', '', '', 57534),
(78694, 'frFR', 'Reprendre la Prtention de Velhan', 'liminez $1oaguerriers kobyss prs de la Prtention de Velhan.', 'Le plus gros problme, $p, ce sont les Kobyss. Ils sont beaucoup trop nombreux.\n\nTous les gens qui sont ici avaient servi dans l\arme  notre arrive  Sainte-Chute. Ils sont peut-tre rouills, aujourd\hui, mais ils ont dj t forms et savent se montrer dangereux.\n\nMais nous devons tout faire pour rduire l\effectif des Kobyss. Alors allez sur le terrain pour faire un peu de mnage. Aemyra et moi allons protger les gens ici.', '', '', '', '', '', '', 57534),
(78693, 'frFR', 'Se lancer un bon coup', 'Collectez $1oalances kobyss pour les gens de la Prtention de Velhan.', 'Je crois que Velhan et sa communaut espraient pouvoir vivre en paix, ici. Ils en taient tellement certains qu\ils n\ont mme pas pris d\armes avec eux.\n\nC\est un problme, avec les attaques des Kobyss, mais les Kobyss vont peut-tre pouvoir le rgler  notre place. Ils ont apport de nombreuses lances pour leur assaut contre la Prtention de Velhan, et celles-ci sont aussi capables de massacrer des Kobyss que des Humains et Humaines.\n\nAllez sur le terrain et dgotez des lances pour ces gens, $p. Ils auront moins peur une fois arms.', '', '', '', '', '', '', 57534),
(78692, 'frFR', 'Apprends  un homme  pcher', 'Distribuez $1oalances aux gens de la Prtention de Velhan.', '$p, la population de la Prtention de Velhan s\est enferme  l\intrieur, terrifie par les ombres, pendant trop longtemps.\n\nEt si leurs peurs sont justifies, il s\agit de gens tout  fait capables et forts. Ils devraient repousser les Kobyss au lieu de se terrer derrire leurs murs.\n\nApportez ces lances au peuple de la Prtention de Velhan. On lui a appris  fuir ses problmes, mais nous allons lui donner les moyens de les rgler par lui-mme!', '', '', '', '', '', '', 57534),
(78691, 'frFR', 'Celui qui s\chappa', 'Sauvez Maximillian prs de l\pave de l\Indomptable.', '$p, mon fils est all trouver les Kobyss. Il a convaincu d\autres enfants de faire le mur pour aller les combattre avec lui. Il a dit qu\il fallait se montrer aussi courageux que mon pre.\n\nLorsque les jeunes en ont rencontr un, les autres ont fui et sont revenus ici, mais lui est parti vers le vaisseau cras pour faire diversion.\n\nJe n\ai fait preuve d\aucun courage, $p. Le grand rcit de l\Indomptable me prsente comme un hros, mais ce sont simplement les mensonges inscrits dans mon rapport.\n\nC\est l\heure de se muer en hros. Si j\y vais seul, les Kobyss ne feront qu\une bouche de moi. Venez avec moi, $p. Aidez-moi  sauver Maximillian.', '', 'Le chef kobyss de cette zone est dou pour la ncromancie, y compris sur des victimes mortes depuis longtemps.', 'Mandicroc os-voyant', '', '', '', 57534),
(78690, 'frFR', 'Conscience de la situation', 'Parlez  $1oacitoyens et citoyennes de la Prtention de Velhan.', 'Je ne sais pas ce qui a pu opposer Taenar et Velhan par le pass, mais nous devons nous occuper des gens de la Prtention de Velhan.\n\n$p, pourriez-vous aller voir les familles? Dites-leur que nous venons les aider.\n\nVoyez si elles sont inquites ou autre chose. Et assurez-les que les falotires et falotiers repousseront les Kobyss.', '', '', '', '', '', '', 57534),
(78689, 'frFR', 'Si a mne, a saigne', 'Triomphez des chefs kobyss qui assigent la Prtention de Velhan.', 'Tout repose sur le commandement, $p. Sous les ordres d\une personne comptente, une unit peut presque tout accomplir. Mais si ce n\est pas le cas, le chaos s\installe rapidement et la victoire s\loigne de plus en plus. Je peux en tmoigner.\n\nSans leurs chefs, le sige des Kobyss se brisera comme une vague et tout ce que nous entreprendrons sera plus simple. J\en ai vu trois qui semblaient mener les autres. Je vais indiquer leurs positions sur votre carte.\n\nOccupez-vous d\eux, et nous serons dj plus en mesure de venir en aide  la Prtention de Velhan.', '', '', '', '', '', '', 57534),
(78688, 'frFR', 'Cage-misre', 'Brlez $1oacages kobyss avec la Flamme sacre d\Aemyra.', 'Lors de notre reconnaissance, avant votre arrive, nous avons vu de nombreuses cages disposes dans la Prtention de Velhan. Les Kobyss aiment emprisonner leurs victimes jusqu\ les soumettre  un sacrifice rituel.\n\nCes crmonies mnent  d\autres activits tout aussi sombres, y compris toutes les dvorer.\n\nvitons-leur tout cela. Prenez ma torche et dtruisez les cages, personne n\aura peut-tre  subir ce sort dans la Prtention de Velhan.', '', '', '', '', '', '', 57534),
(78687, 'frFR', 'Faire parler la poudre', 'Collectez $1oapoudrires retrouves sur des fidles de l\Indomptable.', 'Beaucoup de choses ont mal tourn quand l\Indomptable s\est cras, $p. Mais le plus bouleversant, c\est que quand l\ordre de rentrer  Mereldar est enfin arriv, nous n\avons pas pu dignement honorer nos morts.\n\nOn dirait que les Kobyss ont ranim nos camarades, qui errent dsormais dans l\Indomptable sous une pouvantable forme squelettique.\n\nReprenez leurs poudrires. Si nous parvenons  ramener ces dernires  la Flamme sacre, ces victimes seront enfin libres aprs toutes ces annes.', '', '', '', '', '', '', 57534),
(78686, 'frFR', 'Noir c\est noir', 'Retrouvez Taenar et Aemyra prs de la Prtention de Velhan.', 'Je m\appelle Aegor. J\essaie de garder la trace des falotiers et falotires sur le terrain et de dterminer quelles zones de Sainte-Chute auraient besoin d\aide.\n\nLa tour de l\aube de la Prtention de Velhan s\est teinte il y a quelques semaines. Au vu de la situation  Sainte-Chute, c\est probablement d aux vagues incessantes de Kobyss.\n\nTaenar et Aemyra se dirigent l-bas, mais a fera peut-tre beaucoup pour deux. Pourriez-vous les retrouver sur place et les aider  restaurer la lumire pour la Prtention de Velhan?', '', '', '', '', '', '', 57534),
(78685, 'frFR', 'Le bout du tunnel', 'Enqutez sur les rumeurs concernant Taelloch.', 'Nous entendons de plus en plus de rumeurs concernant Taelloch.\n\nLa ville et sa mine sont responsables de la production de minerai. Visiblement, nous n\avons pas reu de cargaisons depuis des semaines, et la contrematresse de la ville a disparu. Le haut-mandataire dconseille maintenant  quiconque de s\y rendre.\n\nCela signifie que nous devrions enquter. Et bien sr, si des personnes souffrent, nous devons les aider.', '', '', '', '', '', 'Retournez voir Magni.', 57534),
(78672, 'frFR', 'Le devoir d\une falotire', 'Emmenez le canot de falotier  la croise de Lorel.', 'Les tnbres se sont vanouies. Mais nous devons poursuivre nos efforts.\n\n<Faerin vous adresse un sourire las, mais une lueur danse dans ses yeux.>\n\nLa lumire de la tour tiendra les plus grandes menaces des ombres  distance. Il en va de mon devoir de falotire de m\assurer que les tours soient allumes en permanence.\n\nMa patrouille va maintenant m\emmener  la croise de Lorel par les airs. Je serais honore qu\Anduin et vous-mme veniez avec nous.', '', '', '', '', '', 'Retrouvez Faerin prs de l\Envie de Sina.', 57534),
(78671, 'frFR', 'La lumire de la tour de l\aube', 'Aidez les falotiers et falotires  allumer la tour de l\aube.', '$p, Faerin est partie allumer la tour de l\aube. Elle affirme qu\elle permet de maintenir la lumire de la Flamme sacre sur Sainte-Chute. Kyron est avec elle.\n\nDifficile d\imaginer une balise capable de briller plus fort que leur toile Beledar, mais j\ai hte de voir cette nouvelle expression de la Lumire.\n\nRetrouvez-moi prs de la tour de l\aube et nous verrons comment la Flamme sacre du peuple arathi permettra de protger mes lointains cousins et cousines.', '', '', '', '', '', 'Retrouvez Faerin devant la tour de l\aube.', 57534),
(78670, 'frFR', 'Sabotage d\arme de sige', 'Dtruisez 4armes de sige sous l\Ascension de Tenir.', '$p, si nous voulons repousser les Nrubiens, nous devons d\abord dtruire leurs armes de sige.\n\nPrs de l\Ascension de Tenir, vous trouverez des barils de poudre noire destins  nos navires. Puisque les Nrubiens ont dj immobilis nos bateaux, utilisons cette poudre d\une autre faon.\n\nRassemblez des barils et envoyez-les sur les armes de sige nrubiennes.', '', '', '', '', '', '', 57534),
(78669, 'frFR', 'Juste pour leurs yeux', 'Collectez $1oalance-ombres nrubiens pour dcouvrir leurs plans.', 'Depuis notre arrive, nous n\avons eu de cesse de combattre les Nrubiens, $p. Cela fait toutefois bien longtemps que leurs assauts n\avaient pas t aussi intenses.\n\nLes docks ariens sont clairement leur cible, mais qui sait si c\est bien la seule? Et si ce n\tait qu\une diversion?\n\nLes Nrubiens sont assists par des lance-ombres qui ont reu leurs ordres de leur reine. Nous devons en apprendre davantage quant  leurs intentions: le meilleur moyen de le faire serait de s\emparer de quelques-uns de ces lance-ombres.', '', '', '', '', '', '', 57534),
(78668, 'frFR', 'Tous  bord du Brise-Aube', 'Retrouvez Faerin  l\Ascension de Tenir  bord du Brise-Aube.', 'Avec ces hordes de Nrubiens qui affluent  travers le mur de l\gide, il est essentiel que nous dfendions nos aronefs stationns  l\Ascension de Tenir.\n\nLes Nrubiens ont toujours eu l\avantage du nombre, mais grce  notre flotte, nous pouvons mobiliser toutes nos units terrestres pour bloquer leur assaut tout en les bombardant depuis les cieux.\n\nSi nous venions  perdre notre flotte, c\en serait fini de nos espoirs. Retrouvez-nous l-bas ds que vous le pourrez.', '', '', '', '', '', 'Retrouvez Faerin  l\Ascension de Tenir  bord du Brise-Aube.', 57534),
(78667, 'frFR', 'Souvenirs ravivs', 'Retrouvez $1oapoudrires arathies sur des soldates et soldats dfunts, puis brlez leurs corps.', 'De bonnes personnes ont trouv la mort, aujourd\hui, $p. Bien trop  mon got.\n\nToutes les soldates et soldats arathis portent une poudrire qui reprsente leur dvotion envers la Flamme sacre. Beaucoup s\en servent de catalyseur pour invoquer la lumire de la flamme. Dans les lieux sombres, loin de la lumire de Beledar, la Flamme sacre est synonyme d\espoir.\n\nL\assaut nrubien nous empche de rcuprer leurs corps. Alors nous devons chercher leurs symboles, pour rendre hommage  leur sacrifice. Ensuite, servez-vous de cette torche pour brler les corps. Ce sont les meilleures funrailles que nous pouvons leur offrir.', '', '', '', '', '', '', 57534),
(78666, 'frFR', 'La bonne araigne est', 'liminez $1oaassaillants nrubiens.', '$p, si nous n\arrtons pas la vague de Nrubiens qui grimpe vers nous, tout sera perdu.\n\nIls sont simplement trop nombreux.\n\nNous devons retarder leur assaut pour laisser aux gens de Sainte-Chute le temps de se prparer. Le mur nous sert au moins de goulet d\tranglement.\n\nFaites tout votre possible pour rduire leur nombre.', '', '', '', '', '', '', 57534),
(78665, 'frFR', 'Problme de terriers', 'Dtruisez $1oaterriers nrubiens.', 'Je suis heureux d\avoir du renfort. Ensemble, nous avons bien plus de chances d\arriver  protger cette tour.\n\nLes Nrubiens nous ont assaillis. Si nous voulons parvenir  les vaincre, nous devons dtruire les terriers dont ils se servent pour passer sous le mur.\n\nSi vous pouvez vous en charger, nous surveillerons le terrain depuis le haut du mur et nous vous retrouverons l-bas.', '', '', '', '', '', 'Retrouvez Kyron le Grand au sommet du mur de l\gide.', 57534),
(78659, 'frFR', 'L o la Lumire tombe', 'Retrouvez l\allie de Faerin prs du mur de l\gide.', 'Beaucoup  Sainte-Chute vous traiteront d\$gtranger:trangre;. Mais je vous considrerai volontiers comme $gun ami:une amie;. Et je vous demanderai votre aide si vous savez vous battre. C\est dans les moments dsesprs que se forgent les amitis les plus fortes.\n\nLa gnrale Heurtacier a ordonn  l\arme de se replier face  l\assaut nrubien. Ce faisant, elle a abandonn une falotire et de nombreuses troupes dans les tnbres. Je ne pense pas pouvoir les sauver toute seule, mais avec votre aide, ce serait diffrent.\n\nSi a vous intresse, accompagnez-moi ou retrouvez-moi sur place.', '', '', '', '', '', 'Parlez  Kyron le Grand au mur de l\gide.', 57534),
(78658, 'frFR', 'La voie sacre', 'Rencontrez les gens qui habitent Sainte-Chute.', '$p, quel plaisir de croiser votre route. Adelgonn m\a parl d\une grotte qu\on appelle Sainte-Chute.\n\nElle m\a parl d\un peuple appel les Arathis. Je peine  imaginer que ces personnes puissent descendre de l\ancien royaume humain, mais a ne peut pas tre une concidence.\n\nLe peuple d\Adelgonn entretenait de bonnes relations avec ce peuple arathi, par le pass. Quoi qu\il ait pu se passer, j\espre renouer contact et bnficier de leur aide. Je vous en prie, retrouvez-moi  la porte de Sainte-Chute.', '', '', '', '', '', 'Parlez  Faerin  la Bont de Dunelle  Sainte-Chute.', 57534),
(78657, 'frFR', 'La sentinelle de minuit', '', '', '', '', '', '', '', '', 57534),
(78656, 'frFR', 'Bon coup de tuyau', 'Activez Baeny la Barrique et servez-vous du tuyau pour nettoyer $2oageles contaminantes.', 'Maintenant que la flamme est revenue, vous pouvez voir l\tendue de la contamination de la zone de pche. Les Kobyss et les grenouilles ont rpandu une trange matire visqueuse qui pollue la rive.\n\nNous avons besoin de votre aide pour nous dbarrasser de ce flau visqueux! \n\nVoici un moissonneur spcialement modifi pour transporter une barrique d\eau. Servez-vous-en pour arroser les tas gluants et purifier la rive.', '', '', '', '', '', '', 57534),
(78642, 'frFR', 'Nouvelle bougie, nouvel espoir', 'Rcuprez la couronne-bougie dans la faille de Flamme-Noire.', 'Nous affaiblir emprise de roi-bougie. Avoir toujours besoin symbole pour rallier mon peuple.\n\nRoi possder ancienne relique, symbole d\espoir appel couronne-bougie. Cur de mon peuple. Roi-bougie a jete! Avoir trouv nouvelle rcompense: bougie de flamme-noire.\n\nCouronne? Toujours dans trsor. Roi-bougie bientt sortir, lui voir ce que nous avoir fait!\n\nPendant qu\il regarder ce que nous faire, nous pouvoir faufiler! Utiliser les vieux tunnels! Prendre ce qui tre  nous! Nous trop malins.', '', '', '', '', '', '', 57534),
(78641, 'frFR', 'Frapper Escartorche', 'Terrassez Escartorche dans les Ddales.', 'Escartorche diriger les Ddales pour le roi-bougie. Rien d\autre qu\une grosse brute! Trs, trs grosse brute.\n\nNous montrer  tout le monde que les brutes pouvoir tre battues!', '', 'Escartorche, l\un des hommes de main du roi-bougie. Il exerce son autorit sur les Ddales et prend un malin plaisir  opprimer les dissidents.', 'Escartorche', '', '', '', 57534),
(78640, 'frFR', 'Profession de foi du destin', 'Partez en reconnaissance et distribuez des pamphlets dans les Ddales depuis les airs.', 'Avant de prendre les mines, mon peuple vivre dans une grande ville. Les Ttes-de-Caillasse l\appeler les Ddales.\n\nLes brutes du roi-bougie la diriger maintenant. Nous devoir voir ce que nous affronter. Que les Kobolds sachent que nous tre l pour les aider! Il y avoir de meilleurs choix que le roi-bougie.\n\nQuel meilleur moyen que les pamphlets? Tout le monde aimer les pamphlets! On dessiner trs bien!\n\nBrinthe dit que vous avoir une sorte de dragon-oiseau volant? Parfait pour la reconnaissance! Parfait pour distribuer des pamphlets!\n\n<Trotteuse vous regarde avec impatience, faisant de petits mouvements de battement d\ailes en attendant.>', '', '', '', '', '', '', 57534),
(78639, 'frFR', 'Oppresser les oppresseurs', 'Librez les Kobolds oppresss dans les Ddales en liminant leurs geliers.', 'Des brutes partout!\n\nInnocents Kobolds dtenus par les voyous du roi-bougie partout dans les Ddales.\n\nVous brutaliser les brutes.\n\nUne fois les brutes battues, les autres avoir la possibilit de s\enfuir. D\tre libres!', '', '', '', '', '', '', 57534),
(78638, 'frFR', 'Destruction ingnieuse', 'Dtruisez les quipements miniers dans les mines Perdues.', 'Certains Kobolds sont en train de moderniser l\quipement laiss par la destruction des mines.\n\nS\il vous plat, dtruisez les quipements avant qu\ils ne soient utiliss contre nous. Je prfre encore qu\ils soient mis au rebut plutt que de tomber entre les mains de nos ennemis.\n\nIl y avait un entrept sur le bord ouest du niveau le plus bas de la mine. Commencez par l.', '', '', '', '', '', '', 57534),
(78637, 'frFR', 'Casser Mche-Rouages', 'Tuez Mche-Rouages dans les mines Perdues et rcuprez ses cls.', 'Mche-Rouages tre le bras muscl du roi-bougie. Trs mchant! Il reconstruire des engins terrestres pour nos guerres. Il tre aussi en charge des dfenses de la mine.\n\nNous avoir besoin de ses cls pour entrer dans les mines et me sortir de l!', '', '', '', '', '', '', 57534),
(78636, 'frFR', 'Reprendre les mines', 'Dverrouillez la porte des mines Perdues.', 'Maintenant que nous avons les cls, il est temps d\affronter le roi-bougie.\n\nOuvrez cette porte. Une fois  l\intrieur, nous passerons  l\tape suivante.', '', '', '', '', '', '', 57534),
(78635, 'frFR', 'Mort et cire', 'Rcuprez des bougies tremble-flammes autour des mines Perdues.', 'Kobolds prendre les bougies au srieux. La cire, encore plus. Plus important que l\or. Plus important que la libert!\n\nNous voler des bougies au roi-bougie. Nous le faire paratre faible. Un tyran  l\air faible perdre le contrle et mourir!\n\nCela signifier aussi que nous pas avoir  attendre ici dans le noir jusqu\ tre mangs. Vite!', '', '', '', '', '', '', 57534),
(78634, 'frFR', 'Remuer ciel et pierre', 'Rcuprez les plaques d\identification sur les Terrestres morts dans les mines Perdues.', 'De nombreux Terrestres sont tombs lorsque les Kobolds se sont empars de cette mine.\n\nPire, celles et ceux qui sont morts ont t laisss  l\abandon l o ils taient. Nous n\avons pas essay de les retrouver. Nous n\avons pas pu faire le deuil ou leur offrir une spulture honorable. Pourquoi? Pourquoi avons-nous dlaiss les morts?\n\nNous ne les abandonnerons plus, $n. Rassemblez les plaques d\identification de ceux que nous avons perdus, afin que nous puissions honorer leur mmoire.', '', '', '', '', '', '', 57534),
(78631, 'frFR', 'Mandater les mandataires', 'Rassurez les dfenseurs et dfenseuses de Gundargaz sur le chemin des mines Perdues.', 'J\ai appris qu\il y avait un problme dans les environs et je pense savoir ce qui ne va pas.\n\nNous avions une exploitation minire au nord-est de Gundargaz. Lorsque nous sommes partis, les Kobolds se sont installs.\n\nNous n\avons pas eu de nouvelles de ces derniers depuis longtemps, mais il semblerait qu\ils nous attaquent maintenant! Et le haut-mandataire ne fait rien pour y remdier.\n\nQuelqu\un doit agir. Si nous parvenons  rsoudre ce problme, d\autres mandataires des machines nous couteront. Si le haut-mandataire ne fait rien, c\est nous qui le ferons.', '', '', '', '', '', '', 57534),
(78630, 'frFR', 'L\avnement de la Rtribution', 'Embarquez sur la Rtribution et tuez $2oaunits nrubiennes.', 'La Rtribution est prte!\n\nCes araignes vont le payer cher. Le sang appelle le sang.', '', '', '', '', '', 'Trouvez Faerin au lac de la Rupture.', 57534),
(78629, 'frFR', 'Recours aux rservistes', 'Aidez $1oarservistes arathis dans la Patience de Livia  Sainte-Chute.', 'Nous devons porter secours  toute personne encore en vie dans la Patience de Livia.\n\nTout Arathi fait ou a fait partie de l\arme. Ces braves pourront se prendre en main si vous les aidez un peu.', '', '', '', '', '', 'Retrouvez vos allies et allis  la Patience de Livia.', 57534),
(78628, 'frFR', 'Trappe dclenche', 'liminez $1oaNrubiens dans la Patience de Livia  Sainte-Chute.', 'Nous devons prparer la Rtribution. Contenez les Nrubiens aussi longtemps que possible avec vos camarades.\n\nIls ne mritent rien de moins que la mort aprs ce qu\ils ont fait subir  notre peuple.', '', '', '', '', '', 'Retrouvez vos allies et allis  la Patience de Livia.', 57534),
(78627, 'frFR', 'L\ultime front', 'Rejoignez la Redoute de la Lumire  Sainte-Chute.', 'Avant l\attaque des Kobyss, nous avons eu vent de troubles non loin de la Patience de Livia. Voil qui explique leur origine.\n\nLa Lumire Nous ne pouvons pas gagner en combattant sur deux fronts, $n. Il faut mettre un terme  tout cela ds maintenant.', '', '', '', '', '', '', 57534),
(78626, 'frFR', 'Journe d\entranement', 'Affrontez $1oarecrues arathies en duel  Mereldar.', 'Vous savez vraiment vous battre, $n.\n\nNous avons appel de nouveaux rservistes  venir combattre, et un peu d\entranement leur ferait le plus grand bien.\n\nPendant qu\Alleria me parle de Xal\atath, j\aimerais que vous participiez  leur formation.', '', '', '', '', '', '', 57534),
(78624, 'frFR', 'Une bougie dans les tnbres', 'liminez Aelric Leid dans le terrain d\Adulation  Sainte-Chute.', 'Beledar a succomb aux tnbres, nous devons nous replier vers Mereldar!\n\n<Le regard de Vaelisia se porte sur Aelric Leid.>\n\nJe Non. Nous devons d\abord liminer Aelric.\n\nAbattez-le, puis nous nous replierons.', '', 'Dirigeant de l\Ordre de la nuit.', 'Aelric Leid', '', '', '', 57534),
(78621, 'frFR', 'La monte des ombres', 'Tuez les orateurs des fonds kobyss sur le terrain d\Adulation  Sainte-Chute.', 'Je peux sentir trois balises du Vide, un peu plus loin, qui canalisent toute leur puissance pour former un pais mur de tnbres.\n\nVous allez devoir les liminer. Ds qu\elles seront dtruites, je pourrai abattre le bouclier.', '', '', '', '', '', 'Retrouvez vos allies et allis sur le terrain d\Adulation  Sainte-Chute.', 57534),
(78620, 'frFR', ' la croise du crpuscule', 'liminez $1oaassaillants kobyss sur le terrain d\Adulation  Sainte-Chute.', 'Nous devons reprendre le terrain d\Adulation aux Kobyss.\n\nRepoussez-les et frayez-vous un chemin sanglant parmi eux.\n\nNous devons  tout prix sauver la Flamme ternelle! S\ils parviennent  la corrompre comme ce fut le cas  la tour Je n\ose mme pas imaginer les consquences.', '', '', '', '', '', 'Retrouvez vos allies et allis sur le terrain d\Adulation  Sainte-Chute.', 57534),
(78618, 'frFR', 'Frnsie fongique', '', '', '', '', '', '', '', '', 57534),
(78615, 'frFR', 'Le son de la cloche', 'Rejoignez la porte principale de Mereldar dans Sainte-Chute.', 'Ces cloches ne sonnent que lorsque Mereldar est attaque!\n\nVenez avec moi  la porte pour voir ce qui se trame.', '', '', '', '', '', '', 57534),
(78614, 'frFR', 'Lumire de Mereldar', 'Jouez avec $1oapersonnages orphelins arathis.', 'J\ai besoin de passer davantage de temps avec Alleria pour tout savoir de Xal\atath. Ce que j\ai appris jusqu\ici est trs inquitant.\n\nD\aprs le message qu\elle nous a transmis, Faerin compte se rendre  l\orphelinat et a demand  ce que vous l\y rejoigniez. \n\nElle aime divertir les enfants quand elle passe par Mereldar, je suis sre qu\elle apprciera que vous lui donniez un coup de main.', '', '', '', '', '', 'Retrouvez Faerin  l\orphelinat de Mereldar.', 57534),
(78613, 'frFR', 'Le bastion de Sainte-Chute', 'Explorez Mereldar.', 'Je dois avouer que je ne m\attendais pas  ce que les premires personnes  visiter Mereldar viennent d\aussi loin. Je croyais que l\Empire Enfin, laissez tomber.\n\nVous avez beaucoup fait pour mon peuple et vous mritez toute ma reconnaissance. Mereldar est le bastion des Arathis  Sainte-Chute. Prenez le temps de vous reposer.', '', '', '', '', '', '', 57534),
(78607, 'frFR', ' Mereldar', 'Rejoignez Mereldar et rencontrez la gnrale Heurtacier.', 'Nous devons nous rendre  Mereldar pour informer la gnrale Heurtacier des agissements de l\Ordre de la nuit.\n\nLoue soit la Flamme sacre, nous avons pu les arrter avant qu\il ne soit trop tard.', '', '', '', '', '', 'Retrouvez la gnrale Heurtacier  Mereldar.', 57534),
(78590, 'frFR', 'Plaider la faux', '', '', '', '', '', '', '', '', 57534),
(78589, 'frFR', 'Cuisine envahissante', 'Apportez l\aubergine ombreuse au chef Dinaire dans les champs Fongiques.', '<Cette plante peu commune pourrait tre utile au chef Dinaire.>', '', '', '', '', '', '', 57534),
(78574, 'frFR', 'Boss du Bosc', 'Vainquez Putrcorce l\Intomb dans le bassin de Boscracine.', 'Je dois vous demander une dernire chose.\n\nIl y a un grand monstre qui rde dans ces bois. Je suis certaine que vous l\avez senti. Il faut l\abattre.\n\nPutrcorce tait le dernier recours de Freydrin pour contrler le bassin, mais c\tait une trop lourde tche pour une Terrestre seule. Nous n\existons pas pour contrler, mais pour rpondre aux besoins.\n\nFaites  nouveau usage du bton pour mettre fin au rgne de Putrcorce.', '', 'Putrcorce a t cr pour protger ces terres, puis on l\a abandonn. Avec le temps, il s\est oubli, et il a pourri. Tout comme sa cratrice.', 'Putrcorce l\Intomb', '', '', '', 57534),
(78573, 'frFR', 'L\aide de la gardienne', 'Utilisez le shillelagh de Freydrin pour purifier le bassin de Boscracine.', 'Un bton magique? Des protections? Que prpariez-vous, Freydrin?\n\n<Igris rumine brivement, le front pliss, les yeux inquiets. Elle finit par se tourner vers vous, un sourire aux lvres.>\n\nJ\ai compris!\n\nL\nergie vitale de ce bton devrait prendre le pas sur la corruption mycosique de la faune locale. Puis on la renvoie au cycle naturel, et la rgion devrait peu  peu gurir d\elle-mme.\n\nEt si vous voyez des protections, dsactivez-les. Prenez sa gemme mmorielle, au cas o. Elle contient peut-tre d\autres informations.', '', '', '', '', '', '', 57534),
(78572, 'frFR', 'Souvenirs de la lande', 'Cherchez dans la demeure de Freydrin quelque chose d\utile contre les fongiciens du bassin de Boscracine.', 'Freydrin avait d trouver un moyen de repousser les fongiciens.\n\nMme s\il reste peu de gens  suivre les dits dans nos campagnes, de nos jours. Mais Freydrin tait convaincue. Elle n\aurait jamais laiss cette fort tomber dans cet tat. Pas tant qu\elle gardait la foi.\n\nNous devrions aller fouiller sa maison dans la fort. Nous y trouverons peut-tre quelque chose d\utile.', '', '', '', '', '', '', 57534),
(78571, 'frFR', 'Myco-gestion', 'Prlevez $1oaspores de Boscracine sur les fongiciens dans le bassin de Boscracine.', 'Freydrin dirigeait mon ordre. On m\a envoye l\aider. Je suis arrive trop tard.\n\nUne prsence tnbreuse hante ces bois, $rs.\n\nMais c\est la demeure de Freydin. La gardienne elle-mme l\avait charge de les entretenir. Et maintenant, elle a disparu et sa fort a chapp  tout contrle.\n\nApportez-moi les spores de ces semeurs de chaos. Il est peut-tre encore possible de purifier ces terres.', '', '', '', '', '', '', 57534),
(78570, 'frFR', 'L\hritage fragile', 'Retrouvez Igris au bassin de Boscracine sur l\le de Dorn.', 'Tenez bon, $rt.\n\nNous, les garde-landes, tenons une lointaine promesse faite  Freya: protger ces terres. Notre dit est plus ancien que ceux des dmagogues de Dornogal. Plus ancien que Dornogal elle-mme.\n\nMais toutes les terres n\ont pas t protges de la mme manire. La personne qui dirige notre ordre devait se charger du bassin non loin d\ici, mais cela fait bien des cycles que nous n\en avons pas reu de nouvelles.\n\nJ\ai dcid d\envoyer une novice pour enquter. Aidez-la et mon ordre se rangera en votre faveur.', '', '', '', '', '', '', 57534),
(78564, 'frFR', 'Forger un nouveau sens', 'Aidez Kittrin le machiniste  reforger et remodeler ses outils.', 'Le compte est bon! Il est temps de me remettre au travail et de refondre ces outils. Je dois les remodeler, et remodeler mon esprit, afin d\accomplir ce pour quoi je suis n: tre un fier machiniste des abmes Retentissants.', '', '', '', '', '', '', 57534),
(78563, 'frFR', 'Le poids du monde', 'Rcuprez le poids de calibrage de Kittrin le machiniste.', 'Mes outils n\ont pas atterri par hasard l o vous les avez trouvs. Ils y ont t dposs. Par moi.\n\nJ\tais tomb si bas que c\tait le seul moyen. Les machines, la grande uvre de mon peuple, elles n\allaient plus jamais chanter. Alors pourquoi m\embter  les rparer?\n\nMais  prsent, je vois.  prsent, je comprends!\n\nLe dernier outil dont j\ai besoin, je l\ai jet dans l\eau et il a t englouti par une crature gante. Je pense qu\il faudra un peu plus d\huile de coude pour me le rapporter.', '', 'Dvoreur de tout ce qui tombe dans l\eau.', 'Mange-serment', '', '', '', 57534),
(78562, 'frFR', 'parpills et dtruits', 'Rcuprez les outils perdus du machiniste Kittrin.', 'H, vous! Vous tes l pour aider, non?\n\nLe doux chant des machines est en train de changer et j\avoue ne pas tre prt. J\ai servi sans faillir pendant tant d\annes, et aujourd\hui\n\nEnfin, le plus important, c\est que je suis prt  me remettre au travail. Mais voyez-vous, mes outils ont t dtruits et disperss un peu partout.\n\nSi vous pouviez me les rapporter, je vous en serais reconnaissant.', '', '', '', '', '', '', 57534),
(78557, 'frFR', 'S\carter du droit chemin', 'Inspectez le chariot de mine draill dans la station Portefer.', 'La mandataire Brinthe acquiesce. $gtranger:trangre;, nous avons du travail.\n\nL\un de nos plus grands chariots de mine a draill. Il bloque la jonction principale de la station.\n\nLa productivit de mes ouvrires et ouvriers est impacte et leur rendement est donc loin d\tre optimal. Les Titans nous ont donn du travail, mais la force de travail n\est pas  pleine capacit. Pourriez-vous nous aider  nous remettre sur les rails?\n\nVeuillez faire preuve de prudence. Je constate que vous tes $gconstitu:constitue; de chair et d\os, je ne voudrais pas vous voir $gbroy:broye;.', '', '', '', '', '', 'Informez Uzjax  propos du Skardyn chapp.', 57534),
(78555, 'frFR', 'Sous terre et submerg', 'Aidez les mandataires des machines  scuriser la station Portefer.', 'J\ai t absente bien trop longtemps. Les mandataires des machines ne se portent manifestement pas trs bien ici. Le haut-mandataire est-il au courant?\n\nLe sabotage des Nrubiens et la ngligence constituent une combinaison dvastatrice. Nous devons remettre la station Portefer en tat de marche ds que possible. C\est un lien vital entre les abmes Retentissants et la ville situe plus haut.\n\nS\il vous plat, $p, aidez nos travailleuses et travailleurs blesss, rcuprez toute cargaison susceptible d\tre sauve et rtablissez la scurit  Portefer.', '', '', '', '', '', '', 57534),
(78546, 'frFR', 'Rcompense', 'Parlez  Adelgonn pour prvenir Merrix du sort de Baelgrim.', 'Nous avons entendu l\cho de l\explosion jusqu\ici.\n\nJ\imagine que vous avez trouv la victoire, mais votre arrive solitaire suggre qu\elle ne fut pas totale.\n\nQue s\est-il pass?', '', '', '', '', '', '', 57534),
(78545, 'frFR', 'Retour  la galerie Primaire', 'Retournez voir Merrix  Dornogal.', 'Nous avons port un grand coup aux Nrubiens. Mais Baelgrim\n\n<Adelgonn marque une pause pour se reprendre.>\n\nIl tait d\une rigidit rageante, et nous nous disputions sans cesse, mais en fin de compte il tait le dfenseur de notre peuple tout entier.\n\nBaelgrim s\est sacrifi pour protger l\le de Dorn contre les Nrubiens. Tout le monde doit le savoir. Et les Nrubiens ne doivent plus jamais tre en mesure de nous forcer la main.\n\nRetournez voir Merrix  Dornogal. Dites-lui que nous arriverons bientt. Il nous faut juste un moment.', '', '', '', '', '', '', 57534),
(78544, 'frFR', 'Faire gronder le tonnerre', 'Retenez les Nrubiens  l\hydromellerie de Brassecendre jusqu\ ce que le garde de la reine Zirix apparaisse.', 'Les Nrubiens vont frapper, autant par orgueil que par colre. Et c\est exactement ce que nous voulons.\n\nIls vont bientt dferler sur l\hydromellerie pour punir cette attaque contre leur tertre. Nous allons les retenir ici sur la terre ferme pendant que vous dcollerez. Quand Zirix apparatra pour diriger son arme, nous allumerons les mches.\n\nWenbrandt a rassembl quelques outils pour retenir les Nrubiens o nous voulons. Installez-les en vitesse, puis nous vous mettrons sur un freux de la tempte. Au travail!', '', 'Si Zirix meurt ici, la galerie Primaire ne risquera pas d\essuyer une deuxime attaque.', 'Garde de la reine Zirix', '', '', '', 57534),
(78543, 'frFR', 'Un coup de pied dans le terrier', 'Lancez un tonneau d\hydromel Brassecendre dans le terrier nrubien, puis retournez dans la cour de l\Hydromel.', 'L\hydromellerie a t vacue, et les explosifs sont arms. Il ne reste qu\ attirer les Nrubiens dans le pige.\n\nVotre compatriote se trouve prs du terrier nrubien au nord. Sa directive est de monter la garde au cas o les Nrubiens se mettraient en mouvement trop tt.\n\nPour l\instant, ils ne bougent pas, il va falloir les inciter. Apportez un tonneau de Brassecendre au terrier. Lancez-le dedans, cela devrait affoler leur nid.\n\nEt ensuite, rejoignez-nous vite dans la cour de l\Hydromel.', '', '', '', '', '', '', 57534),
(78542, 'frFR', 'Zone d\vacuation', 'vacuez $1oamembres des hydromelleurs dlis.', 'Bon, vous pouvez faire exploser l\uvre de toute ma vie, si c\est notre dernire chance. Mais je refuse de faire courir des risques  mes ouvriers et ouvrires.\n\nNous avons tous choisi cette voie, mais je refuse de les laisser se sacrifier. Dites-leur que je donne l\ordre d\vacuation immdiate. \n\nEt si je vois ne serait qu\une brchure sur leur peau, vous m\en rpondrez!', '', '', '', '', '', '', 57534),
(78541, 'frFR', 'Tendre le pige', 'Placez $1oamches en corde dans les tonneaux crpitants.', 'Avec tous ces tonneaux de Brassecendre, cette hydromellerie brlera plus fort que la Placeforge tout entire s\ils prenaient feu.\n\nC\est sans doute pour a que les tonneaux de Wenbrandt sont en bois de fer. Ils n\clatent pas facilement et rsistent aux flammes.\n\nHeureusement, nous pouvons dclencher une raction depuis l\intrieur si nous y glissons des mches.\n\nCes cordes oublies par les employs devraient faire l\affaire.', '', '', '', '', '', '', 57534),
(78540, 'frFR', ' l\hydromellerie', 'Retrouvez Baelgrim  l\hydromellerie de Brassecendre.', 'Votre camarade  l\arc dit vrai. Si nous voulons protger la galerie Primaire, nous devons liminer Zirix et ses forces.\n\nAllons tout de suite  l\hydromellerie de Brassecendre.', '', '', '', '', '', '', 57534),
(78539, 'frFR', 'Rparations durables', 'Discutez du plan d\attaque contre les Nrubiens avec Baelgrim.', 'Puisque mes chevaucheurs et chevaucheuses de tempte sont sur la touche, Dornogal n\a que quelques garde-paix ordinaires pour se dfendre. Si les Nrubiens nous attaquent  nouveau, Dornogal tombera et nous entranera dans les tnbres.\n\nIl faut imprativement les attirer loin de la ville pour liminer leur commandant. \n\nNous allons tisser notre propre toile pour y capturer Zirix.\n\nJ\ai un plan.', '', '', '', '', '', '', 57534),
(78538, 'frFR', 'Effort collectif', 'Distribuez les ordres de Merrix  10membres des ouvriers dlis dans la galerie Primaire.', 'Le peuple dli a apport l\quipement et les ressources ncessaires pour rparer la galerie Primaire.\n\nC\est un grand jour. Digne de l\archive! Je ne l\avouerai jamais  Adelgonn, mais j\y vois la main des Titans\n\nEt maintenant, l\heure est venue d\exercer ma directive! J\ai conu un plan pour organiser notre main-d\uvre de la manire la plus efficace et allou les provisions ncessaires  leur accueil.\n\nApportez ces ordres aux ouvrires et ouvriers d\Adelgonn pour leur permettre de commencer les travaux au plus vite. Nous nous retrouverons bientt sur place.', '', '', '', '', '', '', 57534),
(78536, 'frFR', 'Probabilits improbables', 'Parlez  Thrall.', 'Par les Titans Il ne reste rien de la galerie Primaire! Il faudra des annes, voire des sicles, pour dblayer les dcombres et rparer les dgts causs par les Nrubiens  la structure interne, sans parler d\atteindre le cur du monde.\n\nLe bilan est plus lourd encore depuis la disparition des tres lis  la pierre\n\nJe dois rflchir  la suite des oprations.\n\nVos camarades sont  bon port. Parlez-leur et ne vous mettez pas en travers de mon chemin.\n\nSi nous avons besoin de vous, je vous le ferai savoir.', '', '', '', '', '', '', 57534),
(78535, 'frFR', 'Ils surgissent des profondeurs', 'Chevauchez le freux de la tempte, Lokren, et tuez des Nrubiens  Dornogal.\n\nLa majorit des services habituellement proposs  Dornogal seront indisponibles durant cette qute.', 'Je ne sais pas encore ce que vous venez faire ici, $gtranger:trangre;. Mais vous semblez efficace pour liminer les Nrubiens.\n\nTout comme nous, les chevaucheurs et chevaucheuses de tempte, qui formons l\avant-garde de cette le.\n\nLes Nrubiens sont un ennemi ancien. Je ne serais pas surpris que ce Zirix ait entendu parler de moi, le garde-tempte, et me craigne.\n\nMais malgr cela, votre talent nous serait utile pour protger Dornogal.\n\nJ\ai un freux de la tempte que vous pouvez monter. En selle, et aidez-nous  dbarrasser la ville de ces insectes!', '', '', '', '', '', 'Regroupez-vous  Dornogal avec Baelgrim.', 57534),
(78534, 'frFR', 'Vers Dornogal', 'Retrouvez Baelgrim  Dornogal en suivant le sillage des chevaucheurs et chevaucheuses de tempte.\n\nLa majorit des services habituellement proposs  Dornogal seront indisponibles durant cette qute.', 'Vous avez amen sur nos rivages la mort et la destruction,  une chelle que nous n\avions pas vue depuis des milliers d\annes.\n\nMais vous avez le sang des Nrubiens sur les mains, et un Thraegar  votre ct. Cela suffit  m\inspirer confiance pour le moment.\n\nJe dois ramener mes chevaucheurs et chevaucheuses de tempte  la capitale, Dornogal, pour enquter sur cette explosion. Volez avec nous. Restez dans notre sillage, et vous n\aurez aucun mal  fendre les airs.\n\nJe vais envoyer d\autres pilotes pour ramener vos camarades une fois que tout danger sera cart.', '', '', '', '', '', 'Retrouvez Baelgrim  Dornogal.', 57534),
(78533, 'frFR', 'Scuriser la plage', 'Retrouvez Magni et vainquez le garde de la reine Zirix.', 'Le garde de la reine Zirix est sorti du sol et a pris Magni par surprise.\n\nIl affronte l\essaim en bordure des dcombres.\n\nMoira et moi avons voulu l\aider, mais nous n\avons pas pu le dgager.\n\nVenez avec moi. Magni a besoin de notre aide!', '', 'Si nous n\arrtons pas l\assaut de Zirix, personne ne survivra  la destruction de Dalaran.', 'Garde de la reine Zirix', '', '', 'Parlez  Baelgrim  la grve Tranquille.', 57534),
(78532, 'frFR', 'Artfacts erratiques', 'Dtruisez $1oareliques des arcanes endommages.', 'On comptait de nombreuses reliques prcieuses et puissantes  Dalaran. Beaucoup ont t endommages dans la catastrophe et sont dfectueuses.\n\nIl faut les dtruire!\n\nPrenez ce parchemin. J\y ai inscrit un sort d\clatement. Lisez-le  voix haute, et sa magie sera libre.\n\nLorsque ce sera fait, prvenez Jaina. Elle comprendra.', '', '', '', '', '', 'Retrouvez Jaina  la grve Tranquille.', 57534),
(78531, 'frFR', 'Rcupration urgente', 'Aidez $1oasurvivants et survivantes de la chute de Dalaran.', 'Nous avons survcu sans trop de blessures. Tout le monde n\a pas eu cette chance.\n\nIl manque encore beaucoup des personnes qui taient  Dalaran. Elles doivent avoir besoin de notre aide.\n\nCherchez celles qui ont survcu sur le champ de bataille. Aidez-les au mieux.\n\nNous avons besoin de tout le monde pour la bataille!', '', '', '', '', '', '', 57534),
(78530, 'frFR', 'Sus aux saboteurs', 'Tuez $1oaNrubiens.', 'Les Nrubiens sont partout, $n.\n\nIls sont trop nombreux pour n\tre que les survivants de la catastrophe. J\en ai vu d\autres sortir du sol. \n\nLe garde de la reine Zirix tait en embuscade pour nous attaquer.\n\nMontrez-leur que nous ne sommes pas des proies faciles. Attaquez!', '', '', '', '', '', '', 57534),
(78529, 'frFR', 'Impact violent', 'Dgagez-vous des dcombres et retrouvez vos suprieurs.', '<Votre vision se trouble, et vous reprenez lentement conscience. Des cris lointains rsonnent  vos oreilles.\n\nLa dernire chose dont vous vous souvenez est la chute de Dalaran, la grande cit magique en lvitation Ensuite, il n\y a que les tnbres.\n\nAu milieu des cris et des bruits de combat, vous entendez un trange cliquetis insectode.\n\nLes Nrubiens vous attendaient.\n\nVous devez retourner au combat, mais avant cela, vous devez vous librer des dcombres qui vous crasent.>', '', '', '', '', '', 'Trouvez un de vos dirigeants sur la grve Tranquille.', 57534),
(78472, 'frFR', 'Briller dans le noir  Activer', '', '', '', '', '', '', '', '', 57534),
(78471, 'frFR', 'Convergence', 'Retournez dans la salle des Fondations de Dornogal.', 'Nous savons que les Nrubiens sont de mche avec Xal\atath. Et nous savons pourquoi ils ont lanc un assaut contre nous et contre Dalaran.\n\nLeur intention semble tre de dtruire les Terrestres.\n\nMais pourquoi? Est-ce parce que la galerie Primaire est la cl, et que sa destruction ne suffit pas? Ils veulent peut-tre nous empcher de la rparer.\n\nNous devrions rentrer  Dornogal pour faire le point.', '', '', '', '', '', 'Retournez voir Moira Thaurissan  Dornogal.', 57534),
(78470, 'frFR', 'Le Proscenium', 'Rendez-vous au Proscenium de l\le de Dorn.', 'Les Nrubiens s\en prennent  nouveau aux Terrestres. Il faut suivre cet essaim!\n\nJe crains que le nombre ne joue contre nous, mais si les Terrestres peuvent s\unir  nous\n\nNous aurons peut-tre une chance.', '', '', '', '', '', 'Rendez-vous au Proscenium et retrouvez Moira Thaurissan.', 57534),
(78469, 'frFR', 'Fivre des grands espaces', 'Examinez puis livrez les poteries de Hreka  Kodun,  Landefrey.', 'Je devais voir Kodun, tout  l\heure, mais je suis aussi ptrifie qu\une pierre morte. L\attaque sur le village a t terrifiante.\n\n<Hreka prend une profonde inspiration et se concentre sur la forme d\une nouvelle jarre.> \n\nPourriez-vous me rendre un service en livrant tout ceci  Kodun? Il vit  un jet de pierre, dans la boutique de poterie du village. Je dois finir cette pice avant que l\argile ne sche.', '', '', '', '', '', '', 57534),
(78468, 'frFR', 'L\archive', 'Utilisez le codex prismatique pour voir la gemme mmorielle. Puis rapportez la gemme mmorielle  la rserve des archives, dans l\archive.', 'La gemme mmorielle que vous avez rcupre est exactement comme son nom l\indique. Elle contient les souvenirs et directives d\un individu terrestre, ainsi que nos dits.\n\nCe btiment, l\archive, est le cur de notre civilisation. C\est l que nous examinons, cataloguons et entreposons les souvenirs de chaque Terrestre au terme de sa rotation programme.\n\nGrce au codex prismatique que j\ai invent, nous pouvons accder  un ou deux souvenirs d\une gemme mmorielle. Prenez-le, et lisez cette gemme.', '', '', '', '', '', '', 57534),
(78467, 'frFR', 'Tout a un cot', 'Rcuprez $1oabatteries dans les confins de Golgrin.', 'Grce  Dragan, vous tes ici, et je m\en rjouis. J\ai besoin d\aide pour une entreprise prilleuse.\n\nJ\ai utilis les opales de Dagran pour rparer la console des Titans que nous avons rcemment rcupre sur ce site.\n\nLes gens asserments veulent depuis longtemps en apprendre davantage sur les Titans et restaurer des donnes inaccessibles dans l\archive, ou antrieures  sa construction.\n\nCette console peut dtenir les rponses,  condition de la remettre en service.\n\nPrenez ceci. Il s\agit d\un dispositif de ma fabrication. Il vous mnera aux batteries des Titans. Elles serviront  l\alimentation, maintenant que le systme est rtabli.', '', '', '', '', '', '', 57534),
(78466, 'frFR', 'L\ombre d\une saveur  Activer', '', '', '', '', '', '', '', '', 57534),
(78465, 'frFR', 'Confins de Golgrin', 'Rejoignez Dagran aux confins de Golgrin sur l\le de Dorn.', 'Maintenant que nous sommes en possession des opales, nous pouvons rejoindre Brinthe aux confins de Golgrin.\n\nElle m\a dit qu\elle travaillait sur un projet et qu\elle comptait sur mon aide.\n\nJe me demande de quoi il s\agit.', '', '', '', '', '', 'Rejoignez Dagran aux confins de Golgrin sur l\le de Dorn.', 57534),
(78464, 'frFR', 'Gouffre souterrain', 'Terminez le Gouffre des mines de Rampeterre prs de Landefrey.', 'L\assaut nrubien, votre chute mtorique\n\nEt  prsent Baelgrim?\n\nBaelgrim a besoin de bras pour sa galerie Primaire, mais mme si je voulais l\aider, je ne serais pas en mesure de le faire. Tandis que nous parlons, les gens de mon peuple meurent. Beaucoup se sont fait enlever par les Nrubiens lors de l\attaque.\n\nVous tes loin d\tre $gle premier tranger:la premire trangre;  venir me voir. Un petit tre semblable  Moira est pass plus tt et a aussitt suivi les Nrubiens. Il est parti vers l\ouest en direction d\une grotte voisine.\n\nSi vous parveniez  retrouver mes congnres, je vous en serais ternellement reconnaissante.', '', '', '', '', '', '', 57534),
(78463, 'frFR', 'Blocs de construction', 'Collectez $1oaminerais scintillants dans la Mineroc.', 'La carrire est infeste de fongiciens, tous les tunnels se sont crouls. Nous n\avons pas le temps de les dblayer et encore moins de tout reconstruire!\n\nCela dit, j\ai vu en chemin beaucoup de minerai qui jonchait le sol. Il nous permettrait de commencer  rparer la galerie Primaire, mais\n\n<Baelgrim soupire et pose les yeux sur le Terrestre dli bless.>\n\nOn a besoin de moi, ici. Auprs du peuple d\Adelgonn. Mon peuple. Pourriez-vous collecter le minerai  ma place?', '', '', '', '', '', '', 57534),
(78462, 'frFR', 'chos de compassion', 'Soignez $1oaTerrestres  Landefrey.', 'Je m\attendais  tout sauf  voir Baelgrim aujourd\hui. Alors le voir me proposer son aide Mais j\imagine que puisque la galerie Primaire a t endommage, il n\a pas le choix. Je Je ne sais pas comment je dois le prendre. La logique me pousse  accepter.\n\n<Adelgonn commence  craser dans ses mains de pierre la chair fongicienne, qui se transforme rapidement en une bouillie.>\n\nTenez. Mlangez ceci avec la boue et appliquez la mixture sur les blessures.', '', '', '', '', '', '', 57534),
(78461, 'frFR', 'La quatrime place', 'Trouvez Adelgonn  Landefrey sur l\le de Dorn.', 'Vu que mon papa et Anduin sont affaiblis et qu\Alleria est introuvable, c\est  nous, $n, qu\il revient de dgager le passage pour l\arme de Thrall et Jaina si on veut riposter face aux Nrubiens et Xal\atath.\n\nOn n\atteindra pas les Nrubiens sans cette galerie Primaire. Et impossible de la rparer sans l\aide des Terrestres.\n\nSi Merrix pense qu\il n\y a que cette Adelgonn et son peuple dli qui peuvent s\occuper de la galerie, alors on doit la trouver.\n\nIl est temps d\afficher mon plus beau sourire et de sortir ma casquette de diplomate. Vous tes avec moi, $n?', '', '', '', '', '', 'Trouvez Adelgonn  Landefrey sur l\le de Dorn.', 57534),
(78460, 'frFR', 'Hypocentre', 'Dblayez les dbris et portez secours aux Terrestres sur le chemin de l\archive.', 'J\ai failli  mon peuple. La galerie Primaire est infranchissable. Le cordon qui reliait Dornogal aux abmes Retentissants est rompu, et le reste du chemin avec.\n\nLes Nrubiens auront ce qu\ils mritent. Il s\agit de mon dit et de ma volont.\n\nJe vais dterminer si le conseiller est encore fonctionnel et l\amener  l\archive. La mandataire Brinthe devrait s\y trouver, si les Titans le veulent.\n\nMais des citoyennes et citoyens asserments sont encore en danger. Si vous souhaitez former une alliance, dblayez les gravats et aidez les personnes encore en vie.\n\nJe vous retrouverai  l\archive.', '', '', '', '', '', 'Retrouvez Baelgrim dans l\archive prs de la galerie Primaire.', 57534),
(78459, 'frFR', 'L\tat de l\union', 'Renseignez-vous auprs de Merrix sur le conseil de Dornogal.', 'a me cote de l\admettre, mais les Nrubiens ont pris tout le monde au dpourvu.\n\nNos efforts se sont reconcentrs sur le soutien de Dornogal et de notre population dclinante.\n\nLa fiert du garde-tempte Baelgrim lui a permis, ainsi qu\aux chevaucheuses et chevaucheurs de tempte, de rester aptes au combat, mais leurs effectifs sont rduits, et btir n\est pas leur spcialit.\n\nNous n\avons pas les comptences pour rparer la galerie Primaire nous-mmes.\n\nMais a n\a pas toujours t le cas. Vous devez en apprendre plus sur nous, si vous voulez comprendre pourquoi.', '', '', '', '', '', '', 57534),
(78458, 'frFR', 'Tumulte de la rcolte  Activation', '', '', '', '', '', '', '', '', 57534),
(78457, 'frFR', 'Les pierres de Dornogal', 'Rencontrez diffrents citoyens terrestres de Dornogal.', 'Je suis Merrix, conseiller de Dornogal.\n\nJe vous suis trs reconnaissant pour votre aide, surtout au vu du contexte tendu de votre arrive. Je vous prie de pardonner le garde-tempte Baelgrim. Se montrer suspicieux fait partie de son travail. \n\nUne discussion plus formelle sur notre situation est ncessaire. Si vous voulez riposter contre les Nrubiens, tout comme nous, retrouvez-nous  la salle des Fondations. Baelgrim et moi devons passer en revue les donnes recueillies jusqu\ prsent.\n\nD\ici l, vous tes mon $ginvit:invite;. Prenez mon anneau. Il vous permettra d\accder aux services que propose Dornogal.', '', '', '', '', '', 'Retournez voir Merrix dans la salle des Fondations de Dornogal.', 57534),
(78452, 'frFR', 'Renforts  Activer', '', '', '', '', '', '', '', '', 57534),
(78393, 'frFR', 'Un semblant de rpit', 'Explorez le repaire de la Tisserande.', 'Vous avez pass une sacre soire depuis votre infortune expdition, pas vrai? Ne vous inquitez pas, ma petite friandise. Vous constaterez que mes collgues sont trs accommodants, mme pour quelqu\un possdant vos prdilections, aussi tranges puissent-elles tre.\n\nPrenez le temps d\explorer les lieux. Profitez de mes nombreux amnagements. Avec un peu de chance, vous trouverez le repos dont vous avez tant besoin.\n\n Oh, mais veillez  ne pas vous dplacer trop rapidement. Vous comprenez sans doute que les mouvements brusques sont  proscrire.', '', '', '', '', '', '', 57534),
(78392, 'frFR', 'La toile enchevtre', 'Consultez l\archive de la Tisserande.', 'Ne vous mprenez point, je n\ai aucunement l\intention de vous envoyer patauger dans l\obscurit comme un hanneton frachement clos. Il ne faudrait pas que ma petite friandise soit happe par un fouisseur cavernicole affam.\n\nVous devez vous duquer, $gmon cher:ma chre;. Vos allis se sont retrouvs dans une toile ardente. Ce n\est qu\en vous familiarisant avec ses anciens architectes que vous pourrez esprer les rcuprer.\n\nHeureusement pour vous, j\ai mis  votre disposition certaines de mes ressources personnelles.', '', '', '', '', '', '', 57534),
(78384, 'frFR', ' la poursuite de la Lumire', 'Recherchez des indices de la survie d\Anduin.', 'Anduin a survcu  cet essaim. Je n\en doute pas un instant. Mais les Nrubiens sont partout et il n\est rien de plus qu\un homme seul.\n\nO qu\il aille, o qu\il soit conduit, je le trouverai. Trouvez-moi tout signe indiquant qu\il vit encore. C\est tout ce dont j\ai besoin pour le suivre jusqu\au fin fond d\Azeroth.', '', '', '', '', '', 'Retrouvez Alleria au bord du lac de la Rupture dans Azj-Kahet.', 57534),
(78383, 'frFR', 'Avantage stratgique', 'Trouvez les lames de Flynn et $2oanotes de renseignements nrubiens sur les troupes kahetis dans Rak-Zakaz.', 'Pour couronner le tout, on m\a confisqu mes armes. Je ne partirai pas sans mes lames!\n\nPendant qu\on y est, essayez de trouver des preuves de ce qu\il se passe ici. Tout ce qui pourrait nous donner un avantage contre les Nrubiens.\n\nQuelque chose d\trange est survenu, ce qui nous a donn l\occasion de prendre la fuite. J\ai le sentiment qu\on va pouvoir s\en servir.', '', '', '', '', '', '', 57534),
(78354, 'frFR', 'Un fil conducteur', 'Suivez Broche.', '<Les mots sur le parchemin semblent brls et non crits. Une odeur toxique vous brle le nez.>\n\nAveugle et solitaire, vous trbuchez dans l\obscurit. Je vous offre une corde  laquelle vous accrocher.\n\nSuivez-la, si vous dsirez trouver vos allis.', '', '', '', '', '', '', 57534),
(78353, 'frFR', 'Hmatophobie', 'Purifiez la fosse Respirante.', 'Ce n\est pas un lieu propice  une longue conversation, alors je serai brve.\n\nCes racines que vous voyez font partie de quelque chose de bien plus grand que vous croyez, et il en va de mon devoir de les protger. \n\nAu cas o vous ne l\auriez pas remarqu, cet endroit regorge de Sang noir qui se contorsionne en tous sens. Si nous ne faisons rien, il s\tendra toujours plus loin et plus profondment.\n\nVous cherchez des allis? Trs bien. Aidez-moi  purifier ce lieu et protger ces racines, et je promets d\couter ce que vous avez  dire.', '', '', '', '', '', '', 57534),
(78352, 'frFR', 'Pour rien, si abominable', 'Dtruisez 8pices d\quipement d\extraction nrubien dans la fosse Respirante.', ' vrai dire, je ne me soucie point de ce que les Nrubiens complotent. Ce ne sont pas les premiers  chercher  obtenir du pouvoir, et ils ne seront certainement pas les derniers. Ce qui est problmatique, c\est la faon dont ils s\y prennent. Je crains que la manipulation de ce Sang noir ne menace bien plus que les cosystmes dlicats de Khaz Algar.\n\nNous devons nous assurer qu\ils ne reviendront plus jamais dans cette fosse. Leur quipement est encore parpill dans la fosse. Dtruisez-en le plus possible.', '', '', '', '', '', '', 57534),
(78351, 'frFR', '[DNT] DEPRECATED', '', '', '', '', '', '', '', '', 57534),
(78350, 'frFR', 'Les hros ne meurent jamais', 'Aidez douze arochevaliers blesss.', 'Damnation! Nous avons agi de faon trop htive, et mon peuple en paie le prix.\n\nNous avons t stupides de croire que les Nrubiens ne seraient pas prpars contre une offensive. Les soldates et soldats arathis sont d\une rsistance  toute preuve, mais mme eux auront du mal  s\extraire de la chute d\un aronef.\n\nJe veillerai  ce que tout le monde ici soit en scurit. S\il vous plat, allez dans le champ et sauvez autant de personnes que possible.', '', '', '', '', '', '', 57534),
(78348, 'frFR', 'Amis des bas-fonds', 'Recherchez votre mystrieux protecteur dans la fosse Respirante.', 'Lorsque nous avons atterri, les Nrubiens se sont immdiatement jets sur nous. Nous aurions perdu presque tous nos camarades si personne n\tait intervenu.\n\nJe ne sais pas qui, ou quoi, nous a aids. Mais s\il existe ne serait-ce qu\une infime lueur d\espoir que nous ayons des allis ici, nous devons la saisir et ne pas la laisser s\chapper.', '', '', '', '', '', '', 57534),
(78294, 'frFR', 'Prise de Tte-tonnerre', 'Accompagnez Durzan jusqu\ Belzt sur le pic de Tte-tonnerre.', 'Durzan semble avoir retrouv sa vitalit et son nergie. Cette mousse lui a fait un sacr effet.\n\nJ\ai l\impression qu\il est prt  y aller. J\aurais juste aim avoir plus de temps. J\ai tant de questions  poser. Mais la plus importante trouvera sa rponse lorsqu\il atteindra le pic.\n\nNous ne devrions pas le laisser faire cette ascension seul. Et je crois qu\il vous fait assez confiance pour que vous l\accompagniez.', '', '', '', '', '', '', 57534),
(78293, 'frFR', 'Une mousse bien frache', 'Rcoltez de la mousse sur les mousselaines de la Randonneraie et offrez-la  Durzan.', 'Vous dites que des Nrubiens l\avaient captur? Je ne sais pas ce qu\ils voulaient  ce bon vieux Durzan, mais il n\a pas l\air d\avoir apprci le traitement qu\il a subi. Il faut le remettre d\aplomb pour son duel avec Belzt sur la montagne.\n\nLa mousse rcolte sur nos troupeaux donne un coup de fouet aux freux de la tempte, elle aura peut-tre le mme effet sur Durzan. Collectez-en un boisseau et allez faire une offrande.\n\nEt si les mousselaines se montrent grincheux, n\hsitez pas  les remettre  leur place.', '', '', '', '', '', '', 57534),
(78292, 'frFR', 'Seigneur de la tempte perdu', 'Trouvez Durzan prs de la Randonneraie.', 'coutez-moi bien. Tous les ans, le grand blier Durzan, seigneur de l\orage du sud, traverse l\le pour retrouver son frre Belzt au pic de Tte-tonnerre. Le choc de leurs cornes annonce le dbut de la tempte et de la prosprit pendant l\anne  venir.\n\nMais il y a un problme. Durzan n\est pas venu, et les cieux se sont claircis. La chevaucheuse de tempte n\y croit pas, mais je sens que vous avez vu des choses bien plus incroyables.\n\nDemandez aux autres si vous avez des doutes. Mais de grce, aidez-nous  retrouver Durzan.', '', '', '', '', '', '', 57534),
(78291, 'frFR', 'Prdateurs nergiques', 'liminez $1oaprdateurs prs de la Randonneraie.', 'En temps normal, le pic de Tte-tonnerre est  la merci d\une tempte ternelle qui fournit les mousselaines en nergie. Sans elle, les pauvres btes sont compltement amorphes et dprimes. Ce qui les rend vulnrables aux prdateurs.\n\nPour relancer la production de mousse, il faudrait savoir pourquoi la tempte s\est arrte. Mais nous devrions d\abord nous occuper de ces prdateurs pour ne pas qu\ils transforment les mousselaines en gravier.', '', '', '', '', '', '', 57534),
(78290, 'frFR', 'Les moutons comptent les moutons', 'Utilisez une magntite nergise pour stimuler $4oamousselaines lthargiques prs de la Randonneraie.', 'La mousse nergise produite par ces troupeaux est une douceur trs apprcie des freux de la tempte. Mais sans orage, les bliers sont apathiques, vulnrables et ne produisent plus rien.\n\nNous ne pourrons sans doute pas conjurer de tempte, mais peut-tre qu\une petite tincelle les motiverait. Regardez si vous pouvez trouver une magntite contenant encore une charge. Puis apportez-la  Shraubendre pour qu\elle puisse la charger.', '', '', '', '', '', '', 57534),
(78289, 'frFR', 'Vers la Randonneraie', 'Retrouvez Lufsela  la Randonneraie.', 'On raconte qu\il se passe des choses tranges dans le village de la Randonneraie, au pied du pic de Tte-tonnerre. \n\nJe ne supporte pas cet endroit. La mto y est catastrophique.\n\nMais Lufsela la nourrice a pens qu\il valait mieux aller jeter un il parce que c\est dans ce village que pousse une mousse dont les oiseaux raffolent. Mais elle dbute  peine, et elle aura peut-tre besoin d\un coup de main.', '', '', '', '', '', 'Retrouvez Lufsela  l\entre de la Randonneraie.', 57534),
(78256, 'frFR', 'Le consensus du gnral', 'Apportez les phromones de Zev\kall  quelqu\un sachant s\en servir.', 'Nous avons eu de la chance. Le gnral Anub\azal est dtermin  nuire  Zev\kall. Pour l\instant comme on dit, l\ennemi de notre ennemi est notre ami.\n\nJ\ai l\impression que a ne fait que commencer: d\autres araignes tenteront de se servir de nous pour se battre entre elles. Ah, bah.\n\nVous voulez voir ces phromones utilises  bon escient, n\est-ce pas? Allez-y. Je vais les mettre  l\abri.', '', '', '', '', '', 'Apportez les phromones de Zev\kall  la Tisserande.', 57534),
(78255, 'frFR', 'Ayez l\air naturel', 'Aidez le convoi  quitter le bastion du Sige en parlant  la gardienne de la porte.', 'Il est temps de mettre les voiles avec les prisonniers et ces phromones. J\ai trouv des chanes plutt convaincantes pour un si grand groupe. Si tout le monde joue bien son rle, a devrait bien se passer.\n\nNous n\avons que le nectar de marqueur du gnral Anub\azal pour vous et moi, alors nous imiterons des ouvrires avec une autorisation. Vous vous occupez de la parlotte, moi, je m\occupe du chariot. Esprons que a fonctionne.\n\nDirection la porte, $n!', '', '', '', '', '', 'Retrouvez Gazleu et le convoi devant le bastion du Sige.', 57534),
(78254, 'frFR', 'Influence vole', 'Volez les phromones et prparez-vous  les faire sortir du bastion du Sige.', 'Ces archives de Zev\kall On y apprend qu\il gche de nombreuses vies nrubiennes. Il les envoie au casse-pipe comme de vulgaires Mantides enrags.\n\nNous devons agir. Comme je l\ai dit, Zev\kall ne produit plus ses propres marques de phromones,  cause de son processus de Sublimation. Il n\a pas d\autre choix que de se servir des miennes. Son alchimiste tente de lui en concocter Mais une fois que ce sera fait, qu\adviendra-t-il de moi?\n\nPrenez ces fausses phromones et faites-les sortir du bastion du Sige. Mettez Zev\kall dans l\embarras grce  elles Vous savez faire preuve de crativit, non? Alors, ne vous retenez surtout pas.', '', '', '', '', '', 'Apportez les phromones de Zev\kall  Gazleu prs de la porte, dans le bastion du Sige.', 57534),
(78251, 'frFR', 'Angoisse  Dalaran', 'Librez des prisonniers pour rejoindre le faux convoi.', 'Je ne fais pas du tout confiance  ce gros insecte. Il m\a laiss pourrir ici sans rien dire!\n\nMais s\il veut bien nous donner accs au bastion du Sige, profitons-en. J\ai vu des gens trans dans d\autres secteurs de la base. Je ne pense pas qu\ils les mangent, mais plutt qu\ils les amnent quelque part.\n\nRassemblons-les en un convoi de prisonniers pour les faire sortir. Retrouvez-moi dehors!', '', '', '', '', '', '', 57534),
(78250, 'frFR', 'Admission gnrale', 'Trouvez de quoi faire chanter le gnral.', 'Ce ne sera pas suffisant pour gner Zev\kall. Il mrite une vritable humiliation. Je possde dj des informations, mais il m\en faut davantage.\n\nIl conserve des archives militaires dans une salle trop petite pour que je m\y infiltre. Dcouvrez quelles informations il y cache, nous dcouvrirons srement de quoi le faire chanter!', '', '', '', '', '', '', 57534),
(78249, 'frFR', 'Personnages spcifiques', 'liminez les serviteurs de Zev\kall pour le gnral Anub\azal.', 'Zev\kall a rcemment plac ses fidles laquais  des positions stratgiques autour du bastion du Sige. Les liminer l\obligera  les remplacer, ce qui entranera des raffectations et du chaos.\n\nAutant de choses qui menaceront l\quilibre des forces de Zev\kall. Dbarrassez-vous des trois.', '', '', '', '', '', '', 57534),
(78248, 'frFR', 'Ce qu\il nous reste', 'Retournez au repaire de la Tisserande.', 'Je suis arrive dans cette ville prte  en dcoudre prte  donner ma vie pour mettre fin  cette guerre.\n\nMais je suis en vie. Tout comme vous. Et Anduin. Nous avons de nouvelles alliances et un nouvel objectif. Je ne me rends compte que maintenant que ma vision tait obscurcie par ma culpabilit.\n\nUne partie de moi a la sensation que ces mots sortent de la bouche d\Anduin et non de la mienne. Je crois qu\il dteint sur moi.\n\nRetournons dans le repaire de la Tisserande. Je veux voir ce qu\Anduin et vous allez mettre en uvre pour sauver ces gens ainsi que nos compatriotes.', '', '', '', '', '', 'Retournez voir la veuve Arak\nai au repaire de la Tisserande.', 57534),
(78244, 'frFR', 'Hospitalit kaheti', 'Parlez  Anduin lorsque vous voudrez assister au discours du Jour de la Sublimation, et quittez discrtement la ville ensuite.', 'C\est sur cette estrade au loin qu\Ansurek prononcera son discours pour le Jour de la Sublimation.\n\nVous, Alleria, et moi-mme allons grimper en haut d\une des tours  proximit pour observer la scne. Si nous voulons russir  retourner ses propres citoyens et citoyennes contre elle, nous devons nous approcher au plus prs pour nous familiariser avec sa stratgie.\n\nComme je l\ai dit  Alleria, nous ne devons en aucun cas trahir notre prsence. Si jamais nous rencontrons un problme, le vizir a prvu des solutions pour nous enfuir en volant  la frontire des Terriers o nous avons fait connaissance.', '', '', '', '', '', 'Parlez  Anduin Wrynn dans les caniveaux Saliens.', 57534),
(78240, 'frFR', '[DNT] DEPRECATED', 'Steal the pheromones from the delayed convoy.', '<The little spider holds out a new note for you.>\n\nSiegehold is dangerous, but you have made it this far already.\n\nBring me the pheromones. Then we will be ready to set our sights on bigger goals.', '', '', '', '', '', '', 57534),
(78237, 'frFR', 'Vers les cieux!', 'Cachez-vous dans une caisse  destination du bastion du Sige.', 'Hum. Cet Anub\azal a donn l\ordre qui a men  la fuite des personnes emprisonnes. Zev\kall ici prsent n\a pas beaucoup apprci.\n\nAlors coutez-moi bien: vous devez vous introduire dans le bastion du Sige et faire ami-$gami:amie; avec Anub\azal. Un jeu d\enfant.\n\nJ\ai remarqu que de nombreuses cargaisons taient achemines dans la zone, et je pense que nous pouvons changer le contenu d\une des caisses sans que personne ne s\en rende compte.\n\nEn attendant, je vais faire part de nos dcouvertes  la Tisserande. J\aimerais beaucoup vous accompagner, mais je prfrerais viter de nouveaux coups de poignards.', '', '', '', '', '', '', 57534),
(78236, 'frFR', 'Retardataire froce', 'Portez secours au retardataire dans Rak-Zakaz.', 'Si quelqu\un est rest derrire, on doit lui venir en aide.\n\na m\ennuie de le reconnatre, mais ces gens ont besoin de quelqu\un pour les protger ici. Je dois rester.\n\nTrouvez notre retardataire. Et tant que vous y tes, profitez-en pour jeter un il derrire les lignes ennemies. Vous trouverez peut-tre quelque chose d\utile.', '', '', '', '', '', 'Retrouvez Flynn  Rak\Zakaz.', 57534),
(78234, 'frFR', 'Ouvrir une brche', 'Tuez $1oa units kahetis dans Rak-Zakaz.', 'Le gnral est peut-tre hors course, mais ce ne sera pas facile de s\chapper pour autant. Cet endroit est vraiment infest.\n\nJe sais que je cache bien mon jeu, mais je ne suis pas vraiment au meilleur de ma forme. Je ne pense pas pouvoir beaucoup vous aider.\n\nVous allez devoir nous dgager un chemin.', '', '', '', '', '', '', 57534),
(78233, 'frFR', 'Le cadeau de la Tisserande', 'Retrouvez les camarades dont la Tisserande vous fait la rvlation en guise de cadeau.', 'Un petit tisse-rat m\a dit qu\une srie d\vnements particulirement intressants se joue au nord. Il semblerait qu\une multitude de contretemps soient venus entraver les manuvres militaires.\n\nJe veux savoir qui en est responsable. Menez l\enqute pour moi, et si vos yeux trangement binaires reprent des allis potentiels, ne vous gnez pas.\n\nCertains de vos petits camarades figurent parmi les vads ayant attir la colre d\un certain Zev\kall. Allez vous renseigner. Dites-leur que la Tisserande leur transmet ses salutations.', '', '', '', '', '', 'Parlez  Faerin  l\avance de Faerin.', 57534),
(78232, 'frFR', 'Rcrire la rcriture', 'Piratez $1oa lance-ombres.', 'Vous tes ici aujourd\hui parce qu\il s\agit du Jour de la Sublimation. La reine Ansurek a daign en faire une journe lors de laquelle nous clbrerons notre nouvelle volution imprgne du Vide, notre Sublimation. Veuillez noter mon ton satirique.\n\nPendant que les rues seront animes et remplies de citoyens en liesse, les lance-ombres installs dans le bazar empliront l\air de la vile propagande d\Ansurek.\n\nPrenez cet objet de mon invention. Utilisez-le pour les pousser  dlivrer  la foule des informations plus clairantes.', '', '', '', '', '', 'Retrouvez Alleria Coursevent au laboratoire d\alchimie de la cit des Fils.', 57534),
(78231, 'frFR', 'Comme une araigne sur le mur', 'Explorez le bazar Ombreux.', 'Inviter Alleria tait un risque  courir mais mme maintenant, je pense que cela en valait la peine. J\en suis mme certain.\n\nJe lui parlerai en priv. En attendant, j\aimerais que vous visitiez la ville au-dessus. Les phromones que Nizrek vous a offertes vous donneront accs au bazar Ombreux. Allez y observer les marchands, couter leurs conversations, acheter leurs produits.\n\nCette cit est aussi vivante que Hurlevent. Et sa population mrite d\tre libre, tout autant que la ntre. Vous verrez vite que nous ne sommes pas si diffrents.', '', '', '', '', '', 'Retrouvez Anduin Wrynn au laboratoire d\alchimie de la cit des Fils.', 57534),
(78228, 'frFR', 'Dans une ville agite', 'Parlez au vizir du plan de la Tisserande et appliquez des phromones pour accder au bazar Ombreux.', 'J\ai envoy ces invitations  Alleria et vous. J\aurais volontiers pari l\pe de mon pre que vous n\alliez pas laisser passer une telle opportunit. C\est ce qui vous diffrencie de nous autres. Alleria, en revanche\n\nEnfin, peu importe. Elle est  la fois prudente et pleine d\assurance. J\imagine que j\esprais que cette dernire qualit prendrait le dessus, mais c\est la premire qui l\a maintenue en vie.\n\nElle nous trouvera peut-tre plus tard. En attendant, j\aimerais vous prsenter comme il se doit  quelqu\un dont j\ai fait la connaissance rcemment.', '', '', '', '', '', '', 57534),
(78226, 'frFR', 'Une invitation pleine de mystre', 'Rencontrez le vizir dans les Terriers de la cit des Fils d\Azj-Kahet.', 'Nous avons reu une invitation. Enfin, elle est plutt  votre nom, $n.\n\nIl s\agit d\un appel  rencontrer le vizir. Ce nom fait trembler jusqu\aux individus les plus riches et puissants de la cit des Fils.\n\nS\en faire un alli pourrait bien suffire  sceller notre victoire contre l\affreuse petite ombre d\Ansurek.\n\nVous devez le rencontrer dans les Terriers. Servez-vous du diffuseur de phromones qui se trouve dans mon antre afin de masquer votre odeur et entrer sans danger.', '', '', '', '', '', 'Rejoignez les Terriers dans la cit des Fils.', 57534),
