(76997, 'frFR', 'Perdus dans les ombres', 'Trouvez et rassemblez $1oarecrues dmoralises avec la torche de patrouille.', 'Salutations, $n. Je crains d\avoir un redoutable problme.\n\nJe patrouillais en compagnie de nouvelles recrues sur ces terres lorsque nos torches se sont teintes, nous laissant gars et dsorients.\n\nJe me suis mis  l\abri dans cette maison, mais la plupart des recrues se sont enfuies et parpilles dans l\obscurit.\n\nM\aiderez-vous  les retrouver? J\ai une torche de patrouille pour vous. Elles vous rejoindront ds qu\elles la verront.', '', '', '', '', '', '', 57534),
(76733, 'frFR', 'La chasse  la patate', 'Embrasez $1oatorches de moisson et rcoltez $2oapommes de terre lumiflammes.', 'Les rcoltes dans cette zone sont devenues un vritable dfi, avec ces moissonneurs fous qui viennent saccager nos champs. On peut tout de mme y trouver des pommes de terre en cherchant bien.\n\nSi vous embrasez les torches de moisson, vous pourriez bien dnicher quelques patates perdues dans l\obscurit. \n\nLaissez-vous guider par ces lumires et rcoltez-en autant que possible. Toute aide est la bienvenue en ces temps troubls.', '', '', '', '', '', '', 57534),
(76600, 'frFR', 'Pile entre les gyro-optiques', 'Avec l\aide d\Auebry, liminez $1oamoissonneurs rendus fous par l\obscurit.', 'Mon mari Ezgi adore ces moissonneurs, mais je ne leur fais pas confiance, et maintenant, vous savez pourquoi!\n\nDs que les lumires s\teignent, ils essaient tous de nous tuer!\n\nVous voulez bien m\aider  arranger a?\n\nJe sais y faire avec les fusils. Indiquez-moi une cible, je me charge de la cribler de balles!', '', '', '', '', '', '', 57534),
(76599, 'frFR', 'Pile entre les Gyro-optiques  Activer', '', '', '', '', '', '', '', '', 57534),
(76588, 'frFR', 'Dfense de la flamme', 'liminez deux cratures rares dans les zones contrles par les flammecls.', 'Les troupes de l\expdition sont confrontes  de formidables adversaires.\n\nAttires comme des papillons vers nos flammecls, des hordes de cratures cherchent  teindre nos lumires et gcher nos efforts de reconstruction.\n\nJe vous en prie, aidez-nous  vaincre deux des plus terribles personnages qui menacent nos flammecls. Ensemble, nous parviendrons  repousser ces tnbres.', '', '', '', '', '', '', 57534),
(76586, 'frFR', 'Propager la lumire', '', '', '', '', '', '', '', '', 57534),
(76578, 'frFR', 'Ralliement de Khaz Algar', 'Traversez les anneaux.', 'Traversez les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 57534),
(76394, 'frFR', 'L\ombre d\une saveur', 'Collectez $2oamrous sombril, $1oachalotes nourries par les ombres et un flacon d\pice du crpuscule.', 'J\ai entrepris de crer un plat qui sort de l\ordinaire, digne de l\empereur en personne.\n\nIl me faut des ingrdients issus des tnbres les plus sombres pour crer ce plat extraordinaire. Beaucoup les considrent comme tant interdits, mais entre mes mains, ils renforceront l\harmonie entre ombre et lumire.\n\nVeuillez m\aider en rassemblant les ingrdients suivants: des mrous sombril, des chalotes nourries par les ombres et un flacon d\pice du crpuscule.', '', '', '', '', '', '', 57534),
(76338, 'frFR', 'Un meilleur ravageur de choux', '', '', '', '', '', '', '', '', 57534),
(76247, 'frFR', 'Alimenter les flammes du foyer', '$1oaravitaillements de vestige de Heaume-Colline rcuprs et utiliss pour alimenter la flammecl de Heaume-Colline.', 'Les braseros des flammecls qui se trouvent dans la campagne repoussent les tnbres et assurent la scurit de notre peuple. Beaucoup se sont teints, car les vestiges radieux ncessaires pour les entretenir se sont faits de plus en plus rares.\n\nNous avons travaill d\arrache-pied pour que le ntre reste allum, mais nous avons besoin de toute l\aide possible.\n\nJe vous en prie, rassemblez les vestiges qui se trouvent dans nos rserves et utilisez-les pour renforcer la flammecl de notre famille.', '', '', '', '', '', '', 57534),
(76169, 'frFR', 'Une lueur dans l\ombre', 'Localisez Paeton Grognon Berncort et rcuprez $3oabouteilles de breuvage de l\Audacieux.', 'C\est pas vrai! Grognon s\est encore enfui. Il a t affect  ce poste, mais il ne s\y trouve jamais.\n\nJe l\ai entendu crier dans la grotte  ct. Il a d essayer de s\y cacher.\n\nPrenez ma torche et allez dans la grotte d\Ombre-Froid. Retrouvez Grognon et toutes les bouteilles de breuvage de l\Audacieux qu\il a voles. Qu\il dserte son poste s\il veut, mais je vais pas le laisser s\approprier la bibine!', '', '', '', '', '', '', 57534),
