(53213, 'frFR', 'Donations pour Arathi: potion de mana ctire', 'Apportez $1oaPotions de mana ctires  Chelsea Larive, au Port de Boralus.', 'L\un de nos derniers arrivages de fournitures d\alchimie a t pill sur le chemin de l\entrept. Nous faisons le maximum pour regarnir nos rserves, mais je crains que nous ne parvenions pas  atteindre notre quota.\n\nVous ne connatriez pas quelqu\un qui pourrait nous procurer quelques potions de mana supplmentaires, par hasard?', '', '', '', '', '', '', 57534),
(43803, 'frFR', 'Un gant parmi les Murlocs', '', '', '', '', '', '', '', '', 57534),
(31520, 'frFR', 'Un dfi de taille: le sha du doute', 'Terminez le Temple du Serpent de jade en mode Dfi.', '$n, il faut que vous rassembliez un groupe de braves et que vous les meniez au temple du Serpent de jade. Une fois l-bas, activez l\orbe de dfi et terrassez le sha du doute.$b$bRevenez me voir quand vous aurez accompli ce dfi et je vous rcompenserai gnreusement.', '', '', '', '', '', '', 57534),
(11138, 'frFR', '[PRIM]Renn McBranchie', 'Apportez les Ordres des dfias  Renn McBranchie dans les eaux au large du Rivage de Troubleffroi.', 'D\'aprs la formulation des ordres que vous avez rcuprs, il semble que la priorit des Dfias sera de localiser cette cargaison et de s\'en emparer, quelle qu\'elle soit.$B$BLe SI:7 emploie depuis quelque temps un plongeur nomm Renn McBranchie pour des oprations de rcupration autour de Theramore. Quand il a entendu parler du naufrage, Renn s\'est dirig vers le nord pour plonger prs des les occupes en ce moment par les Dfias.$B$BSi nous voulons mettre la main sur cette cargaison avant les Dfias, nous allons avoir besoin de son aide. Partez  sa recherche dans les eaux situes au nord-est d\'une petite le, juste au nord de celle que vous venez d\'explorer.', '', '', '', '', '', '', 57534),
(10559, 'frFR', 'Rvr par Thrallmar', 'Nazgrel,  Thrallmar dans la pninsule des Flammes infernales, veut que vous deveniez $gRvr:Rvre; par Thrallmar en combattant les Gangr\'orcs  l\'intrieur des Salles brises de la citadelle des Flammes infernales.', 'Vous avez prouv votre valeur  maintes reprises, $c. Mais d\'autres preuves vous attendent.$B$BContinuez de combattre la Gangr\'Horde  l\'intrieur des Salles brises de la citadelle des Flammes infernales et votre nom sera connu de chacun des partisans de Thrall sur ces terres.', '', '', '', '', '', '', 57534),
(9685, 'frFR', 'La rdemption des morts', 'Apportez le Calice chatoyant rempli  l\'auberge de Lune-d\Argent et utilisez ses pouvoirs magiques pour ressusciter Sangrias Mortelame.', 'Pendant que vous prpariez le calice, j\'ai envoy un groupe d\'initis rcuprer Sangrias Mortelame. Vous le trouverez au dernier tage de l\'auberge de Lune-d\'argent avec quelqu\'un  ses cts. Allez-y le plus vite possible et librez les pouvoirs magiques du calice pour le ramener  la vie.$B$BLe temps presse, $n. S\'il reste mort trop longtemps, pas mme la Lumire ne pourra le faire revenir  nous. Retournez me voir lorsque vous aurez ressuscit Mortelame.', '', '', '', '', '', '', 57534),
(4507, 'frFR', 'Le pion prend la reine', 'Invoquer la Reine gorishi et la vaincre.$B$BApporter le Cerveau de reine gorishi  l\alchimiste Pilonzugg,  Gadgetzan.', 'Voici l\appt. Dans le rseau de la ruche, il doit y avoir une sorte de cristal. Nous pensons que les silithides l\utilisent comme un outil de cohsion. O se trouve ce cristal? Sans doute dans les couvoirs de la ruche.$B$BUtiliser l\appt sur le cristal devrait faire sortir la reine; mais attention, elle viendra sans doute escorte de quelques gardes. Tuez la reine et arrachez-lui son cerveau. Aussi dgotant que cela paraisse, nous en avons un ardent besoin. Bonne chance, $n!', '', '', '', '', '', '', 57534),
(2852, 'frFR', 'Les jambires en cuir fauve', 'Rapporter 2 Casques en cailles de tortue, 2 Brassards en cailles de tortue et 2 Sauvageonnes  Pratt McGrubben au bastion de Pennelune.', 'Vous pouvez maintenant apprendre des techniques plus complexes, $n. Les jambires en cuir fauve sont un des quipements en cuir les plus rsistants et les plus puissants. La taille, les hanches et les parties vitales sont particulirement bien protges. Les aventuriers qui l\'utiliseront apprcieront grandement cette protection combinant l\'amlioration apporte par la sauvageonne.$B$BPour ce modle, j\'ai besoin de deux casques en cailles de tortue, de deux brassards en cailles de tortue et de deux sauvageonnes.', '', '', '', '', '', '', 57534),
(2851, 'frFR', 'Les bottes en cuir fauve', 'Rapporter 2 Pantalons de la nuit, 2 paires de Bottes de la nuit et 2 Sauvageonnes  Pratt McGrubben au bastion de Pennelune.', 'Vous avez dj beaucoup appris, $n. Mais ce n\est pas fini. Aprs viennent les bottes en cuir fauve, la pierre angulaire de tout l\'quipement.$B$BCes bottes protgent bien les pieds tout en tant trs confortables. Les semelles souples sont une bndiction pour ceux qui se dplacent discrtement.$B$BPour ces bottes, j\'ai besoin de deux pantalons de la nuit, de deux paires de bottes de la nuit, ainsi que de deux sauvageonnes. Lorsque vous aurez tout cela, faites-le-moi savoir.', '', '', '', '', '', '', 57534),
(1842, 'frFR', 'Les sabots de satyre', 'Rapporter 7 Sabots fendus de satyre  Ula\'elek au village de Sen\'jin en Durotar.', 'Je peux vous faire une paire de gantelets de brutalit, et ils seront porteurs d\'une grande magie, mais pour cela, vous devez d\'abord m\'apporter cette magie.$B$BLes satyres parcourent le nord-est d\'Orneval  cause du pouvoir de la fort. Ils se nourrissent de sa puret, ils aspirent son innocence comme des sangsues et la corrompent. Ceux d\'entre eux ont des sabots fendus et abms. Ils ont vol plus de magie  la fort que les autres. $B$BCes sabots dtiennent un grand pouvoir. J\'en aurai besoin pour faonner vos gantelets.', '', '', '', '', '', '', 57534),
(1841, 'frFR', 'Velora Nitely et les garde-jambes de brutalit', 'Parler  Velora Nitely  Fossoyeuse.', 'On dit qu\'avant de mourir, Velora Nitely tait l\'un des plus grands forgerons d\'armures de Lordaeron. La mort, semble-t-il, n\'a pas affect ses talents. Allez voir Velora: elle fabriquera vos garde-jambes de brutalit.$B$BVelora officie  Fossoyeuse de Lordaeron, dans le quartier des Marchands.', '', '', '', '', '', '', 57534),
(1839, 'frFR', 'Ula\'elek et les Gantelets de brutalit', 'Parler  Ula\'elek en Durotar.', 'Ula\'elek, le forgeron troll, va faonner pour vous les gantelets de brutalit. Il demeure en Durotar, au Village de Sen\'jin, avec ses frres Sombrelances, et il attend votre arrive.', '', '', '', '', '', '', 57534),
(1710, 'frFR', 'Coquilles dessches au soleil', 'Apportez 20 Coquilles dessches au soleil  Mathiel,  Darnassus.', 'Mon collgue, Furen Barbe-longue, a fait une dcouverte que je suis impatient d\'essayer. Je veux la tester sur une de mes nouvelles armures, car je pense que ses techniques me permettraient d\amliorer la qualit de mes produits.$B$BVoulez-vous m\'aider? Si vous me rapportez de quoi fabriquer l\'armure, alors j\'en ferai une pour vous.$B$BJ\'ai besoin de coquilles d\'uf dessches au soleil des wyvernes ailes-fires qui rsident  Haut-Perchoir, dans les Mille pointes. Cherchez les coquilles au pied de leurs nids, et revenez quand vous en aurez assez.', '', '', '', '', '', '', 57534);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(1398, 'frFR', '[PRIM]Bois flott', 'Apporter 8 Morceaux de Bois sch au soleil au Gardien Biggs dans le marais des Chagrins.', 'Je vous dois beaucoup, $n. Un cur noble bat en vous. J\'ai  prsent une autre tche pour laquelle je demanderai humblement votre aide.$b$bSi je veux avoir la moindre chance d\'atteindre Rempart-du-Nant, alors je dois rparer mon chariot. Et pour cela, j\'ai besoin de bois. Du bois fort, du bois sec, pas de ce bois spongieux et noueux des arbres du marais.$b$b$n, partez  l\'est pour la cte et cherchez du bois qui a sch au soleil. Et apportez-le-moi.', '', '', '', '', '', '', 57534),
(1324, 'frFR', 'Un diplomate a disparu', 'Battre le soldat Hendel dans le marcage d\'prefange.', 'Quoi? Vous venez m\'accuser d\'tre alli aux Dfias et vous pensez que je vais rester l tranquillement alors que vous tes en train de m\'insulter? Quelque chose me dit que vous pensez  cela depuis longtemps.', 'Soumettre le soldat Hendel', '', '', '', '', 'Retournez voir l\'Archimage Tervosh au Marcage d\'prefange.', 57534),
(1219, 'frFR', '[PRIM]Le rapport orc', 'Apportez le Rapport de l\'Espion au Lieutenant Aden de Theramore.', 'En remuant la poussire, on trouve la main coupe d\'un orc. Une main qui agrippe encore un tube en os grav. Le tube contient un parchemin tach.$B$BLe parchemin est crit en orc... Et a semble important.', '', '', '', '', '', '', 57534);
